INSERT INTO `faq` (`id`, `subject`, `content`, `status`, `user_id`, `created_at`, `updated_at`) VALUES
(1, 'Gérer mon compte [Client]', '<div>La création d\'un compte client est <strong>gratuite</strong> et <strong>obligatoire pour pouvoir effectué des achats. 🙂</strong><br><br></div><div>Pour créer un compte :<br><br></div><ul><li>Cliquez sur l’icône USER « <strong>Connectez-vous</strong><br> » en haut à droite de la page d’accueil du site.</li><li>Sur la page de connexion, cliquez sur « <strong>Créer un compte</strong> ».</li></ul><div><br></div><ul><li>Renseignez votre <strong>Nom, Prénom </strong>.<br><br></li><li>Renseignez votre adresse <strong>email</strong> (Attention : vérifiez-en bien l’orthographe).</li></ul><div><br></div><ul><li>Renseignez votre <strong>Numéro de téléphone </strong>.<br><br></li><li>Renseignez un <strong>mot de passe</strong> et le confirmer.<br><br></li><li>Cliquez sur « <strong>S’inscrire </strong>».<br><br></li></ul><div><strong>Depuis le site:</strong> nous vous envoyons un lien de vérification* à l\'<strong>adresse email utilisée pour créer le compte</strong>. </div><div><br></div><div>Note : Si vous ne recevez pas l\'email de confirmation, 2 options :<br><br></div><ul><li>l\'adresse email indiquée n\'est pas valide.</li><li>l\'email a été bloqué par votre filtre anti-spam. Dans ce dernier cas, pas besoin de créer à nouveau votre Compte. Il vous suffit de retrouver l\'email dans votre boîte de réception anti-spam.</li></ul><div><em>&nbsp;*La durée de validité du code et du lien de validation est de indéfini.</em></div><div><br></div>', 1, 1, NULL, NULL),
(2, 'quels sont les moyens de paiement acceptés ?', '<h1>Paiement&nbsp; sécurisé : quels sont les moyens de paiement acceptés ?</h1><div><br></div><div>Toutes les transactions effectuées via le site <em>Click-Univers.com</em> sont sécurisé, les moyens de paiement acceptés sont :&nbsp;<br><br></div><div>&nbsp;Les cartes de paiement en cours de validité de type Visa, Carte Bancaire ou Mastercard.<br><br></div><div><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image&quot;,&quot;height&quot;:35,&quot;url&quot;:&quot;https://assistance.leboncoin.info/hc/article_attachments/360007043639/visacard.jpg&quot;,&quot;width&quot;:53}\" data-trix-content-type=\"image\" class=\"attachment attachment--preview\"><img src=\"https://assistance.leboncoin.info/hc/article_attachments/360007043639/visacard.jpg\" width=\"53\" height=\"35\"><figcaption class=\"attachment__caption\"></figcaption></figure>Visa | <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image&quot;,&quot;height&quot;:36,&quot;url&quot;:&quot;https://assistance.leboncoin.info/hc/article_attachments/360007031240/mastercard.jpg&quot;,&quot;width&quot;:54}\" data-trix-content-type=\"image\" class=\"attachment attachment--preview\"><img src=\"https://assistance.leboncoin.info/hc/article_attachments/360007031240/mastercard.jpg\" width=\"54\" height=\"36\"><figcaption class=\"attachment__caption\"></figcaption></figure>Mastercard | <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image&quot;,&quot;height&quot;:38,&quot;url&quot;:&quot;https://assistance.leboncoin.info/hc/article_attachments/360007043679/cbcard.jpg&quot;,&quot;width&quot;:55}\" data-trix-content-type=\"image\" class=\"attachment attachment--preview\"><img src=\"https://assistance.leboncoin.info/hc/article_attachments/360007043679/cbcard.jpg\" width=\"55\" height=\"38\"><figcaption class=\"attachment__caption\"></figcaption></figure>Carte Bancaire</div><div><br></div>', 1, 1, NULL, NULL),
(3, 'Où livrez-vous?', '<p>Nous livrons partout en France métropolitaine. Pour le moment, nous ne proposons pas de livraison à l\'international.</p>', 1, 1, '2022-02-28 12:09:50', '2022-02-28 12:09:50'),
(4, 'Quels sont les délais de livraison ? Puis-je suivre mon colis', '<p>Nous expéditions les commandes de notre entrepôt 24 à 48 heures après l’achat. La livraison est offerte à partir de 35 € d’achat ! Nous livrons partout en France. Vous revenez automatiquement un e-mail avec un numéro de suivi des colis dès l’expédition de votre commande(24 à 48 heures après votre achat.) Le délai de livraison moyen est de 2 à 5 jours ouvrés. Si votre commande ne vous parvient pas dans un délai de plus de 20 jours. N’hésitez pas à nous contacter à l’adresse : support@click-games.fr</p>', 1, 1, '2022-02-28 12:11:34', '2022-06-14 06:47:44'),
(5, 'Comment fonctionne la PSD2?', '<p>Les exigences de sécurité supplémentaires de la&nbsp;SCA&nbsp;impliquent que vous devez vous authentifier en utilisant deux des trois options suivantes :<br>Un élément connu de vous seul (par exemple un mot de passe) Un élément auquel vous seul avez accès (par exemple un téléphone portable) Un élément que vous \"êtes\" (par exemple votre empreinte digitale)</p>', 1, 1, '2022-02-28 12:14:25', '2022-02-28 12:14:25'),
(6, 'Où puis-je obtenir le nouveau PIN/code ?', '<p>Nous vous conseillons de contacter votre banque afin de recevoir toutes les informations nécessaires et pouvoir effectuer des achats en ligne.</p>', 1, 1, '2022-02-28 12:15:03', '2022-02-28 12:15:03'),
(7, 'Qu\'est-ce que la PSD2?', '<p>La PSD2 est une directive adoptée par l\'Union européenne qui sera mise en œuvre dans toute l\'UE. Les exigences d\'authentification des paiements en ligne ont pour objectif de mieux protéger vos données financières, de garantir une authentification sécurisée et de réduire le risque de fraude.</p>', 1, 1, '2022-02-28 12:15:40', '2022-02-28 12:15:40'),
(10, 'Comment suivre mon colis ?', '<p><strong>Les informations relatives à l’acheminement de votre commande sont disponibles et envoyées par mail dès lors que votre colis est expédié</strong> afin de vous fournir :<br>&nbsp;</p><ul><li>Le nom du transporteur&nbsp;</li><li>Le suivi de colis&nbsp;</li><li>La date prévisionnelle de livraison&nbsp;<br>&nbsp;</li></ul><p>N’hésitez pas à consulter régulièrement vos courriers indésirables, il se peut que le mail s’y glisse !&nbsp;</p>', 1, 1, '2022-04-14 13:00:44', '2022-04-14 13:00:44');
INSERT INTO `items_article` (`id`, `pos`, `number`, `title`, `type`, `content`, `article_id`, `parent_id`, `created_at`, `updated_at`) VALUES
(15, NULL, NULL, 'Préambule', 'standard', '<p>Les présentes conditions générales d\'utilisation (dites « CGU ») ont pour objet l\'encadrement juridique des modalités de mise à disposition du site et des services par CLICK GAMES et de définir les conditions d’accès et d’utilisation des services par l\'utilisateur.<br>Les présentes CGU sont accessibles sur le site dans la rubrique « CGU ».<br>Toute inscription ou utilisation du site implique l\'acceptation sans aucune réserve ni restriction des présentes CGU par l’utilisateur. Lors de l\'inscription sur le site, chaque utilisateur accepte expressément les présentes CGU en cochant la case : « Je reconnais avoir lu et compris les CGU et je les accepte ».<br>En cas de non-acceptation des CGU stipulées dans le présent contrat, l\'utilisateur se doit de renoncer à l\'accès des services proposés par le site.</p>', 2, NULL, '2021-11-14 19:38:51', '2022-06-13 21:01:28'),
(16, NULL, NULL, 'Article 1 : Les mentions légales', 'standard', '<p>L\'édition du site https://click-games.fr est assurée par la Société YOUNG WORKER Nom commercial « CLICK GAMES », immatriculée au RCS sous le numéro 887 683 647, dont le siège social est 70 rue Pierre Marti, 25462 Étupes<br>L\'hébergeur du site https://click-games.fr est la société IONOS, dont le siège social est situé au 7 PL DE LA GARE 57200 SARREGUEMINES, avec le numéro de téléphone : 06 14 06 01 54</p>', 2, NULL, '2021-11-14 19:38:51', '2022-06-13 21:01:28'),
(17, NULL, NULL, 'ARTICLE 2 : Accès au site', 'standard', '<p>Le site « <a href=\"https://click-games/\">https://click-games</a> » permet à l\'utilisateur un accès gratuit aux services suivants :<br>Vente d’articles en ligne, achat d’articles en ligne<br>Le site est accessible gratuitement en tout lieu à tout utilisateur ayant un accès à Internet. Tous les frais supportés par l\'utilisateur pour accéder au service (matériel informatique, logiciels, connexion Internet, etc...) sont à sa charge.<br>L’utilisateur non membre n\'a pas accès aux services réservés. Pour cela, il doit s’inscrire en remplissant le formulaire d\'inscription. En acceptant de s’inscrire aux services réservés, l’utilisateur membre s’engage à fournir des informations sincères et exactes concernant son état civil et ses coordonnées, notamment son adresse e-mail.<br>Pour accéder aux services, l’utilisateur doit ensuite s\'identifier à l\'aide de son identifiant(adresse e-mail) et de son mot de passe choisit lors de son inscription.<br>Tout utilisateur membre régulièrement inscrit pourra également solliciter sa désinscription en se rendant à la page dédiée sur son espace personnel ou avec une demande par mail à l\'adresse : support@click-games.fr . Celle-ci sera effective dans un délai raisonnable.<br>Tout événement dû à un cas de force majeure ayant pour conséquence un dysfonctionnement du site ou serveur et sous réserve de toute interruption ou modification en cas de maintenance, n\'engage pas la responsabilité de « <a href=\"https://click-games.fr/\">https://click-games.fr</a> ». Dans ces cas, l’Utilisateur accepte ainsi ne pas tenir rigueur à l’éditeur de toute interruption ou suspension de service, même sans préavis.<br>L\'utilisateur a la possibilité de contacter le site par messagerie électronique à l’adresse e-mail de l’éditeur communiqué dans l\'article 1.&nbsp;</p>', 2, NULL, '2021-11-14 19:38:51', '2022-06-13 21:01:28'),
(18, NULL, NULL, 'ARTICLE 3 : Collecte des données', 'standard', '<p>Le site assure à l\'utilisateur une collecte et un traitement d\'informations personnelles dans le respect de la vie privée conformément à la loi n°78-17 du 6 janvier 1978 relative à l\'informatique, aux fichiers et aux libertés.<br>En vertu de la loi Informatique et Libertés, en date du 6 janvier 1978, l\'utilisateur dispose d\'un droit d\'accès, de rectification, de suppression et d\'opposition de ses données personnelles. L\'Utilisateur exerce ce droit : par mail à l\'adresse « <a href=\"mailto:support@click-games.fr\">support@click-games.fr</a> ».</p>', 2, NULL, '2021-11-14 19:38:51', '2022-06-13 21:01:28'),
(19, NULL, NULL, 'ARTICLE 4 : Propriété intellectuelle', 'standard', '<p>Les marques, logos, signes ainsi que tous les contenus du site (textes, images, sons...) font l\'objet d\'une protection par le Code de la propriété intellectuelle et plus particulièrement par le droit d\'auteur.<br>La marque CLICK GAMES est une marque déposée par CLICK INC pour l’entreprise CLICK GAMES appartenant à la Société CLICK INC, immatriculée au RCS sous le numéro 887 683 647 .Toute représentation et/ou reproduction et/ou exploitation partielle ou totale de cette marque, de quelque nature que ce soit, est totalement prohibée.<br>L\'utilisateur doit solliciter l\'autorisation préalable du site pour toute reproduction, publication, copie des différents contenus. Il s\'engage à une utilisation des contenus du site dans un cadre strictement privé, toute utilisation à des fins commerciales et publicitaires est strictement interdite.<br>Toute représentation totale ou partielle de ce site par quelque procédé que ce soit, sans l’autorisation expresse de l’exploitant du site internet constituerait une contrefaçon sanctionnée par l’article L 335-2 et suivants du Code de la propriété intellectuelle.<br>Il est rappelé, conformément à l’article L122-5 du Code de propriété intellectuelle que l’utilisateur qui reproduit, copie ou publie le contenu protégé doit citer l’auteur et sa source.&nbsp;</p>', 2, NULL, '2021-11-14 19:38:51', '2022-06-13 21:01:28'),
(20, NULL, NULL, 'ARTICLE 5 : Responsabilité', 'standard', '<p>Les sources des informations diffusées sur le site « <a href=\"https://click-games.fr/\">https://click-games.fr</a> » sont réputées fiables mais le site ne garantit pas qu’il soit exempt de défauts, d’erreurs ou d’omissions.<br>Les informations communiquées sont présentées à titre indicatif et général sans valeur contractuelle. Malgré des mises à jour régulières, le site « <a href=\"https://click-games.fr/\">https://click-games.fr</a> » ne peut être tenu responsable de la modification des dispositions administratives et juridiques survenant après la publication. De même, le site ne peut être tenu responsable de l’utilisation et de l’interprétation de l’information contenue dans ce site.<br>L\'utilisateur s\'assure de garder son mot de passe secret. Toute divulgation du mot de passe, quelque soit sa forme, est interdite. Il assume les risques liés à l\'utilisation de son identifiant et mot de passe. Le site décline toute responsabilité.<br>Le site « <a href=\"https://click-games.fr/\">https://click-games.fr</a> » ne peut être tenu pour responsable d’éventuels virus qui pourraient infecter l’ordinateur ou tout matériel informatique de l’internaute, suite à une utilisation, à l’accès, ou au téléchargement provenant de ce site.<br>La responsabilité du site ne peut être engagée en cas de force majeure ou du fait imprévisible et insurmontable d\'un tiers.&nbsp;</p>', 2, NULL, '2021-11-14 19:38:51', '2022-06-13 21:01:28'),
(21, NULL, NULL, 'ARTICLE 6 : Liens hypertextes', 'standard', '<p>Des liens hypertextes peuvent être présents sur le site. L’utilisateur est informé qu’en cliquant sur ces liens, il sortira du site « <a href=\"https://click-games.fr/\">https://click-games.fr</a> ». Ce dernier n’a pas de contrôle sur les pages web sur lesquelles aboutissent ces liens et ne saurait, en aucun cas, être responsable de leur contenu.&nbsp;</p>', 2, NULL, '2021-11-14 19:38:51', '2022-06-13 21:01:28'),
(22, NULL, NULL, 'ARTICLE 7 : Cookies', 'standard', '<p>L’utilisateur est informé que lors de ses visites sur le site, un cookie peut s’installer automatiquement sur son logiciel de navigation.<br>Les cookies sont de petits fichiers stockés temporairement sur le disque dur de l’ordinateur de l’utilisateur par votre navigateur et qui sont nécessaires à l’utilisation du site « <a href=\"https://click-games.fr/\">https://click-games.fr</a> ».<br>Les cookies ne contiennent pas d’information personnelle et ne peuvent pas être utilisés pour identifier quelqu’un. Un cookie contient un identifiant unique, généré aléatoirement et donc anonyme.<br>Certains cookies expirent à la fin de la visite de l’utilisateur, d’autres restent. L’information contenue dans les cookies est utilisée pour améliorer le site « <a href=\"https://click-games.fr/\">https://click-games.fr</a> ».<br>En naviguant sur le site, L’utilisateur les acceptent.<br>L’utilisateur pourra désactiver ces cookies par l’intermédiaire des paramètres figurant au sein de son logiciel de navigation.</p>', 2, NULL, '2021-11-14 19:38:51', '2022-06-13 21:01:28'),
(23, NULL, NULL, 'ARTICLE 8 : Publication par l’Utilisateur', 'standard', '<p>Le site permet aux membres de publier les contenus suivants :<br>Articles (Produits), photos des articles, descriptions, couleur(s) des articles.<br>CLICK GAMES est une boutique E-commerce réunissant plusieurs entreprises qui souhaitent vendre leurs produits sur internet.<br>Tout article alimentaire publier sur le site « <a href=\"https://click-games.fr/\">https://click-games.fr</a> » par une entreprise tierce fera l’objet d’une suppression du produit et de la publication.<br>Il est strictement interdit de vendre des produits illégaux conformément aux lois françaises : toute publication à caractères illégaux fera l’objet d’un signalement aux autorités compétentes.<br>Dans ses publications, le membre s’engage à respecter les règles de la Netiquette (règles de bonne conduite de l’internet) et les règles de droit en vigueur.<br>Le site peut exercer une modération sur les publications et se réserve le droit de refuser leur mise en ligne, sans avoir à s’en justifier auprès du membre.<br>Le membre reste titulaire de l’intégralité de ses droits de propriété intellectuelle. Mais en partageant une publication sur le site, il cède à la société éditrice le droit non exclusif et gratuit de représenter, reproduire, adapter, modifier, diffuser et distribuer sa publication, directement, ou par un tiers autorisé, dans le monde entier, sur tout support (numérique ou physique), pour la durée de la propriété intellectuelle. Le Membre cède notamment le droit d\'utiliser sa publication sur internet et sur les réseaux de téléphonie mobile.<br>La société éditrice s\'engage à faire figurer le nom du membre à proximité de chaque utilisation de sa publication.<br>Tout contenu mis en ligne par l\'utilisateur est de sa seule responsabilité. L\'utilisateur s\'engage à ne pas mettre en ligne de contenus pouvant porter atteinte aux intérêts de tierces personnes. Tout recours en justice engagé par un tiers lésé contre le site sera pris en charge par l\'utilisateur.<br>Le contenu de l\'utilisateur peut être à tout moment et pour n\'importe quelle raison supprimé ou modifié par le site, sans préavis.&nbsp;</p>', 2, NULL, '2021-11-14 19:38:51', '2022-06-13 21:01:28'),
(24, NULL, NULL, 'ARTICLE 9 : Droit applicable et juridiction compétente', 'standard', '<p>La législation française s\'applique au présent contrat. En cas d\'absence de résolution amiable d\'un litige né entre les parties, les tribunaux français seront seuls compétents pour en connaître.<br>Pour toute question relative à l’application des présentes CGU, vous pouvez joindre l’éditeur aux coordonnées inscrites dans l\'article 1.</p>', 2, NULL, '2021-11-14 19:38:51', '2022-06-13 21:01:28'),
(25, NULL, NULL, 'ARTICLE 10 : Autres entreprises', 'standard', '<p>Des tiers autres que CLICK GAMES gèrent des boutiques, proposent des services et vendent des lignes de produits sur ce site internet. De surcroît, nous fournissons des liens vers des sites internet de sociétés affiliées et d\'un certain nombres d\'entreprises. Nous ne sommes pas responsables de l\'examen ou de l\'évaluation, et nous ne garantissons pas les offres de ces entreprises ou de ces particuliers, ou le contenu de leurs sites internet. CLICK GAMES n\'assume aucune responsabilité ou obligation pour les actes, produits ou contenus de ces entreprises ou de ces particuliers ou d\'autres tiers. Vous êtes informé quand un tiers est impliqué dans votre transaction, et nous pouvons partager vos informations en lien avec cette transaction avec ce tiers.&nbsp;</p>', 2, NULL, '2021-11-15 12:58:38', '2022-06-13 21:01:28'),
(26, NULL, NULL, 'ARTICLE 11 : Notre responsabilité', 'standard', '<p>Nous ferons de notre mieux pour assurer la disponibilité des Services de CLICK GAMES et que les transmissions se feront sans erreurs. Toutefois, du fait de la nature d\'internet, ceci ne peut être garanti. De plus, votre accès aux Services de CLICK GAMES peut occasionnellement être suspendu ou limité pour permettre des réparations, de la maintenance, ou l\'ajout de nouvelles fonctionnalités ou services. Nous nous efforcerons de limiter la fréquence et la durée de ces suspensions ou limitations.&nbsp;</p><p>&nbsp;</p><p>Dans le cadre de ses relations avec des professionnels, CLICK GAMES n\'est pas responsable {1} des pertes qui n\'ont pas été causées par une faute de notre part, ou {2} des pertes commerciales (y compris les pertes de profit, bénéfices, contrats, économies espérées, données, clientèle ou dépenses superflues), ou {3} toute perte indirecte ou consécutive qui n\'était pas prévisible par vous et nous quand vous avez commencé à utiliser le Service de CLICK GAMES.<br>Nous ne serons pas tenus pour responsables des délais ou de votre impossibilité à respecter vos obligations en application de ces conditions si le délai ou l\'impossibilité résulte d\'une cause en dehors de notre contrôle raisonnable. Cette condition n\'affecte pas votre droit légal de recevoir les produits envoyés et les services fournis dans un temps raisonnable ou de recevoir un remboursement si les produits ou les services commandés ne peuvent être délivrés dans un délai raisonnable en raison d\'une cause hors de notre contrôle raisonnable.<br>Les lois de certains pays ne permettent pas certaines des limitations énumérées ci-dessus. Si ces lois vous sont applicables, tout ou partie de ces limitations ne vous sont pas applicables, et vous pouvez disposer de droits supplémentaires.<br>Rien dans ces conditions ne vise à limiter ou exclure notre responsabilité en cas de vol, ou en cas de décès ou de préjudice corporel causé par notre négligence ou une faute lourde.<br>CLICK GAMES ne serra pas tenu responsable de toute commande mal envoyée ou négligence de la part d’un vendeur tiers. En créant un compte sur le site « <a href=\"https://click-games.fr/\">https://click-games.fr</a> » vous acceptez de renoncer à toute poursuite judiciaire à l’encontre de CLICK GAMES et ses employé(e)s.&nbsp;</p>', 2, NULL, '2021-11-15 12:58:38', '2022-06-13 21:01:28'),
(27, NULL, NULL, 'ARTICLE 12 : Modification du service ou des conditions d\'utilisation', 'standard', '<p>Nous nous réservons le droit de faire des modifications sur tout service de CLICK GAMES, à nos procédures, à nos termes et conditions, y compris les présentes Conditions d\'utilisation à tout moment. Vous êtes soumis aux termes et conditions, procédures et Conditions d\'utilisation en vigueur au moment où vous utilisez le service. Si une stipulation de ces CGU est réputée non valide, nulle, ou inapplicable, quelle qu’en soit la raison, cette stipulation sera réputée divisible et n\'affectera pas la validité et l\'opposabilité des stipulations restantes.&nbsp;</p>', 2, NULL, '2021-11-15 12:58:38', '2022-06-13 21:01:28'),
(28, NULL, NULL, 'ARTICLE 13 : Mineurs', 'standard', '<p>Nous ne vendons pas de produits aux mineurs. Nous vendons des produits pour enfants pour des achats par des adultes. Si vous avez moins de 18 ans, vous ne pouvez utiliser un Service de CLICK GAMES que sous la surveillance d\'un parent ou d\'un tuteur. Les offres de produits contenant de l\'alcool sont destinées à des personnes majeures. Vous devez avoir au moins 18 ans pour acheter de l\'alcool ou utiliser toute fonctionnalité du site concernant de l\'alcool.&nbsp;</p>', 2, NULL, '2021-11-15 12:58:38', '2022-06-13 21:01:28'),
(29, NULL, NULL, 'ARTICLE 14 : Résumé responsabilité', 'standard', '<p>Nous rappelons que CLICK GAMES est une plate forme d\'hébergement pour vendeurs et acheteurs qui veulent vendre en ligne toute sorte d\'articles (légaux).</p><p>Ainsi, la plate forme décline toute responsabilité à propos :</p><ul><li>Des produits : non livraison dans le délai initialement prévu, livraison d\'un mauvais article, perte d\'un article, livraison d\'un article abîmé, cassé...&nbsp;</li><li>L\'acheteur doit prendre contact avec le vendeur (via la messagerie instantanée sur le site directement, ou via le profil privé du vendeur)</li><li>L\'utilisateur, qu\'il soit vendeur ou acheteur, se doit de garder son identifiant et son mot de passe strictement secret : CLICK GAMES ne sera pas tenu pour responsable si une utilisation malsaine est effectuée après qu\'un utilisateur ait transmit ses identifiants et mots de passes à une personne lambda.</li><li>Il peut arriver que des mise à jour, maintenances, ou problèmes techniques bloquent ou ralentissent pendant un temps indéfini l\'accès au site de CLICK GAMES, et, nous rappelons, que la plate forme n\'en sera pas tenu responsable.</li><li>De plus, en cliquant sur certains liens que vous trouverez sur le site, il se peut que ceux-ci vous dirige vers d\'autres sites, dans ce cas, nous (CLICK GAMES et les employé(e)s) déclinons toutes responsabilités en cas d\'intrusion d\'un virus sur votre ordinateur.</li></ul>', 2, NULL, '2021-11-15 12:58:38', '2022-06-13 21:01:28'),
(96, NULL, NULL, 'ARTICLE 1 : Introduction', 'standard', '<blockquote><p><i>Cette politique relative aux cookies a été mise à jour pour la dernière fois le 21 septembre 2021 et s\'applique aux citoyens et aux résidents permanents légaux de l\'Espace économique européen.</i></p></blockquote><p><i>&nbsp;</i></p><p>Le site web <a href=\"https://click-games.fr\">https://click-games.fr</a> (ci-après&nbsp;: «&nbsp;le site Web&nbsp;») utilise des cookies et d\'autres technologies connexes (pour des raisons de commodité, toutes les technologies sont appelées «&nbsp;cookies&nbsp;»). Des cookies sont également placés par des tiers que nous avons engagés. Dans le document ci-dessous, nous vous informons de l\'utilisation de cookies sur notre site Web.</p>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(97, NULL, NULL, 'ARTICLE 2 : Que sont les cookies ?', 'standard', '<p>Un cookie est un petit fichier simple qui est envoyé avec les pages de ce site Web et stocké par votre navigateur sur le disque dur de votre ordinateur ou d\'un autre appareil. Les informations qui y sont stockées peuvent être renvoyées à nos serveurs ou aux serveurs des tiers concernés lors d\'une visite ultérieure.</p>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(98, NULL, NULL, 'ARTICLE 3 : Que sont les scripts ?', 'standard', '<p>Un script est un morceau de code de programme utilisé pour que notre site Web fonctionne correctement et de manière interactive. Ce code est exécuté sur notre serveur ou sur votre appareil.</p>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(99, NULL, NULL, 'ARTICLE 4 : Que sont les scripts ?', 'standard', '<p>Une balise Web (ou une balise pixel) est un petit morceau de texte ou une image invisible sur un site Web qui est utilisé pour surveiller le trafic sur un site Web. Pour ce faire, diverses données vous concernant sont stockées à l\'aide de balises Web.</p>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(100, NULL, NULL, 'ARTICLE 5 : Cookies techniques ou fonctionnels', 'standard', '<p>Certains cookies garantissent que certaines parties du site Web fonctionnent correctement et que vos préférences d\'utilisateur restent connues. En plaçant des cookies fonctionnels, nous vous facilitons la visite de notre site Web. De cette façon, vous n\'avez pas besoin de saisir à plusieurs reprises les mêmes informations lorsque vous visitez notre site Web et, par exemple, les articles restent dans votre panier jusqu\'à ce que vous ayez payé. Nous pouvons placer ces cookies sans votre consentement.</p>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(101, NULL, NULL, 'ARTICLE 5.1 : Cookies statistiques', 'standard', '<ul><li>Nous utilisons des cookies statistiques pour optimiser l\'expérience du site Web pour nos utilisateurs. Avec ces cookies statistiques, nous obtenons des informations sur l\'utilisation de notre site Web. Nous vous demandons la permission de placer des cookies statistiques.</li></ul>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(102, NULL, NULL, 'ARTICLE 5.2 : Cookies de marketing, suivi', 'standard', '<p>Les cookies de marketing/suivi sont des cookies ou toute autre forme de stockage local, utilisés pour créer des profils d\'utilisateurs pour afficher de la publicité ou pour suivre l\'utilisateur sur ce site Web ou sur plusieurs sites Web à des fins de marketing similaires..</p>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(103, NULL, NULL, 'ARTICLE 6 : Cookies placés', 'standard', '<ol><li>Google Analystic</li></ol><blockquote><ol><li><a href=\"https://cookiedatabase.org/service/google-analytics/\">Nous utilisons Google Analystic à des fins marketing, plus d\'informations &nbsp;https://cookiedatabase.org/service/google-analytics/</a></li></ol></blockquote><ol><li>&nbsp;Facebook</li></ol><blockquote><ol><li><a href=\"https://cookiedatabase.org/service/google-analytics/\">Nous utilisons Facebook à des fins marketing, plus d\'informations </a><a href=\"https://cookiedatabase.org/service/facebook/\">https://cookiedatabase.org/service/facebook/</a></li></ol></blockquote><ol><li>&nbsp;Instagram</li></ol><blockquote><ol><li><a href=\"https://cookiedatabase.org/service/google-analytics/\">Nous utilisons Instagram à des fins marketing, plus d\'informations </a><a href=\"https://cookiedatabase.org/service/instagram/\">https://cookiedatabase.org/service/instagram/</a></li></ol></blockquote>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(104, NULL, NULL, 'ARTICLE 7 : Consentement', 'standard', '<p>Lorsque vous visitez le site Web pour la première fois, nous vous montrerons une fenêtre contextuelle avec une explication sur les cookies. Dès que vous cliquez sur \"Enregistrer les préférences\", vous consentez à ce que nous utilisions les catégories de cookies et de plug-ins que vous avez sélectionnés dans la fenêtre contextuelle, comme décrit dans la présente Politique relative aux cookies. Vous pouvez désactiver l\'utilisation des cookies via votre navigateur, mais veuillez noter que notre site Web peut ne plus fonctionner correctement.</p>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(105, NULL, NULL, 'ARTICLE 7.1 : Gérer vos paramètres de consentement', 'standard', '<p>L’utilisation du site : <a href=\"https://click-games.fr\">https://click-games.fr</a> implique votre consentement à notre politique relative aux cookies. Lors de votre première connexion une bannière en bas du site s’affiche pour vous avertir que nous utilisons des cookies à des fins marketing&nbsp;</p>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(106, NULL, NULL, 'ARTICLE 8 : Vos droits concernant les données personnelles', 'standard', '<p>Vous disposez des droits suivants concernant vos données personnelles :</p><p>&nbsp;</p><ul><li>- Vous avez le droit de savoir pourquoi vos données personnelles sont nécessaires, ce qui leur arrivera et combien de temps elles seront conservées.</li><li>&nbsp;</li><li>- Droit d\'accès : Vous avez le droit d\'accéder à vos données personnelles que nous connaissons.</li><li>&nbsp;</li><li>- Droit de rectification : vous avez le droit de compléter, corriger, faire supprimer ou bloquer vos données personnelles quand vous le souhaitez.</li><li>&nbsp;</li><li>- Si vous nous donnez votre consentement pour traiter vos données, vous avez le droit de révoquer ce consentement et de faire supprimer vos données personnelles.</li><li>&nbsp;</li><li>- Droit de transférer vos données : vous avez le droit de demander toutes vos données personnelles au responsable du traitement et de les transférer dans leur intégralité à un autre responsable du traitement.</li><li>&nbsp;</li><li>- Droit d\'opposition : vous pouvez vous opposer au traitement de vos données. Nous nous conformons à cela, sauf s\'il existe des motifs justifiés de traitement.</li></ul><p>&nbsp;</p><p>Pour exercer ces droits, veuillez nous contacter. Veuillez vous référer aux coordonnées au bas de cette politique en matière de cookies. Si vous avez une réclamation concernant la manière dont nous traitons vos données, nous aimerions vous entendre, mais vous avez également le droit de déposer une réclamation auprès de l\'autorité de contrôle (l\'Autorité de protection des données).</p>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(107, NULL, NULL, 'ARTICLE 9 : Activer/désactiver et supprimer les cookies', 'standard', '<p>Vous pouvez utiliser votre navigateur Internet pour supprimer automatiquement ou manuellement les cookies. Vous pouvez également préciser que certains cookies ne peuvent pas être déposés. Une autre option consiste à modifier les paramètres de votre navigateur Internet afin que vous receviez un message à chaque fois qu\'un cookie est placé. Pour plus d\'informations sur ces options, veuillez vous référer aux instructions de la section Aide de votre navigateur.</p><p>Veuillez noter que notre site Web peut ne pas fonctionner correctement si tous les cookies sont désactivés. Si vous supprimez les cookies dans votre navigateur, ils seront à nouveau placés après votre consentement lorsque vous visiterez à nouveau nos sites Web.</p>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(108, NULL, NULL, 'ARTICLE 10 : Coordonnées', 'standard', '<p>Pour toute question et ou commentaire concernant notre politique en matière de cookies et cette déclaration, veuillez nous contacter en utilisant les coordonnées suivantes&nbsp;:</p><p><br>Site Internet : https://click-games.fr<br>Courriel : support@click-games.fr</p>', 5, NULL, '2021-11-15 15:23:20', '2021-11-26 22:44:36'),
(110, NULL, NULL, '1. Objet', 'standard', '<p>Les présentes CGU Vendeur ont pour objet de déﬁnir les conditions dans lesquelles CLICK GAMES met à la disposition des Vendeurs, dans le cadre du Service, des outils technologiques permettant à ceux-ci de mettre en vente les Produits.</p>', 3, NULL, '2021-11-23 00:03:04', '2021-11-23 10:32:24'),
(111, NULL, NULL, '2. Description du service', 'standard', '<p>Le Service est constitué d\'un ensemble d\'outils permettant aux Vendeurs de se mettre en relation avec des Acheteurs, aﬁn de leur proposer des Produits à la vente, de référencer et de décrire ces Produits, d\'accepter les commandes passées par les Acheteurs, de percevoir le prix des Produits achetés et de gérer le service après-vente pour les Produits vendus.<br>Les transactions effectuées via le Service pour les besoins de la vente des Produits sont conclues directement entre l\'Acheteur et le Vendeur. CLICK GAMES n\'est en aucun cas Vendeur des Produits proposés par les Vendeurs par l\'intermédiaire du Service.<br>Par ailleurs, en cas de non-respect des présentes CGU Vendeur, CLICK GAMES se réserve le droit d\'interrompre de manière temporaire ou déﬁnitive l\'accès au Service au Vendeur concerné, en suspendant ou en résiliant les présentes dans les conditions prévues à l’article 8.<br>Par principe, le Vendeur est responsable des impôts, droits, taxes et éco- contributions dus au titre de la transaction qu’il conclut avec un Acheteur. Par exception, à compter du 1er juillet 2021, dans le cadre de transactions intervenant entre un Acheteur agissant à titre privé établi en France ou à Monaco et (i) un Vendeur établi hors de l’Union Européenne ou (ii) un Vendeur établi dans l’Union Européenne mais important les Produits depuis un pays hors Union Européenne.&nbsp;<br>La redevabilité par CLICK GAMES de la TVA afférente à la transaction ne s’applique pas aux transactions réalisées par un Vendeur lorsque celles-ci relèvent du régime de la TVA sur marge prévu aux articles 297 A et suivants du Code Général des Impôts (CGI).<br>Pour les transactions où CLICK GAMES est redevable de la TVA du fait que les Produits sont importés depuis un pays hors Union Européenne, le Vendeur reconnaît que l’exactitude du régime ﬁscal afférent à une transaction entre un Vendeur et un Acheteur dépend des informations communiquées par le Vendeur à CLICK GAMES. En conséquence, le Vendeur s’engage à fournir à CLICK GAMES pour chaque transaction avec un Acheteur le lieu d’expédition des Produits vendus à cet Acheteur. Le Vendeur reconnait expressément que la bonne réalisation de la transaction avec un Acheteur établi en France ou à Monaco impose de respecter plusieurs conditions de forme permettant le contrôle systématique des colis par l’administration des douanes. En particulier, le Vendeur s’engage à apposer sur le colis contenant les Produits le numéro IOSS (commande d’une valeur hors taxes et hors frais de transport inférieure ou égale à 150 €) ou TVA (commande d’une valeur hors taxes et hors frais de transport supérieure à 150 €) de CLICK GAMES aﬁn de permettre la remontée d’informations correctes pour le traitement de la TVA des Produits. De plus, lorsqu’un Acheteur achète, dans le cadre d’une même commande, plusieurs Produits auprès d’un même Vendeur, le Vendeur s’engage à regrouper les Produits dans un seul colis.&nbsp;<br>Le Vendeur reconnaît, pour chaque transaction avec un Acheteur, être pleinement redevable des droits de douane dus au titre de l’introduction de Produits sur le territoire de l’Union Européenne, s’engage à les régler dans leur intégralité et à les intégrer dans le prix de vente hors taxes des Produits. En aucune façon les droits de douane acquittés au titre des Produits ne doivent être facturés séparément ou laissés à la charge de l’Acheteur.</p><p>Le vendeur reconnaît gérer lui même sa redevance à la TVA.</p>', 3, NULL, '2021-11-23 00:03:04', '2021-11-23 10:32:24'),
(130, NULL, NULL, '3. Accès au service', 'standard', '<p>Outre l\'acceptation des présentes CGU Vendeur, l\'accès au Service est subordonné à l\'ouverture d\'un compte CLICK GAMES et au paiement d’un abonnement mensuel. Vous devez pour cela fournir les données permettant votre identiﬁcation ainsi que vos coordonnées. Lors de l\'ouverture de ce compte, Vous vous engagez à ne fournir que des informations exactes, puis à informer CLICK GAMES sans délai de tout changement les affectant. L’utilisation du Service implique pour le Vendeur l’ouverture d’un compte de paiement auprès de sa banque, exclusivement dédié à l’encaissement des paiements effectués par l’Acheteur au Vendeur par l’intermédiaire de CLICK GAMES .</p><p>L’accès au service est limité à l’ouverture d’un seul compte, tout doublon de compte se verra immédiatement supprimé sauf validation préalable par CLICK GAMES.&nbsp;<br>CLICK GAMES se réserve la possibilité de résilier un compte si celui-ci présente un ou plusieurs éléments en commun avec un compte précédemment résilié pour manquement.&nbsp;<br>Pour utiliser le Service, vous devez utiliser l\'identiﬁant et le mot de passe créés lors de l\'ouverture de votre compte. Les identiﬁants et mots de passe sont placés sous l’entière et unique responsabilité du Vendeur. Le Vendeur s’engage à prendre toutes mesures utiles pour qu’ils ne soient pas connus de tiers ou utilisés par des personnes non autorisées. Le Vendeur a la responsabilité de la préservation de la conﬁdentialité des identiﬁants et mots de passe. Le Vendeur est à cet égard responsable des conséquences de la perte ou du détournement des identiﬁants et mots de passe.&nbsp;<br>En cas de perte, de détournement ou d\'utilisation frauduleuse de votre identiﬁant et/ou de votre mot de passe, le Vendeur s’engage à en avertir immédiatement le service commercial depuis la page de connexion du compte Vendeur. Le vendeur est responsable des accès indus, dommages, perturbations et conséquences dommageables causés par votre manquement à la conﬁdentialité des identiﬁants.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(131, NULL, NULL, '4. Obligations relatives aux transactions réalisées par l\'intermédiaire du service | 4.1 Obligations d\'ordre général', 'standard', '<p>Le Vendeur doit s\'identiﬁer auprès des Acheteurs comme agissant ou non en qualité de professionnel. Il s\'engage expressément à s\'identiﬁer comme agissant en qualité de Vendeur professionnel dès lors qu\'il effectue des ventes de Produits par l\'intermédiaire du Service de manière régulière et à des ﬁns lucratives. Le Vendeur s\'engage à respecter la législation applicable en matière d\'exercice d\'une activité commerciale (notamment immatriculation, obligations comptables, sociales et ﬁscales). En effet, Le Vendeur peut être tenu de souscrire des déclarations ﬁscales et sociales au titre de son activité de vente de biens sur le Site. L’administration met à sa disposition des ﬁches précisant ses obligations en matière ﬁscale et sociale.&nbsp;<br>Le Vendeur s\'engage également à respecter les lois et règlements qui lui incombent en sa qualité de professionnel eu égard notamment aux Produits qu\'il vend sur le Site (tel que par exemple : déclaration auprès de l\'Administration ﬁscale pour les Vendeurs de postes de télévision).<br>Par ailleurs, le Vendeur s\'interdit expressément de promouvoir directement ou indirectement, sous quelque forme que ce soit (notamment par l\'insertion de liens hypertextes, de tout message dans le descriptif des Produits, de tout imprimé dans es colis expédiés à l\'Acheteur, ou encore par l\'utilisation de l\'adresse URL de son site Internet dans son identiﬁant ou sur la page Vendeur, ou par l’utilisation d’un carton d’emballage) ses produits ou services, de même que ceux de tout autre personne.&nbsp;<br>Le Vendeur s\'engage à mettre en œuvre tous les moyens de façon à satisfaire de manière optimale à ses obligations en délivrant un service de qualité vis-à-vis des Acheteurs.&nbsp;<br>Il s\'engage notamment pour cela à répondre aux emails du Service Client et du Service Commercial de CLICK GAMES ainsi qu\'aux emails des Acheteurs dans un délai de 2 jours ouvrés à compter de leur réception, et ce, en langue française. Tout échange entre le Vendeur et CLICK GAMES est strictement conﬁdentiel. Le Vendeur s’engage donc à ne pas divulguer le contenu de ces échanges à un tiers. Le Vendeur s’interdit, et sans que cette liste soit limitative, d’utiliser des visuels ou des noms commerciaux, des pseudonymes ou de tenir des propos ou autres messages qui seraient injurieux, contraires à l‘ordre public ou aux bonnes mœurs, qui porteraient atteinte aux droits de personnes ou aux droits de propriété intellectuelle de tiers, aux lois et règlements et à l’image de marque CLICK GAMES. A défaut , CLICK GAMES se réserve le droit d\'interrompre de manière temporaire ou déﬁnitive l\'accès au Service au Vendeur concerné, en suspendant ou en résiliant les présentes dans les conditions prévues à l’article 8. Le Vendeur s’engage à détenir un solde positif sur son compte à tout moment</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(132, NULL, NULL, '4.2 Obligations relatives aux offres de Produits sur le Site', 'standard', '<p>Le Vendeur s\'engage et garantit qu\'il ne vendra que des Produits dont il est propriétaire ou sur lesquels il dispose des droits lui permettant de les vendre. Il garantit qu\'ils ne contreviennent en aucune façon aux lois, règlementations en vigueur et normes applicables, obligatoires ou non (en particulier concernant la commercialisation des jeux, jouets) et qu\'ils ne portent pas atteinte aux droits des tiers. Le Vendeur s\'interdit à ce titre notamment de vendre tout Produit consistant en des œuvres contrefaisantes au sens du Code la propriété intellectuelle ou tout Produit dont la commercialisation est réglementée en vertu de dispositions législatives, règlementaires ou contractuelles (notamment en raison de l\'existence d\'un réseau de distribution sélective). Le Vendeur est seul responsable de la mise en vente des Produits qu\'il propose sur le Service.&nbsp;<br>Le Vendeur s’interdit notamment de proposer sur le Site sans que cette liste soit limitative : des produits à caractère pornographique et plus généralement portant atteinte aux bonnes mœurs ; les biens incitant à la haine raciale ou objets de discrimination basée sur la race, le sexe, la religion, nationalité, les capacités physiques, l’orientation sexuelle ou l’âge ; les objets volés ; les médicaments ou drogues de tous types ; les armes, armes de guerre et munitions ; les animaux vivants ; les boissons alcooliques.&nbsp;<br>Sur le descriptif associé aux offres de Produits qu\'il propose sur le Site, le Vendeur s\'engage à agir de bonne foi. Il est seul responsable de l\'exactitude des mentions y ﬁgurant et s\'engage à ce qu\'elles ne risquent pas d\'induire en erreur les Acheteurs potentiels, tant sur les caractéristiques du Produit, les garanties associées, que sur son état ou son prix. Concernant plus particulièrement les Produits d\'occasion, le Vendeur devra faire un descriptif précis de l\'état du Produit. Le Vendeur communique aux Acheteurs toutes les informations leur permettant de connaître les caractéristiques essentielles du Produit (le cas échéant, composition du Produit, accessoires compris, origine, les garanties légales, les modalités de leurs mises en œuvre, ou toutes autres conditions contractuelles etc.). Le Vendeur s\'engage en outre à ce que les illustrations / visuels fournis dans le descriptif associé aux offres de Produits qu\'il propose (photographie, dessin, etc.) soient conformes aux Produits ainsi illustrés et respectent les droits des tiers et qu’ils ne portent pas atteinte à l‘ordre public ou aux bonnes mœurs. Il garantit CLICK GAMES qu\'il dispose des droits, en particulier de propriété intellectuelle, afférents à ces illustrations, qui lui permettent de les utiliser aﬁn de présenter les Produits.&nbsp;<br>Conformément aux dispositions de la loi du 21 juin 2004, dite « LCEN » (Loi pour la Conﬁance en l’Économie Numérique) CLICK GAMES pourra supprimer toute information mise en ligne sur le Site par un Vendeur en cas de notiﬁcation d’un tiers faisant état du caractère illicite de cette information ou d’une violation d’un droit.<br>Le Vendeur devra également préciser dans le descriptif associé aux offres le pays d’expédition des Produits.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(133, NULL, NULL, '4.3 Obligations relatives au prix des Produits', 'standard', '<p>Le prix de vente des Produits est déﬁni librement par le Vendeur, dans le respect des lois et règlements en vigueur.&nbsp;<br>Ce prix doit être mentionné sur le Site toutes taxes et frais compris (notamment TVA, TVA à l\'importation, frais d\'emballage, eco-taxe, droits de douanes, le cas échéant la redevance pour copie privée, etc...), mais hors frais de livraison, ces derniers peuvent être ajoutés par CLICK GAMES au prix de la commande lorsque l\'Acheteur la valide.&nbsp;<br>Ainsi il ne pourra pas être demandé à l’Acheteur de régler toute autre somme que celle ﬁgurant sur la ﬁche descriptive du Produit.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(134, NULL, NULL, '4.4 Obligations relatives à la vente des Produits', 'standard', '<p>Les contrats de vente des Produits proposés par le Vendeur sur le Site sont conclus entre le Vendeur et l’Acheteur. Le Vendeur s\'engage à n\'offrir sur le Site que des Produits disponibles et à supprimer sans délai du Site toute offre se rapportant à des Produits qui ne sont plus disponibles. Le Vendeur est seul responsable en cas d’indisponibilité du Produit dont il a seul la maitrise.&nbsp;<br>Le Vendeur est informé par email, par le bais de son interface Vendeur ou par le biais d\'API s\'il choisit cette option et dans son compte par CLICK GAMES lorsqu\'un Produit qu\'il a mis en ligne a fait l\'objet d\'une commande par un Acheteur. Le Vendeur doit alors conﬁrmer la commande concernée dans un délai de 2 jours ouvrés suivant la réception de l\'information visée à l\'alinéa précédent.&nbsp;<br>Aussi, le Vendeur s\'engage à consulter régulièrement, et au moins une fois par jour ouvré, ses emails reçus à l\'adresse fournie à CLICK GAMES lors de l\'ouverture de son compte puis, par la suite, en cas de changement affectant cette information, et ce, aﬁn d’être en mesure de conﬁrmer les Produits commandés par les Acheteurs.&nbsp;<br>La conﬁrmation de la commande par le Vendeur implique pour le Vendeur, l\'engagement ferme d\'expédier le(s) Produit(s) dans le délai visé au paragraphe 4.5 (v) ci-dessous A défaut de réponse du Vendeur dans le délai auquel il est fait référence à l\'alinéa précédent, le contrat de vente sera automatiquement annulé et le compte du Vendeur mis \"en vacances\". En cas d\'absence ou d\'indisponibilité de plus de 2 jours ouvrés, le Vendeur doit suspendre temporairement la mise en ligne de ses Produits à vendre.&nbsp;<br>Le Vendeur s\'engage à honorer au minimum 95 % des commandes des Produits proposés à la vente sur le Site depuis l’ouverture de son compte. A défaut, CLICK GAMES et pour les Vendeurs ayant réalisé au moins 5 ventes, se réserve le droit d\'interrompre de manière temporaire ou déﬁnitive l\'accès au Service au Vendeur concerné, en suspendant ou en résiliant les présentes dans les conditions prévues à l’article 8.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(135, NULL, NULL, '4.5 Obligations relatives à la livraison des Produits', 'standard', '<p>(i)Le descriptif associé à chaque Produit présenté sur le Site indiquera les modes de livraison proposés pour la livraison de ce Produit. Les modalités de livraison suivantes peuvent être proposées, dans les conditions déﬁnies ci-après, à L\'Acheteur :</p><ul><li>- livraison Standard</li><li>- livraison Express</li><li>- livraison point relais</li><li>- Click&amp;Collect</li></ul><p>Le Vendeur a l\'obligation de respecter le mode de livraison choisi par l\'Acheteur. Le Vendeur peut refuser de livrer le Produit commandé dans ce cas nous appliquons un remboursement à l’acheteur.</p><p>(iii) Le Vendeur doit obligatoirement adresser à l\'acheteur un bon de livraison du Produit acheté. Le Vendeur doit impérativement joindre à la livraison du Produit une facture d\'achat ou tout autre document permettant le cas échéant à l’Acheteur de faire jouer sa garantie.</p><p>(iv) Le Vendeur s\'engage à apporter tout le soin nécessaire à la mise sous pli des Produits commandés de façon à éviter que les Produits ne soient endommagés durant le transport. Le Produit voyage aux frais et aux risques du Vendeur.</p><p>(v) CLICK GAMES adresse au Vendeur, au plus tard dans les 24 heures suivant la commande de l\'Acheteur, les informations relatives à l\'Acheteur lui permettant de livrer le(s) Produit(s) commandé(s).</p><p>(vi) Le Vendeur s\'engage à expédier tout Produit commandé dans les 2 jours ouvrés à compter de la conﬁrmation de la commande du Produit. Si le délai d’expédition du Vendeur est supérieur au délai susvisé, le Vendeur s’engage à en faire mention dans la ﬁche descriptive du Produit.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(136, NULL, NULL, '4.6 Obligations relatives aux contestations relatives aux Produits', 'standard', '<p>De manière générale, le Vendeur s\'engage à mettre en œuvre, de bonne foi, tous les moyens nécessaires aﬁn de remplir ses obligations en délivrant un service de qualité aux Acheteurs. A tout moment, l’Acheteur a la possibilité de contacter le Vendeur, d’adresser toute demande, réclamation relative aux Produits commandés en utilisant l’outil de messagerie mis à disposition dans le cadre du Service, notamment pour faire valoir ses garanties quand elles sont en cours.&nbsp;<br>En sus de l’outil de messagerie, il est mis à la disposition un bouton dédié permettant à , tout Acheteur de signaler dans son compte, et dans un délai de 14 jours pour les achats effectués auprès d’un Vendeur professionnel, toute réclamation concernant les Produits commandés, (par exemple : produit non reçu, etc.).&nbsp;<br>Au-delà de ces délais, l’Acheteur conserve la possibilité de contacter le Vendeur, de formuler toute demande relative aux Produits commandés en utilisant l’outil de messagerie mis à disposition dans le cadre du Service.<br>En cas de réclamation d\'un Acheteur concernant un Produit, y compris lorsque le Vendeur est informé de ladite réclamation par le biais de l\'outil d\'information mis à sa disposition dans le Service et/ou par l\'envoi d\'un email de CLICK GAMES, le Vendeur fait son affaire personnelle de la résolution du différend qui l\'oppose à l\'Acheteur. Les litiges sont directement réglés entre l\'Acheteur et le Vendeur, le cas échéant à l\'aide de l\'outil de messagerie mis à leur disposition sur le Service. Le Vendeur devra faire ses meilleurs efforts pour résoudre le litige l\'opposant à l\'Acheteur amiablement.<br>Néanmoins, dans le cas où le Vendeur n\'aurait pas résolu le litige l\'opposant à l\'Acheteur dans un délai de 8 jours ouvrés à compter de la réception de la réclamation, CLICK GAMES se réserve le droit, après en avoir préalablement informé le Vendeur, de procéder au remboursement du Produit auprès de l\'Acheteur. Ce même montant sera ensuite déduit des sommes à reverser par CLICK GAMES au Vendeur au titre des Produits vendus par le Vendeur via le Service.<br>Si la contestation de l\'Acheteur s\'avère fondée, le Vendeur procèdera soit au renvoi du Produit commandé soit au remboursement.<br>En cas d\'exercice du droit de rétractation par l\'Acheteur, CLICK GAMES, en sa qualité de tiers de conﬁance, procédera au remboursement des sommes versées au plus tard dans les 14 jours à compter de la date à laquelle le droit a été exercé par l’Acheteur auprès du Vendeur et que CLICK GAMES en a été informé. Cette date de remboursement pouvant être différée jusqu’à récupération du Produit ou jusqu’à ce que l’Acheteur ait fourni simultanément au Vendeur et à CLICK GAMES une preuve de l’expédition du Produit, la date retenue étant celle du premier de ces faits. Le remboursement sera effectué par le même moyen de paiement utilisé par l’Acheteur (par recrédit de la carte bancaire). Ce montant sera ensuite déduit des sommes dues par CLICK GAMES au Vendeur au titre des ventes des Produits. Néanmoins, dans le cas où le compte du Vendeur serait débiteur de plus de 40 €, le remboursement du Produit retourné par l\'Acheteur sera alors effectué directement par le Vendeur à l\'Acheteur.<br>CLICK GAMES se réserve le droit, concernant les Vendeurs ayant réalisé au moins 5 ventes, de suspendre ou résilier les présentes dans les conditions prévues à l’article 8 en cas d’atteinte par le Vendeur d’un taux de réclamation supérieur à 5% de ses commandes.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(137, NULL, NULL, '4.7 Non-respect des obligations par le Vendeur', 'standard', '<p>Il est rappelé que CLICK GAMES se réserve le droit de suspendre déﬁnitivement ou temporairement l’accès au service au Vendeur concerné en cas de non-respect de ses obligations , tel que prévu dans l’article 8.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(138, NULL, NULL, '5. Dispositions ﬁnancières', 'standard', '<p>Pour chaque commande de Produits reçue par un Acheteur, CLICK GAMES percevra de la part du Vendeur une commission en fonction de l’abonnement du Vendeur, comme indiqué dans la page d’abonnement.</p><p>CLICK GAMES reversera au Vendeur le montant total du prix de la commande considérée, après conﬁrmation par l\'Acheteur de la réception du ou des Produit(s) achetés après 14 jours.</p><p>A défaut de conﬁrmation de la réception du produit par l\'Acheteur et en l\'absence de contestation de l\'Acheteur portée à la connaissance du Vendeur dans le délai imparti à l\'Acheteur pour le faire, le Produit sera réputé avoir été reçu 15 jours suivant la date du débit du compte bancaire de l’Acheteur ou suivant la date d’expédition effective.<br>CLICK GAMES se réserve le droit de suspendre le paiement des sommes dues au Vendeur en cas de manquement par le Vendeur à ses obligations</p><p>Chaque paiement pour les ventes du Vendeur serra émis le 5,10,25,30 de chaque mois.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24');
INSERT INTO `items_article` (`id`, `pos`, `number`, `title`, `type`, `content`, `article_id`, `parent_id`, `created_at`, `updated_at`) VALUES
(139, NULL, NULL, '6. Suspension - Résiliation', 'standard', '<p>8.1 Les présentes Conditions Générales d’Utilisation sont conclues pour une durée indéterminée. Chaque Partie peut en conséquence résilier les CGU à tout moment sans avoir à en justiﬁer moyennant le respect d’un préavis de 2 mois.&nbsp;<br>8.2 En cas de manquement par le Vendeur Professionnel à l’une quelconque de ses obligations, CLICK GAMES pourra après mise en demeure envoyée par tous moyens restée sans effet pendant une durée de 30 jours, résilier le présent Contrat par simple envoi d\'une lettre recommandée avec avis de réception.<br>8.3 En cas de manquement grave et/ou répété par le Vendeur à ses obligations ou affectant ses comptes, tel que notamment et sans que cette liste soit limitative: fraude, non-respect de ses obligations ﬁscales ou des engagements ﬁscaux ﬁgurant à l’article 2 des présentes, propos injurieux, contrefaçon, atteinte aux droits des tiers, non-respect de au moins un des indicateurs de qualité (...), CLICK GAMES pourra résilier les présentes CGU sans préavis et sans que le Vendeur ne puisse prétendre à une quelconque indemnité.<br>En particulier, un manquement grave est notamment constitué par (i) le non- respect des obligations en matière de TVA (déclaration et paiement de la TVA afférent à des transactions imposables à la TVA en France) qui aboutit à la mise en œuvre de la procédure prévue à l’article 283 bis du CGI, (ii) la communication à CLICK GAMES d’informations inexactes sur l’identité du Vendeur et sur le pays d’établissement véritable de son siège social, (iii) la communication à CLICK GAMES d’un lieu d’expédition erroné.<br>En cas de signalement par l’administration ﬁscale d’une irrégularité du Vendeur, pour quelque motif que ce soit, CLICK GAMES pourra procéder au blocage des paiements du Vendeur le temps de mener les investigations y afférentes.<br>8.4 Lorsque le présent Contrat est résilié pour manquement grave, CLICK GAMES se réserve la possibilité de procéder à la résiliation des autres Contrats liant le Vendeur avec&nbsp; CLICK GAMES, sous réserve du respect du préavis applicable.</p><p>&nbsp;</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(140, NULL, NULL, '7. Service de médiation pour les litiges de consommation - Règlement en ligne des litiges', 'standard', '<p>Conformément à la règlementation, CLICK GAMES propose aux Acheteurs un service de médiation pour les litiges de consommation liés aux transactions réalisées par l’intermédiaire du Service. Les frais de médiation seront refacturés par CLICK GAMES au Vendeur.&nbsp;<br><strong>Plateforme de Règlement en Ligne des Litiges :</strong>Conformément à l’article 14 du Règlement (UE) n°524/2013, la Commission Européenne a mis en place une plateforme de Règlement en Ligne des Litiges, facilitant le règlement indépendant par voie extrajudiciaire des litiges en ligne entre consommateurs et professionnels de l’Union européenne.</p><p>Cette plateforme est accessible au lien suivant : <a href=\"https://%0D%20webgate.ec.europa.eu/odr/\">https:// webgate.ec.europa.eu</a></p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(141, NULL, NULL, '10. Données personnelles', 'standard', '<p>Vos données à caractère personnel en tant que « Vendeur » sont traitées par CLICK GAMES PARTICIPATIONS ET SERVICES et CLICK GAMES (ci-après CLICK GAMES) et par Stripe agissant respectivement en qualité de responsables des traitements mis en œuvre dans le cadre du Service, à savoir :<br><strong>Traitements opérés par CLICK GAMES :</strong>&nbsp;<br>Gestion de l’inscription et suivi des comptes vendeurs ;<br>Mise en relation avec les acheteurs ;<br>Elaboration de statistiques commerciales ;<br>Gestion des demandes de droit d\'accès, de rectiﬁcation et d\'opposition ;<br>Opérations relatives à la prospection commerciale et proﬁlage publicitaire ;<br>Prévention de la fraude et gestion du risque ;<br><strong>Traitements réalisés par Stripe :</strong><br>KYC, recertiﬁcation, exécution du contrat, gestion du produit et des services,, encaissement, lutte contre le blanchiment et le ﬁnancement du terrorisme, lutte contre la fraude, gestion des risques, reporting, Vous avez la possibilité de vous opposer à cette communication, tout en justiﬁant de votre identité, par email :support@click-games.fr</p><p>Click Games collecte également certaines données.</p><p>Vous disposez par ailleurs, du droit d\'introduire une réclamation auprès de la Commission Nationale de l\'Informatique et des Libertés (CNIL), notamment sur son site internet <a href=\"http://click-games.fr/www.cnil.fr\">www.cnil.fr</a>.<br>CLICK GAMES dispose d\'un Délégué à la Protection des données personnelles (DPO) chargé de garantir la protection des données personnelles. Vous pouvez contacter le Délégué à la protection des données personnelles de CLICK GAMES à l\'adresse support@click-games.fr (hors exercice de vos droits qui s\'effectuent principalement sur l’agent conversationnel de la page de la Politique de protection des données personnelles du site).<br>Pour plus d’information sur les traitements réalisés par CLICK GAMES voir police de conﬁdentialité ici.<br>Pour plus d’information sur les traitements réalisés par BNP voir la notice de protection des données personnelles ici.<br>CLICK GAMES utilise des cookies. Pour plus d\'information sur les cookies cliquez ici S\'agissant des données relatives aux commandes de Produits du Vendeur collectées dans le cadre du Service, CLICK GAMES informera les Acheteurs qu\'elles sont destinées à CLICK GAMES, et que les informations nécessaires à la livraison des Produits seront transférées, à cette seule ﬁn ainsi que cas échéant aux ﬁns de lui permettre de répondre à ses obligations légales, au Vendeur. Le Vendeur s\'engage irrévocablement à utiliser les données personnelles de l\'Acheteur qui lui seront transmises par CLICK GAMES uniquement pour les besoins de la livraison des Produits et pour lui permettre de s\'acquitter de ses obligations légales, notamment en termes d’identiﬁcation des cycles le cas échéant. Il s\'engage à n\'en conserver aucune copie dès qu\'il aura procédé à l\'expédition du ou des Produit(s) commandé(s). Toute autre utilisation, location, vente, revente ou copie de la part du Vendeur sont interdites. Dans ce cadre, le Vendeur peut être amené à recevoir des informations par email liées au Service de la part de CLICK GAMES.<br>Lutte contre la fraude Aﬁn de lutter contre la fraude (absence de livraison des clients, impayés, ...) ou des comportements inadéquats du Vendeur (réclamations, mauvaises évaluations ou taux de satisfaction insufﬁsant...) et ainsi assurer aux Utilisateurs du Service une qualité de service optimale, les données personnelles du Vendeur collectées sur le site sont traitées par CLICK GAMES pour déterminer le niveau de risque de fraude et de conﬁance associé au compte Vendeur. Dans le cadre de cette analyse, CLICK GAMES est susceptible d’interroger ses prestataires spécialisés dans la prévention des risques pour afﬁner son analyse. Certains de ces prestataires sont en outre rendus destinataires du résultat de l’analyse effectuée et peuvent l’utiliser pour leur compte aﬁn d’alimenter leur propre ﬁchier d’incidents. Certaines données en rapport avec le terminal associé au compte Vendeur peuvent en outre faire l’objet d’un transfert aux Etats- Unis. CLICK GAMES prend toutes les mesures et garanties nécessaires pour sécuriser ces transferts.<br>Les messages échangés entre le Vendeur et l’Acheteur par le biais de CLICK GAMES sont conservés par CLICK GAMES et pourront être utilisés pour prouver un comportement inadapté du Vendeur.<br>CLICK GAMES pourra, en fonction des résultats du contrôle effectué sur les comptes Vendeurs (à l’inscription et pendant la vie du compte), de l’indice de conﬁance attribué au compte Vendeur ou du comportement du Vendeur, prendre des mesures, telles que refus d’inscription du Vendeur à la Marketplace, suspension temporaire ou fermeture déﬁnitive du compte Vendeur. Ces mesures pourront également avoir pour effet de suspendre le paiement des Vendeurs dans le cas où le Vendeur n’a pas ou pourrait ne pas procéder à la livraison. La survenance d’un incident (absence de livraison, impayé concernant CLICK GAMES, fermeture du compte, indice de conﬁance négatif...) pourra entraîner l’inscription des données en rapport avec le compte au sein du ﬁchier d’alerte de CLICK GAMES, ce qui pourra, lors de prochaines connexions ou inscriptions des Vendeurs, conduire CLICK GAMES à réaliser des vériﬁcations supplémentaires ou des refus d’inscriptions des Vendeurs.</p><p>A tout moment au cours de l’analyse de risque menée par CLICK GAMES, vous pourrez présenter vos observations en écrivant à CLICK GAMES Service Consommateur, 8 rue louis Aragon 25400 Audincourt. En outre, conformément à la loi informatique et libertés du 6 janvier 1978 modiﬁée, vous disposez des droits d\'accès, de rectiﬁcation, de suppression et d’opposition. Pour exercer ces droits, vous pouvez vous adresser par voie électronique à support@click-games.fr ou par courrier à CLICK GAMES Service Consommateur, 8 rue louis Aragon 25400 Audincourt, en nous indiquant vos nom, prénom, e-mail adresse et si possible votre référence client.</p><p>Vendeurs situés en dehors du territoire de l’Union européenne :</p><p>Si vous exercez votre activité depuis un pays situé en dehors du territoire de l’Union européenne, vous vous engagez à traiter les données à caractère personnel qui vous sont communiquées conformément aux dispositions du Règlement UE 2016/679 du 27 avril 2016 (le « RGPD »). Vous reconnaissez également mettre en place les mesures techniques et organisationnelles appropriées pour protéger ces données contre toute atteinte à leur disponibilité, leur intégrité ou leur conﬁdentialité.</p><p>Lorsque vous recevez des données de la part de CLICK GAMES à des ﬁns strictement limitées à l’exécution des commandes, vous agissez en qualité de responsable de traitement. Dans le cas où vous avez recours à des sous-traitants ultérieurs, vous mettez en place des procédures vous permettant d’assurer qu’ils ne peuvent traiter les données que vous leur communiquez que sur instruction expresse de votre part et qu’ils sont tenus aux mêmes obligations que les vôtres en termes de protection des données à caractère personnel.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(142, NULL, NULL, '11. Propriété intellectuelle', 'standard', '<p>11.1 - Tous les textes, commentaires, ouvrages, illustrations, œuvres et images reproduits ou représentés sur le Site sont strictement réservés au titre du droit d\'auteur ainsi qu\'au titre de la propriété intellectuelle, pour toute la durée de protection de ces droits et pour le monde entier. À ce titre et conformément aux dispositions du Code de la propriété intellectuelle, seule l\'utilisation pour un usage privé, sous réserve de dispositions différentes voire plus restrictives du Code de la propriété intellectuelle, est autorisée. Toute reproduction ou représentation totale ou partielle du Site ou de tout ou partie des éléments se trouvant sur le Site est strictement interdite.</p><p>11.2 - Les dénominations sociales, marques et signes distinctifs reproduits sur les sites de la CLICK GAMES sont protégés au titre du droit des marques. La reproduction ou la représentation de tout ou partie d\'un des signes précités est strictement interdite et doit faire l\'objet d\'une autorisation écrite préalable du titulaire de la marque.</p><p>11.3 - Certains produits font l\'objet de droits d\'utilisation personnels et spéciﬁques réglementant les copies, diffusions publiques, locations. Vous devez respecter les conditions générales de vente de ces produits et CLICK GAMES ne saurait être responsable des utilisations qui pourraient être faites des Produits dans ce cadre.</p><p>11.4 - CLICK GAMES se réserve le droit d’utiliser les droits de propriété intellectuelle du Vendeur dans le cadre du Service.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(143, NULL, NULL, '12. Responsabilité', 'standard', '<p>Le Vendeur garantit et indemnisera à première demande CLICK GAMES contre tout dommage subi par CLICK GAMES et contre toute action en responsabilité qui serait engagée à l\'encontre de CLICK GAMES à raison de la violation par le Vendeur d\'un droit quelconque d\'un tiers, y compris d\'un Acheteur, que ce dommage résulte de la vente de Produits, de l\'utilisation faite par le Vendeur du Service, ou de toute autre fait qui lui serait imputable.<br>La responsabilité de CLICK GAMES envers le Vendeur ne peut être engagée que pour des faits qui lui seraient directement imputables et est en tout état de cause limitée au montant correspondant aux commandes réalisées dans le mois précédent. Elle ne peut être engagée pour les préjudices indirects, notamment la perte de chance de vendre des Produits en cas d\'indisponibilité du Service. La responsabilité de CLICK GAMES ne peut pas non plus être engagée du fait de la mauvaise utilisation du Service par le Vendeur.<br>CLICK GAMES décline toute responsabilité en ce qui concerne les ventes conclues entre les Vendeurs et les Acheteurs par l\'intermédiaire de son Service. Toute réclamation relative aux Produits, (description, livraison, conditions d\'utilisation, etc.) qui serait portée à la connaissance de CLICK GAMES sera transmise au Vendeur concerné, qui assumera l\'entière et seule responsabilité.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(144, NULL, NULL, '13. Abonnement', 'standard', '<p>Lors de la création de compte le vendeur, active celui-ci par le biais d\'un abonnement cet abonnement et avec engagement pour une durée de 1 an. les frais de réalisation de cet abonnement peuvent être facture au vendeur pour un montant total de 90 Euros. Click Games met à disposition du vendeur un seul et unique abonnement pour un montant total de 36,99 Euros TTC. Le vendeur Confirme avoir pris connaissance et accepter les termes et conditions de Click Games</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(145, NULL, NULL, '14. Nullité partielle', 'standard', '<p>Si une ou plusieurs stipulations des présentes CGU Vendeur sont tenues pour non valides ou déclarées comme tel en application d\'une loi, d\'un règlement ou d\'une décision déﬁnitive d\'une juridiction compétente, les autres stipulations garderont toute leur force et toute leur portée</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(146, NULL, NULL, '15.Loi applicable / Attribution de compétences', 'standard', '<p>Les présentes CGU Vendeur sont soumises au droit français. Pour tout différend qui viendrait à se produire entre CLICK GAMES et un Vendeur professionnel relatif à l’existence, l’interprétation ou l’exécution du présent contrat, préalablement à toute instance judiciaire, les parties pourront avoir recours au Médiateur des entreprises dont les coordonnées sont les suivantes : 98 rue de Richelieu - 75002 Paris - <a href=\"https://www.economie.gouv.fr/mediateur-des-entreprises\">www.economie.gouv.fr/mediateur-des-entreprises</a>.<br>En application de cette clause de médiation, tous les échanges effectués entre les parties seront, sauf accord des parties, conﬁdentiels pendant une durée illimitée. La durée de la médiation ne pourra excéder 3 mois, sauf accord contraire des parties.<br>En cas d\'échec de la médiation, le différend sera tranché par les Tribunaux de PARIS, nonobstant pluralité de défendeurs ou appels en garantie, y compris pour les procédures en référé ou sur requêtes.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(147, NULL, NULL, '16. Anti-Corruption', 'standard', '<p>Les Parties conviennent que, à tout moment en lien avec et pendant toute la durée du Contrat, et par la suite, elles se conformeront et prendront des mesures raisonnables pour s’assurer que leurs sous-traitants, leurs agents ou d’autres tiers, soumis à leur contrôle ou à leur inﬂuence déterminante, se conformeront aux dispositions suivantes. Les Parties interdiront les pratiques suivantes à tout moment et sous quelque forme que ce soit, à l’égard d’un agent public au niveau international, national ou local, d’un parti politique, d’un dirigeant de parti ou d’un candidat à des fonctions politiques, et d’un directeur, d’un agent ou d’un employé d’une Partie, indépendamment du fait que ces pratiques soient adoptées directement ou indirectement, y compris par l’entremise de tiers : a) La corruption désigne le fait d’offrir, de promettre, de donner, d’autoriser ou d’accepter tout avantage pécuniaire indu ou tout autre avantage indu à, de la part de ou pour l’une des personnes susmentionnées ou pour un tiers dans le but d’obtenir ou conserver un marché ou un autre avantage indu, par ex. en lien avec des attributions de contrats d’achat publics ou privés, des permis réglementaires, la ﬁscalité, les douanes ou des procédures judiciaires et législatives.<br>La corruption inclut notamment :</p><ul><li>i. Le fait de remettre une partie d’un paiement d’un contrat à un gouvernement ou des responsables de partis ou à des employés de l’autre Partie contractante, leurs proches, leurs amis ou leurs partenaires commerciaux ou à l’aide d’intermédiaires tels que des agents, des sous- traitants, des consultants ou d’autres tiers, aﬁn d’attribuer des paiements à un gouvernement ou des responsables de partis, ou à des employés de l’autre Partie contractante, leurs proches, leurs amis ou leurs partenaires commerciaux.</li><li>ii. L\'extorsion ou la sollicitation désigne la demande d’un pot-de-vin, associée ou non à une menace si cette demande est refusée. Chaque Partie s’opposera à toute tentative d’extorsion ou de sollicitation et est invitée à signaler ces tentatives par le biais des mécanismes de rapport formels ou informels disponibles, à moins que ces rapports soient réputés être contre-productifs compte tenu des circonstances.</li></ul><p>b) Le traﬁc d’inﬂuence consiste à offrir ou à solliciter un avantage indu aﬁn d’exercer une inﬂuence inappropriée, réelle ou supposée, en vue d’obtenir auprès d’un agent public ou privé un avantage indu pour l’instigateur initial de l’acte ou pour toute autre personne.<br>c) Le fait de blanchir le produit des pratiques de corruption susmentionnées consiste à dissimuler ou déguiser l’origine, la source, le lieu, la disposition, le mouvement ou la propriété illicite de biens, en sachant que ces biens sont le produit d’activités criminelles. Les termes « corruption » ou « pratique(s) de corruption », tels qu’ils sont utilisés dans la présente Clause Anticorruption de Groupe CLICK GAMES, incluent la corruption, l’extorsion ou la sollicitation, le traﬁc d’inﬂuence et le blanchiment du produit de ces pratiques.<br>En outre le Vendeur reconnait avoir eu connaissance, accepter et s’engage à respecter le contenu du « Code de Conduite des Affaires » accessible sur le site click-games.fr.</p>', 3, NULL, '2021-11-23 10:32:24', '2021-11-23 10:32:24'),
(148, NULL, NULL, 'Informations', 'standard', '<p>Conformément à l\'article L.121-21 et suivants du Code de la Consommation, vous disposez d\'un délai de rétractation de quatorze jours à compter de la date de réception de votre commande, pour retourner les Produits commandés et/ou pour vous rétracter des contrats de prestation de service, sans avoir à en justifier de motif. Dans le cadre de l’exercice de votre droit de rétractation, les frais de renvoi des Produits sont à votre charge exclusive. Le droit de rétractation ne pourra pas s’appliquer en cas de fourniture d’enregistrements audio ou vidéo ou de logiciels informatiques lorsqu’ils ont été descellés après livraison. Télécharger le document : <a href=\"https://www.click-games.fr/service/retractation.php\">Formulaire de Rétractation</a>.</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:51'),
(149, NULL, NULL, 'ARTICLE 1 - Champ d\'application', 'standard', '<p>Les présentes Conditions Générales de Vente (dites « CGV ») s\'appliquent, sans restriction ni réserve à l\'ensemble des ventes conclues par le Vendeur auprès d\'acheteurs non professionnels (« Les Clients ou le Client »), désirant acquérir les produits proposés à la vente (« Les Produits ») par le Vendeur sur le site <a href=\"https:// www.click-games.fr\">https:// www.click-games.fr</a>. Les Produits proposés à la vente sur le site sont les suivants :</p><p>Jeux vidéos (physique), Consoles, Figurine</p><p>Les caractéristiques principales des Produits et notamment les spécifications, illustrations et indications de dimensions ou de capacité des Produits, sont présentées sur le site https://www.click-games.fr ce dont le client est tenu de prendre connaissance avant de commander.</p><p>Le choix et l\'achat d\'un Produit sont de la seule responsabilité du Client.</p><p>Les offres de Produits s\'entendent dans la limite des stocks disponibles, tels que précisés lors de la passation de la commande.</p><p>Ces CGV sont accessibles à tout moment sur le site https://www.click-games.fr et prévaudront sur toute autre document.</p><p>Le Client déclare avoir pris connaissance des présentes CGV et les avoir acceptées en cochant la case prévue à cet effet avant la mise en œuvre de la procédure de commande en ligne du site <a href=\"https://www.click-games.fr\">https://www.click-games.fr.</a></p><p>Sauf preuve contraire, les données enregistrées dans le système informatique du Vendeur constituent la preuve de l\'ensemble des transactions conclues avec le Client.</p><p>Les coordonnées du Vendeur sont les suivantes :</p><p>L\'édition du site https://click-games.fr est assurée par la Société YOUNG WORKER Nom commercial « CLICK GAMES », immatriculée au RCS sous le numéro 887 683 647, dont le siège social est 70 rue Pierre Marti, 25462 Étupes</p><p>Email : support@click-games.fr&nbsp;</p><p>Téléphone : +33 6 60 94 24 96</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:51'),
(150, NULL, NULL, 'ARTICLE 2 - Prix', 'standard', '<p>Les Produits sont fournis aux tarifs en vigueur figurant sur le site https://www.clickgames.fr, lors de l\'enregistrement de la commande par le Vendeur. Les prix sont exprimés en Euros, HT et TTC. Les tarifs tiennent compte d\'éventuelles réductions qui seraient consenties par le Vendeur sur le site https://www.click-games.fr.</p><p>&nbsp;Ces tarifs sont fermes et non révisables pendant leur période de validité mais le Vendeur se réserve le droit, hors période de validité, d’en modifier les prix à tout moment.&nbsp;</p><p>Les prix ne comprennent pas les frais de traitement, d\'expédition, de transport et de livraison, qui sont facturés en supplément, dans les conditions indiquées sur le site et calculés préalablement à la passation de la commande. Le paiement demandé au Client correspond au montant total de l\'achat, y compris ces frais.</p><p>&nbsp;Une facture est établie par le Vendeur et remise au Client lors de la livraison des Produits commandés.</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:51'),
(151, NULL, NULL, 'ARTICLE 3 - Commandes', 'standard', '<p>Il appartient au Client de sélectionner sur le site https://www.click-games.fr les Produits qu\'il désire commander, selon les modalités suivantes :</p><p>Le Client choisi un ou des produits qu\'il a joute a son panier. Panier qu\'il pourra supprimer ou modifier avant de valider sa commande et d\'accepter les présentes conditions générales de vente. Le Client saisira ses coordonnées, afin de se créer un compte client, ou se connectera à son espace client existant. Le Client choisira le mode de livraison et le mode de paiement. Après validation des informations, la commande sera considérée comme définitive. Une fois le paiement validé Click Games préparera la commande et l’expédiera au Client. Le Client en sera informé et recevra les informations pour suivre sa commande.</p><p>Les offres de Produits sont valables tant qu\'elles sont visibles sur le site, dans la limite des stocks disponibles. La vente ne sera considérée comme valide qu’après paiement intégral du prix. Il appartient au Client de vérifier l\'exactitude de la commande et de signaler immédiatement toute erreur. Toute commande passée sur le site https://www.click-games.fr constitue la formation d\'un contrat conclu à distance entre le Client et le Vendeur. Le Vendeur se réserve le droit d\'annuler ou de refuser toute commande d\'un Client avec lequel il existerait un litige relatif au paiement d\'une commande antérieure. Le Client pourra suivre l\'évolution de sa commande sur le site. &nbsp; Toute annulation de la commande par le Client après son acceptation par le Vendeur ne sera possible que dans les L’annulation est possible et gratuite avant la remise de la commande au transporteur. jours au plus après acceptation de la commande par le Vendeur et tant que la livraison n\'a pas eu lieu (indépendamment des dispositions relatives à l\'application ou non du droit de rétractation légal).</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:51'),
(152, NULL, NULL, 'ARTICLE 3 Bis - Espace client - Compte', 'standard', '<p>Afin de passer commande, le Client est invité à créer un compte (espace personnel).</p><p>&nbsp;Pour ce faire, il doit s’inscrire en remplissant le formulaire qui lui sera proposé au moment de sa commande et s’engage à fournir des informations sincères et exactes concernant son état civil et ses coordonnées, notamment son adresse email.</p><p>Le Client est responsable de la mise à jour des informations fournies. Il lui est précisé qu’il peut les modifier en se connectant à son compte.</p><p>Pour accéder à son espace personnel et aux historiques de commande, le Client devra s\'identifier à l\'aide de son nom d’utilisateur et de son mot de passe qui lui seront communiqués après son inscription et qui sont strictement personnels. A ce titre, le Client s’en interdit toute divulgation. Dans le cas contraire, il restera seul responsable de l’usage qui en sera fait.</p><p>Le Client pourra également solliciter sa désinscription en se rendant à la page dédiée sur son espace personnel ou envoyant un email à : support@click-games.fr. Celle-ci sera effective dans un délai raisonnable. &nbsp;&nbsp;</p><p>En cas de non respect des conditions générales de vente et/ou d’utilisation, le site https://www.click-games.fr aura la possibilité de suspendre voire de fermer le compte d’un client après mise en demeure adressée par voie électronique et restée sans effet.&nbsp;</p><p>Toute suppression de compte, quel qu’en soit le motif, engendre la suppression pure et simple de toutes informations personnelles du Client.&nbsp;</p><p>Tout événement dû à un cas de force majeure ayant pour conséquence un dysfonctionnement du site ou serveur et sous réserve de toute interruption ou modification en cas de maintenance, n\'engage pas la responsabilité du Vendeur.&nbsp;</p><p>La création du compte entraine l’acceptation des présentes conditions générales de vente.</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:51'),
(153, NULL, NULL, 'ARTICLE 4 - Conditions de paiement', 'standard', '<p>Le prix est payé par voie de paiement sécurisé, selon les modalités suivantes :</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; paiement par carte bancaire</p><p>Le prix est payable comptant par le Client, en totalité au jour de la passation de la commande.</p><p>Les données de paiement sont échangées en mode crypté grâce au protocole défini par le prestataire de paiement agréé intervenant pour les transactions bancaires réalisée sur le site https://www.click-games.fr.</p><p>Les paiements effectués par le Client ne seront considérés comme définitifs qu\'après encaissement effectif par le Vendeur des sommes dues.</p><p>Le Vendeur ne sera pas tenu de procéder à la délivrance des Produits commandés par le Client si celui-ci ne lui en paye pas le prix en totalité dans les conditions cidessus indiquées.</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:51'),
(154, NULL, NULL, 'ARTICLE 5 - Livraisons', 'standard', '<p>Les Produits commandés par le Client seront livrés en France métropolitaine ou dans la/les zones suivantes : Europe. &nbsp;&nbsp;</p><p>Les livraisons interviennent dans un délai de 2 à 5 jours ouvrés après expédition selon le transporteur choisi par le client. à l\'adresse indiquée par le Client lors de sa commande sur le site.&nbsp;</p><p>La livraison est constituée par le transfert au Client de la possession physique ou du contrôle du Produit. Sauf cas particulier ou indisponibilité d\'un ou plusieurs Produits, les Produits commandés seront livrés en une seule fois.&nbsp;</p><p>Le Vendeur s\'engage à faire ses meilleurs efforts pour livrer les produits commandés par le Client dans les délais ci-dessus précisés.</p><p>Si les Produits commandés n\'ont pas été livrés dans un délai de 72 heures après la date indicative de livraison, pour toute autre cause que la force majeure ou le fait du Client, la vente pourra être résolue à la demande écrite du Client dans les conditions prévues aux articles L 216-2, L 216-3 et L241-4 du Code de la consommation. Les sommes versées par le Client lui seront alors restituées au plus tard dans les quatorze jours qui suivent la date de dénonciation du contrat, à l\'exclusion de toute indemnisation ou retenue.</p><p>Les livraisons sont assurées par un transporteur indépendant, à l\'adresse mentionnée par le Client lors de la commande et à laquelle le transporteur pourra facilement accéder.</p><p>Lorsque le Client s\'est lui-même chargé de faire appel à un transporteur qu\'il choisit lui-même, la livraison est réputée effectuée dès la remise des Produits commandés par le Vendeur au transporteur qui les a acceptés sans réserves. Le Client reconnaît donc que c\'est au transporteur qu\'il appartient d\'effectuer la livraison et ne dispose d\'aucun recours en garantie contre le Vendeur en cas de défaut de livraison des marchandises transportées.</p><p>En cas de demande particulière du Client concernant les conditions d\'emballage ou de transport des produits commandés, dûment acceptées par écrit par le Vendeur, les coûts y liés feront l\'objet d\'une facturation spécifique complémentaire, sur devis préalablement accepté par écrit par le Client.</p><p>Le Client est tenu de vérifier l\'état des produits livrés. Il dispose d\'un délai de #254 Délai maximal pour... à compter de la livraison pour formuler des réclamations par Mail, chat en ligne ou courrier postal, accompagnées de tous les justificatifs y afférents (photos notamment). Passé ce délai et à défaut d\'avoir respecté ces formalités, les Produits seront réputés conformes et exempts de tout vice apparent et aucune réclamation ne pourra être valablement acceptée par le Vendeur.</p><p>Le Vendeur remboursera ou remplacera dans les plus brefs délais et à ses frais, les Produits livrés dont les défauts de conformité ou les vices apparents ou cachés auront été dûment prouvés par le Client, dans les conditions prévues aux articles L 217-4 et suivants du Code de la consommation et celles prévues aux présentes CGV.</p><p>Le transfert des risques de perte et de détérioration s\'y rapportant, ne sera réalisé qu\'au moment où le Client prendra physiquement possession des Produits. Les Produits voyagent donc aux risques et périls du Vendeur sauf lorsque le Client aura lui-même choisi le transporteur. A ce titre, les risques sont transférés au moment de la remise du bien au transporteur.</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:51'),
(155, NULL, NULL, 'ARTICLE 6 - Transfert de propriété', 'standard', '<p>Le transfert de propriété des Produits du Vendeur au Client ne sera réalisé qu\'après complet paiement du prix par ce dernier, et ce quelle que soit la date de livraison desdits Produits.</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:51'),
(156, NULL, NULL, 'ARTICLE 7 - Droit de rétractation', 'standard', '<p>Selon les modalités de l’article L221-18 du Code de la Consommation « Pour les contrats prévoyant la livraison régulière de biens pendant une période définie, le délai court à compter de la réception du premier bien. »</p><p>Le droit de rétractation peut être exercé en ligne, à l\'aide du formulaire de rétractation, par mail ou courrier et également disponible sur le site ou de toute autre déclaration, dénuée d\'ambiguïté, exprimant la volonté de se rétracter et notamment par courrier postal adressé au Vendeur aux coordonnées postales ou mail indiquées à l’ARTICLE 1 des CGV.</p><p>Les retours sont à effectuer dans leur état d\'origine et complets (emballage, accessoires, notice...) permettant leur recommercialisation à l\'état neuf, accompagnés de la facture d\'achat.</p><p>Les Produits endommagés, salis ou incomplets ne sont pas repris.</p><p>Les frais de retour restant à la charge du Client. En cas d’exercice du droit de rétractation, Click Games est tenu au remboursement des sommes versées par le client, avec des frais maximum de 10% du paiement total afin de couvrir les frais des fournisseurs de paiement.</p><p>Les frais d\'expédition de retour restent alors à votre charge.</p><p>L\'échange (sous réserve de disponibilité) ou le remboursement sera effectué dans un délai de 14 jours à compter de la réception, par le Vendeur, des Produits retournés par le Client dans les conditions prévues au présent article.</p><p>Les Clients, s\'ils ne sont pas des consommateurs au sens de la définition donnée par le Code de la Consommation, ne bénéficient d\'aucun délai de rétractation, la validation de leur commande valant commande et achat ferme, définitif et irrévocable. Conformément aux dispositions du code de la consommation, certaines commandes ne pourront bénéficier du droit de rétractation. Seront exclus du droit de rétractation : les produits personnalisables ; périssables ; les magazines ; les produits retournés sans le sceau fabriquant, c’est-à-dire l’emballage transparent, ainsi que les biens dits « sensibles » ou de « collections » descellés, qui concernent les produits qui auront été ouverts par le Client après la Livraison et qui ne pourront plus être renvoyés à Click Games.</p><p><strong>Conditions spécifique pour les produits neuf et scellés </strong>: Ces produits perdent toutes leurs valeurs une fois ouverts ou que l’emballage / film de protection d’origine soit retirés. Afin de bénéficier du droit de rétractation le produit doit être impérativement être dans son emballage cellophane d\'origine. Si l\'article est renvoyé incomplet, endommagé ou descellé au Vendeur, le Vendeur se réserve le droit de refuser le remboursement</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:52'),
(157, NULL, NULL, 'ARTICLE 8 - Responsabilité du Vendeur - Garanties', 'standard', '<p>Les Produits fournis par le Vendeur bénéficient :</p><ul><li>de la garantie légale de conformité, pour les Produits défectueux, abîmés ou endommagés ou ne correspondant pas à la commande,</li><li>de la garantie légale contre les vices cachés provenant d\'un défaut de matière, de conception ou de fabrication affectant les produits livrés et les rendant impropres à l\'utilisation,</li></ul><p>Dispositions relatives aux garanties légales</p><p>Article L217-4 du Code de la consommation</p><p>« Le vendeur est tenu de livrer un bien conforme au contrat et répond des défauts de conformité existant lors de la délivrance. Il répond également des défauts de conformité résultant de l\'emballage, des instructions de montage ou de l\'installation lorsque celle-ci a été mise à sa charge par le contrat ou a été réalisée sous sa responsabilité. »</p><p>Article L217-5 du Code de la consommation</p><p>« Le bien est conforme au contrat :</p><p>1° S\'il est propre à l\'usage habituellement attendu d\'un bien semblable et, le cas échéant :&nbsp;</p><p>&nbsp; - s\'il correspond à la description donnée par le vendeur et possède les qualités que celui-ci a présentées à l\'acheteur sous forme d\'échantillon ou de modèle ;</p><p>&nbsp; - s\'il présente les qualités qu\'un acheteur peut légitimement attendre eu égard aux déclarations publiques faites par le vendeur, par le producteur ou par son représentant, notamment dans la publicité ou l\'étiquetage ;&nbsp;</p><p>2° Ou s\'il présente les caractéristiques définies d\'un commun accord par les parties ou est propre à tout usage spécial recherché par l\'acheteur, porté à la connaissance du vendeur et que ce dernier a accepté. » Article L217-12 du Code de la consommation « L\'action résultant du défaut de conformité se prescrit par deux ans à compter de la délivrance du bien.»</p><p>Article 1641 du Code civil.</p><p>« Le vendeur est tenu de la garantie à raison des défauts cachés de la chose vendue qui la rendent impropre à l\'usage auquel on la destine, ou qui diminuent tellement cet usage, que l\'acheteur ne l\'aurait pas acquise, ou n\'en aurait donné qu\'un moindre prix, s\'il les avait connus. »</p><p>Article 1648 alinéa 1er du Code civil</p><p>« L\'action résultant des vices rédhibitoires doit être intentée par l\'acquéreur dans un délai de deux ans à compter de la découverte du vice. »</p><p>Article L217-16 du Code de la consommation.</p><p>« Lorsque l\'acheteur demande au vendeur, pendant le cours de la garantie commerciale qui lui a été consentie lors de l\'acquisition ou de la réparation d\'un bien meuble, une remise en état couverte par la garantie, toute période d\'immobilisation d\'au moins sept jours vient s\'ajouter à la durée de la garantie qui restait à courir. Cette période court à compter de la demande d\'intervention de l\'acheteur ou de la mise à disposition pour réparation du bien en cause, si cette mise à disposition est postérieure à la demande d\'intervention. »</p><p>Afin de faire valoir ses droits, le Client devra informer le Vendeur, par écrit (mail ou courrier), de la non-conformité des Produits ou de l\'existence des vices cachés à compter de leur découverte.</p><p>Le Vendeur remboursera, remplacera ou fera réparer les Produits ou pièces sous garantie jugés non conformes ou défectueux.</p><p>Les frais d\'envoi seront remboursés sur la base du tarif facturé et les frais de retour seront remboursés sur présentation des justificatifs.</p><p>Les remboursements, remplacements ou réparations des Produits jugés non conformes ou défectueux seront effectués dans les meilleurs délais et au plus tard dans les 15 jours, à compter de la validation du remboursement émise du service après vente jours suivant la constatation par le Vendeur du défaut de conformité ou du vice caché. Ce remboursement pourra être fait par virement ou chèque bancaire.</p><p>La responsabilité du Vendeur ne saurait être engagée dans les cas suivants :</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; non respect de la législation du pays dans lequel les produits sont livrés, qu\'il appartient au Client de vérifier,&nbsp;</p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; en cas de mauvaise utilisation, d\'utilisation à des fins professionnelles, négligence ou défaut d\'entretien de la part du Client, comme en cas d\'usure normale du Produit, d\'accident ou de force majeure.</p><p>&nbsp;·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Les photographies et graphismes présentés sur le site ne sont pas contractuels et ne sauraient engager la responsabilité du Vendeur.&nbsp;</p><p>La garantie du Vendeur est, en tout état de cause, limitée au remplacement ou au remboursement des Produits non conformes ou affectés d\'un vice.</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:52'),
(158, NULL, NULL, 'ARTICLE 9 - Données personnelles', 'standard', '<p>Le Client est informé que la collecte de ses données à caractère personnel est nécessaire à la vente des Produits par le Vendeur ainsi qu\'à leur transmission à des tiers à des fins de livraison des Produits. Ces données à caractère personnel sont récoltées uniquement pour l’exécution du contrat de vente.</p><p><strong>9.1 Collecte des données à caractère personnel</strong></p><p>&nbsp; Les données à caractère personnel qui sont collectées sur le site https://www.clickgames.fr sont les suivantes :</p><p><strong>&nbsp; Ouverture de compte</strong></p><p>&nbsp; Lors de la création du compte Client / utilisateur : Noms, prénoms, adresse postale, numéro de téléphone et adresse e-mail.</p><p>&nbsp; <strong>Paiement</strong></p><p><strong>&nbsp; </strong>Dans le cadre du paiement des Produits proposés sur le site https://www.clickgames.fr, celui-ci enregistre des données financières relatives au compte bancaire &nbsp; &nbsp; ou à la carte de crédit du Client / utilisateur.</p><p><strong>9.2 Destinataires des données à caractère personnel</strong></p><p>Les données à caractère personnel sont réservées à l’usage unique du Vendeur et de ses salariés.</p><p><strong>9.3 Responsable de traitement</strong></p><p>Le responsable de traitement des données est le Vendeur, au sens de la loi Informatique et libertés et à compter du 25 mai 2018 du Règlement 2016/679 sur la protection des données à caractère personnel.</p><p><strong>9.4 limitation du traitement&nbsp;</strong></p><p>Sauf si le Client exprime son accord exprès, ses données à caractère personnelles ne sont pas utilisées à des fins publicitaires ou marketing</p><p><strong>9.5 Durée de conservation des données&nbsp;</strong></p><p>Le Vendeur conservera les données ainsi recueillies pendant un délai de 5 ans, couvrant le temps de la prescription de la responsabilité civile contractuelle applicable. &nbsp;&nbsp;</p><p><strong>9.6 Sécurité et confidentialité</strong>&nbsp;</p><p>Le Vendeur met en œuvre des mesures organisationnelles, techniques, logicielles et physiques en matière de sécurité du numérique pour protéger les données personnelles contre les altérations, destructions et accès non autorisés. Toutefois il est à signaler qu’Internet n’est pas un environnement complètement sécurisé et le Vendeur ne peut garantir la sécurité de la transmission ou du stockage des informations sur Internet. &nbsp;&nbsp;</p><p><strong>9.7 Mise en œuvre des droits des Clients et utilisateurs&nbsp;</strong></p><p>En application de la règlementation applicable aux données à caractère personnel, les Clients et utilisateurs du site https://www.click-games.fr disposent des droits suivants :</p><p>&nbsp;·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ils peuvent mettre à jour ou supprimer les données qui les concernent de la manière suivante : Depuis son compte client. Le client peut également en faire la demande par courrier ou mail.</p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Ils peuvent supprimer leur compte en écrivant à l’adresse électronique indiqué à l’article 9.3 « Responsable de traitement » ·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Ils peuvent exercer leur droit d’accès pour connaître les données personnelles les concernant en écrivant à l’adresse indiqué à l’article 9.3 « Responsable de traitement » ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Si les données à caractère personnel détenues par le Vendeur sont inexactes, ils peuvent demander la mise à jour des informations des informations en écrivant à l’adresse indiqué à l’article 9.3 « Responsable de traitement »</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ils peuvent demander la suppression de leurs données à caractère personnel, conformément aux lois applicables en matière de protection des données en écrivant à l’adresse indiqué à l’article 9.3 « Responsable de traitement » ·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Ils peuvent également solliciter la portabilité des données détenues par le Vendeur vers un autre prestataire&nbsp;</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Enfin, ils peuvent s’opposer au traitement de leurs données par le Vendeur Ces droits, dès lors qu’ils ne s’opposent pas à la finalité du traitement, peuvent être exercé en adressant une demande par courrier ou par E-mail au Responsable de traitement dont les coordonnées sont indiquées ci-dessus.&nbsp;</p><p>Le responsable de traitement doit apporter une réponse dans un délai maximum d’un mois.&nbsp;</p><p>En cas de refus de faire droit à la demande du Client, celui-ci doit être motivé.&nbsp;</p><p>Le Client est informé qu’en cas de refus, il peut introduire une réclamation auprès de la CNIL (3 place de Fontenoy, 75007 PARIS) ou saisir une autorité judiciaire.&nbsp;</p><p>Le Client peut être invité à cocher une case au titre de laquelle il accepte de recevoir des mails à caractère informatifs et publicitaires de la part du Vendeur. Il aura toujours la possibilité de retirer son accord à tout moment en contactant le Vendeur (coordonnées ci-dessus) ou en suivant le lien de désabonnement.</p><p>&nbsp;</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:52'),
(159, NULL, NULL, 'ARTICLE 10 - Propriété intellectuelle', 'standard', '<p>Le contenu du site https://www.click-games.fr est la propriété du Vendeur et de ses partenaires et est protégé par les lois françaises et internationales relatives à la propriété intellectuelle.&nbsp;</p><p>Toute reproduction totale ou partielle de ce contenu est strictement interdite et est susceptible de constituer un délit de contrefaçon.</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:52'),
(160, NULL, NULL, 'ARTICLE 11 - Droit applicable - Langue', 'standard', '<p>Les présentes CGV et les opérations qui en découlent sont régies et soumises au droit français.</p><p>&nbsp;Les présentes CGV sont rédigées en langue française. Dans le cas où elles seraient traduites en une ou plusieurs langues étrangères, seul le texte français ferait foi en cas de litige</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:52'),
(161, NULL, NULL, 'ARTICLE 12 - Litiges', 'standard', '<p>Pour toute réclamation merci de contacter le service clientèle à l’adresse postale ou mail du Vendeur indiquée à l’ARTICLE 1 des présentes CGV.</p><p>&nbsp;</p><p>Le Client est informé qu\'il peut en tout état de cause recourir à une médiation conventionnelle, auprès des instances de médiation sectorielles existantes ou à tout mode alternatif de règlement des différends (conciliation, par exemple) en cas de contestation.</p><p>En l’espèce, le médiateur désigné est Association des médiateurs indépendants d\'Île de France&nbsp;</p><p>1 place de Fleurus - 77100 Meaux&nbsp;</p><p><a href=\"www.amidif.com\">www.amidif.com</a></p><p>E-mail : contact@amidif.com.</p><p>Le Client est également informé qu’il peut, également recourir à la plateforme de Règlement en Ligne des Litige (RLL) :https://webgate.ec.europa.eu/odr/main/ index.cfm?event=main.home.show&nbsp;</p><p>Tous les litiges auxquels les opérations d\'achat et de vente conclues en application des présentes CGV et qui n’auraient pas fait l’objet d’un règlement amiable entre le vendeur ou par médiation, seront soumis aux tribunaux compétents dans les conditions de droit commun.</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:52'),
(162, NULL, NULL, 'ANNEXE I', 'standard', '<h2><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Formulaire de rétractation</strong></h2><p>Date ______________________</p><p>Le présent formulaire doit être complété et renvoyé uniquement si le Client souhaite se rétracter de la commande passée sur https://www.click-games.fr sauf exclusions ou limites à l\'exercice du droit de rétractation suivant les Conditions Générales de Vente applicables.</p><p>A l\'attention de Affaire personnelle commerçant, Click Games - CLICK GAMES 70 rue Pierre Marti, 25462 Étupes</p><p>Je notifie par la présente la rétractation du contrat portant sur le bien ci-dessous :&nbsp;</p><p>- Commande du (indiquer la date)&nbsp;</p><p>- Numéro de la commande : ...........................................................</p><p>- Nom du Client : ...........................................................................&nbsp;</p><p>- Adresse du Client : .......................................................................</p><p>Signature du Client (uniquement en cas de notification du présent formulaire sur papier</p>', 1, NULL, '2022-04-05 14:30:54', '2022-06-13 20:57:52'),
(252, NULL, NULL, 'Droit de rétractation', 'standard', '<p>Vous disposez de 14 jours, à compter du jour de réception des produits, pour nous retourner les articles qui ne vous conviennent pas. <strong>Seuls les produits retournés complets, dans leur emballage d\'origine et en parfait état de revente seront acceptés</strong>. Ainsi, les produits doivent impérativement être sur-emballés pour le transport.</p>', 6, NULL, '2022-05-04 15:18:13', '2022-05-04 15:18:13'),
(253, NULL, NULL, 'Coût de renvoi des produits', 'standard', '<p>Le coût de renvoi du produit reste à votre charge, cela dépend de la compagnie de transporteur utilisé, à ce jour nous vous conseillons d’utiliser la compagnie de livraison <a href=\"https://www.laposte.fr\">www.laposte.fr</a> pour effectuer vos retours produits. Sachez également que tout autre moyens renvoi du produit sont acceptés.</p>', 6, NULL, '2022-05-04 15:18:13', '2022-05-04 15:18:13'),
(254, NULL, NULL, 'Modes de remboursement', 'standard', '<p>Nous recréditons directement le compte bancaire lié à la carte utilisée pour le paiement de la commande.\r\nvotre RIB peut également être demandé pour recréditer, si nous ne pouvons émettre de remboursement directement depuis l\'interface que nous confie notre prestataire de paiement</p>', 6, NULL, '2022-05-04 15:18:13', '2022-05-04 15:18:13');
INSERT INTO `items_article` (`id`, `pos`, `number`, `title`, `type`, `content`, `article_id`, `parent_id`, `created_at`, `updated_at`) VALUES
(255, NULL, NULL, 'Délai de remboursement', 'standard', '<p>Il faut compter en moyenne 5 à 8 jours ouvrés entre la validation d\'un remboursement et l\'apparition sur ton compte. Si&nbsp; vous possèder une carte à débit différé le remboursement le sera également. <strong>Pour toute demande relative à tes remboursements, vous pouvez-nous contacter depuis l’onglet «&nbsp;Supports&nbsp;»&nbsp;</strong></p>', 6, NULL, '2022-05-04 15:18:13', '2022-05-04 15:18:13'),
(312, NULL, NULL, 'Instantané', 'standard', '<p>Il est conseillé au client de lire et de comprendre attentivement notre politique de confidentialité, car en accédant au site Web / à l\'application, vous acceptez d\'être lié par les termes et conditions de la politique de confidentialité et consentez à la collecte, au stockage et à l\'utilisation des informations vous concernant comme indiqué dans les présentes. .</p><p>&nbsp;</p><p>Si vous n\'êtes pas d\'accord avec les termes et conditions de notre politique de confidentialité, y compris en ce qui concerne le mode de collecte ou d\'utilisation de vos informations, veuillez ne pas utiliser ni accéder au site Web / à l\'application.</p><p>&nbsp;</p><p>Notre politique de confidentialité est intégrée aux conditions d\'utilisation du site Web/de l\'application et peut être modifiée de temps à autre sans préavis. Il est fortement recommandé de consulter périodiquement notre politique de confidentialité telle qu\'elle est publiée sur l\'application/le site Web.</p>', 7, NULL, '2022-05-04 15:34:25', '2022-06-13 21:04:01'),
(313, NULL, NULL, 'les autres informations', 'standard', '<p>Nous pouvons suivre automatiquement certaines informations vous concernant en fonction de votre comportement sur le site Web. Nous utilisons ces informations pour effectuer des recherches internes sur les données démographiques, les intérêts et le comportement de nos utilisateurs afin de mieux comprendre, protéger et servir nos utilisateurs. Ces informations sont compilées et analysées sur une base agrégée. Ces informations peuvent inclure l\'URL d\'où vous venez (que cette URL se trouve sur le site Web ou non), l\'URL vers laquelle vous allez ensuite (que cette URL se trouve sur le site Web ou non), les informations du navigateur de votre ordinateur, votre adresse IP, et d\'autres informations associées à votre interaction avec le site Web. <strong>Nous pouvons également partager votre adresse IP mobile/appareil IP avec des tiers et au meilleur de nos connaissances, de notre vie et des représentations qui nous sont données par ces tiers, ces informations ne sont pas stockées.</strong></p>', 7, NULL, '2022-05-04 15:34:25', '2022-06-13 21:04:01'),
(314, NULL, NULL, 'Liens', 'standard', '<p>Nous utilisons ces informations pour effectuer des recherches internes sur les données démographiques, les intérêts et le comportement de nos utilisateurs afin de mieux comprendre, protéger et servir nos utilisateurs. Ces informations sont compilées et analysées sur une base agrégée. Ces informations peuvent inclure l\'URL d\'où vous venez (que cette URL soit sur le site Web ou non), l\'URL vers laquelle vous allez ensuite (que cette URL soit sur le site Web ou non), les informations du navigateur de votre ordinateur, votre adresse IP</p><p>&nbsp;</p><ol><li>1 Identifiants (par exemple, nom, adresse postale, adresse e-mail, numéro de téléphone, numéro de carte de crédit/débit)</li><li>&nbsp;</li><li>2 Caractéristiques des classifications protégées (par exemple sexe, âge)</li><li>&nbsp;</li><li>3 Informations commerciales (par exemple, produits ou services achetés, historique des achats)</li><li>&nbsp;</li><li>4 Activité sur Internet ou sur un autre réseau électronique (par exemple, historique de navigation ou de recherche)</li><li>&nbsp;</li><li>5 Données de géolocalisation (par exemple latitude ou longitude)</li><li>&nbsp;</li><li>6 Informations audio, électroniques, visuelles ou similaires (par exemple, enregistrement des appels de service client)</li><li>&nbsp;</li><li>7 Inférences tirées de l\'un des éléments ci-dessus (par exemple, préférences ou caractéristiques)</li></ol><p>&nbsp;</p>', 7, NULL, '2022-05-04 15:34:25', '2022-06-13 21:04:01'),
(315, NULL, NULL, 'Annonceurs tiers', 'standard', '<p>Pour se protéger contre la perte, l\'utilisation abusive et l\'altération des informations sous son contrôle, la Société a mis en place des procédures physiques, électroniques et de gestion appropriées. Par exemple, les serveurs de la Société ne sont accessibles qu\'au personnel autorisé et vos informations sont partagées avec les employés et le personnel autorisé en cas de besoin pour effectuer la transaction et fournir les services que vous avez demandés. Bien que la Société s\'efforce de protéger la confidentialité de vos informations personnellement identifiables, les transmissions effectuées au moyen d\'Internet ne peuvent pas être absolument sécurisées. En utilisant le site Web, vous acceptez que la Société n\'assume aucune responsabilité pour la divulgation de vos informations en raison d\'erreurs de transmission et/ou d\'actes non autorisés de tiers.</p>', 7, NULL, '2022-05-04 15:34:25', '2022-06-13 21:04:01'),
(316, NULL, NULL, 'Sécurité', 'standard', '<p>Veuillez noter que la Société ne vous demandera pas de partager des données ou des informations sensibles par e-mail ou par téléphone. Si vous recevez une telle demande par e-mail ou par téléphone, veuillez ne pas répondre/divulguer de données ou d\'informations sensibles et transmettre les informations y relatives à info@click-games.fr pour les mesures nécessaires.</p><p>&nbsp;</p><ol><li>1 Exécution de services, y compris la maintenance ou la gestion de comptes, la fourniture d\'un service client, le traitement ou l\'exécution de commandes et de transactions, la vérification d\'informations sur les clients, le traitement de paiements, la fourniture de services de publicité ou de marketing, la fourniture de services d\'analyse ou la fourniture de services similaires&nbsp;;</li><li>&nbsp;</li><li>2 Audit lié à une interaction actuelle avec vous et à des transactions simultanées, y compris, mais sans s\'y limiter, le comptage des impressions d\'annonces pour les visiteurs uniques, la vérification du positionnement et de la qualité des impressions d\'annonces et l\'audit de la conformité&nbsp;;</li><li>&nbsp;</li><li>3 Utilisation transitoire à court terme, y compris, mais sans s\'y limiter, la personnalisation contextuelle des publicités affichées dans le cadre de la même interaction&nbsp;;</li><li>&nbsp;</li><li>4 Détecter les incidents de sécurité, protéger contre les activités malveillantes, trompeuses, frauduleuses ou illégales et poursuivre les responsables de ces activités&nbsp;;</li><li>&nbsp;</li><li>5 Débogage pour identifier et réparer les erreurs qui nuisent à la fonctionnalité prévue existante&nbsp;;</li><li>&nbsp;</li><li>6 Entreprendre des recherches internes pour le développement technologique et la démonstration&nbsp;; et</li><li>&nbsp;</li><li>7 Entreprendre des activités pour vérifier ou maintenir la qualité ou la sécurité d\'un service ou d\'un appareil qui est détenu, fabriqué, fabriqué pour ou contrôlé par nous, et pour améliorer, mettre à niveau ou améliorer le service ou l\'appareil qui est détenu, fabriqué, fabriqué pour, ou contrôlé par nous.</li></ol>', 7, NULL, '2022-05-04 15:34:25', '2022-06-13 21:04:01'),
(317, NULL, NULL, 'Adresse', 'standard', '<p><strong>CLICK GAMES&nbsp;</strong></p><p>70 rue Pierre Marti,&nbsp;</p><p>25462 Étupes&nbsp;</p><p>Adresse email :&nbsp;support@click-games.fr&nbsp;</p><p>Numéro de téléphone : +33 6 60 94 24 96</p>', 7, NULL, '2022-06-13 21:04:01', '2022-06-13 21:04:01');
