(9, NULL, 'Cullière bébé | compte-gouttes', 'culliere-bebe-compte-gouttes', '<p>Biberon en Silicone pour nouveau-né, cuillère à riz d\'entraînement pour nourrisson<br>Outils de table sûrs<br>Caractéristiques du produit:<br>Matériau: PP<br>Taille: hauteur de la bouteille: 20cm / 7.87 \", largeur de la bouteille: 5cm / 1.97\", longueur de la cuillère: 3cm / 1.18,\"largeur de la cuillère: 2cm / 0.79\"<br>Tranche d\'âge Applicable: 4 mois ou plus<br>Couleur: bleu, rose, blanc, vert, jaune<br>100% neuf et de haute qualité.<br>Conçu pour que maman puisse nourrir le jeune bébé.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://ae01.alicdn.com/kf/H8d00ba9736ba46b98683e40bd3ebd732h.jpg\"></figure>', 1, NULL, 31, 0.00, 6.99, 6.99, 0, 0, 0, NULL, 'fff', 80, 1, 0, NULL, NULL, NULL, 'publish', 'variable', 'u', NULL, NULL, NULL, '{\"id\": 399, \"original\": \"https://api.click-games.fr/storage/349/9.png\", \"thumbnail\": \"https://api.click-games.fr/storage/349/conversions/9-thumbnail.jpg\"}', '[{\"id\": 411, \"original\": \"https://api.click-games.fr/storage/361/9.png\", \"thumbnail\": \"https://api.click-games.fr/storage/361/conversions/9-thumbnail.jpg\"}, {\"id\": 412, \"original\": \"https://api.click-games.fr/storage/362/11.png\", \"thumbnail\": \"https://api.click-games.fr/storage/362/conversions/11-thumbnail.jpg\"}, {\"id\": 413, \"original\": \"https://api.click-games.fr/storage/363/10.png\", \"thumbnail\": \"https://api.click-games.fr/storage/363/conversions/10-thumbnail.jpg\"}, {\"id\": 414, \"original\": \"https://api.click-games.fr/storage/364/9.png\", \"thumbnail\": \"https://api.click-games.fr/storage/364/conversions/9-thumbnail.jpg\"}, {\"id\": 416, \"original\": \"https://api.click-games.fr/storage/366/7.png\", \"thumbnail\": \"https://api.click-games.fr/storage/366/conversions/7-thumbnail.jpg\"}, {\"id\": 417, \"original\": \"https://api.click-games.fr/storage/367/6.png\", \"thumbnail\": \"https://api.click-games.fr/storage/367/conversions/6-thumbnail.jp