(10, NULL, 'Cuillère pliable en Silicone pour bébé', 'cuillere-pliable-en-silicone-pour-bebe', '<p>1. N\'utilisez pas d\'ébouillonnement, de micro-ondes et d\'autres méthodes de stérilisation à haute température pour la désinfection.<br>2. Petite cuillère en silicone souple de conception professionnelle pour le bébé, pour s\'adapter à la transition du biberon à la cuillère qui nourrit le bébé.<br>3. Petite cuillère à tête ronde en silicone souple, n\'abîme pas les gencives sensibles du bébé.<br>4.Non toxique, sans goût, ne contient pas d\'impuretés chimiques, peut être dans une désinfection à l\'eau bouillante.<br>5. Résistant au vieillissement, non collant, long le bas de la poignée peut atteindre les boîtes de conserve.</p><figure class=\"image\"><img src=\"https://ae01.alicdn.com/kf/Hda0fc98c27c848f4835ebeaf83bdd6927.jpg\"></figure>', 1, NULL, 31, 0.00, 6.99, 6.99, 0, 0, 0, NULL, NULL, 20, 1, 0, NULL, NULL, NULL, 'publish', 'variable', 'u', NULL, NULL, NULL, '{\"id\": 424, \"original\": \"https://api.click-games.fr/storage/374/3.png\", \"thumbnail\": \"https://api.click-games.fr/storage/374/conversions/3-thumbnail.jpg\"}', '[{\"id\": 425, \"original\": \"https://api.click-games.fr/storage/375/3.png\", \"thumbnail\": \"https://api.click-games.fr/storage/375/conversions/3-thumbnail.jpg\"}, {\"id\": 426, \"original\": \"https://api.click-games.fr/storage/376/2.png\", \"thumbnail\": \"https://api.click-games.fr/storage/376/conversions/2-thumbnail.jpg\"}, {\"id\": 427, \"original\": \"https://api.click-games.fr/storage/377/1.png\", \"thumbnail\": \"https://api.click-games.fr/storage/377/conversions/1-thumbnail.jpg\"}]', '2021-12-30 20:41:45', '2021-12-13 13:46:40', '2021-12-30 20:41:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(11, NULL, 'Kit de tampons empreintes', 'kit-de-tampons-empreintes', '<p><i><strong>&nbsp;pour nouveau-né de 0 à 12 mois&nbsp;</strong></i></p><p>&nbsp;</p><p>1. Grands cadeaux commémoratifs pour les parents pour enregistrer la croissance de leurs enfants;</p><p>2. Matériau: anti-croix de haute technologie, tampon jetable;</p><p>3. Les mains de bébé n\'ont pas besoin de contacter l\'encre et peuvent obtenir une empreinte claire, sans aucun risque de sécurité;</p><p>4. Pas de pollution; Utiliser un processus de production spécial, laissant une conservation claire, réelle et à long terme;</p><p>5. Prévention efficace des stimuli du plomb et des produits chimiques et prévention des croisements.</p><p>&nbsp;</p><p><strong>Description</strong></p><p>&nbsp;</p><p>1. Article: machine d\'empreinte main et pied de bébé</p><p>2. Taille: dans le cadre taille 9.5*5.7cm</p><p>Taille globale 12.5*8cm (Bébé de 0 à 6 mois)</p><p>3. Matériau: encre tampon</p><p>4. Couleur: 6 couleurs disponibles</p><p>5. Quantité:1 huile d\'impression + 2 feuilles de papier</p><p>&nbsp;</p><p><strong>Spécifications:</strong></p><p>Tampon d\'encre spécial empreinte de main et de pied pour bébé, articles Souvenir mains et empreintes de pied, apprentissage et éducation, jouet empreinte de main</p><p><strong>Emballage Inclus:</strong></p><p>1 pad 2 feuilles de papier blanc</p><p><img src=\"https://ae01.alicdn.com/kf/Ha702df9fe124411ca69d0242bf36fb78E.jpg?width=800&amp;height=800&amp;hash=1600\"></p>', 1, 15.00, 31, 10.99, NULL, NULL, 0, 0, 0, NULL, 'CUI56255125', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 437, \"original\": \"https://api.click-games.fr/storage/387/1.png\", \"thumbnail\": \"https://api.click-games.fr/storage/387/conversions/1-thumbnail.jpg\"}', '[{\"id\": 429, \"original\": \"https://api.click-games.fr/storage/379/1.png\", \"thumbnail\": \"https://api.click-games.fr/storage/379/conversions/1-thumbnail.jpg\"}, {\"id\": 430, \"original\": \"https://ap