(13, NULL, 'Légendes Pokémon : Arceus', 'legendes-pokemon-arceus', '<h3><strong>Un grand voyage dans l’histoire Pokémon !</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/4507d0c8-b05f-4e81-b50e-075583996afe.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Cover\"></p><h3><strong>Préparez-vous à vivre une aventure Pokémon inédite !</strong></h3><p>Des centaines d’années avant l’aventure Pokémon Diamant Etincelant et Pokémon Perle Scintillante, vous êtes plongé dans la région de Hisui (connue aujourd’hui sous le nom de Sinnoh) encore largement inexplorée ! Un monde plein de possibilités s’offre et une mission vous est confiée : constituer le tout premier Pokédex de cette région. Au fil de vos missions d’explorateur, guettez les Pokémon dans leur environnement et lancez l’ancêtre de la Poké Ball pour essayer de les attraper en temps réel. Des adversaires plus coriaces requerront l’aide de vos Pokémon dans des combats intenses, mais gardez en tête que dans ce monde, ils constitueront également de réels alliés pour collecter des ressources ! Le Légendaire Arceus est au coeur du récit, quel rôle jouera ce puissant Pokémon dans votre aventure ?</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/c5af8dff-149f-490a-a748-d08a604a6bad.__CR435,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"6\"></p><h3><strong>Félicitations, vous avez été choisi par le Groupe Galaxie pour faire partie du Corps des Chercheurs !</strong></h3><p>Dans cette unité d’élite de votre village d’origine, Rusti-Cité, vous avez pour mission d’épauler le Professeur Lavande dans son travail de documentation des espèces Pokémon pour élaborer le tout premier Pokédex de la région. En effet à cette époque, les liens avec les Pokémon restent rares : Dresseurs, Arène, Ligue… tout cela n’existe pas encore !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/16c6c39b-4fbf-46b0-a5aa-3cee0524131c.__CR420,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"S5\"></p><h3><strong>Bienvenue à Rusti-Cité, le coeur de votre aventure :</strong></h3><p>&nbsp;</p><ul><li>Des missions vous attendent au quartier général ! Pour valider et étoffer l\'entrée d’un Pokémon dans le Pokédex, il vous faut compléter toutes les tâches lui étant dédiées (et pas seulement l’attraper une fois). Vous contribuez ainsi aux travaux du Groupe Galaxie et montez en rang. Plus votre rang sera élevé, plus les zones à explorer seront nombreuses.</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>Visitez les différentes échoppes en bois pour stocker des objets (potions, cailloux et pièges) avant vos missions, pour changer de coupe de cheveux à l’Art Capillaire ou même de style à la Maison du Textile !</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>Au sein de la foisonnante ville, faites la rencontre de personnages hauts en couleur venus des quatre coins de Hisui ; n’hésitez pas à leur rendre service lors de quêtes annexes pour obtenir des objets rares.</li></ul><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/bd755b7e-3fff-4fe1-9776-74d032f661ba.__CR420,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"4\"></p><h3><strong>Découvrez la majestueuse nature de la région de Hisui… à dos de Pokémon !</strong></h3><p>&nbsp;</p><ul><li>De grandes zones ouvertes sont à explorer de jour comme de nuit pour en découvrir tous les secrets et Pokémon au rythme d’une bande son mémorable : les Plaines Obsidiennes, couvertes de fleurs et de forêts, le Mont Couronné enneigé en toute saison, ou encore les plages de Hisui !</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>Au fil de votre progression, vous pourrez jouer de votre Flûte Céleste et chevaucher des Pokémon inédits comme Cerbyllin pour galoper dans les plaines ou encore Gueriaigle pour planer dans les airs !</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>Une fois au coeur de la nature, collectez un maximum de ressources avec l’aide de vos Pokémon et n’hésitez pas à établir un bivouac pour reposer votre équipe et confectionner de nouveaux outils dont des Poké Ball !</li></ul><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/cf473dee-b581-4e9c-afbe-1a2dec91c7f6.__CR420,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"2\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/b8e0a79f-ceca-46ce-8e3b-71fd0e886963.__CR489,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"1\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/2d578a7b-1577-4749-bad7-40f901dfd9bf.__CR0,433,2409,2409_PT0_SX300_V1___.png\" alt=\"Arceus\"></th></tr><tr><th><h4>Comment attraper un Pokémon sauvage ?</h4><p>&nbsp;</p><ul><li>Allez à leur rencontre : les Pokémon sont plus ou moins dissimulés dans Hisui, ou alors n’apparaitront que dans certains contextes comme lors d’une condition météo précise ou en frappant un arbre !</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>Observez-les : à la différence des jeux Pokémon traditionnels, il vous faudra être plus patient et précautionneux. Des Pokémon craintifs s’enfuiront au moindre bruit de votre part alors que des Pokémon agressifs vous chargeront ! Une fois votre cible en vue, accroupissez vous jusqu’à arriver à distance de jet de… Poké Ball.</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>Affaiblissez-les et attrapez-les : pour les Pokémon les plus communs, un lancer précis de Poké Ball suffira, pour d’autres il faudra les affaiblir avec des projectiles ou encore envoyer un Pokémon pour initier un combat !</li></ul><p>&nbsp;</p></th><th><h4>Place au combat !</h4><p>&nbsp;</p><ul><li>Plongez dans des combats dynamiques et stratégiques ! L’interface des attaques de combat s’ajoute avec fluidité sur la vue à la 3ème personne classique pour plus d’immersion. Nouveautés de cet opus, vos Pokémon peuvent opter pour des Styles Rapide ou Puissant que vous choisissez avant chaque attaque et qui influent sur leur vélocité ou leur efficacité, au détriment de l’autre.</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>Affrontez les Pokémon monarques : très puissants, ils règnent dans leur écosystème, protégés par un ou une Gardienne, comme par exemple le terrible Hachécateur dans les Plaines Obsidiennes. Les rencontrer vous fera progresser dans votre aventure et votre connaissance du monde Pokémon !</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>Les Barons : pris de folie, ces Pokémon aux yeux rouges sont généralement bien plus forts que vous, il faudra esquiver leurs attaques chargées. Ces redoutables adversaires peuvent se révéler être de formidables alliés si vous parvenez à les attraper.</li></ul><p>&nbsp;</p></th><th><h4>Quel grand secret cache Arceus ?</h4><p>&nbsp;</p><ul><li>Ce Pokémon Légendaire iconique semble être au coeur de toutes les intrigues… et toutes les convoitises. Assemblez un maximum d’indices pour comprendre son rôle dans la création de ce monde !</li></ul></th></tr></tbody></table></figure>', 1, 59.99, 31, 59.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000001', 14, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 441, \"original\": \"https://api.click-games.fr/storage/391/Legendes-Pokemon-Arceus-Nintendo-Switch.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/391/conversions/Legendes-Pokemon-Arceus-Nintendo-Switch-thumbnail.jpg\"}', '[{\"id\": 442, \"original\": \"https://api.click-games.fr/storage/392/Legendes-Pokemon-Arceus-Nintendo-Switch.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/392/conversions/Legendes-Pokemon-Arceus-Nintendo-Switch-thumbnail.jpg\"}, {\"id\": 443, \"original\": \"https://api.click-games.fr/storage/393/Legendes-Pokemon-Arceus-Nintendo-Switch-5.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/393/conversions/Legendes-Pokemon-Arceus-Nintendo-Switch-5-thumbnail.jpg\"}, {\"id\": 444, \"original\": \"https://api.click-games.fr/storage/394/Legendes-Pokemon-Arceus-Nintendo-Switch-4.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/394/conversions/Legendes-Pokemon-Arceus-Nintendo-Switch-4-thumbnail.jpg\"}, {\"id\": 445, \"original\": \"https://api.click-games.fr/storage/395/Legendes-Pokemon-Arceus-Nintendo-Switch-3.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/395/conversions/Legendes-Pokemon-Arceus-Nintendo-Switch-3-thumbnail.jpg\"}, {\"id\": 446, \"original\": \"https://api.click-games.fr/storage/396/Legendes-Pokemon-Arceus-Nintendo-Switch-2.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/396/conversions/Legendes-Pokemon-Arceus-Nintendo-Switch-2-thumbnail.jpg\"}]', NULL, '2022-02-01 17:05:10', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(14, NULL, 'Pokémon Diamant Etincelant', 'pokemon-diamant-etincelant', '<h3><strong>La génération Pokémon la plus attendue des joueurs arrive sur Nintendo Switch !</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/f494b30c-b855-49d2-aae0-da775e7f0bdf.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Cover\"></p><h3><strong>La génération qui a marqué l’histoire de la Nintendo DS s’offre un refonte totale sur Nintendo Switch</strong></h3><p>Apprenti Dresseur dans la région de Sinnoh dominée par le Mont Couronné, vous devez choisir votre premier allié parmi les iconiques Tortipouss, Ouisticram et Tiplouf, constituer la meilleure équipe de Pokémon et essayer de triompher de la Ligue tenue par la redoutable Cynthia. Votre chemin pour devenir le meilleur Dresseur vous emmènera découvrir des villes inspirées de l’île d’Hokkaido au Japon, vous fera affronter la Team Galaxy et son chef mégalo et, bien sûr, plonger dans la mythologie entourant les Légendaires Dialga et Palkia, maîtres du Temps et de l’Espace. Avec sa direction artistique modernisée et son scenario inchangé, les fans pourront revivre l’expérience d’un épisode culte désormais accessible à tous.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/5fb49ca2-4636-4cf8-91c4-0db2066e7602.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"1\"></p><h3><strong>Explorez la région de Sinnoh avec Pokémon Diamant Étincelant et Pokémon Perle Scintillante !</strong></h3><p>Les aventures de Pokémon Diamant Étincelant et Pokémon Perle Scintillante se déroulent dans la région de Sinnoh, terre luxuriante dominée par le Mont Couronné et berceau de nombreux mythes ayant transcendé les générations. Découvrez les nombreux lieux qu\'elle abrite au cours de votre périple pour devenir le nouveau Maître ou la nouvelle Maîtresse de la Ligue Pokémon.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/07483ecb-f199-465a-94a1-c9692c1087a9.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"2\"></p><h3><strong>Le jeu original a été retranscrit avec soin et fidélité</strong></h3><p>Aussi bien dans son scénario que dans l\'échelle des routes et villes qui composent son environnement. Ceux et celles ayant connu Pokémon Diamant et Pokémon Perle pourront revisiter des lieux familiers et revivre des scènes connues. Quant à ceux et celles qui s\'apprêtent à découvrir Sinnoh pour la première fois, de nombreuses surprises et nouvelles rencontres les attendent.</p><p>Ces remakes incluent les ajouts qui ont rendu les épisodes modernes de la série Pokémon plus confortables et faciles à prendre en main, ainsi qu\'une mise en scène plus intense des combats de Pokémon.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/93d8c0c2-1535-4da2-ba5e-08d26f432a1d.__CR204,0,1080,1080_PT0_SX300_V1___.png\" alt=\"3\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/38ff4f92-7353-40c1-90a6-7f4b1d9bffe7.__CR469,0,1080,1080_PT0_SX300_V1___.png\" alt=\"4\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/f2b06c70-c02a-4bb7-8ffd-b42e0394bd9b.__CR155,0,1080,1080_PT0_SX300_V1___.png\" alt=\"4\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/a6d119d9-87da-4413-baba-3dd220fe90d8.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"5\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/636f9f27-4f7b-4315-816a-c39d09403355.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"5\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/d2608020-7fe0-45c7-8ba4-01c0f2e25ca6.__CR204,0,1080,1080_PT0_SX300_V1___.png\" alt=\"6\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', 1, 54.19, 31, 54.19, NULL, NULL, 0, 0, 0, NULL, 'CU0000002', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 447, \"original\": \"https://api.click-games.fr/storage/397/81xBNuArqxS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/397/conversions/81xBNuArqxS._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 455, \"original\": \"https://api.click-games.fr/storage/405/81xBNuArqxS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/405/conversions/81xBNuArqxS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 456, \"original\": \"https://api.click-games.fr/storage/406/71bCc9vYFkS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/406/conversions/71bCc9vYFkS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 457, \"original\": \"https://api.click-games.fr/storage/407/61dHUqJhP4S._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/407/conversions/61dHUqJhP4S._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 458, \"original\": \"https://api.click-games.fr/storage/408/71b7E0U73hS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/408/conversions/71b7E0U73hS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 459, \"original\": \"https://api.click-games.fr/storage/409/71DPhRrcOyS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/409/conversions/71DPhRrcOyS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 460, \"original\": \"https://api.click-games.fr/storage/410/71Npe4mH5HS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/410/conversions/71Npe4mH5HS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 461, \"original\": \"https://api.click-games.fr/storage/411/71ZxzhF0tHS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/411/conversions/71ZxzhF0tHS._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-01 17:40:13', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL,