(18, NULL, 'Console Nintendo 3DS XL - bleu & noir', 'console-nintendo-3ds-xl-bleu-noir', '<p>Console portable Nintendo 3DS XL: des écrans 90% plus grands pour jouer en 3D sans lunettes !&nbsp;</p><p><br>La console Nintendo 3DS vous ouvre les portes de la 3D sans lunettes : pas besoin d’accessoire encombrant ou assombrissant pour profiter des superbes images 3D de ses jeux exclusifs.&nbsp;<br><br>Avec ses écrans 90% plus grands que ceux de la Nintendo 3DS, la Nintendo 3DS XL permet à chacun de plonger encore plus au cœur de ses jeux ou de ses vidéos, à domicile comme à l’extérieur.&nbsp;<br><br>L’écran du haut passe de 8.9 centimètres à 12.40 centimètres pour offrir un confort visuel unique, et une 3D, toujours sans lunette, encore plus agréable.&nbsp;<br><br>L’écran tactile en bas de la Nintendo 3DS XL est lui aussi plus grand : naviguer au stylet ou même au doigt devient encore plus intuitif pour un confort et une précision de jeu plus importants.&nbsp;<br><br>La Nintendo 3DS XL offre toujours des sensations précises avec le « Pad de commande circulaire » permettant une commande analogique sur 360 degrés.&nbsp;<br><br>La console offre aussi plus de communication avec le monde entier ou même vos voisins immédiats en recherchant de manière invisible le maximum de connexion avec les réseaux ou les autres joueurs.&nbsp;<br><br>L’autonomie a grandi elle aussi : jouez plus longtemps sans avoir à recharger votre console, puisqu’il vous sera possible de profiter de la Nintendo 3DS XL jusqu’à 6 heures 30 minutes pour les jeux Nintendo 3DS, et jusqu’à 10 heures pour les jeux Nintendo DS !&nbsp;<br><br><br><br><br>Découvrez la 3D relief&nbsp;<br>L\'écran supérieur de la console Nintendo 3DS XL utilise la toute dernière technologie pour produire des effets 3D nets et impressionnants sans qu\'il soit nécessaire de porter des lunettes spéciales.&nbsp;<br><br>Curseur 3D : la 3D comme je veux et quand je veux&nbsp;<br>Le curseur 3D vous permet d\'augmenter ou de diminuer l\'effet 3D afin de trouver un niveau de 3D qui convienne parfaitement à vos yeux. Vous pouvez également utiliser la fonction de contrôle parental pour désactiver l\'affichage des images en 3D et mettre la console Nintendo 3DS en mode 2D (recommandé pour les enfants de moins de 7 ans).&nbsp;<br><br>Jouez aussi avec vos jeux Nintendo DS&nbsp;<br>Si vous possédez déjà une console de la gamme Nintendo DS, la Nintendo 3DS XL vous invite certes à découvrir de nouvelles expériences en 3D sans pour cela mettre de côté vos jeux Nintendo DS préférés. Il est possible de jouer en 2D à quasiment tous les jeux Nintendo DS et Nintendo DSi sur une Nintendo 3DS XL.&nbsp;<br><br><br><br><br>Communication sans fil !&nbsp;<br><br>La console la plus connectée : La Nintendo 3DS XL a été conçue comme la console la plus connectée du monde : en Wi-Fi ou de console à console, elle cherchera toujours à télécharger le maximum de contenu, sans vous interrompre ou vous déranger. Vous n\'avez qu\'à rabattre l\'écran de votre console allumée et à l\'emporter partout avec vous !&nbsp;<br><br>StreetPass : découvrez plein de bonus dans vos jeux&nbsp;<br>Votre console Nintendo 3DS XL échange à distance des données de jeu avec les Nintendo 3DS/Nintendo 3DS XL d\'autres joueurs que vous croisez dans la rue, sans même que vous n\'ayez à lever le petit doigt. Lancez-vous dans des combats immédiats dans Super Street Fighter IV, récupérez des pièces et des bonus dans Super Mario 3D Land, récupérez les données fantômes des joueurs croisés sur Mario Kart 7, et partagez vos dessins dans New Art Academy. Votre console Nintendo 3DS XL va rechercher et échanger des données avec d\'autres consoles Nintendo 3DS / 3DS XL, vous fournissant ainsi de nouveaux contenus et des défis inédits provenant d\'autres joueurs.&nbsp;<br><br>SpotPass : jouer en ligne n’a jamais été aussi simple&nbsp;<br>Avec SpotPass, votre console Nintendo 3DS XL cherche automatiquement à se connecter à Internet via les points d\'accès sans fil qu’elle détecte afin d’échanger différents types de données. Logiciels gratuits, notifications et contenus 3D ne sont qu\'un petit aperçu de ce qui vous attend. Connectez votre console à Internet et laissez-vous surprendre.&nbsp;<br><br>Se connecter, c\'est facile !&nbsp;<br>La connexion à Internet vous offre davantage de façons de jouer. Que ce soit avec vos amis ou avec d\'autres joueurs connectés du monde entier, vous êtes sûr de pouvoir jouer partout, tout le temps. Connectez-vous grâce à Mario Kart 7, PES 2012 3D, Tetris et bien d\'autres !&nbsp;<br>De plus, vous pouvez profiter désormais du téléchargement gratuit de jeux célèbres, accéder à des applications amusantes, et plus encore !&nbsp;<br>Vous pouvez aussi choisir d\'être alerté sur les sorties les plus récentes et les offres via le service SpotPass.&nbsp;<br><br><br><br><br>Logiciels préinstallés&nbsp;<br><br>Découvrez des jeux qui exploitent les fonctions novatrices de la Nintendo 3DS XL : créez des personnages Mii en un clin d\'œil avec l\'éditeur Mii, enregistrez vos activités physiques et vos parties grâce au journal d\'activité ou bien créez et modifiez des photos ou des sons grâce aux applications intégrées. Il vous suffit d\'appuyer sur le nouveau bouton HOME pour accéder instantanément à vos fonctions préférées.&nbsp;<br><br>Créez votre Mii&nbsp;<br>Amusez-vous à créer un personnage Mii à partir d\'une photo grâce au nouvel éditeur Mii et rentrez véritablement dans le jeu ! Il vous suffit de prendre une photo de vous ou de quelqu\'un d\'autre. L\'éditeur Mii se charge ensuite de transformer le cliché en personnage Mii personnalisé pour vous. Vous pouvez ensuite faire les retouches que vous souhaitez pour que votre Mii ait le look qui vous convient.&nbsp;<br><br>Boutique en ligne Nintendo eShop : des surprises à découvrir&nbsp;<br>Découvrez une foule de contenus, comme des jeux novateurs créés par des développeurs indépendants grâce au Nintendo DSiWare, de grands classiques avec la console virtuelle et des logiciels exclusifs Nintendo 3DS à télécharger, en exclusivité sur le Nintendo eShop.&nbsp;<br>Il vous suffit de mettre à jour votre console, si ce n\'est déjà fait, et vous pourrez aussitôt découvrir ce qu\'il a à vous offrir !&nbsp;<br>(L\'icône Nintendo eShop s\'ajoutera au menu HOME de votre Nintendo 3DS une fois que vous aurez effectué une mise à jour de la console).&nbsp;<br><br>Jeux en réalité augmentée&nbsp;<br>Les capacités 3D des appareils photo vous font littéralement entrer dans une nouvelle dimension avec la réalité augmentée (RA) et les applications des jeux en RA. Placez l\'une des cartes RA fournies sur une surface plane. Attendez un peu et vous verrez votre jeu s\'animer !&nbsp;<br><br>Appareil photo Nintendo 3DS&nbsp;<br>Prenez d\'incroyables photos en 3D à l\'aide des deux objectifs numériques extérieurs, puis immortalisez vos amis, votre famille pour entrer dans une toute nouvelle dimension.&nbsp;<br><br>Caméra Vidéo Nintendo 3DS&nbsp;<br>Filmez tout ce qui vous entoure pour avoir vos meilleurs souvenirs en 3D avec le double objectif de la Nintendo 3DS, il est également possible de filmer en 2D.&nbsp;<br><br>Studio son Nintendo 3DS&nbsp;<br>Enregistrez des sons et amusez-vous avec.&nbsp;<br><br>Journal d\'activité&nbsp;<br>Gardez un œil sur le nombre de pas que vous avez effectués et consultez votre historique et vos statistiques de jeu.&nbsp;<br><br>Notes de jeu&nbsp;<br>Cette fonction amusante vous permet de visualiser vos progrès ou de prendre une note même lorsque vous jouez à un jeu.&nbsp;<br><br>Liste d\'amis&nbsp;<br>Jouez et communiquez via Internet avec les amis de votre liste où qu\'ils se trouvent.&nbsp;<br><br>Mode téléchargement&nbsp;<br>Jouez à certains jeux multijoueurs avec une seule carte de jeu ou partagez certaines démos de jeu avec vos amis.&nbsp;<br><br><br>Contenu du pack :&nbsp;<br><br>Votre nouvelle console Nintendo 3DS XL comprend tout ce dont vous avez besoin pour passer à l\'action sans perdre un instant !&nbsp;<br>Avec votre toute nouvelle Nintendo 3DS XL, vous trouverez :</p><ul><li>Un stylet Nintendo 3DS XL : un stylet rétractable qui s\'insère parfaitement dans votre nouvelle console.</li><li>Une carte SD (4 Go) : gardez toujours votre musique, vos jeux et vos logiciels téléchargés à portée de main en les sauvegardant sur la carte SD fournie</li></ul><p><br>La durée de vie de la batterie (ions lithium) à pleine charge est comprise entre 3h30 minutes et 6h30 minutes, suivant l’utilisation ou non des fonctions 3D et du volume sonore de la console.&nbsp;<br><br>SPÉCIFICATIONS TECHNIQUES&nbsp;<br><br>Taille (console fermée) : Environ 156 millimètres de largeur, 93 millimètres de longueur, 22 millimètres d’épaisseur.&nbsp;<br><br>Poids : Environ 336 grammes.&nbsp;<br><br>Écran supérieur : Un écran large à cristaux liquides de 12.40 centimètres, permettant un affichage en 3D sans utilisation de lunettes. Une résolution de 800x240 pixels (400 pixels sont attribués à chaque œil pour un visionnage en 3D).&nbsp;<br><br>Écran tactile : Un écran de 10.61 centimètres à cristaux liquides d’une résolution de 320x240 avec reconnaissance tactile.&nbsp;<br><br>Caméras : Une caméra interne et deux caméras externes d’une résolution de 640x480 pixels (0,3 mégas).&nbsp;<br><br>Communication sans fil : Capacité de communication sur fréquence 2,4 GHz. Plusieurs consoles Nintendo 3DS XL peuvent être reliées via une connexion sans fil pour des parties coopératives ou compétitives. Les consoles peuvent aussi se connecter à des points d’accès LAN pour accéder à Internet et jouer avec le monde entier. La console assure une reconnaissance IEEE 802.11 et des protocoles avancés de sécurité (WPA/WPA2). La Nintendo 3DS XL a été conçue pour permettre un échange des données même lorsque la console est en mode veille : elle peut automatiquement échanger des données avec d’autres consoles Nintendo 3DS XL ou recevoir des données via Internet.&nbsp;<br><br>Commandes de jeu : L’écran tactile, le microphone intégré, les boutons frontaux A/B/X/Y, la manette +, les boutons latéraux L/R, les boutons Start et Select, le « Pad de Commande Circulaire » permettant une commande analogique sur 360 degrés, un appareil photo interne, deux appareils photo externes, un détecteur de mouvement et un gyroscope.&nbsp;<br><br>Entrée/Sortie : Un port acceptant les cartes de jeu Nintendo 3DS et les cartes pour consoles de la gamme Nintendo DS™ ; un port pour cartes mémoire SD ; un port d’alimentation pour adaptateur secteur ; un terminal de charge et une sortie jack pour écouteurs stéréo.&nbsp;<br><br>Son : Des haut-parleurs stéréo sont situés à gauche et à droite de l’écran supérieur.&nbsp;<br><br>Contrôle parental : Les contrôles parentaux semblables à ceux de la console Nintendo DSi sont inclus.&nbsp;<br><br>Bloc d’alimentation :Non inclus, vendu séparément – console Nintendo 3DS XL rechargeable via bloc d’alimentation Nintendo DSi, Nintendo DSi XL ou Nintendo 3DS.</p>', 1, 179.99, 31, 179.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000006', 7, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 486, \"original\": \"https://api.click-games.fr/storage/436/81Z4veyPyrL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/436/conversions/81Z4veyPyrL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 487, \"original\": \"https://api.click-games.fr/storage/437/51sLsoNM0aL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/437/conversions/51sLsoNM0aL._AC_-thumbnail.jpg\"}, {\"id\": 488, \"original\": \"https://api.click-games.fr/storage/438/31L8Y23o0sL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/438/conversions/31L8Y23o0sL._AC_-thumbnail.jpg\"}, {\"id\": 489, \"original\": \"https://api.click-games.fr/storage/439/81Z4veyPyrL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/439/conversions/81Z4veyPyrL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 17:55:00', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NU