(20, NULL, 'Nintendo DS Lite - rouge', 'nintendo-ds-lite-cobalt-bleu', '<p><br>La Nintendo DS revient avec un lifting qui met ses atouts encore plus avant !&nbsp;<br><br>Dénommée « Lite », Cette nouvelle version est don plus compacte et légère : 2/3 en taille par rapport à la version originale et 20% de poids en moins ! Elle a de quoi se glisser dans toutes les poches ! Désormais, le micro se trouve au centre de la console, le stylet est plus confortable car plus long et épais et les boutons « Start » et « Select » ont été repositionnés pour faciliter leur accès ! Notons aussi que l\'accès au port cartouche GBA est protégé par un cache pour une meilleure protection. Il vous sera aussi possible de régler la luminosité de votre écran pour jouer dans toutes les conditions ! La DS Lite a vraiment les atouts pour plaire? Ajoutez à cela une gamme de jeux des plus alléchante, et vous la recette d\'une console à succès !&nbsp;<br><br>Version plus compacte et légère&nbsp;<br>Touches plus accessibles et confort d\'utilisation optimisé&nbsp;<br>Console idéale pour des plaisirs de jeu nomades&nbsp;<br>Possibilité de régler la luminosité de l\'écran</p>', 1, 89.99, 31, 89.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000008', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 497, \"original\": \"https://api.click-games.fr/storage/447/412VOkz905L._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/447/conversions/412VOkz905L._AC_-thumbnail.jpg\"}', '[{\"id\": 498, \"original\": \"https://api.click-games.fr/storage/448/41rfxgqVNaL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/448/conversions/41rfxgqVNaL._AC_-thumbnail.jpg\"}, {\"id\": 499, \"original\": \"https://api.click-games.fr/storage/449/412VOkz905L._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/449/conversions/412VOkz905L._AC_-thumbnail.jpg\"}]', NULL, '2022-02-02 18:12:50', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(21, NULL, 'Pokémon Perle Scintillante', 'pokemon-perle-scintillante', '<h3><strong>La génération Pokémon la plus attendue des joueurs arrive sur Nintendo Switch !</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/f494b30c-b855-49d2-aae0-da775e7f0bdf.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Cover\"></p><h3><strong>La génération qui a marqué l’histoire de la Nintendo DS s’offre un refonte totale sur Nintendo Switch</strong></h3><p>Apprenti Dresseur dans la région de Sinnoh dominée par le Mont Couronné, vous devez choisir votre premier allié parmi les iconiques Tortipouss, Ouisticram et Tiplouf, constituer la meilleure équipe de Pokémon et essayer de triompher de la Ligue tenue par la redoutable Cynthia. Votre chemin pour devenir le meilleur Dresseur vous emmènera découvrir des villes inspirées de l’île d’Hokkaido au Japon, vous fera affronter la Team Galaxy et son chef mégalo et, bien sûr, plonger dans la mythologie entourant les Légendaires Dialga et Palkia, maîtres du Temps et de l’Espace. Avec sa direction artistique modernisée et son scenario inchangé, les fans pourront revivre l’expérience d’un épisode culte désormais accessible à tous.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/5fb49ca2-4636-4cf8-91c4-0db2066e7602.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"1\"></p><h3><strong>Explorez la région de Sinnoh avec Pokémon Diamant Étincelant et Pokémon Perle Scintillante !</strong></h3><p>Les aventures de Pokémon Diamant Étincelant et Pokémon Perle Scintillante se déroulent dans la région de Sinnoh, terre luxuriante dominée par le Mont Couronné et berceau de nombreux mythes ayant transcendé les générations. Découvrez les nombreux lieux qu\'elle abrite au cours de votre périple pour devenir le nouveau Maître ou la nouvelle Maîtresse de la Ligue Pokémon.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/07483ecb-f199-465a-94a1-c9692c1087a9.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"2\"></p><h3><strong>Le jeu original a été retranscrit avec soin et fidélité</strong></h3><p>Aussi bien dans son scénario que dans l\'échelle des routes et villes qui composent son environnement. Ceux et celles ayant connu Pokémon Diamant et Pokémon Perle pourront revisiter des lieux familiers et revivre des scènes connues. Quant à ceux et celles qui s\'apprêtent à découvrir Sinnoh pour la première fois, de nombreuses surprises et nouvelles rencontres les attendent.</p><p>Ces remakes incluent les ajouts qui ont rendu les épisodes modernes de la série Pokémon plus confortables et faciles à prendre en main, ainsi qu\'une mise en scène plus intense des combats de Pokémon.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/93d8c0c2-1535-4da2-ba5e-08d26f432a1d.__CR204,0,1080,1080_PT0_SX300_V1___.png\" alt=\"3\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/38ff4f92-7353-40c1-90a6-7f4b1d9bffe7.__CR469,0,1080,1080_PT0_SX300_V1___.png\" alt=\"4\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/f2b06c70-c02a-4bb7-8ffd-b42e0394bd9b.__CR155,0,1080,1080_PT0_SX300_V1___.png\" alt=\"4\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/a6d119d9-87da-4413-baba-3dd220fe90d8.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"5\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/636f9f27-4f7b-4315-816a-c39d09403355.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"5\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/d2608020-7fe0-45c7-8ba4-01c0f2e25ca6.__CR204,0,1080,1080_PT0_SX300_V1___.png\" alt=\"6\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure>', 1, 53.99, 31, 53.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000009', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 500, \"original\": \"https://api.click-games.fr/storage/450/81yD84J84QS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/450/conversions/81yD84J84QS._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 501, \"original\": \"https://api.click-games.fr/storage/451/61dHUqJhP4S._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/451/conversions/61dHUqJhP4S._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 502, \"original\": \"https://api.click-games.fr/storage/452/71b7E0U73hS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/452/conversions/71b7E0U73hS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 503, \"original\": \"https://api.click-games.fr/storage/453/71DPhRrcOyS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/453/conversions/71DPhRrcOyS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 504, \"original\": \"https://api.click-games.fr/storage/454/71Npe4mH5HS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/454/conversions/71Npe4mH5HS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 505, \"original\": \"https://api.click-games.fr/storage/455/71ZxzhF0tHS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/455/conversions/71ZxzhF0tHS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 506, \"original\": \"https://api.click-games.fr/storage/456/71bCc9vYFkS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/456/conversions/71bCc9vYFkS._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 18:22:35', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(22, NULL, 'Super Mario Odyssey standard', 'super-mario-odyssey-standard', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/66caa381-f7bd-4abb-a798-4a8b8468637e._SR300,300_.jpg\" alt=\"\"></p><h3><strong>Cap sur l\'aventure !</strong></h3><p>Embarquez pour une aventure inoubliable avec Mario à bord de son tout nouveau vaisseau, l\'Odyssée, et offrez-vous votre plus grand voyage avec Super Mario Odyssey ! Pour sa toute nouvelle aventure en 3D, la première dans le style de Super Mario 64 (1997) et Super Mario Sunshine (2002), Mario va devoir tenter de déjouer les plans machiavéliques de Bowser qui a de nouveau kidnappé la Princesse Peach, cette fois pour la forcer à se marier avec lui ! Heureusement, pour y arriver, Mario est accompagné d\'un tout nouvel ami, Cappy, qui prend possession de sa célèbre casquette ! Lancez-le pour prendre le contrôle d\'objets et même d\'ennemis et utiliser leurs compétences ! Bien au-delà du Royaume Champignon, partez à la découverte d\'univers incroyables, des gratte-ciels de New Donk City au pays de la cuisine dominé par le Piton du Frouno, et tentez de délivrer Peach des griffes de Bowser! Mario met les voiles, cap vers Super Mario Odyssey, le 27 Octobre exclusivement sur Nintendo Switch.</p><h3><strong>Caractéristiques</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a98ebf49-897d-41c5-82e2-7d800fe6ee11._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e260003a-e6e6-4d79-b4d1-9b36e4223064._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/2941f44d-bfa7-41cc-aee2-0e94572d9cee._SL300__.jpg\" alt=\"\"></th></tr><tr><th><h4>Qu\'est-ce que la chapimorphose ?</h4><p>Lancez votre casquette sur un objet ou un ennemi et prenez-en possession. Un Bill Balle par là ? Hop, prenez-en le contrôle en un coup de casquette. Idéal pour acquérir de toutes nouvelles compétences !</p></th><th>Faites virevolter Cappy sur les ennemis qui vous entourent pour les attaquer, ou pour récupérer des objets inaccessibles.</th><th>Besoin d\'un petit coup de pouce pour réussir un saut ? Lancez Cappy devant vous et sautez-lui dessus pour atteindre des zones éloignées.</th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/5389969d-541d-46ad-ab02-b62fbb0bd753._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/ff2f71ca-a403-48dc-8598-72c5dd03089c._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/f723592d-6f96-444d-b98a-b3c836fa0fb1._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/9929c387-7e2e-4e6d-8ef8-a333eafdc7a9._SL220__.jpg\" alt=\"\"></th></tr><tr><th><h4>Vive les mariés ?</h4><p>En plus de kidnapper Peach, Bowser veut la forcer à se marier avec lui ! Et pour mettre des bâtons dans les roues de Mario, Bowser n\'est pas seul mais accompagné des horribles Broodals ! Pour mettre un terme au mariage, à vous de prendre le contrôle maintenant ou de vous taire à jamais !</p></th><th><h4>Mettez les voiles à bord de l\'Odyssée !</h4><p>Pour sauver Peach, Mario et Cappy vont jouer les globe-trotters et parcourir le monde aux commandes de leur vaisseau. Des Royaumes, il y en a tellement à explorer ! Pour partir à leur découverte, vous devrez faire évoluer votre vaisseau, l\'Odyssée, en collectant des lunes de puissance cachées à différents endroits bon courage pour toutes les trouver.</p></th><th><h4>Un pull rouge et une salopette bleue ?</h4><p>En plus de la mythique salopette de Mario, faites votre shopping chez Crazy Cap pour lui trouver de nouvelles tenues ! Pour les obtenir, il faudra être vigilant et collecter les pièces présentes dans les différents pays du jeu. Certains costumes sont nouveaux alors que d\'autres vous rappelleront des souvenirs. Et vous, êtes-vous plutôt toque de cuisiner ou tenue façon safari?</p></th><th><h4>Nostalgique de la grande époque ?</h4><p>Certains tuyaux sont particuliers quand vous entrez à l\'intérieur, vous vous retrouvez dans une zone 2D avec un gameplay identique à celui de Super Mario Bros. de la NES ! En plus des niveaux retro, les musiques ont été, elles aussi, remaniées en version 8 bits !</p></th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/560670c5-3628-4af6-81f0-d3cacb17f8a2._SR300,300_.JPG\" alt=\"\"></p><h3><strong>Compatibilité Amiibo</strong></h3><p>A l\'occasion du lancement de Super Mario Odyssey, trois visages connus s\'offrent un amiibo en tenue de mariage : Peach, Bowser et Mario ! Ils ont des effets bien utiles dans le jeu comme vous aider à découvrir les lunes de puissance cachées, par exemple ! Tous les amibo de la collection Super Mario sont compatibles avec le jeu !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/9bc5edbb-f650-4f1d-b3ed-7fe4baa0e5ab._SL300__.jpg\" alt=\"\"></p><h3><strong>Goomba</strong></h3><p>Empilez-les pour atteindre des hauteurs autrement inaccessibles !</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000010', 46, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 507, \"original\": \"https://api.click-games.fr/storage/457/81TksYoxfQL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/457/conversions/81TksYoxfQL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 508, \"original\": \"https://api.click-games.fr/storage/458/41oWPpYDPKL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/458/conversions/41oWPpYDPKL._AC_-thumbnail.jpg\"}, {\"id\": 509, \"original\": \"https://api.click-games.fr/storage/459/51xUs5-IyqL._AC_SL1200_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/459/conversions/51xUs5-IyqL._AC_SL1200_-thumbnail.jpg\"}, {\"id\": 510, \"original\": \"https://api.click-games.fr/storage/460/5136Ut339GL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/460/conversions/5136Ut339GL._AC_-thumbnail.jpg\"}, {\"id\": 511, \"original\": \"https://api.click-games.fr/storage/461/51uj0LKamWL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/461/conversions/51uj0LKamWL._AC_-thumbnail.jpg\"}, {\"id\": 512, \"original\": \"https://api.click-games.fr/storage/462/41Skooxh5wL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/462/conversions/41Skooxh5wL._AC_-thumbnail.jpg\"}]', NULL, '2022-02-02 18:25:54', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(23, NULL, 'SUPER MARIO 3D WORLD+BOWSER FURY', 'super-mario-3d-world-bowser-fury', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/b5e677d6-9974-407a-9d7b-a1c5b5aa8b8a.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"screen\"></p><h3><strong>En solo ou à plusieurs, sortez les griffes pour partir à l’aventure !</strong></h3><p>Bowser a encore fait des siennes… et cette fois la mission est double pour Mario ! Le plombier moustachu est appelé à l’aide pour sauver le monde des griffes acérées de son ennemi juré dans deux aventures qui vont lui faire hérisser le poil avec Super Mario 3D World + Bowser’s Fury exclusivement sur Nintendo Switch et Nintendo Switch Lite.</p><p>Dans Super Mario 3D World, c’est le monde des Libella (de petites fées colorées) qui est menacé par les grosses pattes de Bowser. Montagnes, déserts, plages… parcourez chaque recoin des différents mondes et niveaux et utilisez les supers pouvoirs pour affronter les ennemis ou accéder à des endroits difficiles. Grâce à la super clochette transformez-vous-même en chat pour grimper sur les murs et griffer vos ennemis !</p><p>Un coup de patte ne serait pas de trop ? Unissez vos forces et jouez jusqu’à 4 en local ou en ligne.</p><p>Dans le nouveau mode Bowser’s Fury, Bowser est devenu plus incontrôlable que jamais. Bowser Jr., en personne, vous appelle à l’aide pour le combattre. Cette aventure vous emmène au lac de Saudechat et ses nombreuses îles que vous allez devoir explorer pour trouver comment rétablir le calme et affronter le courroux de Bowser. Jouez même à 2, l’un incarnant Mario l’autre Bowser Jr., pour avancer dans l’aventure.</p><p>En solo ou à plusieurs, préparez vos coussinets pour vivre deux aventures qui vont vous faire ronronner de plaisir dans Super Mario 3D World + Bowser’s Fury dès le 12 février exclusivement sur Nintendo Switch et Nintendo Switch Lite.</p><h3><strong>Plongez dans l’aventure féérique de Super Mario 3D World</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/9659b1b9-0944-4bd8-8e6c-e1bf378f6591.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"1\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/36c21608-dc81-47c0-9988-7f473e47ee98.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"5\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/5243e616-3506-4c6c-8c2b-78b0cb1e0389.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"6\"></th></tr><tr><th><h4>Bowser « fée » des siennes</h4><p>Pour une fois, la cible de Bowser n’est pas Peach mais les Libella d’adorables petites fées très colorées. Au fil des différents mondes sauvez-les des griffes de l’affreux Bowser et libérez leur royaume de la menace.</p></th><th><h4>Explorez une multitude de mondes et niveaux en 3D et fouillez tous les recoins</h4><p>Que ce soit de gauche à droite, de bas en haut, sur les côtés, explorez la plateforme sous toutes ses coutures pour tenter de collecter les étoiles vertes présentes dans chaque niveau et atteindre le drapeau final.</p></th><th><h4>Mario, Luigi, Peach et Toad… choisissez le personnage qui vous correspond le plus.</h4><p>Alors que Mario est assez équilibré, Luigi peut sauter très haut, Peach flotter dans les airs et Toad sprinter comme personne.</p></th></tr></tbody></table></figure><h3><strong>Faites face à un Bowser plus enragé que jamais dans le mode Bowser’s Fury</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/47cb7b5b-fa53-45ac-8292-5d37df1d2f42.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"7\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/73af3778-1726-4a1e-83a9-d987fafa2e89.__CR680,0,1080,1080_PT0_SX300_V1___.png\" alt=\"7\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/952bfb82-380f-46c8-98e5-c615777d9f9a.__CR332,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"2\"></th></tr><tr><th><h4>Utilisez tout un tas de pouvoirs… et transformez-vous-même en chat !</h4><p>En plus des traditionnels champignons, étoiles et fleurs découvrez la super clochette qui va vous transformer en chat. Tout de fourrure vêtu(e) escaladez les murs pour atteindre des plateformes en hauteur et donnez des coups de griffes à vos ennemis.</p></th><th><h4>L’aventure se partage de 1 à 4 joueurs… ou pas* !</h4><p>A la fin de chaque niveau découvrez celui qui aura récolté le plus de points et soulèvera la couronne. De quoi oublier parfois l’esprit d’équipe au détriment de la compétition !</p></th><th><h4>Mario à la rescousse</h4><p>Bowser Jr. fait appel à vous pour tenter de calmer son père qui est devenu aussi géant que hors de contrôle. Gare à ses épines et à son souffle dévastateur !</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d9e932e1-dded-4622-bbf7-9890339b0f88.__CR420,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"3\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/b0a339b5-1750-4d0a-bc12-f9f4586dcab4.__CR449,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"4\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a6a8d2c7-33a9-4dff-89f2-aa907773b803.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"amiibo\"></th></tr><tr><th><h4>Ile était une fois une aventure qui a du chat</h4><p>Pour aider Bowser Jr. cela rendez-vous au lac Saudechat, qui abrite de nombreuses îles. Faites équipe avec lui et explorez librement les îles afin de remplir des missions et rassembler les astres félins, des étoiles en forme de tête de chat. Réunissez les astres pour libérer la Giga cloche qui transforme Mario en Giga Mario chat ! Quoi de mieux pour affronter un giga Bowser en furie ?!</p></th><th><h4>Vivez l’aventure en duo</h4><p>Votre nouveau partenaire, Bowser Jr., sera aussi là pour vous aider ! Passez un Joy-Con à un proche pour qu\'il prenne son contrôle et parte à l’aventure avec vous.</p></th><th><h4>Compatibilité amiibo</h4><p>Super Mario 3D World + Bowser’s Fury est compatible avec tous les amiibo.</p><p>Deux nouveaux amiibo sont lancés en même temps que le jeu le 12 février : Peach &amp; Mario chat !</p></th></tr></tbody></table></figure>', 1, 53.99, 31, 53.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000011', 16, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 513, \"original\": \"https://api.click-games.fr/storage/463/81VrW5EM1NL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/463/conversions/81VrW5EM1NL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 514, \"original\": \"https://api.click-games.fr/storage/464/81VrW5EM1NL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/464/conversions/81VrW5EM1NL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 18:29:48', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(24, NULL, 'Mario Kart 8 Deluxe', 'mario-kart-8-deluxe', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e16954ad-f553-4411-aa8a-86e63a3b9f28._SL300__.jpg\" alt=\"\"></p><h3><strong>Bananes et carapaces sur place ou à emporter !</strong></h3><p>Appuyez sur le champignon et affûtez vos carapaces, Mario Kart 8 Deluxe va tout retourner sur Nintendo Switch ! Foncez à fond les ballons la tête à l\'envers avec les pneus anti-gravité ! Irez-vous plus vite en passant par le plafond ? Ou allez-vous tracer au sol entre les bananes et les batailles de carapace ? Tous les coups les plus fourbes sont permis pour se hisser à la première place ! Maîtriser tous les pouvoirs comme la plume pour éviter les mauvaises surprises, ou encore le fantôme pour devenir invisible dans les 48 circuits légendaires ! D\'autant plus que de nouveaux invités de marque s\'invitent à la fête dès le 28 avril !</p><h4>Innovations</h4><ul><li>Le plus grand contenu pour un Mario Kart avec le plus grand nombre de circuits et de modes de jeu !</li><li>De nouveaux personnages et pouvoirs emblématiques débarquent pour tout retourner !</li><li>Seul ou avec 11 autres joueurs, affrontez tous vos amis où vous voulez avec la console de salon à emmener partout !</li><li>La version Deluxe du digne héritier de Mario Kart 8, acclamé par la critique et les joueurs !</li></ul><h3><strong>Points clés</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/7186a548-5e8b-47c7-a268-e6c8269053ff._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/48fb86b4-7876-4f18-b735-c6c4c974c699._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a0141e1e-901f-4d3e-91b6-20c4c58ed9b3._SL300__.jpg\" alt=\"\"></th></tr><tr><th><h4>48 circuits de légende à arpenter dans le sens que vous voulez !</h4><p>Avec les pneus anti-gravité, pilotez à fond les ballons la tête à l\'envers sur les 48 circuits que comprend le jeu ! Sur les mûrs, au plafond ou dans les airs, à vous de choisir votre route de prédilection pour éviter les attaques de vos concurrents !</p></th><th><h4>De nouveaux invités de marque !</h4><p>En plus des 36 personnages bien connus issus de vos jeux préférés, 6 nouveaux pilotes viennent balancer bananes et carapaces. Retrouvez le Roi Boo, les Inklings de Splatoon ou Bowser Junior pour la première fois dans un Mario Kart ! Lequel allez-vous préférer ?</p></th><th><h4>Le grand retour des arènes et du mode ballons !</h4><p>Affrontez vos amis dans le mode culte de Mario Kart ! Chacun possède 3 ballons à protéger et accrochés à son kart. Le 1er à tous les perdre est éliminé ! Alors qui sera le roi de l\'arène dans les 8 nouvelles zones de bataille ?</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a7bf9154-5f30-4745-a9b8-ebdcbb024d75._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/05097877-d35e-4fbd-b36a-086ec4b66aea._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/811bda70-04f5-4115-aaf7-059a14238818._SL300__.jpg\" alt=\"\"></th></tr><tr><th><h4>Un pouvoir n\'est pas suffisant ? Doublez-le !</h4><p>Vous pouvez dorénavant stocker 2 pouvoirs pour balancer des combos encore plus fourbes ! Surtout que d\'anciens pouvoirs font leur grand retour. Alors, apprenez à maîtriser le Fantôme pour devenir invisible et voler les objets de vos adversaires, à moins que vous ne préfériez la délicatesse de la Plume pour sauter et éviter tous les pièges !</p></th><th><h4>Mario Kart plus beau et plus fluide que jamais !</h4><p>Lancez-vous à fond les ballons dans des courses endiablées sur les mûrs, le plafond ou sous l\'eau en esquivant carapaces et bananes pour la première fois en 1080p et 60 fps sur le mode TV de la Nintendo Switch !</p></th><th><h4>Personnalisez vos bolides !</h4><p>En deltaplane, en moto ou en kart, customisez comme vous voulez votre véhicule de prédilection ! Allez-vous privilégier la vitesse ou la maniabilité ? A vous de choisir les roues, la carrosserie ainsi que la voile de votre aile volante !</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/9e940321-e10a-480d-b4af-4244d9890627._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/084e15a0-bfe3-49b3-8c6d-e11ca2884704._SL300__.jpg\" alt=\"\"></th><th>&nbsp;</th></tr><tr><th><h4>Encore plus de contenu avec les amiibo !</h4><p>En posant des amiibo sur le lecteur NFC du Joy-Con droit de votre console Nintendo Switch ou sur la manette Nintendo Switch Pro (vendue séparément), vous ajoutez du contenu additionnel et de nombreux costumes pour donner du style à vos personnages et enrichir vos parties Mario Kart 8 Deluxe !</p></th><th><h4>Comme un vrai pilote</h4><p>Retrouvez l\'incontournable volant de course qui vous fera sentir comme un véritable pilote. Optez pour la précision et le confort avec le volant Nintendo Switch (vendu séparément) compatible avec les Joy-Con pour devenir le roi de la piste !</p></th><th>&nbsp;</th></tr></tbody></table></figure><h3><strong>Mario Kart quand vous voulez, où vous voulez, avec qui vous voulez.</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/93852341-edfe-4701-994c-02ca15ee977b._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/bccf73b3-1758-4d3b-a874-8ffc18d6cf60._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/0a04fcb0-7159-44e5-bad8-fe172d362c5f._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/8b9c1f03-daa4-42fd-8c5e-dc5c40576478._SL220__.jpg\" alt=\"\"></th></tr><tr><th>..... En solo ou à 8 joueurs en local avec 8 Nintendo Switch dans une cour ......</th><th>..... à 2 joueurs en \"mode table\" avec 2 Joy-Cons dans un avion....</th><th>.... 4 sur une même Nintendo Switch en portable ou dans votre salon sur l\'écran de la TV ....</th><th>...... 12 Joueurs en ligne dans des courses endiablées ou dans le mode bataille pour tout casser.....</th></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', 1, 54.49, 31, 54.49, NULL, NULL, 0, 0, 0, NULL, 'CU0000012', 16, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 515, \"original\": \"https://api.click-games.fr/storage/465/81EdgFXOWWL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/465/conversions/81EdgFXOWWL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 516, \"original\": \"https://api.click-games.fr/storage/466/81EdgFXOWWL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/466/conversions/81EdgFXOWWL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 517, \"original\": \"https://api.click-games.fr/storage/467/71-6mb4Et8L._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/467/conversions/71-6mb4Et8L._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 518, \"original\": \"https://api.click-games.fr/storage/468/71GImi+KhfL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/468/conversions/71GImi+KhfL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 519, \"original\": \"https://api.click-games.fr/storage/469/71R2CYY5iiL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/469/conversions/71R2CYY5iiL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 520, \"original\": \"https://api.click-games.fr/storage/470/71MlQ6d7psL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/470/conversions/71MlQ6d7psL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 521, \"original\": \"https://api.click-games.fr/storage/471/716OmdRvSvL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/471/conversions/716OmdRvSvL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 522, \"original\": \"https://api.click-games.fr/storage/472/710qvASxCEL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/472/conversions/710qvASxCEL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 523, \"original\": \"https://api.click-games.fr/storage/473/51Qih43iPcL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/473/conversions/51Qih43iPcL._AC_-thumbnail.jpg\"}, {\"id\": 524, \"original\": \"https://api.click-games.fr/storage/474/61gtbAJfxEL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/474/conversions/61gtbAJfxEL._AC_SL1280_-thumbnail.jpg\"}]', NULL, '2022-02-02 18:33:38', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL);
