(25, NULL, 'Mario Party Superstars', 'mario-party-superstars', '<h3><strong>100 mini-jeux classiques tirés des épisodes sur Nintendo 64, Nintendo GameCube et bien plus !</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/4fe09466-7845-4266-9964-ced8f675aa89.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Cover\"></p><h3><strong>Cet automne la fête reprend dès le 29 octobre sur Nintendo Switch avec Mario Party Superstars !</strong></h3><p>Sortez vos plus beaux costumes pour jouer sur 5 plateaux classiques de l\'ère Nintendo 64. Faites la course aux étoiles sur le Gâteau d\'anniversaire de Peach issu du tout premier jeu Mario Party ou faites votre possible pour ne pas perdre toutes vos pièces dans la Station spatiale lorsque le compte à rebours du rayon de pièces de Bowser tombe à zéro. A chaque plateau son lot de surprises !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/b1309eef-5b4e-416f-a1e7-672ba2b65583.__CR440,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"2\"></p><h3><strong>Et du rebondissement il va y en avoir !</strong></h3><p>Grâce aux 100 mini-jeux issus de toute la série Mario Party !</p><p>Gagnez-les pour récolter le plus de pièces, acheter le plus d’étoiles possible et remporter la partie. A moins que ne vous souhaitiez juste vous entrainer en mode programme libre. Cette fois-ci tous les mini-jeux se jouent avec les boutons. Vous pouvez donc aussi bien utiliser une ou deux manettes Joy-Con, qu\'une manette Nintendo Switch Pro ou encore une Nintendo Switch Lite.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/b33b6e05-445a-4c8b-b9f2-d03548f4efe2.__CR420,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"1\"></p><h3><strong>La fête se savoure à plusieurs en local et même en ligne.</strong></h3><p>Tous les modes de jeu étant compatibles avec le jeu en ligne affrontez vos amis ou des adversaires du monde entier sur une poignée de mini-jeux au cours d\'une session rapide, ou encore dans un marathon qui s\'étale sur 30 tours ! Ou que vous soyez dans le monde, le goût de la victoire sera toujours aussi doux (et le vol d\'étoiles aussi savoureux !)</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/bc232cea-bed0-4bd6-bd28-a7e472d8af34.__CR391,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"3\"></p><h3><strong>100 mini-jeux classiques tirés des épisodes sur Nintendo 64, Nintendo GameCube et bien plus !</strong></h3><p>Plongez-vous dans une brillante collection de mini-jeux issus de toute la série Mario Party. Que vous soyez en train d\'engranger des pièces pour mettre la main sur encore plus d\'étoiles en mode jeu de plateau, ou simplement en train de vous entraîner en mode programme libre, vous pourrez goûter aux joies d\'être le dernier en lice dans Champi-couleurs ou Maskass a dit.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/b262e5fc-a353-4f1f-b318-5f25cf4b56aa.__CR420,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"4\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/d5c4b37c-06e5-46d7-9d62-67fbd630b214.__CR420,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"4\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/9ed0b9a5-1fd2-40d9-8501-af9ee2876e21.__CR420,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"6\"></th></tr></tbody></table></figure>', 1, 53.99, 31, 53.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000013', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 525, \"original\": \"https://api.click-games.fr/storage/475/81d4weAdkOS._AC_SL1405_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/475/conversions/81d4weAdkOS._AC_SL1405_-thumbnail.jpg\"}', '[{\"id\": 526, \"original\": \"https://api.click-games.fr/storage/476/810xgxvbAtS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/476/conversions/8