(26, NULL, 'Super Mario Party Switch', 'super-mario-party-switch', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/c60ac9ef-b884-4741-8632-2dbf007e591e.__CR0,0,970,300_PT0_SX970_V1___.jpg\" alt=\"1\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/c76a598c-b170-485f-807f-c10fc4e2962a.__CR0,0,970,300_PT0_SX970_V1___.jpg\" alt=\"1\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/5bc94060-8a7b-4905-ba42-07099bfdf9c9.__CR0,0,970,300_PT0_SX970_V1___.jpg\" alt=\"2\"></p>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000014', 35, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 534, \"original\": \"https://api.click-games.fr/storage/484/81LRUoay7uL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/484/conversions/81LRUoay7uL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 535, \"original\": \"https://api.click-games.fr/storage/485/81K9AYIC7oL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/485/conversions/81K9AYIC7oL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 536, \"original\": \"https://api.click-games.fr/storage/486/81xKzKjCCbL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/486/conversions/81xKzKjCCbL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 537, \"original\": \"https://api.click-games.fr/storage/487/81cNljdUCIL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/487/conversions/81cNljdUCIL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 538, \"original\": \"https://api.click-games.fr/storage/488/81LRUoay7uL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/488/conversions/81LRUoay7uL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 18:45:26', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(27, NULL, 'New Super Mario Bros. U Deluxe', 'new-super-mario-bros-u-deluxe', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/eadf117c-489b-4dfe-8b9a-7b8681b8ebd0.__CR0,56,926,926_PT0_SX300_V1___.jpg\" alt=\"1\"></p><h3><strong>New Super Mario Bros. U Deluxe</strong></h3><p>Mario, Luigi et Toad sont de la partie, mais ils sont également rejoints par Toadette et Carottin. Ce dernier ne subit pas de dommages lorsqu\'il touche des ennemis, c\'est donc un personnage idéal pour tous ceux qui trouvent que l\'action du jeu est un défi de taille et si Toadette prend une super couronne, elle se transforme en Peachette !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/6052b4a5-e017-4bb3-ad17-b3109e329202.__CR393,0,844,844_PT0_SX300_V1___.jpg\" alt=\"1\"></p><h3><strong>Super couronne :</strong></h3><p>cette amélioration exclusive est uniquement disponible si vous jouez avec Toadette. En l\'utilisant, Toadette se transforme en Peachette et peut désormais faire des double-sauts, planer dans les airs en retombant, et profiter d\'un boost pour s\'extirper des crevasses !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/e4c49c68-3463-4676-a0f3-2081ab73db39.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"1\"></p><p>Au fil de votre périple pour sauver la princesse, vous tomberez sur de nombreuses améliorations qui vous permettront de vous extirper des situations les plus périlleuses.</p>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000015', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 539, \"original\": \"https://api.click-games.fr/storage/489/81OUxIX0VZL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/489/conversions/81OUxIX0VZL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 540, \"original\": \"https://api.click-games.fr/storage/490/81OUxIX0VZL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/490/conversions/81OUxIX0VZL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 18:48:32', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(28, NULL, 'Super Mario Maker 2', 'super-mario-maker-2', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/16a217d7-4f2f-4fce-8a7c-d9c7ff41373c.__CR0,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"Screen1\"></p><h3><strong>Super Mario à L\'infini</strong></h3><p>Après un premier opus sur Wii U acclamé par la critique et les joueurs, Super Mario Maker 2 arrive sur Nintendo Switch avec plein de nouveautés, des modes coopératifs et un mode histoire !</p><p>Grâce à son éditeur de niveau, créez vos propres stages Super Mario, comme si vous étiez le développeur du jeu ! Choisissez parmi 5 univers Super Mario et disposez intuitivement blocs, ennemis farfelus ou plateformes en laissant libre cours à votre imagination. Votre niveau est fini ? Faites-le essayer à vos proches ou partagez-le aux joueurs du monde entier avec le Nintendo Switch Online. Si vous aimez les défis, profitez de plus de 100 stages inédits du mode Histoire, ou testez une infinité de niveaux créés par la communauté de joueurs*. Il y en a pour tous les goûts et pour tous les niveaux, c’est ça l’esprit Super Mario Maker !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a2a64234-0fad-4d2f-91f4-dde0afce366c.__CR482,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"Screen 2\"></p><h3><strong>L’architecte des niveaux de Super Mario…c’est vous!</strong></h3><p>Construisez le Mario de vos rêves !</p><p>Créez vos propres niveaux grâce à une interface graphique revisitée et intuitive : d’un simple mouvement, disposez sur la grille d’édition, le sol, les plateformes et… autant d’éléments que vous voulez. Blocs, tuyaux, ennemis déjantés, interrupteurs… à vous de casser les codes ! Piéger un bloc avec un Goomba caché à l’intérieur ? C’est possible ! Construisez un niveau pour vous ou pour vos proches, testez-le et faites-le découvrir au monde entier, sur votre TV, ou du bout du doigt sur l’écran tactile de la Nintendo Switch en mode portable ! Vous avez la possibilité d’alterner entre 5 univers Super Mario différents, avec leurs propres styles graphiques ; et retrouvez notamment les éléments du jeu Super Mario 3D World ! À vous le costume de Mario-chat ou le kart de Koopa !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/1d4648b6-a53d-4925-9fe9-4d453c2e715b.__CR5,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"Screen 3\"></p><p>Besoin d’aide sur le chantier ? Tendez un Joy-con à un 2nd joueur pour qu’il puisse vous aider sur vos constructions, à deux sur un même écran en mode sur table ou sur votre télévision !</p><p>De nouveaux éléments viennent enrichir les possibilités de conception ! Des pentes, des niveaux verticaux, le réglage du niveau de la lave ou de l’eau, ou encore la possibilité d’instaurer des nouvelles conditions pour finir votre niveau, tous ces éléments ont été ajoutés dans ce deuxième opus, à vous d’ajuster la complexité de votre création !</p><p>Les Toads maladroits ont « effacé » le château de Peach et ont besoin de votre aide !</p><p>Vous vous sentez plus aventurier que constructeur ? Alors plongez dans une nouvelle quête Super Mario Bros. Traversez les thèmes originaux des 5 univers Super Mario dans plus de 100 stages plein d’aventures, finissez-les et remportez le maximum de pièces pour participer à la reconstruction du château de Peach !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/13eec30d-fd70-49ff-85c8-6aef52c93791.__CR663,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"Screen 6\"></p><h3><strong>En solo, entre amis ou en famille, rejoignez la communauté de Super Mario Maker 2 grâce au Nintendo Switch Online*</strong></h3><p>Joueur ou constructeur, vous trouverez votre bonheur !</p><p>Partagez en ligne vos niveaux, vous serez référencé en tant que créateur, la communauté pourra les essayer et les évaluer. Côté joueur, rien de plus simple : téléchargez gratuitement une infinité de niveaux, essayez-les en local et suivez l’activité de vos créateurs favoris. Vous pouvez aussi tester votre adresse dans des speedrun endiablés en solo ou contre 3 autres joueurs en ligne !</p><p>Un multijoueur qui casse des briques ! En ligne, vous avez la possibilité de parcourir les niveaux du monde entier à plusieurs ! Plutôt collaboration ou course sans pitié ?</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/0fd60bf3-583e-4ecb-9028-7b95604d1af0.__CR764,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"Screen 5\"></p><p>&nbsp;</p><ul><li>Plateforme : Nintendo Switch</li><li>Genre : Jeu de plateformes / Éditeur de jeu de plateformes</li><li>Nombre de joueurs : 1 à 4 joueurs (en local, multi en ligne*)</li><li>Date de sortie : 28 Juin</li><li>PEGI : 3</li><li>Développeur : Nintendo</li><li>Editeur : Nintendo</li></ul><p>&nbsp;</p><p>&nbsp;</p>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000016', 39, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 541, \"original\": \"https://api.click-games.fr/storage/491/81mytYbi6KL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/491/conversions/81mytYbi6KL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 542, \"original\": \"https://api.click-games.fr/storage/492/71cecFxbU6L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/492/conversions/71cecFxbU6L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 543, \"original\": \"https://api.click-games.fr/storage/493/716DKs+tt-L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/493/conversions/716DKs+tt-L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 544, \"original\": \"https://api.click-games.fr/storage/494/71iZ6trreRL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/494/conversions/71iZ6trreRL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 545, \"original\": \"https://api.click-games.fr/storage/495/81fEAjzn25L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/495/conversions/81fEAjzn25L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 546, \"original\": \"https://api.click-games.fr/storage/496/71ebx7E+m7L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/496/conversions/71ebx7E+m7L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 547, \"original\": \"https://api.click-games.fr/storage/497/71qYHMo4fAL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/497/conversions/71qYHMo4fAL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 548, \"original\": \"https://api.click-games.fr/storage/498/711USo0veDL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/498/conversions/711USo0veDL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 549, \"original\": \"https://api.click-games.fr/storage/499/71mWSAit6dL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/499/conversions/71mWSAit6dL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 550, \"original\": \"https://api.click-games.fr/storage/500/81mytYbi6KL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/500/conversions/81mytYbi6KL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 18:53:27', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(29, NULL, 'SUPER MARIO 3D - ALL STARS', 'super-mario-3d-all-stars', '<h3><strong>Super Mario 3D All-Stars</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/1ff1bbde-4a68-49b2-8f12-d6fec9dc2b63.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\" \"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/2095a76d-5cae-4782-8d20-bad6710b0d9c.__CR0,0,300,300_PT0_SX300_V1___.png\" alt=\" \"></p><h3><strong>Trois grands jeux réunis dans une collection unique !</strong></h3><p>Découvrez trois des plus grandes aventures de Mario en 3D dans Super Mario 3D All-Stars sur Nintendo Switch ! Cette collection exceptionnelle réunit Super Mario 64, Super Mario Sunshine et Super Mario Galaxy dans des versions optimisées pour Nintendo Switch incluant des graphismes en haute-définition, des contrôles au Joy-Con ainsi que les généreuses bandes-son de ces trois grands classiques !</p><h3><strong>Super Mario 3D All-Stars</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/9b459c9b-1b84-4640-adbf-84ee16081eb7.__CR0,0,300,300_PT0_SX300_V1___.png\" alt=\" \"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/6b70e431-971d-4de1-977b-41e7faf91ad9.__CR0,0,300,300_PT0_SX300_V1___.png\" alt=\" \"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/13dce976-711a-41d0-8ccc-704126fbf0f2.__CR0,0,300,300_PT0_SX300_V1___.png\" alt=\" \"></th></tr><tr><th><h4>Le jeu de plateformes prend une nouvelle dimension</h4><p>Mario 64 marque le début des aventures de Mario en 3D ainsi que l\'arrivée d\'un système de contrôle qui est aujourd\'hui devenu intemporel. Utilisez les nombreuses techniques de Mario pour courir, sauter ou même voler à travers les mondes que renferment les tableaux du château de la princesse Peach, et partez à la recherche des super étoiles pour contrecarrer les plans de Bowser !</p></th><th><h4>Y a du soleil et des tracas</h4><p>Même les héros ont droit à un peu de repos ! Mario est parti pour l\'île Delfino afin de prendre quelques vacances bien méritées en compagnie de ses amis, mais en lieu et place du farniente tant attendu, notre pauvre plombier va se retrouver accusé à tort d\'un terrible délit ! Avec l\'aide de son nouvel acolyte J.E.T., Mario va devoir laver l\'île (ainsi que son honneur) en se servant de nouvelles commandes qui font la part belle à la pression hydraulique.</p></th><th><h4>Une épopée qui va vous mettre sens dessus dessous</h4><p>Mario décolle pour une aventure intergalactique pour aider Harmonie et sauver la princesse Peach des terribles griffes de Bowser. Défiez la gravité et élancez-vous de planète en planète grâce aux commandes par mouvements optionnelles, ou passez un Joy-Con à un ami pour vivre cette aventure en duo !</p></th></tr></tbody></table></figure>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000017', 17, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 551, \"original\": \"https://api.click-games.fr/storage/501/81tkL0RYLQL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/501/conversions/81tkL0RYLQL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 552, \"original\": \"https://api.click-games.fr/storage/502/81tkL0RYLQL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/502/conversions/81tkL0RYLQL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 18:55:46', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(30, NULL, 'Luigi\'s Mansion 3', 'luigi-s-mansion-3', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/04876442-338e-48c5-b673-9b868ebe6aaa.__CR0,161,960,288_PT0_SX600_V1___.jpg\" alt=\"L1\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/5fa2edb6-a4e2-4fbc-b26c-ebc556c58f0e.__CR341,0,1080,1080_PT0_SX300_V1___.png\" alt=\"S1\"></p><h3><strong>La chasse aux fantômes reprend !</strong></h3><p>Le plus courageux des froussards est de retour dans la suite d’un des plus grands succès de la Nintendo 3DS, avec Luigi’s Mansion 3 !</p><p>Après avoir reçu une invitation à séjourner dans un hôtel luxueux, Luigi se prépare à passer des vacances idylliques avec Mario et ses amis. Le rêve tourne rapidement au cauchemar lorsque le Roi Boo révèle que tout cela n\'était qu\'un stratagème pour capturer Mario et ses compagnons ! Une nouvelle fois assisté du farfelu professeur K. Tastroff, c’est au plus trouillard des téméraires de s\'aventurer dans l’exploration d’un hôtel qui n’a rien d’une destination idéale…</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/b4e6c87c-a943-4659-bf42-d7d2adfd5d48.__CR597,0,1080,1080_PT0_SX300_V1___.png\" alt=\"SS1\"></p><p>Incarnez Luigi et partez à la chasse aux fantômes avec votre aspirateur à spectres : l’Ectoblast GL-U ! Pour la première fois, faites aussi appel à Gluigi, un double de Luigi vert et gluant, pour vous aider à franchir les obstacles insurmontables tout seul. Jouez en solo, en alternant entre Luigi et Gluigi pour résoudre les énigmes, ou en coopération et contrôlez chacun un personnage. En famille ou entre amis, jouez jusqu’à 8 joueurs et tentez de résoudre les missions de la Tour Hantée !</p><p>La chasse aux fantômes reprend de plus belle dans Luigi’s Mansion 3, exclusivement sur Nintendo Switch et Nintendo Switch Lite !</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/4b68014e-3da7-4734-8c4c-f9b23e9e44ca.__CR469,0,1080,1080_PT0_SX220_V1___.png\" alt=\"S1\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/be548234-25e0-40e7-a9d6-c934c63bdd19.__CR165,0,1080,1080_PT0_SX220_V1___.png\" alt=\"S2\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/6ebb1a51-64ef-46ce-8e84-e56850d95c96.__CR121,0,1080,1080_PT0_SX220_V1___.png\" alt=\"S3\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/3c40ba16-6ab5-4d8e-95b4-11cbdb6a30f9.__CR371,0,1080,1080_PT0_SX220_V1___.png\" alt=\"S6\"></th></tr><tr><th><h4>Bienvenue à l\'hôtel du Repos Éternel !</h4><p>Explorez cet hôtel peu rassurant et ses étages thématiques pour sauver vos amis du Roi Boo. Les fantômes ont plus d’un tour dans leur sac et l’hôtel regorge de mécanismes bizarres, d’objets cachés et d\'apparitions… terrifiantes</p></th><th><h4>Plus froussard que jamais, mais bien équipé !</h4><p>Incarnez Luigi et partez à la recherche de fantômes dans les différentes salles de l’hôtel hanté</p><p>-Explorez et fouillez les différentes salles pour attraper des fantômes. Aspirez un ennemi avec votre Ectoblast GL-U pour le capturer et le neutraliser</p><p>-On vous attaque ? Défendez-vous en attrapant un fantôme et utilisez-le comme une arme pour attaquer les autres fantômes !</p><p>-Un objet vous barre la route ? Utilisez votre Lance-ventouses pour l’agripper et le déplacer !</p><p>-Trop d’ennemis autour de vous ? Libérez votre bourrasque pour effrayer les spectres !</p></th><th><h4>Qu’est ce qui est plus fort qu’un Luigi ? Deux Luigi !</h4><p>Faites équipe avec la dernière invention de l’ingénieux Professeur K. Tastroff, Gluigi, un double de Luigi !</p><p>-Dans votre chasse en solitaire, alternez entre Luigi et Gluigi pour résoudre les énigmes qui se dressent devant vous ! Utilisez ses capacités uniques pour passer à travers les barreaux, marcher sur des pics… mais attention, ce Luigi gluant ne supporte pas l’eau !</p><p>-Un deuxième joueur rejoint l’aventure ? Combinez le talent des deux personnages : utilisez chacun un JoyCon pour contrôler Luigi et Gluigi, en même temps, afin de débusquer ensemble ces farceurs de fantômes !</p></th><th><h4>Un mode multijoueur spectr’aculaire !</h4><p>Lancez-vous dans les défis de la Tour Hantée, jusqu’à 8 joueurs, en local* ou en ligne** ! Montez d’étage en étage après chaque nouveau jeu, et remplissez des objectifs toujours plus farfelus ! Quel sera votre prochain défi ? Eliminer tous les fantômes avant la fin du temps imparti ? Retrouver tous les Toad disparus ?</p><p>Collectionneur en herbe, à vos aspirateurs ! Débusquez les éléments cachés dans le décor pour finir le jeu à 100% ! Fouillez, aspirez, déplacez et vous serez récompensé !</p></th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/09d90eed-f6b1-47df-aa10-a520c7563f05.__CR0,0,4096,4096_PT0_SX300_V1___.jpg\" alt=\"s1\"></p><h3><strong>LUIGI</strong></h3><p>Aidé de l’Ectoblat GL-U, cet éternel froussard brave sa peur pour capturer les fantômes… et sauver ses amis !</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 64.99, 31, 64.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000018', -1, 1, 0, NULL, NULL, NULL, 'draft', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 553, \"original\": \"https://api.click-games.fr/storage/503/81Q4gUeNi-L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/503/conversions/81Q4gUeNi-L._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 554, \"original\": \"https://api.click-games.fr/storage/504/71z6xTYfH3L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/504/conversions/71z6xTYfH3L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 555, \"original\": \"https://api.click-games.fr/storage/505/71kMwTS8M1L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/505/conversions/71kMwTS8M1L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 556, \"original\": \"https://api.click-games.fr/storage/506/71dvUBnQMrL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/506/conversions/71dvUBnQMrL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 557, \"original\": \"https://api.click-games.fr/storage/507/712MctUij5L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/507/conversions/712MctUij5L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 558, \"original\": \"https://api.click-games.fr/storage/508/71eGf+c5jCL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/508/conversions/71eGf+c5jCL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 559, \"original\": \"https://api.click-games.fr/storage/509/618GSM7UThL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/509/conversions/618GSM7UThL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 560, \"original\": \"https://api.click-games.fr/storage/510/81pgC4Tl32L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/510/conversions/81pgC4Tl32L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 561, \"original\": \"https://api.click-games.fr/storage/511/81Q4gUeNi-L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/511/conversions/81Q4gUeNi-L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 562, \"original\": \"https://api.click-games.fr/storage/512/417kMeegiqL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/512/conversions/417kMeegiqL._AC_-thumbnail.jpg\"}, {\"id\": 563, \"original\": \"https://api.click-games.fr/storage/513/81N7YJAAYRL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/513/conversions/81N7YJAAYRL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 564, \"original\": \"https://api.click-games.fr/storage/514/61F5ca3boML._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/514/conversions/61F5ca3boML._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 565, \"original\": \"https://api.click-games.fr/storage/515/61E9V9CH-5L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/515/conversions/61E9V9CH-5L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 566, \"original\": \"https://api.click-games.fr/storage/516/715r2L6XXrL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/516/conversions/715r2L6XXrL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 567, \"original\": \"https://api.click-games.fr/storage/517/71SX17IMFQL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/517/conversions/71SX17IMFQL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 568, \"original\": \"https://api.click-games.fr/storage/518/71jKQ2V98tL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/518/conversions/71jKQ2V98tL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 569, \"original\": \"https://api.click-games.fr/storage/519/71uC7fg0O+L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/519/conversions/71uC7fg0O+L._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 18:59:19', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(31, NULL, 'Hyrule Warriors - L\'ère du Fléau', 'hyrule-warriors-l-ere-du-fleau', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/cd78266e-05c4-4a8c-b1c5-651f78c908c5.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Logo\"></p><h3><strong>Découvrez comment tout a basculé…</strong></h3><p>Un siècle avant les événements de The Legend of Zelda : Breath of the Wild, le Grand Fléau a frappé Hyrule, défigurant le royaume et plongeant ce dernier dans les ténèbres. Hyrule Warriors : L’Ère du Fléau propose aux joueurs de vivre pour la première fois les batailles épiques de cette période intense dans un jeu d’action au rythme effréné ! En plus de Link, incarnez de nombreux personnages comme la Princesse Zelda ou les quatre Prodiges et découvrez sous un nouvel angle les relations entre les différents protagonistes croisés 100 ans plus tard dans The Legend of Zelda : Breath of the Wild ! Réussirez-vous à lever le voile sur cette sombre période d’Hyrule ?</p><p>Hyrule Warriors : L’Ère du Fléau sera disponible en exclusivité sur Nintendo Switch et Nintendo Switch Lite le 20 novembre !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/f9380e8f-ec6a-4da8-99d8-bb66b98916b1.__CR445,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"screen1\"></p><h3><strong>Découvrez les origines d’un jeu mythique !</strong></h3><p>Dans Hyrule Warriors : L’Ère du Fléau, vous êtes transportés avant la chute du royaume… soit 100 ans avant le réveil de Link dans The Legend of Zelda : Breath of the Wild. Dans ce jeu, les monstres ralliés au Fléau Ganon menacent Hyrule ! La Princesse Zelda, aux côtés d’un soldat courageux dénommé Link, part pour une aventure à travers le royaume afin d’alerter les habitants, repousser les vagues d’assauts et rencontrer ceux que nous connaîtrons plus tard sous le nom de… Prodiges.</p><h3><strong>Un casting 5 étoiles à maîtriser !</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a8ba4eaf-4d25-406a-b298-da323e4dc42f.__CR518,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"screen 2\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/f3e674f3-395a-49e9-a8d2-5eda44cf3cf4.__CR415,0,1080,1080_PT0_SX300_V1___.png\" alt=\"screen 3\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/98b469fa-4c34-4d53-80cf-05e1c73e88a1.__CR724,0,1080,1080_PT0_SX300_V1___.png\" alt=\"screen 4\"></th></tr><tr><th>Au cours de chaque mission, votre équipe sera composée de plusieurs personnages selon votre avancée dans le scénario. Vous pourrez maîtriser entre autres les quatre Prodiges (Mipha, Daruk, Revali et Urbosa), la jeune et fringante Impa ou encore la scientifique Pru’Ha, et passer de l’un à l’autre selon votre envie et vos besoins au combat.</th><th>Chaque personnage, équipé d’une arme ou doté de pouvoirs magiques, peut attaquer avec des coups simples, réaliser des combos et ralentir le temps lors d’une esquive réussie. Ils peuvent même utiliser les modules de la tablette Sheikah : figez vos ennemis avec Cinetis, protégez-vous avec les blocs de glace de Cryonis ou envoyez des bombes sur des ennemis groupés ! Enfin, chaque héros a une capacité signature : Link possède son arc dévastateur, Mipha surfe sur des vagues au-dessus du champ de bataille et Impa peut générer des clones offensifs en plein combat !</th><th>Faites progresser vos personnages préférés : chaque mission vous offre l’occasion de glaner des objets et matériaux pour créer des équipements adaptés à votre façon de jouer. Par exemple, vous pouvez opter pour une tenue furtive pour le personnage d’Urbosa afin d’augmenter sa discrétion. Choisissez un héros comme personnage principal lors de vos missions pour monter son niveau et renforcer sa puissance !</th></tr></tbody></table></figure><h3><strong>Venez à bout de vos ennemis dans diverses missions !</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/57cbd64d-55b8-438b-ac06-02ff97b97323.__CR287,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"s\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/8d57c4ff-9729-45d4-955f-2b44c15d6cf4.__CR238,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"ss\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/af52f5a2-3b10-4c4e-b928-f4f957310f89.__CR724,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"sss\"></th></tr><tr><th><h4>Eliminer des hordes d’ennemis</h4><p>Comme dans un jeu Hyrule Warriors, dans une vue à la troisième personne.</p><p>Chaque chapitre du mode Histoire vous transporte dans un environnement familier de The Legend of Zelda : Breath of The Wildcomme la plaine d’Hyrule, le Domaine Zora ou encore la Montagne de la Mort. Lancé dans une zone définie avec vos alliés, vous avez un ensemble d’objectifs à réaliser (par exemple, « Reprendre le contrôle des Ruines de l’Autel »). Plongez au cœur de la bataille pour terrasser vos ennemis et reconquérir votre territoire !</p></th><th><h4>Tout au long de la mission</h4><p>vous avez une maîtrise stratégique de la carte avec la visibilité sur le positionnement de vos ennemis, les points clés à tenir et les héros de votre équipe. Vous pouvez assigner des tâches aux personnages que vous ne maitrisez pas directement pour réaliser vos objectifs plus rapidement. Pendant et à la fin de chaque mission, des cinématiques intenses viennent ponctuer vos combats et vous faire progresser dans le fil narratif. Une mission se clôt généralement par un combat de boss, comme un Lynel qui vous charge par exemple !</p><p>Il existe également des objectifs parallèles à la mission principale comme « Défaire 300 Bokoblins » qui vous rapporteront des trophées et bonus si vous les atteignez !</p></th><th><h4>Profitez d’un doublage français intégral</h4><p>Vous êtes nostalgique de la voix française extrêmement touchante de la Princesse Zelda ou encore de la voix rauque et énergique de Daruk ? Tous les comédiens du jeu original The Legend of Zelda : Breath of the Wild sont de retour pour incarner les héros iconiques et certains personnages ont aussi bénéficié du doublage français comme Pru’ha ou le Grand Kohga par exemple !</p></th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/28965464-1a1e-4616-a3de-f0734a1221a3.__CR283,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"ssss\"></p><h3><strong>Jouez à deux pour la première fois dans l’univers de The Legend of Zelda : Breath of Wild !</strong></h3><p>· Vivez cette aventure à deux en local sur une même cartouche de jeu avec les modes Histoire et Défis ! Chacun peut choisir son personnage en début de mission et combattre les hordes de Ganon sur l’écran séparé à l’horizontal.</p>', 1, 53.99, 31, 53.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000019', 18, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 570, \"original\": \"https://api.click-games.fr/storage/520/71oYVaoI8iL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/520/conversions/71oYVaoI8iL._AC_SL1000_-thumbnail.jpg\"}', '[{\"id\": 571, \"original\": \"https://api.click-games.fr/storage/521/71kOEDtyxDL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/521/conversions/71kOEDtyxDL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 572, \"original\": \"https://api.click-games.fr/storage/522/71FDtXGo00L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/522/conversions/71FDtXGo00L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 573, \"original\": \"https://api.click-games.fr/storage/523/71oYVaoI8iL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/523/conversions/71oYVaoI8iL._AC_SL1000_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:04:24', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(32, NULL, 'Sonic Colours Ultimate', 'sonic-colours-ultimate', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/ec92c9a2-794f-45aa-a8a8-5171d9694218.__CR0,0,970,300_PT0_SX970_V1___.jpg\" alt=\"Sonic 1\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/53da13bc-67fb-4dbf-bc52-47ccb746d38f.__CR0,0,970,300_PT0_SX970_V1___.jpg\" alt=\"Sonic 2\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/1cdc8f25-e0bc-442e-961b-c206f25d9c96.__CR0,0,970,300_PT0_SX970_V1___.jpg\" alt=\"Sonic 3\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/4edbf9b9-b03c-442a-832b-2a7c7f0e077b.__CR0,0,970,300_PT0_SX970_V1___.jpg\" alt=\"Sonic 4\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/10d4b4e7-0533-4e85-82a0-58ddace94f6d.__CR0,0,970,300_PT0_SX970_V1___.jpg\" alt=\"Sonic 5\"></p><p>&nbsp;</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 49.99, 31, 49.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000020', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 574, \"original\": \"https://api.click-games.fr/storage/524/814zKoX9bLS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/524/conversions/814zKoX9bLS._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 575, \"original\": \"https://api.click-games.fr/storage/525/81MEusouz+S._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/525/conversions/81MEusouz+S._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 576, \"original\": \"https://api.click-games.fr/storage/526/71WITC8JfPS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/526/conversions/71WITC8JfPS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 577, \"original\": \"https://api.click-games.fr/storage/527/81tCWNy2IaS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/527/conversions/81tCWNy2IaS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 578, \"original\": \"https://api.click-games.fr/storage/528/81HZfYicpXS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/528/conversions/81HZfYicpXS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 579, \"original\": \"https://api.click-games.fr/storage/529/91tuqCsYXgS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/529/conversions/91tuqCsYXgS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 580, \"original\": \"https://api.click-games.fr/storage/530/81nWge3pHAS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/530/conversions/81nWge3pHAS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 581, \"original\": \"https://api.click-games.fr/storage/531/814zKoX9bLS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/531/conversions/814zKoX9bLS._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:06:45', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(33, NULL, 'Donkey Kong Country: Tropical Freeze', 'donkey-kong-country-tropical-freeze', '<p>&nbsp;<br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/032db6ea-338c-4cef-aff2-bd60c22d6d7d._SR300,300_.jpg\" alt=\"\"></p><h3><strong>Les Kong n\'ont pas froid aux yeux !</strong></h3><p>Les singes les plus célèbres du jeu vidéo sont de retour sur Nintendo Switch ! Dans ce jeu de plateformes, une armée de Vikings de tout poil a décidé de jeter un froid sur l\'île de Donkey Kong, Dixie Kong et le grand-père de la tribu, Cranky Kong. Et mettez-vous dans la peau du singe-surfeur Funky Kong ! Avec sa planche de surf et son bandana, il a vraiment la banane ! Grâce au nouveau mode de jeu, le Funky Mode, vous pouvez parcourir les niveaux comme vous le souhaitez. Utilisez les capacités de Funky Kong pour surmonter les obstacles avec plus de facilité et profitez de l\'aventure à votre rythme. Préparez-vous à nager, à vous balancer, et à bondir à travers des niveaux remplis d\'épreuves, de bonus et de boss à affronter ! Servez-vous des techniques uniques de chaque personnage pour explorer six mondes différents dans leurs moindres recoins. Sous un soleil de plomb ou les pattes dans la neige, sur terre comme sur mer, il faudra redoubler d\'ingéniosité pour dégeler les situations les plus compliquées.</p><h3><strong>Présentation</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/f503f37f-94ed-4f88-86f1-0313a1096619._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/6adea4fa-ac62-4071-a480-be03bad6036e._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/22956f74-ee18-4c18-a742-7b87f7154600._SL300__.JPG\" alt=\"\"></th></tr><tr><th><h4>Cinq Kong à incarner !</h4><p>En plus de pouvoir jouer avec Donkey Kong et toute sa joyeuse bande, enfilez vos lunettes de soleil et surfez sur vos ennemis grâce à Funky Kong ! Ce sacré personnage dispose de techniques bien à lui. Grâce à sa planche de surf, il peut planer dans les airs pour éviter les obstacles, atterrir dans des pièges sans encombre, et enchaîner d\'impressionnantes roulades et double-sauts. Ce singe possède une sacrée personnalité, et en tant qu\'adepte de la vague, il peut aussi retenir sa respiration et faire des vrilles sous l\'eau. Chaque personnage jouable possède son propre style et son utilité, alors essayez-les tous et combinez-les pour explorer de fond en comble ce jeu de plateforme coloré !</p></th><th><h4>Repoussez l\'invasion des Givrés des mers du Nord!</h4><p>Alors que vous étiez tranquillement en train de déguster votre régime quotidien de bananes, voilà qu\'une bande de Vikings débarque pour gâcher votre repas ! Combattez l\'envahisseur et récupérez vos précieuses bananes. Attaques Rodéo, sauts de barils et courses de wagonnet... Toutes les épreuves qui ont rendu la franchise Donkey Kong mythique sont toujours bien présentes !</p></th><th>&nbsp;</th></tr></tbody></table></figure><h3><strong>Plus on est de Kong, plus on rit !</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/6470b5bc-4bc8-4047-9dcd-0b71bcc23c3d._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/6d9e5679-cdfd-4902-8257-d55cc262d1fe._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/7d4a772e-9474-4db0-8ded-fae2a5e62263._SL300__.JPG\" alt=\"\"></th></tr><tr><th><h4>Jouez à deux en partageant vos Joy-Con</h4><p>et relevez le défi en duo en mode Classique ou en mode Funky.</p><p>Incarnez ensemble les singes de votre choix pour une double dose d\'attaques délirantes et de bananes. Comparez votre score avec d\'autres joueurs et essayez de battre votre record !</p></th><th><h4>Grâce à la Nintendo Switch, jouez où vous voulez et comme vous voulez</h4><p>Commencez une partie en mode TV dans votre salon et emmenez le soleil avec vous grâce au mode portable !</p></th><th>&nbsp;</th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/7444da44-6a16-43d5-a994-99c10eec1c40._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/2ba74ca1-a214-4921-8152-5182305db8f3._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/89eb8598-1a22-4d13-9108-b043a784a4ad._SL300__.JPG\" alt=\"\"></th></tr><tr><th><h4>Sous le soleil des tropiques glacés !</h4><p>Parcourez des mondes variés : Environnements sous-marins, paysages gelés, plages de sable fin.Récupérez les lettres K-O-N-G, débloquez des zones secrètes et récupérez pleins de bonus ! Restant fidèle à l\'esprit du jeu original, jouez jusqu\'en 1080p en mode TV pour admirer au maximum ces paysages de rêve sur fond de musique \"funky\" typique de l\'univers Donkey Kong.</p></th><th><h4>Détendez-vous avec le Funky Mode</h4><p>En plus du mode classique;, l\'ajout du Funky mode sur Nintendo Switch vous permet désormais de profiter de l\'aventure à votre rythme. Plus accessible, Funky Kong est un dur à cuire, et il vous permet d\'avancer plus facilement dans les niveaux ! Certaines fonctionnalités sont aussi disponibles, comme la possibilité de passer un niveau s\'il vous semble trop difficile. Que vous soyez à la recherche d\'un meilleur chrono ou que vous vouliez juste terminer les niveaux l\'esprit tranquille, il existe toujours un mode à votre goût !</p></th><th>&nbsp;</th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th>&nbsp;</th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d01d5a77-a05a-4285-9d2f-f8ba7610aa47._SR150,300_.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/4de81024-48a4-40a0-ace3-606a7734d1fc._SR150,300_.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/085382d6-fced-4be5-b34d-35a018ef01f4._SR150,300_.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/7ae23f15-852c-45d0-9447-affa5608e20e._SR150,300_.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/f83f7f3a-b82d-4385-802e-090b0ec263d2._SR150,300_.jpg\" alt=\"\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr><tr><th>Personnages</th><th>Donkey Kong</th><th>Funky Kong</th><th>Diddy King</th><th>Cranky Kong</th><th>Dixie Kong</th></tr><tr><th>&nbsp;</th><th>Le plus célèbre des gorilles. Avec sa cravate rouge, c\'est un personnage iconique de Nintendo. Aidez-le à récupérer ses bananes !</th><th>Le plus cool des Kong ! Il ne quitte jamais ses lunettes de soleil et sa planche de surf.</th><th>Le meilleur ami de Donkey Kong. Sa petite taille lui permet d\'être plus rapide et de sauter plus haut. Il peut utiliser un jetpack pour planer et un pistolet à cacahuètes pour étourdir les ennemis. Pratique !</th><th>Patriarche de la tribu, toujours prêt à utiliser sa canne pour sauter par-dessus les plateformes et les ennemis. En vieux sage, il pense que les jeux vidéo étaient plus difficiles avant</th><th>La copine de Diddy. Elle peut utiliser ses longs cheveux pour sauter plus haut que n\'importe quel Kong et les faire tourbillonner pour se débarrasser des ennemis.</th></tr></tbody></table></figure>', 1, 55.99, 31, 55.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000021', 19, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 582, \"original\": \"https://api.click-games.fr/storage/532/91GQSDUyPxL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/532/conversions/91GQSDUyPxL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 583, \"original\": \"https://api.click-games.fr/storage/533/91GQSDUyPxL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/533/conversions/91GQSDUyPxL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:09:02', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL);
