(34, NULL, 'KIRBY STAR ALLIES', 'kirby-star-allies', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/b5699f1b-c00e-4226-ab6f-8cbcbb41ef88._SR300,300_.jpg\" alt=\"\"></p><h3><strong>Unissez vos pouvoirs pour vaincre les ténèbres !</strong></h3><p>Retrouvez Kirby dans sa toute première aventure sur Nintendo Switch ! Alors que notre boule rose préférée fait tranquillement sa sieste, un déluge de coeurs sombres s\'abat sur Dream Land, transformant tous ses habitants en terrifiants méchants ! Devant le danger, à vous de recruter de nouveaux compagnons pour sauver le royaume.</p><p>Quand vos ennemis deviennent vos alliés : En plus de pouvoir copier de multiples aptitudes différentes en avalant ses ennemis, Kirby peut maintenant devenir amis avec eux pour associer Plusieurs pouvoirs en même temps ! A chaque pouvoir, son utilité : Faites fondre la glace avec le feu, actionnez des mécanismes avec de l\'électricité, et plus encore. Cultivez votre esprit d\'équipe pour surpasser les obstacles sur votre route.</p><p>Et si vous partagiez l\'aventure avec vos proches ? Créez votre propre équipe en mode local jusqu\'à quatre joueurs et utilisez des pouvoirs complémentaires pour débloquer les différents niveaux !</p><p>Serrez-vous les coudes (même petits et roses) dès le 16 mars avec Kirby Star Allies en exclusivité sur Nintendo Switch.</p><h3><strong>Formez une équipe de choc pour sauver Dream Land !</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/bad50c49-4817-4e37-95f1-dcbd1f88f630._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d36684c9-8a75-4223-bd8a-54b8c81549d9._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/06f79eab-9900-48b2-a0a6-d5f4d77badcc._SL300__.JPG\" alt=\"\"></th></tr><tr><th><h4>Recrutez jusqu\'à trois alliés aux compétences uniques et complémentaires</h4><p>Et surmontez toutes les épreuves ensemble. De l\'eau vous empêche de passer ? Engagez un ennemi avec la compétence Parapluie. Vous avez plutôt besoin d\'un peu de muscles contre un ennemi coriace ? Combattez aux côtés de Bio Spark et sa compétence Ninja ! A chaque problème sa solution.</p></th><th><h4>Une ribambelle de pouvoirs à combiner</h4><p>Mêlez l\'eau et le feu pour créer de dangereux stalactites géants, fusionnez bombe et vent pour créer une bombe volante et tout détruire sur votre passage. A vous d\'associer judicieusement les pouvoirs de votre équipiers afin de lancer de puissantes attaques combinées, résoudre des énigmes diaboliques et même découvrir des zones secrètes bien cachées.</p></th><th><h4>Inédit : Maîtrisez les nouveaux pouvoirs de Kirby</h4><p>Comme la capacité Araignée, qui vous permet d\'emprisonner l\'adversaire dans votre toile !</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/f7b46158-3bd8-4939-8d09-d4ed7dd27287._SL300__.JPG\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/2e33e2e6-995e-47c2-8ea6-88739f56b966._SL300__.png\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/9f3de8ed-a51c-4c37-af4f-618093d5daab._SL300__.JPG\" alt=\"\"></th></tr><tr><th><h4>Pour sa première sur Nintendo Switch, Kirby met le paquet sur la plateforme !</h4><p>Explorez tous les recoins de Dream Land et parcourez les nombreux niveaux pour sauver la situation de la mystérieuse force venue de l\'espace attention aux ennemis qui rôdent sur le chemin. Fouillez bien chaque recoin pour découvrir des bonus et autres passages secrets !</p></th><th><h4>Une aventure accessible jusqu\'à quatre en mode local !</h4><p>En plus du mode solo, vous avez la possibilité de faire toute l\'aventure en mode coopératif avec jusqu\'à 3 de vos proches. Unissez vos forces et entraidez-vous pour avancer dans les niveaux ! Un gouffre vous sépare de la sortie ? Formez un pont vivant avec les membres de votre équipe pour traverser !</p></th><th><h4>Profitez de Kirby Star Allies comme bon vous semble</h4><p>Grâce aux possibilités de la Nintendo Switch, à tout moment, rejoignez une partie en cours ! Partagez votre paire de Joy-Con en mode table ou contrôlez Kirby avec votre manette pro en mode TV. De multiples façons de jouer en famille ou entre amis !</p></th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/12e59409-6365-483c-8729-f75c7ee9d667._SL300__.jpg\" alt=\"\"></p><h3><strong>Kirby</strong></h3><p>Notre héros Kirby est une adorable boule rose qui possède des capacités extraordinaires : Il peut avaler ses ennemis pour imiter leurs pouvoirs, voler dans les airs en se remplissant d\'air. Et désormais, lancer un coeur rose pour recruter ses anciens ennemis !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/12e59409-6365-483c-8729-f75c7ee9d667._SL300__.jpg\" alt=\"\"></p><p>Kirby</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/67f0e7c5-3003-4c81-b900-fb6ce466cb33._SL300__.jpg\" alt=\"\"></p><p>Roi Dadidou</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/474b2ec4-71e8-43a2-bf40-f3385bb0bd48._SL300__.jpg\" alt=\"\"></p><p>Francisca</p>', 1, 59.99, 31, 59.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000022', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 584, \"original\": \"https://api.click-games.fr/storage/534/81FncKXxdVL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/534/conversions/81FncKXxdVL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 585, \"original\": \"https://api.click-games.fr/storage/535/81FncKXxdVL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/535/conversions/81FncKXxdVL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:11:18', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(35, NULL, 'Captain Toad Treasure Tracker', 'captain-toad-treasure-tracker', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/f2674bab-6baa-443b-b36d-2fc883b5339c._CR197,0,506,506_PT0_SX300__.jpg\" alt=\"1\"></p><h3><strong>Lampe frontale</strong></h3><p>Grâce à cette lampe, le capitaine Toad peut non seulement s\'éclairer dans le noir, mais aussi faire fuir les fantômes !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/03b8a46f-f0ac-4537-aa19-500e0063506a._CR197,0,506,506_PT0_SX300__.jpg\" alt=\"2\"></p><h3><strong>Toadette</strong></h3><p><strong>La fidèle partenaire du capitaine Toad dans sa quête de trésors.</strong></p><p>&nbsp;</p><p>Le capitaine Toad et Toadette se servent de leurs bras puissants pour déterrer des navets, tirer des interrupteurs, faire tourner des roues et creuser des trous avec la super pioche.</p><p>Le capitaine Toad et Toadette peuvent courir pour fuir les ennemis ou traverser des ponts qui s\'écroulent derrière eux.</p>', 1, 44.99, 31, 44.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000023', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 586, \"original\": \"https://api.click-games.fr/storage/536/81uOS06sFKL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/536/conversions/81uOS06sFKL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 587, \"original\": \"https://api.click-games.fr/storage/537/81+UmdWt7PL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/537/conversions/81+UmdWt7PL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 588, \"original\": \"https://api.click-games.fr/storage/538/81n3+pEbgqL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/538/conversions/81n3+pEbgqL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 589, \"original\": \"https://api.click-games.fr/storage/539/81uOS06sFKL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/539/conversions/81uOS06sFKL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:14:47', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(36, NULL, 'Animal Crossing : New Horizons pour Nintendo Switch', 'animal-crossing-new-horizons-pour-nintendo-switch', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/7bd21483-d9f2-4dc3-b1f7-449a06058c7c.__CR0,0,600,180_PT0_SX600_V1___.jpg\" alt=\"Cover\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/b8f1b487-3d5f-401d-bb58-73f20e912d20.__CR466,0,3000,3000_PT0_SX300_V1___.jpg\" alt=\"s1\"></p><h3><strong>Et si vous quittiez tout pour vivre sur une île déserte ?</strong></h3><p>Vous avez soif de liberté et d’évasion ? Vous voulez échapper à l’agitation du monde moderne ? L’idée de partir vous installer sur une île déserte vous a déjà traversé l’esprit ? Ne cherchez plus : Animal Crossing: New Horizons et sa formule « Évasion île déserte » sont faits pour vous !</p><p>La proposition est simple : partir vous installer sur une île inhabitée, y créer votre petit paradis et prendre le temps d’y développer votre communauté. Commencez par installer votre campement, et libre à vous ensuite de mener votre vie comme vous l’entendez. Récoltez des ressources, utilisez-les pour créer les objets qui vous plaisent et, bien sûr, faites connaissance avec les nombreux animaux qui visitent votre île. Qui sait, ils auront peut-être envie de s’y installer et de prendre part à votre aventure</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/8381c2f5-6d9f-4268-8caf-c5859f87fba8.__CR778,0,2960,2960_PT0_SX300_V1___.jpg\" alt=\"s2\"></p><p>Que vous soyez plutôt pêche, jardinage, déco, ou tout simplement balade en bord de mer à admirer un coucher de soleil, les possibilités sont infinies ! Et parce que les plus beaux souvenirs sont ceux que l’on partage avec les gens que l’on aime, vivez l’aventure jusqu’à 4 joueurs sur un écran et jusqu’à 8 joueurs en réseau local et en ligne*.</p><p>Votre vie rêvée n’attend plus que vous, dans Animal Crossing: New Horizons, le 20 mars 2020, en exclusivité sur Nintendo Switch.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/56838ab5-859f-4460-9d9b-3586a1dd804d.__CR0,0,220,220_PT0_SX220_V1___.jpg\" alt=\"car1\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/3e2cac19-d989-4fa3-af43-e4019a398eb8.__CR0,0,220,220_PT0_SX220_V1___.jpg\" alt=\"car2\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/1a1cf41b-92f5-41f8-be41-466af09a7103.__CR0,0,3240,3240_PT0_SX220_V1___.png\" alt=\"car 3\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d529abcb-4854-482f-aa0b-43f619f8b502.__CR0,0,220,220_PT0_SX220_V1___.jpg\" alt=\"amiibo\"></th></tr><tr><th><h4>Embarquement immédiat !</h4><p>Créée par le célèbre Tom Nook, la formule « Évasion île déserte » vous offre la possibilité de partir vous installer sur une île et d’y créer le monde dont vous rêvez. Posez votre campement et suivez les conseils de Méli et Mélo, les adorables neveux de Tom Nook, qui vous guideront pas à pas lors de votre installation. Comme toujours avec Tom Nook, rien n’est gratuit : vous pouvez rembourser vos emprunts (billet d’avion, campement de base…) directement en accomplissant les tâches du « Programme Miles Nook ». Collecter un certain nombre de fossiles ou désherber une partie de l’île vous permettra de rembourser vos dettes ! Pour suivre l’avancement de vos projets, consultez votre NookPhone : un autre objet « prêté » par Tom Nook… et que vous devrez rembourser !</p></th><th><h4>Vos animaux préférés sont de retour :</h4><p>que ce soient des personnages célèbres des anciens épisodes, comme l’adorable Marie, toujours prête à vous prêter main forte dans vos projets, ou Tom Nook et son sens des affaires redoutable, ils sont tous curieux de découvrir où vous vous êtes installés. Ils sont des centaines à pouvoir venir vous rendre visite, et peut-être à décider de s’installer avec vous, sur votre île. Pour les convaincre, il faudra parfois leur rendre service… mais ils sauront vous rendre la pareille et faire de votre île un endroit inoubliable !</p></th><th><h4>Vivez la « Dolce Vita » au rythme des saisons !</h4><p>Comme dans la vraie vie : au printemps, prenez le temps de découvrir la nature qui s’éveille… Mais n’oubliez pas la chasse aux insectes pour votre collection, il se pourrait qu’ils aient déjà quitté votre île d’ici l’été ! En hiver, enfilez écharpes et gants, et amusez-vous les jours de grand froid à construire un bonhomme de neige avec vos amis ! En plus des saisons qui passent, fêtez également les événements du quotidien avec votre communauté… Qui sait, vos amis vous ont peut-être prévu une surprise pour le jour de votre anniversaire !</p></th><th><h4>Toujours plus d’amis avec vos figurines et cartes amiibo !</h4><p>Utilisez vos amiibo pour inviter vos amis sur votre île. Que ce soit pour une séance photo au studio de Photopia ou tout simplement pour partager un bon moment autour d’un feu de camp, à la belle étoile, profitez de vos amiibo pour vous créer de merveilleux souvenirs.</p></th></tr></tbody></table></figure><h3><strong>Un univers qui vous ressemble… jusque dans les moindres détails !</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/34fb3f41-ff51-4e95-9356-f3b550179ca2.__CR307,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s3\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/41bb8105-71b8-4dd6-b2d7-5133442de9f9.__CR371,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"chantier\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/09a5c5ef-9e85-4d50-9849-ee2ab7b42bdd.__CR332,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"screen5\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a5566899-f24c-416d-a24e-d2550fb82c14.__CR356,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s5\"></th></tr><tr><th><h4>Personnalisez votre avatar de la tête aux pieds</h4><p>Coupe de cheveux, couleur des yeux… quel est votre style du moment ? Plutôt bûcheron ou chemise à fleurs et sandales ?</p><p>La déco n’a pas de secrets pour vous ?Créez votre havre de paix en personnalisant l’intérieur et même l’extérieur de votre maison. Fabriquez vos propres objets de déco, comme un tableau fait main pour votre salon ou bien une balançoire pour votre jardin.</p></th><th><h4>Envie d’aller plus loin ?</h4><p>Enfilez votre casque de chantier et à vous les travaux de voirie avec le permis de construire « Remod’île » ! Créer des routes, construire un pont, trouver l’emplacement du futur musée ou même détourner le cours d’une rivière… A vous de laisser parler votre imagination !</p></th><th><h4>Un peu d’huile de coude !</h4><p>Vous avez besoin d’un outil ? Fabriquez-le vous-même !</p><p>Récupérez des matériaux, allez couper du bois, et rendez-vous à l’atelier pour, par exemple, créer votre première pelle. Ne vous inquiétez pas, Tom Nook a pensé à tout et a prévu une application spéciale pour votre NookPhone contenant les « tutos » pour créer une foule d’objets qui vous permettront de devenir un artisan de talent !</p></th><th><h4>Plus on est de fous… plus on vit !</h4><p>Découvrez les différentes configurations pour, ensemble, vous créer de fabuleux souvenirs :</p><p>&nbsp;</p><ul><li>1 console + 1 jeu + plusieurs manettes : vous pouvez explorez l’île jusqu’à quatre joueurs en même temps, sur un seul et même écran ! Êtes-vous plutôt séance de jardinage avec vos amis au soleil ou recherche de fossiles en famille ?</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>1 console et 1 jeu par joueur : jusqu’à huit joueurs peuvent explorer ensemble l’île de l’un des joueurs, en réseau local ou grâce au jeu en ligne*. Direction l’aéroport pour prendre l’avion et aller explorer l’île d’un de vos amis. Vous pourrez même y trouver des ressources qui n’existent pas sur votre île. N’oubliez surtout pas de les emmener avec vous lors de votre retour chez vous !</li></ul><p>&nbsp;</p></th></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', 1, 54.49, 31, 54.49, NULL, NULL, 0, 0, 0, NULL, 'CU0000024', 18, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 590, \"original\": \"https://api.click-games.fr/storage/540/81s8etnYPrL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/540/conversions/81s8etnYPrL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 591, \"original\": \"https://api.click-games.fr/storage/541/719Xp9NiZ9L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/541/conversions/719Xp9NiZ9L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 592, \"original\": \"https://api.click-games.fr/storage/542/61F-dWPTejL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/542/conversions/61F-dWPTejL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 593, \"original\": \"https://api.click-games.fr/storage/543/61cD06+ZXEL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/543/conversions/61cD06+ZXEL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 594, \"original\": \"https://api.click-games.fr/storage/544/71nXJz6sM8L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/544/conversions/71nXJz6sM8L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 595, \"original\": \"https://api.click-games.fr/storage/545/71qIfR7SVbL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/545/conversions/71qIfR7SVbL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 596, \"original\": \"https://api.click-games.fr/storage/546/71TfRzLOLnL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/546/conversions/71TfRzLOLnL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 597, \"original\": \"https://api.click-games.fr/storage/547/71VaPEnr74L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/547/conversions/71VaPEnr74L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 598, \"original\": \"https://api.click-games.fr/storage/548/611Vds9mg4L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/548/conversions/611Vds9mg4L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 599, \"original\": \"https://api.click-games.fr/storage/549/819vsB5MxtL._AC_SL1500_-2.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/549/conversions/819vsB5MxtL._AC_SL1500_-2-thumbnail.jpg\"}, {\"id\": 600, \"original\": \"https://api.click-games.fr/storage/550/819vsB5MxtL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/550/conversions/819vsB5MxtL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 601, \"original\": \"https://api.click-games.fr/storage/551/71oFpgIuCCL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/551/conversions/71oFpgIuCCL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 602, \"original\": \"https://api.click-games.fr/storage/552/81s8etnYPrL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/552/conversions/81s8etnYPrL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:22:47', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(37, NULL, 'Mario Golf: Super Rush', 'mario-golf-super-rush', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/83ae7248-ac79-4688-b4e1-da945a011052.__CR104,0,2092,1294_PT0_SX970_V1___.jpg\" alt=\"cover\"></p><h3><strong>A toute allure sur le green !</strong></h3><p>Envie de prendre un grand bol d’air frais sur les terrains de golf ? Mario Golf: Super Rush, le nouvel épisode de la série Mario Golf arrive sur Nintendo Switch !</p><p>Parcourez les cours de golf avec vos personnages préférés du royaume Champignon, jouez en utilisant les commandes classiques ou les commandes utilisant la détection de mouvements en tenant le Joy-Con comme un club de golf ! Comme sur un véritable parcours, vous allez devoir étudier attentivement le vent et le terrain avant de frapper. Heureusement, vous pourrez compter sur plusieurs fonctionnalités pour vous aider telles que la jauge de puissance qui permet de voir l\'influence des pentes sur votre tir, ou bien encore un scanner qui permet d\'examiner le terrain en détail. Pour les amateurs d’action, deux nouveautés : dans le mode Speed Golf, tout le monde joue en même temps, puis court à travers le parcours pour rejoindre sa balle avant de la frapper à nouveau, et ainsi de suite alors que dans le mode Golf Mêlée, les joueurs s’affrontent dans une arène et doivent être les plus rapides à mettre trois balles avant les autres. Un mode histoire vous permet également d’incarner un Mii novice en golf et il est possible de jouer avec jusqu\'à trois autres joueurs, en local comme en ligne.</p><p>Foncez sur le green avec Mario Golf: Super Rush qui sera disponible le 25 juin sur Nintendo Switch et Nintendo Switch Lite</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/b65e6b50-9f7f-46a7-8c34-3fc589e8e01c.__CR400,0,4000,4000_PT0_SX300_V1___.png\" alt=\"characters\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/f22bd1d6-f065-48f3-ab84-8bb5729a5d01.__CR39,0,1080,1080_PT0_SX300_V1___.png\" alt=\"Speed golf\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/f855a37e-0966-48e2-91b5-880e3fc8a9a3.__CR449,0,1080,1080_PT0_SX300_V1___.png\" alt=\"Nouveau mode\"></th></tr><tr><th><h4>La grande Aventure golfique n’attend que vous !</h4><p>Dans ce mode de jeu solo, vous incarnez votre Mii, et l’objectif est de passer de novice à pro du golf en affrontant, entre autres, plusieurs personnages du Royaume Champignon. Ce véritable mode histoire vous apprendra les bases pas à pas et vous permettra avec le temps de récolter de l’expérience et d’améliorer les statistiques de votre Mii pour l’emmener au bout de l’Aventure golfique !</p><p> De</p></th><th><h4>Nouveau mode: Speed Golf</h4><p>Vous jouez votre balle en même temps que les autres joueurs, et ensuite à vous de foncer sur le green pour la rejoindre le plus rapidement possible. Vous pouvez ramasser des objets sur le terrain pour gagner en endurance ou utiliser votre sprint spécial pour accélérer pendant un cours instant tout en repoussant vos concurrents : tous les coups sont permis !</p><p>Informations générales</p><p>Plateforme : Nintendo Switch / Nintendo Switch Lite</p><p>Genre : Sport</p><p>Nombre de joueurs : 1 - 4 joueurs</p><p>Date de sortie : 25 juin 2021</p><p>PEGI : 3</p><p>Développeur : Camelot</p><p>Editeur : Nintendo</p></th><th><h4>Nouveau mode: Golf Mêlée</h4><p>Ici tout va très vite, il faut faire rentrer le plus rapidement trois balles dans</p><p>trois des neufs trous disponibles au coeur d’un énorme stade ! Un mode complétement</p><p>frénétique où seuls les joueurs les plus rapides et les plus précis pourront se hisser tout en</p><p>haut du podium !</p></th></tr></tbody></table></figure><p>En lire plus</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/84e1bbed-231d-4d5c-a8e4-132f75d04f7b.__CR420,0,1080,1080_PT0_SX220_V1___.png\" alt=\"perso\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/940060b3-1546-4775-99ba-56bdf6c8f6e2.__CR621,0,1080,1080_PT0_SX220_V1___.png\" alt=\"Shot\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/eb88b1e4-851f-4673-a2f2-7c58c027601a.__CR500,0,5000,5000_PT0_SX220_V1___.png\" alt=\"play\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/c34780ed-dc6b-4996-af6d-20129700dbc1.__CR235,0,2529,2529_PT0_SX220_V1___.png\" alt=\"Multi\"></th></tr><tr><th><h4>16 personnages à incarner</h4><p>Pour fêter l’arrivée de la série Mario</p><p>Golf sur Nintendo Switch, les héros du Royaume Champignon</p><p>ont tous répondu à l’appel ! Mario, Peach ou Toad sont toujours</p><p>présents, et certains font même leur toute première apparition</p><p>sur le green, comme Pauline ! Ils ont tous des caractéristiques</p><p>différentes, comme la puissance ou la précision. A vous de</p><p>choisir le personnage qui vous correspond le mieux !</p></th><th><h4>La technique, c’est fantastique !</h4><p>Maîtrise de la jauge de puissance, scan du dénivelé du terrain et coups</p><p>à effet devront être maîtrisés pour appréhender au mieux les parcours de Mario Golf: Super Rush. Des</p><p>terrains qui vous réservent d’ailleurs de nombreuses surprises : alors que certains d’entre eux</p><p>ressemblent à des terrains de golf « classiques », d’autres puisent leur inspiration dans les univers de</p><p>Mario, et jouer sur un terrain volcanique avec la lave en fusion devient possible !</p></th><th><h4>Le golf comme si vous y étiez !</h4><p>Avec la détection de mouvements, le coup</p><p>parfait est à la portée de tous. En tenant le Joy-Con comme un club de golf, c’est</p><p>comme si vous vous teniez sur le green face à votre balle, vos mouvements seront</p><p>retranscrits dans le jeu et vous aurez l’impression d’y être vraiment. Si vous</p><p>préférez les commandes classiques, c’est aussi possible, tout le monde y trouvera</p><p>son compte.</p></th><th><h4>Qui sera le meilleur sur le green ?</h4><p>Le multijoueur peut réunir jusqu’à 4 participants, que vous soyez</p><p>réunis en famille ou entre amis devant un seul et même écran, ou à distance grâce aux différents</p><p>modes de jeu accessibles en ligne via un abonnement au Nintendo Switch Online.</p></th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/3195532b-7dc8-458a-9802-6d8d60993d5d.__CR0,122,2586,1600_PT0_SX970_V1___.png\" alt=\"artwork\"></p>', 1, 53.49, 31, 53.49, NULL, NULL, 0, 0, 0, NULL, 'CU0000025', 19, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 603, \"original\": \"https://api.click-games.fr/storage/553/51ZMyFedE9S._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/553/conversions/51ZMyFedE9S._AC_-thumbnail.jpg\"}', '[{\"id\": 604, \"original\": \"https://api.click-games.fr/storage/554/51ZMyFedE9S._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/554/conversions/51ZMyFedE9S._AC_-thumbnail.jpg\"}, {\"id\": 605, \"original\": \"https://api.click-games.fr/storage/555/81Q4OJadOSL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/555/conversions/81Q4OJadOSL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 606, \"original\": \"https://api.click-games.fr/storage/556/71GRZQU7c6L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/556/conversions/71GRZQU7c6L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 607, \"original\": \"https://api.click-games.fr/storage/557/71bD2ISnwLS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/557/conversions/71bD2ISnwLS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 608, \"original\": \"https://api.click-games.fr/storage/558/71wT2WxDefL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/558/conversions/71wT2WxDefL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 609, \"original\": \"https://api.click-games.fr/storage/559/71uVacY4-YL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/559/conversions/71uVacY4-YL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 610, \"original\": \"https://api.click-games.fr/storage/560/81o68caiwML._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/560/conversions/81o68caiwML._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 611, \"original\": \"https://api.click-games.fr/storage/561/71RukIyEcyL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/561/conversions/71RukIyEcyL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:25:31', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(38, NULL, 'Mario & Sonic aux Jeux Olympiques', 'mario-sonic-aux-jeux-olympiques', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/bef07ffa-a32c-4e2a-8013-eafc381dde67.__CR167,0,1667,500_PT0_SX600_V1___.jpg\" alt=\"Cover\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/77a52c78-f623-44e8-babd-e8b44609889d.__CR283,0,720,720_PT0_SX300_V1___.jpg\" alt=\"s1\"></p><h3><strong>Echauffez-vous pour les Jeux Olympiques avec Mario, Sonic et leurs amis !</strong></h3><p>Rendez-vous aux Jeux Olympiques de Tokyo 2020 avec Mario, Sonic et leurs amis en exclusivité sur Nintendo Switch !</p><p>Tentez de remporter la médaille d\'or en donnant le maximum dans des disciplines bourrées d\'action, parmi lesquelles une large panoplie de sports classiques mais également le skateboard, le karaté, le surf et l\'escalade sportive, présents pour la première fois aux J.O. de Tokyo 2020. Allumez votre Nintendo Switch, et que la compétition commence ! Différentes façons de jouer s\'offrent à vous : vous pouvez utiliser les boutons aussi bien que les commandes par mouvements, dans des modes de jeu multijoueur où peuvent s\'affronter jusqu\'à quatre joueurs en local et jusqu\'à huit joueurs en ligne.</p><p>Incarnez Mario, Sonic, Yoshi, Amy Rose, Luigi, Dr. Eggman et bien d\'autres personnages !</p><h3><strong>La course aux médailles d’or débarque exclusivement sur Nintendo Switch en novembre 2019 !</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d180af3c-709b-4c55-84ad-6af267bc725d.__CR252,0,720,720_PT0_SX220_V1___.jpg\" alt=\"s2\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/299651b7-d1e5-4f12-a03e-0c8ea0e5bbf2.__CR280,0,720,720_PT0_SX220_V1___.jpg\" alt=\"s2\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/c674a68d-4079-4136-a855-8aa9540c1ff6.__CR452,0,720,720_PT0_SX220_V1___.jpg\" alt=\"s3\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a43bb4b3-4835-487f-aeae-a0e9049e0079.__CR331,0,720,720_PT0_SX220_V1___.jpg\" alt=\"s4\"></th></tr><tr><th><h4>Affrontez-vous à travers de nombreuses disciplines. En</h4><p>En plus des disciplines classiques, découvrez 4 nouveaux sports représentés pour la première fois aux J.O. de Tokyo 2010 : le skateboard, le karaté, le surf et l’escalade sportive.</p></th><th><h4>Grâce à votre Nintendo Switch, jouez de plein de manières différentes.</h4><p>Utilisez le contrôle classique avec les boutons ou utilisez la détection de mouvements pour jouer comme si vous y étiez.</p></th><th><h4>Vivez la compétition à plusieurs, jusqu’à 4 en local et 8 en ligne.</h4></th><th><h4>Mario, Sonic, Dr. Eggman…</h4><p>incarnez vos personnages préférés et tentez de remporter le plus de médailles d’or possible !</p></th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/1aec2756-8cec-4669-9de2-5c584d375264.__CR169,0,720,720_PT0_SX300_V1___.jpg\" alt=\"s5\"></p><h3><strong>Informations générales</strong></h3><p>Plateforme : Nintendo Switch</p><p>Genre : Sport/ Party game</p><p>Nombre de joueurs : 1-8 joueurs</p><p>Date de sortie : 8 novembre 2019</p><p>PEGI : 3 à confirmer</p><p>Développeur : SEGA</p><p>Editeur : SEGA</p><p>&nbsp;</p><p>&nbsp;</p>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000026', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 612, \"original\": \"https://api.click-games.fr/storage/562/81sHbQ11-7L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/562/conversions/81sHbQ11-7L._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 613, \"original\": \"https://api.click-games.fr/storage/563/81sHbQ11-7L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/563/conversions/81sHbQ11-7L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 614, \"original\": \"https://api.click-games.fr/storage/564/61TtIjkrP5L._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/564/conversions/61TtIjkrP5L._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 615, \"original\": \"https://api.click-games.fr/storage/565/615VL8vvxUL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/565/conversions/615VL8vvxUL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 616, \"original\": \"https://api.click-games.fr/storage/566/61IPY-eiaIL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/566/conversions/61IPY-eiaIL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 617, \"original\": \"https://api.click-games.fr/storage/567/61eGiLJkkcL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/567/conversions/61eGiLJkkcL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 618, \"original\": \"https://api.click-games.fr/storage/568/71r3aevaxoL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/568/conversions/71r3aevaxoL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 619, \"original\": \"https://api.click-games.fr/storage/569/71WJmyDDGQL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/569/conversions/71WJmyDDGQL._AC_SL1280_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:29:34', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(39, NULL, 'The Legend of Zelda : Skyward Sword HD', 'the-legend-of-zelda-skyward-sword-hd', '<h3><strong>The Legend of Zelda Skyward Sword HD</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/1599e2fe-7543-4c53-9e46-cdbf284656ca.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Cover\"></p><h3><strong>L’origine de la Légende.</strong></h3><p>Retraçant l\'histoire la plus ancienne dans la chronologie des jeux de la série, The Legend of Zelda: Skyward Sword HD conte les origines de l\'Épée de Légende.</p><p>Dans cette aventure originellement sortie sur Wii en 2011, Link doit voyager entre un monde situé au-dessus des nuages et les vastes contrées inconnues qui s\'étendent sous leur surface pour retrouver son amie d\'enfance, Zelda. Armé de son épée et de son bouclier, Link va embarquer pour une aventure épique et devra se tenir prêt à croiser le fer avec de redoutables ennemis, résoudre des énigmes et parcourir les cieux à dos de célestrier, une monture volante. Le jeu propose deux types de prise en main : jouez avec deux manettes Joy-Con pour contrôler l\'arsenal de Link avec la reconnaissance de mouvements comme dans le jeu d’origine, ou avec des commandes plus classiques à la manette et pour vous permettre de profiter du jeu en mode portable sur Nintendo Switch ou sur une Nintendo Switch Lite.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/6fba573a-e063-433a-8005-522a7293d187.__CR0,1107,6800,6800_PT0_SX300_V1___.jpg\" alt=\"illust\"></p><p>La Légende raconte que pour protéger les humains des ténébres, une déesse les mis à l’abri sur une île volante dans les cieux, cette île devint le village de Célesbourg. Link, apprenti chevalier, et son ami d’enfance Zelda y coulent des jours heureux jusqu’au jour où Zelda disparaît, emportée par une tornade. Armé de son courage et d’une mystérieuse épée habitée par un esprit nommé Fay, Link devra retourner à la surface pour tenter de retrouver son amie</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/2965585c-9a2c-4fc8-b050-6b86c494aced.__CR420,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"screen 1\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/0bc99a48-d436-49d2-ba5a-a8d6ff7e99ea.__CR464,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"Screen 2\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/d10d3efe-a4f3-4ded-925b-938c6ce3b3d7.__CR395,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"Screen 3\"></th></tr><tr><th><h4>Deux univers à explorer: Dans les cieux...</h4><p>le village de Célesbourg vous sert de point de ralliement entre vos différentes missions à la surface. Vous y rencontrerez des personnages hauts en couleur, pourrez améliorer votre équipement ou participer à des quêtes annexes pour aider les habitants. En chevauchant votre célestrier, une monture volante bien pratique, d’autres îles volantes seront accessibles et vous dévoileront leurs secrets.</p></th><th><h4>Et sous les nuages</h4><p>l’exploration et l’aventure vous attendent ! Découvrez des univers riches et mystérieux, explorez des donjons et venez à bout d’ennemis coriaces pour retrouver Zelda.</p></th><th><h4>Des donjons impressionnants</h4><p>Eléments clés de nombreux épisodes de la série, les donjons de cet</p><p>opus vont vous donner du fil à retordre ! Recolter des clés, trouver la carte pour savoir où vous</p><p>déplacer, affronter des mini-boss pour obtenir de nouveaux objets et bien sûr, résoudre de multiples</p><p>casse-têtes seront indispensables pour venir à bout de ces donjons pensés pour vous faire réfléchir. A</p><p>la fin de chaque donjon, un boss redoutable vous attend !</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/36adc54b-7288-4b01-a89d-5e1ec96f1174.__CR420,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"screen 4\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/506a49bc-2741-4c7e-b777-9ce89087355a.__CR0,180,1542,1542_PT0_SX300_V1___.png\" alt=\"Amiibo\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/ab882fa2-3355-471d-b8b9-f99ac870bc14.__CR134,0,2933,2933_PT0_SX300_V1___.png\" alt=\"Joy con\"></th></tr><tr><th><h4>Une foule d’objets à maîtriser</h4><p>En plus des grands classiques de la série, comme le lance-pierres ou le</p><p>grappin, The Legend of Zelda: Skyward Sword a introduit de nombreux nouveaux objets à maîtriser qui</p><p>démultiplient les possibilités de gameplay. Avec la Jarre magique, souffler de l’air vous permet</p><p>d’activer des mécanismes à hélice à distance ou même de repousser de petits ennemis. Le Scarabée</p><p>quant à lui agit comme un objet volant commandé à distance, il permet d’atteindre des mécanismes</p><p>éloignés et même de recolter des objets sur son passage !</p></th><th><h4>Un nouvel amiibo Zelda &amp; Célestrier :</h4><p>Cette figurine peut être utilisée à n’importe quel</p><p>moment, lors de l’exploration du monde ou des donjons, pour créer un point de contrôle</p><p>et retourner dans les airs. En plein vol, ou lors d’une visite des nombreuses îles par-delà les</p><p>nuages, le fait d’appliquer à nouveau l’amiibo permettra au joueur de retourner au point</p><p>de contrôle précédemment créé</p></th><th><h4>Des Joy-Con aux couleurs de The Legend of Zelda !</h4><p>Le Joy-Con droit rend</p><p>hommage à l’Épée de Légende, tandis que le Joy-Con gauche se pare des</p><p>couleurs du mythique bouclier d’Hylia. Ensemble, ces Joy-Con disponibles</p><p>en édition limitée vous permettront de donner une dimension encore plus</p><p>épique à votre Nintendo Switch.</p></th></tr></tbody></table></figure><h3><strong>Maniez l’Épée de Légende et le bouclier d’Hylia selon vos goûts</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/888cdfae-942a-4dab-b251-edbd3707cdda.__CR87,0,1746,1080_PT0_SX970_V1___.jpg\" alt=\"Epee\"></p><p>que vous soyez adepte de la détection de mouvements ou plus à l’aise avec des commandes classiques, vous trouverez votre bonheur dans The Legend of Zelda: Skyward Sword HD :</p><p>o Détection de mouvements : comme dans l’épisode d’origine, vous pouvez manier l’épée</p><p>et le bouclier comme si vous y étiez ! Parez avec votre bouclier en soulevant une main,</p><p>donnez des coups d’épée avec l’autre en orientant votre lame comme bon vous semble,</p><p>idéal pour se sortir des situations les plus délicates. Et ce n’est pas tout, les Joy-Con vous</p><p>permettent, entre autres, de tirer à l’arc comme si vous aviez un vrai arc entre les mains !</p><p>o Commandes classiques : nouveauté de cette version HD, vous pouvez profiter de toute</p><p>l’aventure en jouant avec des commandes classiques aux boutons, en utilisant votre Joy-</p><p>Con Grip ou un Controller Pro, ou encore pour que l’aventure vous suive partout même</p><p>quand vous jouez en mode portable sur votre Nintendo Switch ou sur votre Nintendo</p><p>Switch Lite. Le stick droit vous permet de retrouver la précision de la détection de</p><p>mouvements et d’orienter votre épée comme bon vous semble !</p>', 1, 53.99, 31, 53.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000027', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 620, \"original\": \"https://api.click-games.fr/storage/570/8176VSvYCDS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/570/conversions/8176VSvYCDS._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 621, \"original\": \"https://api.click-games.fr/storage/571/8176VSvYCDS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/571/conversions/8176VSvYCDS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 622, \"original\": \"https://api.click-games.fr/storage/572/71mT4A0PMvL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/572/conversions/71mT4A0PMvL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 623, \"original\": \"https://api.click-games.fr/storage/573/71dKeQhS9yL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/573/conversions/71dKeQhS9yL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 624, \"original\": \"https://api.click-games.fr/storage/574/61vGjGPBo0L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/574/conversions/61vGjGPBo0L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 625, \"original\": \"https://api.click-games.fr/storage/575/718U-rMVUuS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/575/conversions/718U-rMVUuS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 626, \"original\": \"https://api.click-games.fr/storage/576/71KnttYm2+L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/576/conversions/71KnttYm2+L._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:32:55', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(40, NULL, '\"L\'Aventure LaytonTM : Katrielle et la conspiration des millionnaires - Édition Deluxe\"', 'l-aventure-laytontm-katrielle-et-la-conspiration-des-millionnaires-edition-deluxe', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/3fd7f476-20f8-40df-b477-7608f9e95a07.__CR0,0,600,180_PT0_SX600_V1___.png\" alt=\"LOGO\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/33288a44-fc17-4638-8311-8e0c2e316024.__CR103,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"S1\"></p><p>Résolvez des énigmes dans votre salon et continuez ou vous voulez avec L\'AVENTURE LAYTON™: Katrielle et la conspiration des millionnaires - Edition Deluxe, disponible sur Nintendo Switch dès le 8 novembre.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/323c890b-0004-4eea-8139-b6efacee2f20.__CR71,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"S2\"></p><p>Pour la première fois dans la série LAYTON menez l’enquête sur votre téléviseur. Le célèbre professeur Hershel Layton a disparu, et c’est sa fille Katrielle qui prend les choses en main et devient le personnage principal. Intelligente et passionnée, la jeune femme a un véritable don pour découvrir la vérité, même lorsque les preuves sont minces. Tout au long de son aventure, elle bénéficiera de l’aide de nouveaux personnages hauts en couleur dont Oliver Marchence, un jeune étudiant recruté comme assistant, ainsi que son premier client, Sherl, un chien doté de parole qui deviendra rapidement son acolyte.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/79cbbd35-8a95-4104-94e7-efb769c11cfb.__CR91,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"S3\"></p><p>Pour résoudre les énigmes utilisez les boutons, les capteurs de mouvements ou, en mode portable en utilisant l’écran tactile de la console Nintendo Switch. Par ailleurs, découvrez de nouveau contenu et des fonctionnalités de gameplay améliorées dont plus de 40 énigmes inédites et plus de 50 nouvelles tenues !</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/0dc9894b-2b8f-4706-8213-9fdf85c0dedc.__CR602,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"S4\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/1c669e82-4f40-4ac8-8c30-cd45b4063d16.__CR64,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"S5\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/43c2fc40-44b5-4f8a-84a4-65693ddac69f.__CR258,0,386,386_PT0_SX220_V1___.png\" alt=\"S6\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/784e6895-1dad-41ee-9dd3-4540615f1a58.__CR108,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"S6\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', 1, 64.99, 31, 64.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000028', 20, 1, 0, NULL, NULL, NULL, 'draft', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 627, \"original\": \"https://api.click-games.fr/storage/577/91RCrul3MNL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/577/conversions/91RCrul3MNL._AC_SL1500_-thumbnail.jpg\"}', '[]', NULL, '2022-02-02 19:35:28', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL);
