(41, NULL, 'The Legend of Zelda : Breath of the Wild', 'the-legend-of-zelda-breath-of-the-wild', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/aa1d0c9d-ed0b-4e47-a557-3ffc8c8b8589._SL300__.jpg\" alt=\"\"></p><h3><strong>ENTREZ DANS UN MONDE D\'AVENTURE</strong></h3><p>Oubliez tout ce que vous savez sur es jeux The Legend of Zelda. Plongez dans un monde de découverte, d\'exploration et d\'aventure dans The Legend of Zelda : Breath of the Wild, un nouveau jeu qui vient bouleverser la série à succès. Voyagez à travers des champs, des forêts et grimpez sur des sommets dans votre périple où vous explorez le royaume d\'Hyrule en ruines à travers cette aventure à ciel ouvert.</p><h4>POINTS FORTS</h4><ul><li>Bande son originale HD</li><li>Résolution 1080p</li></ul><h3><strong>FONCTIONNALITES</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/bbd1aa22-8d28-4f0b-a314-59f6d62482a2._SL220__.JPG\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/6988cc15-58ab-4d9e-8489-76377584c3f2._SL220__.JPG\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/c2ff3379-7499-4615-8caa-e6609cc7fc30._SL220__.JPG\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/2414013b-31d3-4b74-b447-80eb3169cf43._SL220__.JPG\" alt=\"\"></th></tr><tr><th><h4>Explorez les contrées sauvages d\'Hyrule à votre guise</h4><p>Escaladez des tours et montagnes à la recherche de nouvelles destinations : trouvez votre propre voie à travers ces contrées sauvages. Au long de votre route, vous combattrez des foules d\'ennemis, vous chasserez du gibier et rassemblerez des ingrédients nécessaires pour vous nourrir et créer des potions qui vous aideront à survivre au cours de votre périple.</p></th><th><h4>Plus de 100 sanctuaires à découvrir et à explorer</h4><p>Les sanctuaires qui sont disséminés sur le territoire ne demandent qu\'à être découverts, et dans l\'ordre de votre choix. Partez à leur recherche comme il vous plaît et résolvez différentes énigmes. Prenez garde aux pièges et aux périls qui vous y attendent pour obtenir des objets spéciaux et d\'autres récompenses qui vous aideront dans votre aventure.</p></th><th><h4>Préparez-vous et équipez-vous en conséquence</h4><p>Avec ce monde gigantesque que vous vous apprêtez à explorer, vous aurez besoin de diverses tenues et équipements pour pouvoir atteindre chaque recoin. Il vous faudra probablement de quoi vous tenir chaud dans les contrées glacées et quelque chose de léger pour affronter les chaleurs du désert. Certaines tenues ont également des effets spéciaux vous permettant par exemple de vous rendre plus rapide et furtif.</p></th><th><h4>Combattre les ennemis requiert de la stratégie</h4><p>Le monde est habité d\'ennemis de toutes formes et de toutes tailles. Chacun d\'eux possède sa propre méthode d\'attaque et des armes spécifiques, il vous faudra donc réfléchir vite et développer les stratégies gagnantes pour en venir à bout.</p></th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/4491e952-3eaf-475e-88c5-cb95b10238ed._SR300,300_.JPG\" alt=\"\"></p><h3><strong>Les amiibo s\'invitent dans l\'aventure</strong></h3><p>Scanner l\'amiibo de Link loup (vendu séparément), fera apparaître Link loup dans le jeu. Il attaquera les ennemis de manière indépendante et vous permettra de trouver des objets que vous recherchez.</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 61.99, 31, 61.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000029', 50, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 629, \"original\": \"https://api.click-games.fr/storage/579/91jvZUxquKL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/579/conversions/91jvZUxquKL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 630, \"original\": \"https://api.click-games.fr/storage/580/91jvZUxquKL._AC_SL1500_.jpg\", \"thumbna