640, \"original\": \"https://api.click-games.fr/storage/590/91FS6Luj5XL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/590/conversions/91FS6Luj5XL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 641, \"original\": \"https://api.click-games.fr/storage/591/91y6CzEzeLL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/591/conversions/91y6CzEzeLL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 642, \"original\": \"https://api.click-games.fr/storage/592/81zeCvDdDJL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/592/conversions/81zeCvDdDJL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 643, \"original\": \"https://api.click-games.fr/storage/593/614J-MUtJzL._AC_SL1200_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/593/conversions/614J-MUtJzL._AC_SL1200_-thumbnail.jpg\"}, {\"id\": 644, \"original\": \"https://api.click-games.fr/storage/594/51ekybz6QUL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/594/conversions/51ekybz6QUL._AC_-thumbnail.jpg\"}, {\"id\": 645, \"original\": \"https://api.click-games.fr/storage/595/614C-3BJjoL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/595/conversions/614C-3BJjoL._AC_SL1280_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:38:35', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(42, NULL, 'The Legend of Zelda: Link\'s Awakening', 'the-legend-of-zelda-link-s-awakening', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/58099e2d-94f5-4fb3-a479-5071cc4ce6ad.__CR0,0,600,180_PT0_SX600_V1___.jpg\" alt=\"Logo\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e726b7ac-bed4-49de-9f28-19f772c64838.__CR231,69,462,462_PT0_SX300_V1___.jpg\" alt=\"logo\"></p><h3><strong>Petit héros, grande Aventure</strong></h3><p>Après une terrible tempête, Link fait naufrage sur une île mystérieuse</p><p>Pour pouvoir rentrer chez lui, il doit collecter divers instruments de musique disséminés aux quatre coins de l’île de Cocolint afin de réveiller son gardien: le Poisson-Rêve</p><p>Le classique de la console Game Boy, The Legend of Zelda: Link’s Awakening, s’offre une nouvelle jeunesse sur Nintendo Switch, pour le plaisir des nostalgiques comme pour les nouveaux venus!</p><p>Profitez d’une version entièrement retravaillée, avec un style graphique unique et des thèmes musicaux réorchestrés, qui séduiront aussi bien les fans de la série que les nouveaux joueurs adeptes d’aventures!</p><p>Embarquez pour un voyage exceptionnel, explorez les différents donjons, affrontez des ennemis redoutables et tentez de lever le voile sur les mystères de l’île</p><p>Un nouveau mode de jeu vous permettant pour la première fois de créer vos propres donjons fait son entrée !</p><h3><strong>(Re)plongez sur l’île de Cocolint, dans The Legend of Zelda : Link’s Awakening, le 20 septembre 2019, exclusivement sur Nintendo Switch.</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/eea43922-5fab-4a75-a223-092c4077f69f.__CR524,0,1090,1090_PT0_SX220_V1___.png\" alt=\"s1\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/43392f92-b9e3-485b-bbc0-be6542646bd1.__CR400,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s5\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/58b08c7e-5479-4fee-9451-ceba8c901101.__CR0,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s4\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/3d27804d-ea25-4ca4-aaa7-0e402d4c81de.__CR449,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s3\"></th></tr><tr><th><h4>Sur la plage abandonnée, Poisson-Rêve et crustacés…</h4><p>Après un terrible naufrage, le jeune Link se retrouve échoué sur une plage. Marine, jeune fille rêveuse tombe sur le pauvre garçon et décide de l’accueillir chez elle. Vous apprenez alors qu’il vous faut trouver le gardien de l’île, aussi appelé Poisson-Rêve, pour pouvoir retourner chez vous. Explorez les environs, rencontrez des habitants hauts en couleur, partez à la découverte de donjons truffés de pièges et d’ennemis… et tentez d’élucider les mystères de l’île de Cocolint !</p></th><th><h4>Une carte postale idyllique !</h4><p>Pour son grand retour sur Nintendo Switch, The Legend of Zelda: Link’s Awakening soigne les moindres détails, pour le plaisir des yeux et des oreilles:</p><p>L’île de Cocolint comme vous ne l’avez jamais vue : Avec son nouveau style graphique, parcourez l’île de Cocolint entre nostalgie et émerveillement, et prenez plaisir à (re)découvrir des personnages bien connus !</p><p>Un voyage pour les oreilles : Profitez d’une bande originale remise au goût du jour qui donne une toute nouvelle dimension à l’ambiance sur l’île et aux musiques de la version originale sur Game Boy !</p></th><th><h4>L’achitecte du donjon : c’est vous !</h4><p>En venant à bout des donjons au cours de l\'aventure principale, vous gagnerez des modèles de salles de donjon. A vous de les arranger comme vous le souhaitez et de connecter les différentes salles pour créer votre propre donjon. Placez une entrée, organisez les liens entre les salles, choisissez les ennemis et même un boss pour obtenir des donjons uniques ! Les possibilités sont infinies !</p></th><th><h4>Des mini-jeux pour un grand héros !</h4><p>L’île de Cocolint regorge de surprises, et les activités en plein air ne manquent pas !Dévalez les rapides avec votre radeau, récoltez des items dans des machines à pince ou adonnez-vous même aux petits plaisirs de la pêche !</p><p>Les amiibo sont aussi de la fête : scannez vos amiibo compatibles de la série The Legend of Zelda pour obtenir d\'autres salles de donjon !</p></th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/76540653-848b-4047-823b-20287ed1a06e.__CR420,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"s6\"></p><h3><strong>Informations générales</strong></h3><p>Plateforme : Nintendo Switch</p><p>Genre : Action / aventure</p><p>Nombre de joueurs : 1</p><p>Date de sortie : 20 septembre 2019</p><p>PEGI : 7</p><p>Développeur : Nintendo</p><p>Editeur : Nintendo</p>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000030', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 646, \"original\": \"https://api.click-games.fr/storage/596/81QydOacjqL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/596/conversions/81QydOacjqL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 647, \"original\": \"https://api.click-games.fr/storage/597/81QydOacjqL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/597/conversions/81QydOacjqL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 648, \"original\": \"https://api.click-games.fr/storage/598/61nCQv618lL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/598/conversions/61nCQv618lL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 649, \"original\": \"https://api.click-games.fr/storage/599/71Yyf9X5I8L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/599/conversions/71Yyf9X5I8L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 650, \"original\": \"https://api.click-games.fr/storage/600/71o-i1XtYfL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/600/conversions/71o-i1XtYfL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 651, \"original\": \"https://api.click-games.fr/storage/601/71FuJJF5bAL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/601/conversions/71FuJJF5bAL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 652, \"original\": \"https://api.click-games.fr/storage/602/71HeeFyFe7L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/602/conversions/71HeeFyFe7L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 653, \"original\": \"https://api.click-games.fr/storage/603/717cblGIPeL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/603/conversions/717cblGIPeL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 654, \"original\": \"https://api.click-games.fr/storage/604/71+0Yo+UmxL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/604/conversions/71+0Yo+UmxL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 655, \"original\": \"https://api.click-games.fr/storage/605/71RLTHVHmwL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/605/conversions/71RLTHVHmwL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 656, \"original\": \"https://api.click-games.fr/storage/606/71NVgmOnUYL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/606/conversions/71NVgmOnUYL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 657, \"original\": \"https://api.click-games.fr/storage/607/71v3hrkB5mL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/607/conversions/71v3hrkB5mL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 658, \"original\": \"https://api.click-games.fr/storage/608/71mjWD8SQaL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/608/conversions/71mjWD8SQaL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 659, \"original\": \"https://api.click-games.fr/storage/609/71DxVluDLJL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/609/conversions/71DxVluDLJL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 660, \"original\": \"https://api.click-games.fr/storage/610/71EmS9aEhsL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/610/conversions/71EmS9aEhsL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 661, \"original\": \"https://api.click-games.fr/storage/611/71a-S623sSL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/611/conversions/71a-S623sSL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:42:10', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(43, NULL, 'Pokémon Donjon Mystère : Equipe de secours DX', 'pokemon-donjon-mystere-equipe-de-secours-dx', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/466c454c-70b5-4956-b058-4734ec1c4f12.__CR0,0,600,180_PT0_SX600_V1___.jpg\" alt=\"cover\"></p><p>Et si cette fois le Pokémon,… c’était vous ?</p><p>Et si pour une fois vous oubliiez vos Poké Ball et vos rêves de Dresseur pour découvrir l’envers du décor ? Bienvenue dans le monde enchanteur de Pokémon Donjon Mystère : Équipe de Secours DX, vous incarnez un Pokémon, sans aucun souvenir, au sein d’une communauté de Pokémon qui parle et s‘organise sans Dresseurs !</p><p>Si dans cet univers coloré tout à l’air paisible, méfiez-vous de l’eau qui dort, ces créatures ne sont pas à l’abri des rivalités et des bouleversements : des cataclysmes inexpliqués frappent toute la région et mettent en danger les Pokémon !</p><p>Impliquez-vous dans la vie de votre nouveau village Pokémon et, avec vos alliés, venez en aide à des Pokémon en détresse en accomplissant des missions dans des donjons, ces labyrinthes où des Pokémon sauvages vous mettront au défi. À vous de mener des combats pour triompher, apprendre de nouvelles attaques et monter en niveau ! Succès après succès, constituez votre Équipe de Secours ultime composée de vos alliés préférés et levez le voile sur ce mystère qui sème le chaos dans la communauté Pokémon !</p><p>Pokémon Donjon Mystère fait peau neuve sur Nintendo Switch : fusion des titres Pokémon Donjon Mystère : Équipe de Secours Rouge et Pokémon Donjon Mystère : Équipe de Secours Bleue, (re)découvrez ce classique de Game Boy Advance et Nintendo DS complètement retravaillé. Fini les pixels, place à une direction artistique d’inspiration aquarelle très colorée avec un effet 3D qui ravira tous les publics. Au niveau de la jouabilité, des raccourcis d’attaques ou encore la fonction accélération dans les donjons ont été ajoutés.</p><p>Testez-le gratuitement avec la démo disponible sur le Nintendo eShop.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e818076f-c2d0-4b51-936a-134b9c80b40d.__CR425,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s2\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d5615d73-db20-4481-bf2f-a53532c0e84c.__CR420,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s2\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/b8ff113a-e669-4270-975b-5966a8f5e2d6.__CR420,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s3\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d5049664-0780-4b9a-a103-e8c89cf80d35.__CR253,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s4\"></th></tr><tr><th><h4>Quel Pokémon êtes-vous ?</h4><p>Dès le début de l’aventure, répondez le plus honnêtement possible à une série de questions pour déterminer le Pokémon qui vous correspond le plus comme dans un vrai test de personnalité ! Plutôt timide, espiègle, solitaire ou courageux ? Votre Pokémon sera déterminé parmi 16 Pokémon iconiques dont Salamèche, Pikachu, Gobu, et bien d’autres ! Pas de panique, si à l’issue de votre test le résultat ne vous convient pas vous pouvez tout de même choisir d’incarner votre préféré.</p><p>Curieux de découvrir quel Pokémon vous correspond ? Faites le test directement sur votre Nintendo Switch avec la démo gratuite du jeu disponible sur le Nintendo eShop.</p></th><th><h4>Le monde des Pokémon a besoin de vous !</h4><p>« Mais… où suis-je ? » Réveillé soudainement dans un environnement inconnu, vous vous retrouvez dans le corps d’un Pokémon. Pourquoi ? Que vous est-il arrivé ? À vous de remonter la piste pour découvrir qui vous êtes !Pour l’heure, découvrez votre village d’adoption et ses besoins : des Pokémon sont pris au piège loin de leur maison suite à de récentes catastrophes naturelles ! Parlez aux Pokémon voisins, liez-vous d’amitié et écoutez leurs préoccupations avant de partir en mission avec votre Équipe de Secours. Préparez-vous à des échanges uniques avec des Pokémon aux personnalités très diverses et des rebondissements dans le scénario ! Si certains Pokémon sont bien intentionnés, comme le sage Barbicha, méfiez-vous d’autres Pokémon aux desseins louches ! En effet vous n’êtes pas la seule Équipe de « Secours » à œuvrer sur le terrain…</p></th><th><h4>Partez en mission dans des donjons !</h4><p>Les diverses missions s’accumulent sur le tableau d’affichage du village ou arrivent directement dans votre Boîte aux Lettres grâce à Békipan, le Pokémon postier. Il y a en a pour tous les goûts: expéditions de sauvetage ou d’escorte de Pokémon, mais aussi des expéditions pour livrer ou trouver un objet particulier. Et si vous voulez vous entraîner, il existe de nombreuses missions bonus en dehors du mode histoire pour les plus gourmands.</p><p>Une fois la mission acceptée, vous voilà parti avec votre Équipe de Secours dans un donjon généré aléatoirement, regorgeant d’objets à collecter et de Pokémon sauvages qui vous assaillent. Trouvez votre chemin dans le labyrinthe et guettez les escaliers qui vous mèneront au prochain étage. Attention un Pokémon attaque votre Équipe ! Choisissez l’offensive la plus pertinente selon le type de Pokémon et mettez-le au tapis ! Parfois un Pokémon « Boss » final vous attendra au dernier étage, il faudra travailler en équipe pour coordonner vos attaques.</p></th><th><h4>Des centaines de Pokémon à découvrir !</h4><p>Chaque expédition vous permet de rencontrer de nouveaux Pokémon parmi les 3 premières générations et les Pokémon « sauvés » peuvent s’ajouter à votre liste d’alliés potentiels. Avant chaque mission, vous pouvez choisir jusqu’à 3 compagnons dans votre escouade ; ils combattent selon la tactique que vous leur affectez (suivre le meneur, rester en retrait, attaquer coûte que coûte…). Choisissez-les stratégiquement selon la nature du donjon et de la mission. Par exemple des Pokémon de type Feu vous seront très utiles dans les donjons du Petit Bois, où rodent beaucoup de Pokémon de type Plante ! Arriverez-vous à découvrir tous les Pokémon du jeu ? Même certains Pokémon Légendaires peuvent se joindre à votre Équipe !</p></th></tr></tbody></table></figure><p>En lire plus</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/27acc3d2-ec14-4f22-af56-8c0ea7c726a5.__CR499,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"s1\"></p><h3><strong>Votre nouvelle vie dans le village Pokémon entre deux missions !</strong></h3><p>La Poste Békipan : ici arrivent les différentes missions, il y en a de nouvelles tous les jours !</p><p>Le Magasin Kecleon : avant de partir pensez à y faire un tour pour acheter baies, orbes et projectiles pour survivre dans les donjons.</p><p>La Réserve Kangourex : l’endroit rêvé pour conserver tous les objets ramassés au cours de vos expéditions.</p><p>La Banque Félicité : Persian met à l’abri votre argent, car si vous mourrez dans un donjon, vous perdez tout !</p><p>Le Dojo Makuhita : éprouvez vos alliés dans des donjons d’entraînement et confrontez-vous à des Équipes de Secours adverses !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/953d2c88-012a-4894-858d-52bd6225f73d.__CR0,227,1280,396_PT0_SX970_V1___.png\" alt=\"artw\"></p><p>Testez-le gratuitement avec la démo déjà disponible sur le Nintendo eShop.</p>', 1, 49.99, 31, 49.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000031', 19, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 662, \"original\": \"https://api.click-games.fr/storage/612/71FWCPd9LiL._AC_SL1125_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/612/conversions/71FWCPd9LiL._AC_SL1125_-thumbnail.jpg\"}', '[{\"id\": 663, \"original\": \"https://api.click-games.fr/storage/613/71FWCPd9LiL._AC_SL1125_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/613/conversions/71FWCPd9LiL._AC_SL1125_-thumbnail.jpg\"}, {\"id\": 664, \"original\": \"https://api.click-games.fr/storage/614/715XmhShjWL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-ga