(44, NULL, 'Super Smash Bros Ultimate', 'super-smash-bros-ultimate', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/e023d7a1-308c-4421-aafd-3ece92703ba7._CR0,0,1000,1000_PT0_SX300__.jpg\" alt=\"1\"></p><h3><strong>Super Smash Bros Ultimate</strong></h3><p>Des mondes de jeux et des combattants légendaires se retrouvent pour l’affrontement ultime dans le nouvel opus de la série Super Smash Bros. sur Nintendo Switch !</p><p>De nouveaux combattants comme l\'Inkling de la série Splatoon et Ridley de la série Metroid, font leur débuts dans Super Smash Bros. aux côtés de tous les combattants ayant jamais figuré dans la série Super Smash Bros. !</p>', 1, 61.99, 31, 61.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000032', 43, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 678, \"original\": \"https://api.click-games.fr/storage/628/81QiNb1LIjL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/628/conversions/81QiNb1LIjL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 679, \"original\": \"https://api.click-games.fr/storage/629/81QiNb1LIjL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/629/conversions/81QiNb1LIjL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 19:57:30', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(45, NULL, 'Dragon Ball Z Kakarot', 'dragon-ball-z-kakarot', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/8f6c91a8-268e-4f2c-bb87-ad8b03667f35.__CR0,243,1920,594_PT0_SX970_V1___.jpg\" alt=\"Dragon ball Z kakarot \"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e43a4ef0-943a-4425-af79-953332a0a483.__CR310,0,810,1080_PT0_SX300_V1___.jpg\" alt=\"Dragon ball Z kakarot \"><br>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/23f47f3f-ee5c-4b8f-876d-3fb755d7c964.__CR0,0,350,175_PT0_SX350_V1___.jpg\" alt=\"bandai namco entertainment jeu vidéo \"><strong>Bandai Namco Entertainment</strong></p><p>&nbsp;</p><p>Bandai Namco Entertainment est un acteur majeur de l’industrie du jeu vidéo, réputé pour la création et l’édition de nombreuses franchises de jeux vidéo à succès comme Pac-Man, Tekken, SoulCalibur, Naruto Shippuden, Dragon Ball, Ace Combat et bien d’autres. « More fun for everyone», c’est la devise du groupe Bandai Namco, toujours en quête de nouveaux divertissements à vous proposer !</p><ul><li>Dreams</li><li>Fun</li><li>Inspiration</li></ul><h3><strong>Dragon Ball Z : Kakarot</strong></h3><p>Revivez l\'histoire de Goku et des autres guerriers Z dans DRAGON BALL Z: KAKAROT ! Menez des combats épiques et découvrez la vie dans le monde de DRAGON BALL Z : combattez, pêchez, mangez et entraînez-vous avec Goku, Gohan, Vegeta...</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e9d3f830-df28-4565-a855-41615b66167e.__CR420,0,1080,1080_PT0_SX220_V1___.png\" alt=\"Dragon ball z kakarot\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/5674fa19-e91a-4a13-b88e-c3405f96e04e.__CR0,0,606,606_PT0_SX220_V1___.jpg\" alt=\"dragon ball z kakarot\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e244c6ba-bb85-4b19-8784-2f7fff3ed041.__CR0,0,606,606_PT0_SX220_V1___.jpg\" alt=\"dragon ball z kakarot \"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d9a3dd90-6c59-4a54-8aa4-5a2511a830b1.__CR0,0,606,606_PT0_SX220_V1___.jpg\" alt=\"dragon ball z kakarot\"></th></tr><tr><th><h4>Une véritable dimension RPG</h4><p>Au cours de votre progression dans l\'histoire, explorez de nouvelles zones, vivez de nouvelles aventures et tissez des liens étroits avec d\'autres héros de l\'univers de DRAGON BALL Z.</p></th><th><h4>Revivez l\'histoire de DRAGON BALL Z</h4><p>De l’arrivée de Raditz au combat final contre Boo ; et profitez d’événements épiques ainsi que de quêtes secondaires amusantes. Des moments inédits de l\'histoire répondront pour la toute première fois à certaines questions brûlantes que tout le monde se pose sur l\'univers de Dragon Ball !</p></th><th><h4>Livrez des combats emblématiques</h4><p>Luttez sur de vastes champs de bataille à l\'environnement destructible et repoussez vos limites en affrontant des boss lors de combats épiques (Raditz, Freezer, Cell, Boo etc…). Augmentez votre niveau de puissance et relevez de grands défis !</p></th><th><h4>Ne combattez pas seulement comme les guerriers Z, vivez comme eux</h4><p>Pêchez, volez, mangez, entraînez-vous et combattez, tout en vous faisant des amis et en nouant des relations avec de multiples personnages de DRAGON BALL.</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th>&nbsp;</th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/097194a0-6b58-4a4c-bf8b-e68ea3cdf15b.__CR0,1,413,826_PT0_SX150_V1___.jpg\" alt=\"dragon ball z kakarot\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/4971dfd7-3f16-4413-8a56-48c27f36098f.__CR0,1,413,826_PT0_SX150_V1___.jpg\" alt=\"dragon ball z kakarot\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/9bd2adf9-832a-497e-9d97-d6ac846382d4.__CR0,1,413,826_PT0_SX150_V1___.jpg\" alt=\"dragon ball z kakarot\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/8c731949-7d6e-496a-bf1b-2844ccb000f7.__CR0,0,150,300_PT0_SX150_V1___.jpg\" alt=\"DBZ Dragon Ball Kakarot Switch\"></th></tr><tr><th>&nbsp;</th><th><a href=\"https://www.amazon.fr/dp/B07XJZS6L2/ref=emc_b_5_t\">Dragon Ball Z : Kakarot PS4 Standard</a></th><th><a href=\"https://www.amazon.fr/dp/B07XL54Z1H/ref=emc_b_5_t\">Dragon Ball Z : Kakarot X1 Standard</a></th><th><a href=\"https://www.amazon.fr/dp/B07XTNM71T/ref=emc_b_5_t\">Dragon Ball Z : Kakarot PS4 et X1 Collector</a></th><th><a href=\"https://www.amazon.fr/dp/B0989PMQQ4/ref=emc_b_5_t\">Dragon Ball Z : Kakarot NSW</a></th></tr><tr><th>Jeu complet</th><th>✓</th><th>✓</th><th>✓</th><th>✓</th></tr><tr><th>Artbook du jeu</th><th>&nbsp;</th><th>&nbsp;</th><th>✓</th><th>&nbsp;</th></tr><tr><th>Steelbook</th><th>&nbsp;</th><th>&nbsp;</th><th>✓</th><th>&nbsp;</th></tr><tr><th>Diorama Exclusif</th><th>&nbsp;</th><th>&nbsp;</th><th>✓</th><th>&nbsp;</th></tr><tr><th>Season Pass</th><th>&nbsp;</th><th>&nbsp;</th><th>✓</th><th>&nbsp;</th></tr><tr><th>Illustration de la carte du jeu</th><th>&nbsp;</th><th>&nbsp;</th><th>✓</th><th>&nbsp;</th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/51516ebd-7705-407d-8531-0265ae01b88a.__CR0,243,1920,594_PT0_SX970_V1___.png\" alt=\"Dragon ball z kakarot\"></p><p>&nbsp;</p>', 1, 49.90, 31, 49.90, NULL, NULL, 0, 0, 0, NULL, 'CU0000033', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 680, \"original\": \"https://api.click-games.fr/storage/630/71Br-c+klYS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/630/conversions/71Br-c+klYS._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 681, \"original\": \"https://api.click-games.fr/storage/631/71Br-c+klYS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/631/conversions/71Br-c+klYS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 682, \"original\": \"https://api.click-games.fr/storage/632/61MmODSyn7S._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/632/conversions/61MmODSyn7S._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 683, \"original\": \"https://api.click-games.fr/storage/633/71QNFyZqP4S._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/633/conversions/71QNFyZqP4S._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 684, \"original\": \"https://api.click-games.fr/storage/634/71KNjLGXPIS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/634/conversions/71KNjLGXPIS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 685, \"original\": \"https://api.click-games.fr/storage/635/71MNgw4IWzS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/635/conversions/71MNgw4IWzS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 686, \"original\": \"https://api.click-games.fr/storage/636/71IEcfYCjaS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/636/conversions/71IEcfYCjaS._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-02 20:02:05', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(46, NULL, 'Kirby et le monde oublié', 'kirby-et-le-monde-oublie', '<p><br><img src=\"https://m.media-amazon.com/images/I/81IiL3UGaxL.jpg\" alt=\"Kirby et le monde oublié (Nintendo Switch)\"></p><p><img src=\"https://m.media-amazon.com/images/I/714t2YK36rL.jpg\" alt=\"\"></p><p><img src=\"https://m.media-amazon.com/images/I/71CjWoux-mL.jpg\" alt=\"\"></p><p><img src=\"https://m.media-amazon.com/images/I/61agS2kaf6L.jpg\" alt=\"\"></p><p><img src=\"https://m.media-amazon.com/images/I/71PDda3EPPL.jpg\" alt=\"\"></p><p><img src=\"https://m.media-amazon.com/images/I/819L+lSeFNL.jpg\" alt=\"\"></p>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, '2022-03-25 00:00:00', 'CU0000034', 952, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 687, \"original\": \"https://api.click-games.fr/storage/637/B512F013-19E9-4132-849F-57E5982EA0B4.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/637/conversions/B512F013-19E9-4132-849F-57E5982EA0B4-thumbnail.jpg\"}', '[{\"id\": 687, \"original\": \"https://api.click-games.fr/storage/637/B512F013-19E9-4132-849F-57E5982EA0B4.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/637/conversions/B512F013-19E9-4132-849F-57E5982EA0B4-thumbnail.jpg\"}, {\"id\": 688, \"original\": \"https://api.click-games.fr/storage/638/38B971BA-B0A2-4657-ACC1-8E0A9991A186.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/638/conversions/38B971BA-B0A2-4657-ACC1-8E0A9991A186-thumbnail.jpg\"}, {\"id\": 689, \"original\": \"https://api.click-games.fr/storage/639/1FA062C4-BC1D-482D-8E10-98A0D13B3C37.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/639/conversions/1FA062C4-BC1D-482D-8E10-98A0D13B3C37-thumbnail.jpg\"}, {\"id\": 690, \"original\": \"https://api.click-games.fr/storage/640/C1AB2FB5-1613-4B82-9F95-122B100BB0FD.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/640/conversions/C1AB2FB5-1613-4B82-9F95-122B100BB0FD-thumbnail.jpg\"}, {\"id\": 691, \"original\": \"https://api.click-games.fr/storage/641/58F37DE4-767C-4D36-A6E5-B38DB96413AE.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/641/conversions/58F37DE4-767C-4D36-A6E5-B38DB96413AE-thumbnail.jpg\"}, {\"id\": 692, \"original\": \"https://api.click-games.fr/storage/642/FC14AD30-22A3-4C44-9C1D-2667286F998B.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/642/conversions/FC14AD30-22A3-4C44-9C1D-2667286F998B-thumbnail.jpg\"}, {\"id\": 693, \"original\": \"https://api.click-games.fr/storage/643/7EB07F11-41FE-4999-8F92-958DFF2D2846.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/643/conversions/7EB07F11-41FE-4999-8F92-958DFF2D2846-thumbnail.jpg\"}]', NULL, '2022-02-10 07:46:25', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(47, NULL, 'KIRBY STAR ALLIES', 'kirby-star-allies-2', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/b5699f1b-c00e-4226-ab6f-8cbcbb41ef88._SR300,300_.jpg\" alt=\"\"></p><h3><strong>Unissez vos pouvoirs pour vaincre les ténèbres !</strong></h3><p>Retrouvez Kirby dans sa toute première aventure sur Nintendo Switch ! Alors que notre boule rose préférée fait tranquillement sa sieste, un déluge de coeurs sombres s\'abat sur Dream Land, transformant tous ses habitants en terrifiants méchants ! Devant le danger, à vous de recruter de nouveaux compagnons pour sauver le royaume.</p><p>Quand vos ennemis deviennent vos alliés : En plus de pouvoir copier de multiples aptitudes différentes en avalant ses ennemis, Kirby peut maintenant devenir amis avec eux pour associer Plusieurs pouvoirs en même temps ! A chaque pouvoir, son utilité : Faites fondre la glace avec le feu, actionnez des mécanismes avec de l\'électricité, et plus encore. Cultivez votre esprit d\'équipe pour surpasser les obstacles sur votre route.</p><p>Et si vous partagiez l\'aventure avec vos proches ? Créez votre propre équipe en mode local jusqu\'à quatre joueurs et utilisez des pouvoirs complémentaires pour débloquer les différents niveaux !</p><p>Serrez-vous les coudes (même petits et roses) dès le 16 mars avec Kirby Star Allies en exclusivité sur Nintendo Switch.</p><h3><strong>Formez une équipe de choc pour sauver Dream Land !</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/bad50c49-4817-4e37-95f1-dcbd1f88f630._SL300__.jpg\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>Recrutez jusqu\'à trois alliés aux compétences uniques et complémentaires</strong></h4><p>Et surmontez toutes les épreuves ensemble. De l\'eau vous empêche de passer ? Engagez un ennemi avec la compétence Parapluie. Vous avez plutôt besoin d\'un peu de muscles contre un ennemi coriace ? Combattez aux côtés de Bio Spark et sa compétence Ninja ! A chaque problème sa solution.</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d36684c9-8a75-4223-bd8a-54b8c81549d9._SL300__.jpg\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>Une ribambelle de pouvoirs à combiner</strong></h4><p>Mêlez l\'eau et le feu pour créer de dangereux stalactites géants, fusionnez bombe et vent pour créer une bombe volante et tout détruire sur votre passage. A vous d\'associer judicieusement les pouvoirs de votre équipiers afin de lancer de puissantes attaques combinées, résoudre des énigmes diaboliques et même découvrir des zones secrètes bien cachées.</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/06f79eab-9900-48b2-a0a6-d5f4d77badcc._SL300__.JPG\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>Inédit : Maîtrisez les nouveaux pouvoirs de Kirby</strong></h4><p>Comme la capacité Araignée, qui vous permet d\'emprisonner l\'adversaire dans votre toile !</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/f7b46158-3bd8-4939-8d09-d4ed7dd27287._SL300__.JPG\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>Pour sa première sur Nintendo Switch, Kirby met le paquet sur la plateforme !</strong></h4><p>Explorez tous les recoins de Dream Land et parcourez les nombreux niveaux pour sauver la situation de la mystérieuse force venue de l\'espace attention aux ennemis qui rôdent sur le chemin. Fouillez bien chaque recoin pour découvrir des bonus et autres passages secrets !</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/2e33e2e6-995e-47c2-8ea6-88739f56b966._SL300__.png\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>Une aventure accessible jusqu\'à quatre en mode local !</strong></h4><p>En plus du mode solo, vous avez la possibilité de faire toute l\'aventure en mode coopératif avec jusqu\'à 3 de vos proches. Unissez vos forces et entraidez-vous pour avancer dans les niveaux ! Un gouffre vous sépare de la sortie ? Formez un pont vivant avec les membres de votre équipe pour traverser !</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/9f3de8ed-a51c-4c37-af4f-618093d5daab._SL300__.JPG\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>Profitez de Kirby Star Allies comme bon vous semble</strong></h4><p>Grâce aux possibilités de la Nintendo Switch, à tout moment, rejoignez une partie en cours ! Partagez votre paire de Joy-Con en mode table ou contrôlez Kirby avec votre manette pro en mode TV. De multiples façons de jouer en famille ou entre amis !</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/12e59409-6365-483c-8729-f75c7ee9d667._SL300__.jpg\" alt=\"\"></p><h3><strong>Kirby</strong></h3><p>Notre héros Kirby est une adorable boule rose qui possède des capacités extraordinaires : Il peut avaler ses ennemis pour imiter leurs pouvoirs, voler dans les airs en se remplissant d\'air. Et désormais, lancer un coeur rose pour recruter ses anciens ennemis !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/67f0e7c5-3003-4c81-b900-fb6ce466cb33._SL300__.jpg\" alt=\"\"></p><h3><strong>Roi Dadidou</strong></h3><p>Le Roi Dadidou se considère lui-même comme le dirigeant de Dream Land. Après avoir été touché par un coeur maléfique, il subit une transformation musclée.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/474b2ec4-71e8-43a2-bf40-f3385bb0bd48._SL300__.jpg\" alt=\"\"></p><h3><strong>Francisca</strong></h3><p>Avec sa longue chevelure bleue, Francisca donnera du fil à retordre à Kirby, maîtrisant à merveille le pouvoir de la glace.</p>', 1, 59.00, 31, 59.00, NULL, NULL, 0, 0, 0, NULL, 'CU0000035', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 694, \"original\": \"https://api.click-games.fr/storage/644/B3DFBC31-2A2E-448A-AFAA-9D5FA3B2D8B1.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/644/conversions/B3DFBC31-2A2E-448A-AFAA-9D5FA3B2D8B1-thumbnail.jpg\"}', '[{\"id\": 695, \"original\": \"https://api.click-games.fr/storage/645/D7E9ED52-0402-4F70-B70A-3F53352B7FFF.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/645/conversions/D7E9ED52-0402-4F70-B70A-3F53352B7FFF-thumbnail.jpg\"}]', NULL, '2022-02-10 07:55:22', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL);
