(48, NULL, 'Splatoon 2', 'splatoon-2', '<h3><br><strong>VOTRE TERRAIN DE JEU EST PARTOUT !</strong></h3><p>La Guerre des couleurs comme vous ne l\'avez jamais vue ! Dans le monde des Inklings, des humanoïdes pouvant se transformer en calamars, on règle ses comptes à grandes rafales de peinture ! Ces gangs flashy n\'ont qu\'un objectif : recouvrir le plus de surface avec leur propre couleur ! Nagez, sautez et faufilez-vous dans l\'encre pour dominer le terrain à l\'aide de vos armes chargées de peinture ! Avec la Nintendo Switch, jouez dans votre salon sur la télé puis continuez la bataille n\'importe où, en mode portable, en solo et en local jusqu\'à 8 joueurs sur 8 consoles !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e219484b-5685-4c65-9b0a-4b91624ad56f._SL300__.jpg\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>UN MODE SOLO QUI ÉCLABOUSSE !</strong></h4><p>Les Inklings ont du souci à se faire : les Octariens sont de retour, faisant souffler un vent de panique sur la ville et Ayo, célèbre chanteuse des Calamazones, est portée disparue ! Pour rétablir la vérité à Chromapolis, aidez Oly, sa partenaire et agent secret à ses heures perdues, à mener l\'enquête ... Équipé de votre arsenal, partez à l\'aventure dans de niveaux déjantés et tentez de réunir à nouveau les Calamazones dans ce mode solo !</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/50279662-d46d-4d14-afe2-b0ce6384f1c1._SL300__.jpg\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>DE NOUVELLES ARMES QUI NE FONT PAS TÂCHE !</strong></h4><p>Ou plutôt si, elles font deux fois plus de tâches ! Comme le tout nouveau Double Encreur qui permet de mitrailler avec une arme dans chaque main tout en se déplaçant ultra facilement ! Retrouvez aussi vos armes fétiches parmi les dizaines d\'armes disponibles, des plus imposantes avec les Rouleaux, aux plus précises avec les différentes versions du Concentrateur.</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/f6b1c98f-836b-4956-8f1c-e77fda2fb0c0._SL300__.jpg\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>ENCORE PLUS D\'ARENES A REPEINDRE !</strong></h4><p>Faites de votre équipe d\'Inklings les rois de la glisse sur la Piste Méroule et mélangez votre âme d\'artiste-peintre et de pro de la gonflette dans le Gymnase Ancrage, deux des nouvelles arènes de Splatoon 2 ! Ces nouvelles arènes n\'attendent que d\'être repeintes à votre sauce !</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/853ce09b-ad78-4a6d-a938-ccbb01913683._SL300__.jpg\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>DU NOUVEAU A CHROMAPOLIS !</strong></h4><p>Au square Chromapolis, ça grouille de petits calamars en activité. Et s\'il y a bien une chose que les Inklings adorent, c\'est la mode ! Les boutiques les plus cools de la ville sont à votre disposition afin de parfaire votre look et de rester à la pointe de la mode ! Ne négligez pas votre style : les vêtements et accessoires que vous choisissez peuvent améliorer vos compétences au combat !</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/18935b3b-f465-4aa8-8ec1-524206554f77._SL300__.jpg\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>VOTRE MISSION : LA COOPÉRATION !</strong></h4><p>Une application pour smartphone verras le jour afin de faciliter la programmation des matchs de votre équipe de calamars ! Il sera également possible de discuter avec vos amis céphalopodes directement via l\'application pour favoriser la coopération !</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/2167aaf8-c6b4-4bf9-a086-e12724b1cc54._SL300__.PNG\" alt=\"\">&nbsp;<br>&nbsp;</p><h4><strong>COMPATIBILITÉ AMIIBO</strong></h4><p>- Sauvegardez l\'équipement et les armes de votre Inkling pour l\'emmener chez vos amis !</p><p>- Débloquez des armes et équipements inédits !</p><p>- Prenez des selfies avec vos Inklings et partagez-les !</p><p>&nbsp;</p><h3><strong>Du multi avec vos calamarades</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d6da14fe-04a4-485c-9251-19c077d02cc0._SL220__.jpg\" alt=\"\"></p><h4><strong>GUERRE DE TERRITIOIRE</strong></h4><p>Mode de jeu multi-joueurs classique où deux équipes de 4 Inklings se battent pour recouvrir le plus de surface possible avec leur propre peinture.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/0ca2f3a8-9d19-496a-ae0c-1c6edab2b89d._SL220__.jpg\" alt=\"\"></p><h4><strong>DÉFENSE DE ZONE</strong></h4><p>Pour les calamars plus compétitifs, la Défense de zone se joue en match classé. Ici, le but est de défendre des zones délimitées sur la carte et de les protéger des adversaires. L\'esprit d\'équipe et la communication sont indispensables !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/78e1674c-06c5-416e-9362-7d8087c383a4._SL220__.jpg\" alt=\"\"></p><h4><strong>SALMON RUN</strong></h4><p>Pour arrondir leurs fins de mois, les Inklings ont un emploi à temps partiel, la chasse aux oeufs ! Affrontez les Salmonoïdes, de nouveaux ennemis, dans ce mode de jeu inédit. L\'objectif ? Récolter des oeufs de poisson tout en repoussant les hordes d\'ennemis qui tentent de vous en empêcher !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/6cb734c0-8c4f-4f99-9e04-269063920752._SL220__.jpg\" alt=\"\"></p><h4><strong>.... ET BIEN D\'AUTRES VOUS ATTENDENT !</strong></h4><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/82e451d8-9f0c-4efe-8722-3cf2927cdd45._SL300__.png\" alt=\"\"></p><h3><strong>LE ROULEAU : Repeint l\'arène en un rien de temps !</strong></h3><p>Le Rouleau est une arme lourde mais extrêmement efficace pour repeindre l\'arène à vos couleurs ! Très large et avec un court rayon d\'action,il est redoutable au corps à corps.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/ee540b8b-b9ce-473f-aa22-842985692bdb._SL300__.PNG\" alt=\"\"></p><h3><strong>LE DOUBLE ENCREUR : Pour deux fois plus de jets de peinture !</strong></h3><p>Le Double Encreur est une nouvelle arme à la cadence endiablée mais à portée limitée. Légère et rapide, cette arme est parfaite pour les Inklings qui ne tiennent pas en place !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/623eeb1e-05d2-40da-ad2f-0cf7206d3b74._SL300__.jpg\" alt=\"\"></p><h3><strong>LE SEAUCEUR : Attention aux giclées de peinture !</strong></h3><p>Avec ce gros seau de peinture, il devient très facile de recouvrir le sol et les murs avec votre couleur. Terriblement efficace pour mettre de l\'encre partout, le Seauceur n\'est cependant pas très précis, alors attention lors des combats !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/2747a500-497b-4885-beda-37431b7ccc17._SL300__.PNG\" alt=\"\"></p><h3><strong>LE CONCENTRATEUR : L\'arrosage de loin !</strong></h3><p>Certains diront que c\'est fourbe, d\'autres diront que c\'est réservé aux Inklings d\'élite : le Concentrateur est un fusil de sniper à longue portée mais qui réduit la mobilité. Très efficace pour soutenir son équipe en hauteur et de loin !</p>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000036', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 696, \"original\": \"https://api.click-games.fr/storage/646/F73D60F4-84A8-439A-A7CD-7C70A0D3DE68.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/646/conversions/F73D60F4-84A8-439A-A7CD-7C70A0D3DE68-thumbnail.jpg\"}', '[{\"id\": 697, \"original\": \"https://api.click-games.fr/storage/647/92F1F610-0453-4AE7-A822-BF32426D4884.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/647/conversions/92F1F610-0453-4AE7-A822-BF32426D4884-thumbnail.jpg\"}, {\"id\": 698, \"original\": \"https://api.click-games.fr/storage/648/3DE324F4-D4A1-408C-8E91-D1FC2131EAAC.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/648/conversions/3DE324F4-D4A1-408C-8E91-D1FC2131EAAC-thumbnail.jpg\"}, {\"id\": 699, \"original\": \