lick-games.fr/storage/666/91oy7KLqWmL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/666/conversions/91oy7KLqWmL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 717, \"original\": \"https://api.click-games.fr/storage/667/91NisnQVlYL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/667/conversions/91NisnQVlYL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 718, \"original\": \"https://api.click-games.fr/storage/668/81+Hy-VQNIL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/668/conversions/81+Hy-VQNIL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 719, \"original\": \"https://api.click-games.fr/storage/669/819IBi0B-KL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/669/conversions/819IBi0B-KL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 720, \"original\": \"https://api.click-games.fr/storage/670/71tV6-yyjFL._AC_SL1080_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/670/conversions/71tV6-yyjFL._AC_SL1080_-thumbnail.jpg\"}, {\"id\": 721, \"original\": \"https://api.click-games.fr/storage/671/81-evQTuLOL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/671/conversions/81-evQTuLOL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-12 20:24:17', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(51, NULL, 'Riders Republic - Édition Limitée', 'riders-republic-edition-limitee', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/35fc8478-3466-48e9-a34f-fe3367141d34.__CR0,0,970,600_PT0_SX970_V1___.png\" alt=\"RR\"></p><p>Pars à l’assaut de l’immense terrain de jeu multijoueur RIDERS REPUBLIC ! Rencontre et affronte d’autres joueurs, ride comme jamais et lance-toi dans des activités exaltantes comme le vélo, le ski, le snowboard, la wingsuit et la wingsuit propulsée.</p><p>Donne tout ce que tu as. Vis ta folie !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/310ffef1-06bd-4a53-8bb1-496d70d89ea4.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"Img 1\"></p><h3><strong>DÉCOUVRE UN ÉNORME TERRAIN DE JEU SOCIAL</strong></h3><p>Vis le rêve de tout rider et explore librement un immense monde ouvert animé, où se retrouvent de nombreux autres joueurs. Parcours des parcs nationaux américains emblématiques comme Bryce Canyon, Yosemite Valley, Mammoth Mountain... tous réunis pour t’offrir un maximum de sensations !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/698bbab1-38c2-475c-af0e-62fdf2800f28.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"RR2 \"></p><h3><strong>JOUE AVEC OU CONTRE TES AMIS DANS DES MODES MULTIJOUEUR DÉMENTIELS</strong></h3><p>Fais équipe avec tes amis et participe à une grande variété de modes multijoueur : fais le plein d\'adrénaline dans des courses de descente, domine les cartes dans des compétitions équipe contre équipe ou donne-toi à fond dans des courses PvP en mass start épiques.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/08d1c6df-d5c9-4cbf-b8e8-f407e51dbcd3.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"RR3\"></p><h3><strong>GÈRE TA CARRIÈRE ET HISSE-TOI AU SOMMET DU CLASSEMENT</strong></h3><p>Crée ton propre rider grâce à un équipement évolutif basé sur ta progression et définit chaque aspect de ton avatar. Que tu veuilles faire partie des meilleurs snowboardeurs ou des plus rapides sur deux roues, tout est possible.</p><p>&nbsp;</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 80.00, 31, 80.00, NULL, NULL, 0, 0, 0, NULL, 'CU0000039', 10, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 722, \"original\": \"https://api.click-games.fr/storage/672/81KqMEL3PqL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/672/conversions/81KqMEL3PqL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 723, \"original\": \"https://api.click-games.fr/storage/673/81KqMEL3PqL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/673/conversions/81KqMEL3PqL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 724, \"original\": \"https://api.click-games.fr/storage/674/71NbMdiyjNL._AC_SL1080_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/674/conversions/71NbMdiyjNL._AC_SL1080_-thumbnail.jpg\"}, {\"id\": 725, \"original\": \"https://api.click-games.fr/storage/675/71vbsDeN9FL._AC_SL1080_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/675/conversions/71vbsDeN9FL._AC_SL1080_-thumbnail.jpg\"}, {\"id\": 726, \"original\": \"https://api.click-games.fr/storage/676/71IAAOiRBoL._AC_SL1080_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/676/conversions/71IAAOiRBoL._AC_SL1080_-thumbnail.jpg\"}, {\"id\": 727, \"original\": \"https://api.click-games.fr/storage/677/81a0SHkEMTL._AC_SL1080_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/677/conversions/81a0SHkEMTL._AC_SL1080_-thumbnail.jpg\"}, {\"id\": 728, \"original\": \"https://api.click-games.fr/storage/678/81ES2BiNNcL._AC_SL1080_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/678/conversions/81ES2BiNNcL._AC_SL1080_-thumbnail.jpg\"}, {\"id\": 729, \"original\": \"https://api.click-games.fr/storage/679/81WA6AlALqL._AC_SL1080_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/679/conversions/81WA6AlALqL._AC_SL1080_-thumbnail.jpg\"}, {\"id\": 730, \"original\": \"https://api.click-games.fr/storage/680/71TbslRiBUL._AC_SL1080_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/680/conversions/71TbslRiBUL._AC_SL1080_-thumbnail.jpg\"}, {\"id\": 731, \"original\": \"https://api.click-games.fr/storage/681/71QtjhNMQ9L._AC_SL1080_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/681/conversions/71QtjhNMQ9L._AC_SL1080_-thumbnail.jpg\"}, {\"id\": 732, \"original\": \"https://api.click-games.fr/storage/682/81lm54oVu0L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/682/conversions/81lm54oVu0L._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-12 20:30:19', '2022-05-18 09:00:45', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(52, NULL, 'Far Cry 6 Edition Limitée', 'far-cry-6-edition-limitee', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/4ad543d6-ef3f-4fc9-aa8b-16c73ec9be47.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Far Cry 6 Header\"></p><h3><strong>Far Cry 6</strong></h3><p>Bienvenue sur Yara, un paradis tropical figé dans le temps. Anton Castillo, dictateur de l\'île, est bien décidé à rendre sa gloire d\'antan à la nation, accompagné de son fils Diego qui suit les traces sanglantes de son père. Leur régime de terreur a déclenché une véritable révolution dans tout le pays.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/8641252b-fc9c-4023-b446-2e3ffff2fceb.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"FC6 FIGHTSTREETS\"></p><h3><strong>COMBATTEZ POUR LA LIBERTÉ</strong></h3><p>Incarnez Dani Rojas, un citoyen de l\'île, et aidez la guérilla à libérer la nation.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/7e434099-9ed3-42b8-83ab-0dc40c4811dd.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"ISLANDNATION \"></p><h3><strong>UNE ÎLE DE YARA DÉCHIRÉE</strong></h3><p>Combattez les troupes d\'Anton sur le plus grand terrain de jeu Far Cry à ce jour, entre la jungle, les plages et Esperanza, capitale de Yara.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/daff99d3-97bf-40a8-a0f5-37bbd975bc86.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\" FIREPOWER\"></p><h3><strong>GUÉRILLA ET PUISSANCE DE FEU</strong></h3><p>Utilisez des armes et véhicules de fortune, mais aussi \"Amigos\", le nouveau système d\'animaux, pour mettre un terme à la tyrannie.</p>', 1, 49.00, 31, 49.00, NULL, NULL, 0, 0, 0, NULL, 'CU0000040-1', 10, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1042, \"original\": \"https://api.click-games.fr/storage/992/81JC78QuD-S._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/992/conversio