(54, NULL, 'Marvel\'s Spider-Man : Miles Morales', 'marvel-s-spider-man-miles-morales', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/4fd77a65-849c-45b6-8fc4-8c442e675aae.__CR0,0,970,300_PT0_SX970_V1___.jpg\" alt=\" \"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/b98cc588-12f6-4475-b412-3e3fa21c9656.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\" \"></p><h3><strong>Devenez meilleur. Devenez vous-mêmes.</strong></h3><p><strong>Marvel\'s Spider-Man : Miles Morales Edition Standard</strong></p><p>&nbsp;</p><p>Dans la nouvelle aventure de l\'univers Marvel\'s Spider-Man, le jeune Miles Morales tente de combiner ses deux vies avec son tout nouveau rôle en tant que Spider-Man, tout en marchant dans les pas de son mentor, Peter Parker. Mais quand une lutte féroce de pouvoir menace de détruire sa nouvelle vie, le héros réalise qu\'avec de grands pouvoirs viennent de grandes responsabilités. Pour sauver tout le New York de Marvel, Miles doit reprendre le flambeau de Spider-Man, et devenir un véritable héros.</p><p>Vivez l\'avènement de Miles Morales en tant que héros, à mesure qu\'il apprend à maîtriser de nouveaux pouvoirs explosifs pour devenir sa propre version de Spider-Man.</p><h4>Vos avantages en un coup d\'œil :</h4><ul><li>Jeu d\'action et d\'aventure</li><li>1 joueur</li><li>Disponible en français et en anglais</li><li>Qualité d\'image 4K et audio 3D pour une expérience immersive complète</li><li>Compatible avec PS5 et manette DualSense</li><li>Bonus de précommande : 2 Spider-Tenues, Gadget Puits de Gravité et 3 points de compétence</li></ul><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/861809f8-36b7-4768-bd7c-9451c074635d.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\" \"></p><h3><strong>L\'avènement de Miles Morales</strong></h3><p>Miles découvre ses nouveaux pouvoirs explosifs et ils diffèrent de ceux de son mentor, Peter Parker. Apprenez à maîtriser ses décharges bio-électriques uniques ainsi que son pouvoir de camouflage ou encore ses acrobaties aériennes, en plus de ses gadgets et de ses compétences.</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 59.99, 31, 59.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000042-1', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1035, \"original\": \"https://api.click-games.fr/storage/985/81oqvhd82yL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/985/conversions/81oqvhd82yL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 758, \"original\": \"https://api.click-games.fr/storage/708/81SZZG2wpTL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/708/conversions/81SZZG2wpTL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 759, \"original\": \"https://api.click-games.fr/storage/709/81zAf1sFyBL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/709/conversions/81zAf1sFyBL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 760, \"original\": \"https://api.click-games.fr/storage/710/815IWuWEk6L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/710/conversions/815IWuWEk6L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 761, \"original\": \"https://api.click-games.fr/storage/711/814GXLGhRiL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/711/conversions/814GXLGhRiL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 762, \"original\": \"https://api.click-games.fr/storage/712/81QC9CP-A7L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/712/conversions/81QC9CP-A7L._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-12 20:41:48', '2022-05-18 09:00:46', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(55, NULL, 'NBA 2K22', 'nba-2k22', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/438fd806-b973-4b42-b81e-763ada82d8ea.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"NBA 2K22\"></p><h3><strong>NBA 2K22 - L\'EXPÉRIENCE DE BASKET ULTIME</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/2d48d87f-b5bd-459d-97bd-1673a659f5cc.__CR0,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"NBA 2K22 - Dirk Nowitzki\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/a569714c-0b06-43ad-afc3-8187b95b2ba7.__CR0,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"Candace Parker\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/e4ef095d-f37a-41f6-a246-ea0fff8b33a4.__CR0,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"Luka Doncic\"></th></tr><tr><th><h4>PLONGEZ AU COEUR DU JEU</h4><p>Jouez avec vos équipes et stars préférées de la NBA et WNBA, et vivez une expérience authentique de basket professionnel au plus haut niveau. Le basket n\'a jamais été plus réel et complet que dans NBA 2K : présentation visuelle et IA de pointe, effectifs actualisés, équipes historiques et bien plus. Ressentez l\'énergie de la foule, l\'intensité de la compétition et amusez-vous à n\'en plus finir dans l\'un des jeux de sport les plus immersifs qui existent à ce jour.</p></th><th><h4>DÉCOUVREZ UNE COMMUNAUTÉ IMMENSE</h4><p>Dans la Ville (sur PlayStation 5 et Xbox Series X|S) ou dans le Quartier (sur PlayStation 4, Xbox One, Nintendo Switch, et PC), vivez votre passion pour le basket au sein de l\'une des communautés de fans de basket les plus grandes et vivantes qui soient. Mettez-vous au travail, entraînez-vous et dominez le parquet avec Mon JOUEUR. Devenez l\'athlète que vous avez toujours rêvé d\'être aux côtés d\'autres fans de la NBA.</p></th><th><h4>CONSTITUEZ VOTRE ÉQUIPE DE RÊVE</h4><p>Montez l\'équipe fictive ultime avec les stars de la NBA d\'aujourd\'hui et les légendes d\'hier dans MyTEAM. MyTEAM est une expérience de collection et de compétition stimulante. Elle combine l\'excitation de la découverte et de l\'obtention des cartes de vos joueurs préférés et l\'intensité des rencontres entre les différentes sélections proposées par la communauté de MyTEAM. Jouez, gagnez, sélectionnez, et prenez part à des défis, des tournois et bien d\'autres.</p></th></tr></tbody></table></figure>', 1, 37.99, 31, 37.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000043', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 763, \"original\": \"https://api.click-games.fr/storage/713/814XAGz4xYS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/713/conversions/814XAGz4xYS._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 764, \"original\": \"https://api.click-games.fr/storage/714/814XAGz4xYS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/714/conversions/814XAGz4xYS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 765, \"original\": \"https://api.click-games.fr/storage/715/71o-dV5IaCL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/715/conversions/71o-dV5IaCL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 766, \"original\": \"https://api.click-games.fr/storage/716/71a7kgo-UGL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/716/conversions/71a7kgo-UGL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 767, \"original\": \"https://api.click-games.fr/storage/717/714jwL0kwNL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/717/conversions/714jwL0kwNL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-02-12 20:48:24', '2022-05-18 09:00:46', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(56, NULL, 'Uncharted Legacy of Thieves Collection', 'uncharted-legacy-of-thieves-collection', '<p>Cherchez votre héritage et laissez votre empreinte sur la carte avec UNCHARTED™: Legacy of Thieves Collection. Vivez une expérience narrative et cinématique exaltante signée Naughty Dog, et plongez dans les plus grandes scènes d\'action de cette série emblématique.Découvrez des morceaux d\'histoire perdus avec Nathan Drake et Chloe Frazer, des voleurs charismatiques à la personnalité complexe, tandis qu\'ils voyagent pleins d\'émerveillement autour du monde, en quête d\'aventures extraordinaires et de mythes oubliés.UNCHARTED™: Legacy of Thieves Collection contient les aventures en solo acclamées par la critique UNCHARTED™ 4: A Thief’s End et UNCHARTED™: The Lost Legacy, magnifiquement remastérisées pour la console PS5™ avec des graphismes et des fréquences d\'images améliorées.</p>', 1, 58.38, 31, 58.38, NULL, NULL, 0, 0, 0, NULL, 'CU0000044', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 768, \"original\": \"https://api.click-games.fr/storage/718/91u-RP3+NTL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/718/conversions/91u-RP3+NTL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 769, \"original\": \"https://api.click-games.fr/storage/719/91u-RP3+NTL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/719/conversions/91u-RP3+NTL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 770, \"original\": \"https://api.click-games.fr/storage/720/71-DMlkufTL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/720/conversions/71-DMlkufTL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 771, \"original\": \"https://api.click-games.fr/storage/721/81Q2DMrIhwL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/721/conversions/81Q2DMrIhwL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 772, \"original\": \"https://api.click-games.fr/storage/722/81js31HJCgL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api