(58, NULL, 'Demon’s Souls', 'demon-s-souls', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/daa6db93-498d-464d-9329-089bc0cd629b.__CR0,0,970,300_PT0_SX970_V1___.jpg\" alt=\" \"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/841a676e-a1bd-4821-8d36-1a9a7a620943.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\" \"></p><h3><strong>Découvrez l\'histoire troublante et les combats sans pitié de Boletaria dans ce remake entièrement réinventé</strong></h3><p><strong>Demon\'s Souls sur PlayStation 5</strong></p><p>&nbsp;</p><p>Dans sa quête de pouvoir, le roi Allant, 12ème roi de Boletaria, s\'appropria les anciens arts de l\'âme, réveillant ainsi un démon aussi vieux que le monde, l\'Ancien. Une épaisse brume et des créatures cauchemardesques ayant soif d\'âmes humaines envahirent la région suite au réveil de l\'Ancien. Ceux dont l\'âme avait été volée par les créatures devinrent fous à lier, leur seul désir étant désormais d\'attaquer les quelques rescapés encore sains d\'esprit.</p><p>Boletaria est désormais coupée du monde extérieur. Les chevaliers qui osent s\'aventurer dans cet épais brouillard dans l\'espoir de délivrer la contrée de ce calvaire n\'en ressortent jamais. Guerrier solitaire bravant la brume funeste, vous devez affronter les épreuves les plus insurmontables pour mériter le titre de Fléau des démons et replonger l\'Ancien dans son sommeil éternel.</p><h4>Vos avantages en un coup d\'œil :</h4><ul><li>Remake du classique Demon\'s Souls</li><li>1 joueur</li><li>Version multijoueur en ligne (2-6 joueurs)</li><li>Disponible en français et en anglais</li><li>Qualité d\'image 4K et audio 3D pour une immersion complète</li><li>Compatible avec PS5 et manette DualSense</li></ul><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/0fd792fc-a3f3-406e-8fa0-4025e17781e3.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\" \"></p><h3><strong>Découvrez comment tout a commencé</strong></h3><p>Revivez dans ce remake du classique de PlayStation l’aventure entièrement remaniée dans toute sa brutalité. La qualité visuelle époustouflante et les performances accrues vous feront voyager dans le monde de Boletaria comme jamais auparavant.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/0fd792fc-a3f3-406e-8fa0-4025e17781e3.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\" \"></p><p>Découvrez comment tout a commencé</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/1659221e-a206-4d15-819b-7bbcde82cf4b.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\" \"></p><p>Affrontez et détruisez les démons</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/5b3c8e47-e662-4e66-941b-c2bd2698aff5.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\" \"></p><p>Vous aimez les arts de la sorcellerie et de la guerre ?</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/0d64af71-a515-452b-872b-c8851e071a18.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\" \"></p><p>Les plus grands guerriers du monde n\'attendent que vous !</p>', 1, 69.24, 31, 69.24, NULL, NULL, 0, 0, 0, NULL, 'CU0000046', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 785, \"original\": \"https://api.click-games.fr/storage/735/81KQ95YstNL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/735/conversions/81KQ95YstNL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 786, \"original\": \"https://api.click-games.fr/storage/736/81KQ95YstNL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/736/conversions/81KQ95YstNL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 787, \"original\": \"https://api.click-games.fr/storage/737/81odpMk8XYL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/737/conversions/81odpMk8XYL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 788, \"original\": \"https://api.click-games.fr/storage/738/81Wmkp-2zWL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/738/conversions/81Wmkp-2zWL._AC_SL1500_-thumb