(60, NULL, 'Mortal Kombat 11', 'mortal-kombat-11', '<p>The Definitive mk11 experience! Take control of earthrealm\'s protectors in the game\'s two critically acclaimed, time-bending story campaigns as they race to stop kronika from rewinding time and rebooting history. Friendships are tested, and new alliances forged, in the battle to save all of existence. mk11 ultimate features the complete character roster, including new additions rain, mileena &amp; Rambo.</p><p>Mortal Kombat 11 showcases every amusing friendship, gory Fatality and soul-crushing Fatal blow like never before. You\'ll be so close to the fight, you can feel it!</p><p>includes Mortal Kombat 11, Kombat Pack 1, mk11: aftermath &amp; Kombat Pack 2.</p><p>&nbsp;</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 39.21, 31, 39.21, NULL, NULL, 0, 0, 0, NULL, 'CU0000048', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 801, \"original\": \"https://api.click-games.fr/storage/751/81JUeRPYdiL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/751/conversions/81JUeRPYdiL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 802, \"original\": \"https://api.click-games.fr/storage/752/81JUeRPYdiL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/752/conversions/81JUeRPYdiL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 803, \"original\": \"https://api.click-games.fr/storage/753/81uSVwmPCpL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/753/conversions/81uSVwmPCpL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 804, \"original\": \"https://api.click-games.fr/storage/754/9166ivXBiDL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/754/conversions/9166ivXBiDL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 805, \"original\": \"https://api.click-games.fr/storage/755/91F0cq7vCWL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/755/conversions/91F0cq7vCWL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 806, \"original\": \"https://