(62, NULL, 'Demon Slayer - Kimetsu no Yaiba - The Hinokami Chronicles', 'demon-slayer-kimetsu-no-yaiba-the-hinokami-chronicles', '<p>Soyez la lame qui pourfend les démons ! Dans l’ère Taisho au Japon, Tanjiro, un jeune homme au grand cœur qui vend du charbon pour vivre, découvre en rentrant chez lui sa famille massacrée par un démon. Et pour empirer la situation, sa jeune sœur Nezuko, unique survivante, a été transformée en démon. Bien que dévasté par cette dure réalité, Tanjiro est résolu à devenir un « Demon Slayer » afin de venger sa famille et faire redevenir Nezuko humaine. Suivez l’histoire tragique d’un frère et d’une sœur dans ce conte où les destins des humains et des démons s’entremêlent. Adapté du manga et de l’anime à succès, Demon Slayer arrive enfin pour la première fois en jeu vidéo sur console de salon ! Dans ce jeu de combat d’arène dynamique, vous suivez la quête de vengeance de Kamado Tanjiro. Revivez l’histoire du manga et de l\'anime à travers les combats mémorables de Tanjiro pour rendre à Nezuko son humanité face aux démons !</p><h3>Amazon.fr</h3>', 1, 59.38, 31, 59.38, NULL, NULL, 0, 0, 0, NULL, 'CU0000050', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 819, \"original\": \"https://api.click-games.fr/storage/769/71R2fjf7NcS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/769/conversions/71R2fjf7NcS._AC_SL1000_-thumbnail.jpg\"}', '[{\"id\": 820, \"original\": \"https://api.click-games.fr/storage/770/71R2fjf7NcS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/770/conversions/71R2fjf7NcS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 821, \"original\": \"https://api.click-games.fr/storage/771/61jYEnmpGdS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/771/conversions/61jYEnmpGdS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 822, \"original\": \"https://api.click-games.fr/storage/772/61VizIcmjVS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/