(65, NULL, 'A Plague Tale: Innocence', 'a-plague-tale-innocence', '<p>Vivez le récit déchirant aux multiples récompenses d’Amicia et de son petit frère Hugo, livrés à eux-mêmes au cœur des heures les plus sombres de l’Histoire. Pourchassés par l\'Inquisition et cernés par l\'avancée inexorable des hordes de rats, Amicia et Hugo vont apprendre à se connaître et à compter l\'un sur l\'autre. Submergés par l’adversité, ils devront lutter pour survivre et trouver leur rôle dans ce monde impitoyable. Profitez de la résolution 4K, 60 images par secondes, des graphismes améliorés et des temps de chargement raccourcis sur PlayStation 5.</p>', 1, 37.98, 31, 37.98, NULL, NULL, 0, 0, 0, NULL, 'CU0000053', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 839, \"original\": \"https://api.click-games.fr/storage/789/61xylmwZNOL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/789/conversions/61xylmwZNOL._AC_SL1000_-thumbnail.jpg\"}', '[{\"id\": 840, \"original\": \"https://api.click-games.fr/storage/790/61xylmwZNOL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/790/conversions/61xylmwZNOL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 841, \"original\": \"https://api.click-games.fr/storage/791/512RhWJRIwL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/791/conversions/512RhWJRIwL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 842, \"original\": \"https://api.click-games.fr/storage/792/51JbqDbWRPS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/792/conversions/51JbqDbWRPS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 843, \"original\": \"https://api.click-games.fr/storage/793/51Dv3gcPfXS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/793/conversions/51Dv3gcPfXS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 844, \"original\": \"https://api.click-games.fr/storage/794/51M9l5rniML._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/794/conversions/51