(66, NULL, 'Call Of Duty: Vanguard', 'call-of-duty-vanguard', '<ul><li>Combattez sur tous les fronts : Combats aériens au-dessus du Pacifique, parachutage en terres françaises, défense de Stalingrad avec la précision d\'un sniper, et campagnes en Afrique du Nord. La franchise Call of Duty est de retour avec Call of Duty: Vanguard, développé par Sledgehammer Games, où les joueurs seront plongés dans la Seconde Guerre mondiale, au milieu de combats sanglants et, grande première, aux 4 coins du monde</li><li>À travers une campagne solo captivante, un groupe de soldats d\'élite venus de pays différents feront face à la grave menace qui pèse sur le monde. Les joueurs pourront aussi profiter de l\'expérience multijoueur emblématique de Call of Duty, ainsi que de l\'incroyable nouvelle expérience Zombies développée par Treyarch.</li><li>Call of Duty: La sortie de Call of Duty: Vanguard sera également accompagnée d\'une toute nouvelle intégration post-lancement de Call of Duty: Warzone, offrant cross-progression et cross-génération, ainsi qu\'un gigantesque calendrier de contenu post-lancement gratuit comprenant de nombreuses nouveautés : cartes Multijoueur, modes, événements saisonniers, fêtes communautaires, et bien plus.</li></ul>', 1, 83.87, 31, 83.87, NULL, NULL, 0, 0, 0, NULL, 'CU0000054', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 846, \"original\": \"https://api.click-games.fr/storage/796/81CW9w4uE5L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/796/conversions/81CW9w4uE5L._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 847, \"original\": \"https://api.click-games.fr/storage/797/81CW9w4uE5L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/797/conversions/81CW9w4uE5L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 848, \"original\": \"https://api.click-games.fr/storage/798/71hP5MQd3DL._AC_SL1500_-2.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/798/conversions/71hP5MQd3DL._AC_SL1500_-2