(69, NULL, 'Resident Evil VIllage', 'resident-evil-village', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/58620373-a6ba-4636-843a-cb1861eb3746.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Main\"></p><p>La référence du survival/horror revient dans un épisode explosif qui nous plonge quelques années après les événements terrifiants de Resident Evil 7 biohazard, le jeu unanimement salué par la critique.</p><p>Ethan et sa femme Mia refont doucement leur vie mais le passé les rattrapent et Ethan doit affronter l\'enfer pour retrouver sa fille.</p><p>Ce nouvel opus, toujours en vue à la première personne propose un environnement inédit : un village d’Europe peuplé d’étranges créatures et dominé par un château inquiétant.</p><h3><strong>Points Clés</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d8e98c6f-c5e6-4bca-9152-f3e2b1e2f024.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Chris\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/94c78fe4-61b2-42be-a841-4f8d2217934d.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Le village\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/52f64f27-54f7-452f-b9cd-a04623ad0f89.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"FPS\"></th></tr><tr><th><h4>Une nouvelle expérience</h4><p>Ethan Winters et son épouse Mia, commencent au loin une nouvelle vie paisible, enfin libérés de leur passé tortueux. Mais le sort s\'acharne de nouveau sur eux...</p></th><th><h4>Un nouvel environnement</h4><p>Un village situé en Europe de l’est qui vit dans la crainte des habitants du château qui le surplombe vont être le théâtre d’évènement étrange.</p></th><th><h4>Vue à la première personne</h4><p>Le jeu est toujours en vue à la première personne pour une atmosphère et une tension toujours plus intense. La possibilité de donner un coup de pied pour repousser les ennemis permet de nouvelles stratégies.</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/9f4131ef-f85f-4c8d-834e-96c88466a20d.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Chris\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e1e1ba9c-b404-4a55-a7cf-47d8784da876.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Vieille\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/b4f19456-c3c2-4b3e-882d-5c2a30d35af0.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Re-Verse\"></th></tr><tr><th><h4>Des vieilles connaissances et de nouveaux ennemis</h4><p>De Lady Dimitrescu et ses filles en passant par les lycans et des monstres encore inconnus, les rencontres sont toujours hautes en couleurs.</p></th><th><h4>Immersif, viscéral</h4><p>La puissance du moteur «RE Engine» combiné à aux possibilités de la PlayStation 5 et de la Xbox Series X, font de Resident Evil Village une expérience qui marquera aux fer rouge tous les joueurs.</p></th><th><h4>Multijoueur : Re:Verse</h4><p>Un jeu multijoueur en cadeau pour fêter les 25 ans de la série.</p></th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/863f829a-d30e-444a-b434-c8043387e3f8.__CR193,0,1940,1200_PT0_SX970_V1___.jpg\" alt=\"PRECOMMANDE\"></p>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000057', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 873, \"original\": \"https://api.click-games.fr/storage/823/61ys+lhCaMS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/823/conversions/61ys+lhCaMS._AC_SL1000_-thumbnail.jpg\"}', '[{\"id\": 875, \"original\": \"https://api.click-games.fr/storage/825/81ZAHFDViiL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/825/conversions/81ZAHFDViiL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 876, \"original\": \"https://api.click-games.fr/storage/826/61pA8NBL4hL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/826/conversions/61pA8NBL4hL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 877, \"original\": \"https://api.click-games.fr/storage/827/61um76fAyOL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/827/conversions/61um76fAyOL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 878, \"original\": \"https://api.click-games.fr/storage/828/61yKIAN4PwL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/828/conversions/61yKIAN4PwL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 879, \"original\": \"https://api.click-games.fr/storage/829/51gB3SbtKoL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/829/conversions/51gB3SbtKoL._AC_SL1000_-thumbnail.jpg\"}]', NULL, '2022-02-12 21:40:54', '2022-05-18 09:00:46', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
(70, NULL, 'Dying Light 2', 'dying-light-2', '<p>Le virus a triomphé. Le dernier bastion de l’humanité est au bord de l’effondrement, déchiré par les conflits et infesté de monstres sanguinaires…</p><p>Vous incarnez Aiden Caldwell, un survivant infecté.</p><p>Dans ce monde impitoyable, vous devrez tirer parti de votre agilité exceptionnelle, de vos compétences en combat et de votre vivacité d’esprit pour survivre.</p><p>Utilisez-les à bon escient pour évoluer dans cet univers truffé de dangers et le remodeler à travers les choix que vous ferez. Le sort de la ville est entre vos mains.</p><p>Pre order incentive :</p><p>- Pack Reload : une tenue, une skin d’arme et un skin de deltaplane</p>', 1, 64.99, 31, 64.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000058-2', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1032, \"original\": \"https://api.click-games.fr/storage/982/61g4mQQMR9S._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/982/conversions/61g4mQQMR9S._AC_SL1000_-thumbnail.jpg\"}', '[{\"id\": 882, \"original\": \"https://api.click-games.fr/storage/832/6122JgPRa5S._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/832/conversions/6122JgPRa5S._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 883, \"original\": \"https://api.click-games.fr/storage/833/710aI-LOgmS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/833/conversions/710aI-LOgmS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 884, \"original\": \"https://api.click-games.fr/storage/834/61ZzWrogT6S._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/834/conversions/61ZzWrogT6S._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 885, \"original\": \"https://api.click-games.fr/storage/835/612rktVDPpS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/835/conversions/612rktVDPpS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 886, \"original\": \"https://api.click-games.fr/storage/836/81VZG3HeGpS._AC_SL1500_.jpg\", \"thumbnai