(72, NULL, 'Returnal', 'returnal', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/1401bcc8-7f0a-4dd1-97a1-fa11758bf12a.__CR0,0,1293,800_PT0_SX970_V1___.jpg\" alt=\"ps5, playstation, jeux, jeu video, action, aventure, roguelike\"></p><p>Brisez le cycle du chaos sur une planète extraterrestre imprévisible.</p><p>Après s\'être écrasée sur un monde en perpétuel changement, Sélène doit explorer les ruines d\'une ancienne civilisation pour s\'échapper. Abandonnée à elle-même, elle va devoir combattre de toutes ses forces pour survivre. Encore et encore, elle est vaincue, obligée de recommencer son périple à chaque fois qu\'elle meurt.</p><p>Dans ce rogue-like implacable, vous découvrirez qu\'à chaque changement de cycle, la planète se transforme, tout comme les objets à votre disposition. Chaque boucle offre de nouvelles combinaisons, vous obligeant à adopter à chaque fois une nouvelle stratégie pour les combats.</p><p>La sombre beauté d\'un monde en perdition et rempli de surprises explosives prend vie autour de vous grâce à des effets visuels époustouflants. Vous passerez de combats intenses et palpitants à des moments d\'introspection viscéraux dans des décors sombres et contrastés. Explorez, découvrez et combattez tout au long d\'un périple impitoyable, où chacune de vos actions est nimbée de mystères.</p><p>Conçu pour offrir un maximum de rejouabilité, le monde procédural de Returnal vous invite à vous relever après chaque défaite, pour affronter de nouveaux défis en perpétuelle évolution à chaque renaissance.</p>', 1, 69.99, 31, 69.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000060', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 918, \"original\": \"https://api.click-games.fr/storage/868/71L-R+WLTzS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/868/conversions/71L-R+WLTzS._AC_SL1000_-thumbnail.jpg\"}', '[{\"id\": 919, \"original\": \"https://api.click-games.fr/storage/869/71L-R+WLTzS._AC_SL1000_.