(79, NULL, 'Gameboy SP Noir', 'gameboy-sp-noir', '<ul><li>Écran&nbsp;: Écran diffusant 3\" TFT avec éclairage intégré, taille de l\'écran 40,8&nbsp;mm × 61,2&nbsp;mm, <a href=\"https://fr.m.wikipedia.org/wiki/D%C3%A9finition_d%27%C3%A9cran\">définition d\'écran</a> 240×160 px, 32&nbsp;768 couleurs possibles (15 bit), 511 couleurs simultanées en mode personnage, 32768 couleurs simultanées en mode image par points. Sur les modèles standards, l\'écran est éclairé par l\'avant, et non pas <a href=\"https://fr.m.wikipedia.org/wiki/R%C3%A9tro%C3%A9clairage\">par l\'arrière</a>.</li><li>La GBA SP possède six modes graphiques (trois modes «&nbsp;mosaïques&nbsp;» et trois modes «&nbsp;bitmap&nbsp;»).</li><li><a href=\"https://fr.m.wikipedia.org/wiki/Processeur\">CPU</a>&nbsp;: <a href=\"https://fr.m.wikipedia.org/wiki/ARM\">ARM</a> <a href=\"https://fr.m.wikipedia.org/wiki/Architecture_32_bits\">32 bits</a> cadencé à 16,8&nbsp;MHz, couplé avec un processeur Z80 pour la compatibilité avec les jeux <a href=\"https://fr.m.wikipedia.org/wiki/Game_Boy\">Game Boy</a> et <a href=\"https://fr.m.wikipedia.org/wiki/Game_Boy_Color\">Game Boy Color</a>.</li><li>Mémoire&nbsp;: 32&nbsp;ko + 96&nbsp;ko VRAM (interne CPU), 256&nbsp;ko WRAM (externe CPU).</li><li>Batterie rechargeable <a href=\"https://fr.m.wikipedia.org/wiki/Lithium-ion\">lithium-ion</a> d\'une capacité de 18 h sans éclairage, et 10 h avec éclairage (l\'Advance classique utilise des piles).</li><li>Taille&nbsp;: 82&nbsp;mm de largeur, 24,3&nbsp;mm épaisseur pour 84,6&nbsp;mm de longueur.</li></ul>', 1, 179.99, 31, 179.99, NULL, NULL, 1, 0, 0, NULL, 'CU0000067', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 970, \"original\": \"https://api.click-games.fr/storage/920/30E621C2-0735-4229-803E-A2EB7545959D.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/920/conversions/30E621C2-0735-4229-803E-A2EB7545959D-thumbnail.jpg\"}', '[{\"id\": 971, \"original\": \"https://api.click-games.fr/storage/921/6329DFD9-8792-41E4-82B7-441109CC7DED.jpeg\", \"thumbnail\": \"https://api.click-games.fr/storage/921/conversions/6329DFD9-8792-41E4-82B7-441109CC7DED-thumbnail.jpg\"}]', NULL, '2022-02-21 21:02:57', '2022-05-18 09:00:46', 0.00, 'recondition', NULL, NULL, NULL, NULL, NULL),
(80, NULL, 'Elden Ring - Launch Edition', 'elden-ring-launch-edition', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/420f5e27-e9cc-446d-a9ee-df1ce6c724c3.__CR0,519,3840,1188_PT0_SX970_V1___.jpg\" alt=\"Elden Ring \"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/8dad8342-0a44-49c0-8353-4544aa747987.__CR1120,0,1620,2160_PT0_SX300_V1___.jpg\" alt=\"Elden Ring \"><br>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/ec87cf90-1c05-42fd-8ed2-76b14b217260.__CR1237,0,1638,819_PT0_SX350_V1___.png\" alt=\"BNEE BNEF bandai namco entertainement video games\"><strong>Bandai Namco Entertainment</strong></p><p>&nbsp;</p><p>Bandai Namco Entertainment est un acteur majeur de l’industrie du jeu vidéo, réputé pour la création et l’édition de nombreuses franchises de jeux vidéo à succès comme Pac-Man, Tekken, SoulCalibur, Naruto Shippuden, Dragon Ball, Dark Souls et bien d’autres. « More fun for everyone», c’est la devise du groupe Bandai Namco, toujours en quête de nouveaux divertissements à vous proposer !</p><ul><li>Dreams</li><li>Fun</li><li>Inspiration</li></ul><h3><strong>Elden Ring</strong></h3><h4>L\'Ordre d\'or a été anéanti. Levez-vous, Sans-éclat, et puisse la grâce guider vos pas. Brandissez la puissance du Cercle d\'Elden. Devenez Seigneur de l\'Entre-terre.</h4><p>ELDEN RING, développé par FromSoftware Inc. et produit par BANDAI NAMCO Entertainment Inc., est un Action-RPG de fantasy et le jeu le plus ambitieux jamais créé par FromSoftware, qui a pour théâtre un monde nimbé de mystère où le danger est omniprésent.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/cd505174-5483-4444-bb9f-0625fb2cd179.__CR948,0,2160,2160_PT0_SX220_V1___.jpg\" alt=\"Elden Ring\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/b31cbd77-ea79-4078-a327-3608922a98c2.__CR506,0,2160,2160_PT0_SX220_V1___.jpg\" alt=\"elden ring\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/267f9dcd-1db7-4293-a729-0b5705c53931.__CR840,0,2160,2160_PT0_SX220_V1___.jpg\" alt=\"elden ring\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/cba5a2e0-1044-4cce-9cc7-df002cc45354.__CR339,0,2160,2160_PT0_SX220_V1___.jpg\" alt=\"elden ring \"></th></tr><tr><th><h4>Un nouvel univers de fantasy</h4><p>Explorez l\'Entre-terre, un nouveau monde de fantasy conçu par Hidetaka Miyazaki, créateur de l\'incontournable série de jeux vidéo DARK SOULS, et George R. R. Martin, auteur de la série de romans de fantasy au succès mondial Le Trône de fer. Partez en quête du puissant et mystérieux Cercle d\'Elden. Rencontrez des adversaires à l\'histoire riche, des personnages qui pourront devenir vos alliés comme vos ennemis, et de redoutables créatures.</p></th><th><h4>L\'Entre-terre, un monde grandiose à explorer</h4><p>ELDEN RING propose d\'immenses et prodigieux paysages, parsemés d\'obscurs et tortueux donjons reliés naturellement entre eux. Arpentez ce monde époustouflant à pied ou à dos de monture, en solitaire ou avec d\'autres joueurs, et immergez-vous dans ses plaines verdoyantes, ses marécages suffocants, ses montagnes vertigineuses, ses châteaux lugubres et bien d\'autres lieux majestueux, le tout dans un terrain de jeu d\'une envergure jamais vue dans un titre FromSoftware.</p></th><th><h4>Un Gameplay qui redéfinit tout un genre</h4><p>Créez votre personnage dans ce nouvel Action-RPG, définissez votre propre style de jeu en testant un vaste arsenal d\'armes, de sorts et de techniques à découvrir lors de votre aventure. Jetez-vous dans la mêlée, éliminez furtivement vos ennemis un à un, ou faites appel à vos alliés. Avec d\'innombrables options à votre disposition, vous serez entièrement libre d\'aborder l\'exploration et le combat comme bon vous semble.</p></th><th><h4>Une aventure épique jouable à plusieurs</h4><p>Les joueurs auront la possibilité de partager leur aventure dans L’ENTRE-TERRE avec d’autres Sans-éclat, en coopération ou en envahissant le monde d’autres guerriers.</p><p>Les joueurs PS4 et PS5 seront en mesure de jouer sur le même serveur.</p><p>Les joueurs Xbox One, Xbox One X, Xbox One S et Series X seront en mesure de jouer sur le même serveur.</p></th></tr></tbody></table></figure><p>&nbsp;</p><p><br>&nbsp;</p>', 1, 72.99, 31, 72.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000068', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 972, \"original\": \"https://api.click-games.fr/storage/922/7121jYOqVgL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/922/conversions/7121jYOqVgL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 983, \"original\": \"https://api.click-games.fr/storage/933/7121jYOqVgL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/933/conversions/7121jYOqVgL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 984, \"original\": \"https://api.click-games.fr/storage/934/51d+hwQ9Q1S._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/934/conversions/51d+hwQ9Q1S._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 985, \"original\": \"https://api.click-games.fr/storage/935/51d99AU4D8S._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/935/conversions/51d99AU4D8S._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 986, \"original\": \"https://api.click-games.fr/storage/936/411aUbGipfS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/936/conversions/411aUbGipfS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 987, \"original\": \"https://api.click-games.fr/storage/937/417I3je3HgS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/937/conversions/417I3je3HgS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 988, \"original\": \"https://api.click-games.fr/storage/938/81PR3-VwFES._AC_SL1500_.jpg\", \"thumbnail\