(81, NULL, 'Nintendo Switch - Rouge Néon et Bleu Néon', 'nintendo-switch-rouge-neon-et-bleu-neon', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/5a04349f-02e0-4904-81d6-36625d41d7b3.__CR44,0,509,509_PT0_SX300_V1___.png\" alt=\" \"></p><p><strong>Comprend :</strong></p><p>&nbsp;</p><p>&nbsp;</p><ul><li>Console Nintendo Switch</li><li>Station d\'accueil Nintendo Switch</li><li>Joy-Con (L) Rouge néon</li><li>Joy-Con (R) Bleu néon</li><li>Dragonnes Joy-Con</li><li>Support Joy-Con</li><li>Câble HDMI haute vitesse</li><li>Adaptateur secteur Nintendo Switch</li></ul><p>&nbsp;</p><h4>Nintendo Switch avec paire de Joy-Con Rouge Néon et Bleu Néon</h4><p>Obtenez la console de jeu qui vous permet de jouer aux jeux que vous voulez, n\'importe où, comme vous le voulez!</p><p>À la maison, la Nintendo Switch est placée sur la station d\'accueil Nintendo Switch qui relie la console au téléviseur et vous permet de jouer avec votre famille et vos amis dans le confort de votre salon.</p><p>Retirez simplement la Nintendo Switch de la station d\'accueil pour faire passer la console en mode portable; vous pourrez alors profiter de la même fantastique expérience de jeu qu\'à la maison lors de vos déplacements. La portabilité de la Nintendo Switch est améliorée grâce à son écran lumineux à haute définition. Elle vous permet de profiter d\'une expérience de console de jeu complète au parc, en avion, en voiture ou chez un ami.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/ae097dba-3492-40e1-9e26-0d3fe648727f.__CR40,0,493,493_PT0_SX300_V1___.png\" alt=\" \"></p><p>Cet ensemble comprend la console Nintendo Switch et la station d\'accueil Nintendo Switch en noir, et les manettes Joy-Con gauche et droite en gris contrastant. Il comprend également tout ce qu\'il vous faut pour commencer.</p><p>La Nintendo Switch est maintenant offerte en tant qu\'ensemble Nintendo authentique remis à neuf et fourni uniquement par Nintendo. Bien qu\'il puisse présenter quelques imperfections superficielles, il est garanti pour être entièrement opérationnel.</p>', 1, 279.99, 31, 279.99, NULL, NULL, 0, 0, 0, NULL, 'CU0000071', 10, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 993, \"original\": \"https://api.click-games.fr/storage/943/71r5EDssKdL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/943/conversions/71r5EDssKdL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 994, \"original\": \"https://api.click-games.fr/storage/944/71r5EDssKdL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/944/conversions/71r5EDssKdL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 995, \"original\": \"https://api.click-games.fr/storage/945/815oUTWYyQL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/945/conversions/815oUTWYyQL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 996, \"original\": \"https://api.click-games.fr/storage/946/71k47LPEkuL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/946/conversions/71k47LPEkuL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 997, \"original\": \"https://api.click-games.fr/storage/947/71j3g0GW6EL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/947/conversions/71j3g0GW6EL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 998, \"original\": \"https://api.click-games.fr/storage/948/51N-s3eUvXL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/948/conversions/51N-s3eUvXL._AC_-thumbnail.jpg\"}]', NULL, '2022-03-01 15:15:22', '2022-05-18 09:00:46', 0.00, 'new', NULL, NULL, NULL, NULL, NULL),
