mble.</p></th><th><h4>Une aventure épique jouable à plusieurs</h4><p>Les joueurs auront la possibilité de partager leur aventure dans L’ENTRE-TERRE avec d’autres Sans-éclat, en coopération ou en envahissant le monde d’autres guerriers.</p><p>Les joueurs PS4 et PS5 seront en mesure de jouer sur le même serveur.</p><p>Les joueurs Xbox One, Xbox One X, Xbox One S et Series X seront en mesure de jouer sur le même serveur.</p></th></tr></tbody></table></figure><p>&nbsp;</p><p><br>&nbsp;</p>', 1, 75.15, 31, 75.15, NULL, NULL, 0, 0, 0, NULL, 'CU0000069', 19, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1004, \"original\": \"https://api.click-games.fr/storage/954/71iM4UcPH2L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/954/conversions/71iM4UcPH2L._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1005, \"original\": \"https://api.click-games.fr/storage/955/71iM4UcPH2L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/955/conversions/71iM4UcPH2L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1006, \"original\": \"https://api.click-games.fr/storage/956/91y1KNl7shS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/956/conversions/91y1KNl7shS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1007, \"original\": \"https://api.click-games.fr/storage/957/91vNRnkl8GS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/957/conversions/91vNRnkl8GS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1008, \"original\": \"https://api.click-games.fr/storage/958/81cVM7PAAIL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/958/conversions/81cVM7PAAIL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1009, \"original\": \"https://api.click-games.fr/storage/959/81lew-CZ8HL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/959/conversions/81lew-CZ8HL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1010, \"original\": \"https://api.click-games.fr/storage/960/51d+hwQ9Q1S._AC_SL1000_.jpg\", \"t