(84, NULL, 'Elden Ring - Launch Edition', 'elden-ring-launch-edition-3', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/420f5e27-e9cc-446d-a9ee-df1ce6c724c3.__CR0,519,3840,1188_PT0_SX970_V1___.jpg\" alt=\"Elden Ring \"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/8dad8342-0a44-49c0-8353-4544aa747987.__CR1120,0,1620,2160_PT0_SX300_V1___.jpg\" alt=\"Elden Ring \"><br>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/ec87cf90-1c05-42fd-8ed2-76b14b217260.__CR1237,0,1638,819_PT0_SX350_V1___.png\" alt=\"BNEE BNEF bandai namco entertainement video games\"><strong>Bandai Namco Entertainment</strong></p><p>&nbsp;</p><p>Bandai Namco Entertainment est un acteur majeur de l’industrie du jeu vidéo, réputé pour la création et l’édition de nombreuses franchises de jeux vidéo à succès comme Pac-Man, Tekken, SoulCalibur, Naruto Shippuden, Dragon Ball, Dark Souls et bien d’autres. « More fun for everyone», c’est la devise du groupe Bandai Namco, toujours en quête de nouveaux divertissements à vous proposer !</p><ul><li>Dreams</li><li>Fun</li><li>Inspiration</li></ul><h3><strong>Elden Ring</strong></h3><h4>L\'Ordre d\'or a été anéanti. Levez-vous, Sans-éclat, et puisse la grâce guider vos pas. Brandissez la puissance du Cercle d\'Elden. Devenez Seigneur de l\'Entre-terre.</h4><p>ELDEN RING, développé par FromSoftware Inc. et produit par BANDAI NAMCO Entertainment Inc., est un Action-RPG de fantasy et le jeu le plus ambitieux jamais créé par FromSoftware, qui a pour théâtre un monde nimbé de mystère où le danger est omniprésent.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/cd505174-5483-4444-bb9f-0625fb2cd179.__CR948,0,2160,2160_PT0_SX220_V1___.jpg\" alt=\"Elden Ring\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/b31cb