(85, NULL, 'Pokémon Diamant Etincelant', 'pokemon-perle-scintillante-2', '<h3><strong>La génération Pokémon la plus attendue des joueurs arrive sur Nintendo Switch !</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/f494b30c-b855-49d2-aae0-da775e7f0bdf.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Cover\"></p><h3><strong>La génération qui a marqué l’histoire de la Nintendo DS s’offre un refonte totale sur Nintendo Switch</strong></h3><p>Apprenti Dresseur dans la région de Sinnoh dominée par le Mont Couronné, vous devez choisir votre premier allié parmi les iconiques Tortipouss, Ouisticram et Tiplouf, constituer la meilleure équipe de Pokémon et essayer de triompher de la Ligue tenue par la redoutable Cynthia. Votre chemin pour devenir le meilleur Dresseur vous emmènera découvrir des villes inspirées de l’île d’Hokkaido au Japon, vous fera affronter la Team Galaxy et son chef mégalo et, bien sûr, plonger dans la mythologie entourant les Légendaires Dialga et Palkia, maîtres du Temps et de l’Espace. Avec sa direction artistique modernisée et son scenario inchangé, les fans pourront revivre l’expérience d’un épisode culte désormais accessible à tous.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/5fb49ca2-4636-4cf8-91c4-0db2066e7602.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"1\"></p><h3><strong>Explorez la région de Sinnoh avec Pokémon Diamant Étincelant et Pokémon Perle Scintillante !</strong></h3><p>Les aventures de Pokémon Diamant Étincelant et Pokémon Perle Scintillante se déroulent dans la région de Sinnoh, terre luxuriante dominée par le Mont Couronné et berceau de nombreux mythes ayant transcendé les générations. Découvrez les nombreux lieux qu\'elle abrite au cours de votre périple pour devenir le nouveau Maître ou la nouvelle Maîtresse de la Ligue Pokémon.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/07483ecb-f199-465a-94a1-c9692c1087a9.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"2\"></p><h3><strong>Le jeu original a été retranscrit avec soin et fidélité</strong></h3><p>Aussi bien dans son scénario que dans l\'échelle des routes et villes qui composent son environnement. Ceux et celles ayant connu Pokémon Diamant et Pokémon Perle pourront revisiter des lieux familiers et revivre des scènes connues. Quant à ceux et celles qui s\'apprêtent à découvrir Sinnoh pour la première fois, de nombreuses surprises et nouvelles rencontres les attendent.</p><p>Ces remakes incluent les ajouts qui ont rendu les épisodes modernes de la série Pokémon plus confortables et faciles à prendre en main, ainsi qu\'une mise en scène plus intense des combats de Pokémon.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/93d8c0c2-1535-4da2-ba5e-08d26f432a1d.__CR204,0,1080,1080_PT0_SX300_V1___.png\" alt=\"3\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/38ff4f92-7353-40c1-90a6-7f4b1d9bffe7.__CR469,0,1080,1080_PT0_SX300_V1___.png\" alt=\"4\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/f2b06c70-c02a-4bb7-8ffd-b42e0394bd9b.__CR155,0,1080,1080_PT0_SX300_V1___.png\" alt=\"4\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/a6d119d9-87da-4413-baba-3dd220fe90d8.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"5\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/636f9f27-4f7b-4315-816a-c39d09403355.__CR420,0,1080,1080_PT0_SX300_V1___.png\" alt=\"5\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/d2608020-7fe0-45c7-8ba4-01c0f2e25ca6.__CR204,0,1080,1080_PT0_SX300_V1___.png\" alt=\"6\"></th></tr><tr><th>&nbsp;</th