(89, NULL, 'Far Cry 6 Edition Limitée', 'far-cry-6-edition-limitee-2', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/4ad543d6-ef3f-4fc9-aa8b-16c73ec9be47.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Far Cry 6 Header\"></p><h3><strong>Far Cry 6</strong></h3><p>Bienvenue sur Yara, un paradis tropical figé dans le temps. Anton Castillo, dictateur de l\'île, est bien décidé à rendre sa gloire d\'antan à la nation, accompagné de son fils Diego qui suit les traces sanglantes de son père. Leur régime de terreur a déclenché une véritable révolution dans tout le pays.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/8641252b-fc9c-4023-b446-2e3ffff2fceb.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"FC6 FIGHTSTREETS\"></p><h3><strong>COMBATTEZ POUR LA LIBERTÉ</strong></h3><p>Incarnez Dani Rojas, un citoyen de l\'île, et aidez la guérilla à libérer la nation.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/7e434099-9ed3-42b8-83ab-0dc40c4811dd.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"ISLANDNATION \"></p><h3><strong>UNE ÎLE DE YARA DÉCHIRÉE</strong></h3><p>Combattez les troupes d\'Anton sur le plus grand terrain de jeu Far Cry à ce jour, entre la jungle, les plages et Esperanza, capitale de Yara.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/daff99d3-97bf-40a8-a0f5-37bbd975bc86.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\" FIREPOWER\"></p><h3><strong>GUÉRILLA ET PUISSANCE DE FEU</strong></h3><p>Utilisez des armes et véhicules de fortune, mais aussi \"Amigos\", le nouveau système d\'animaux, pour mettre un terme à la tyrannie.</p>', 1, 55.99, 31, 55.99, NULL, NULL, 0, 0, 0, NULL, 'CU00078', 10, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1043, \"original\": \"https://api.click-games.fr/storage/993/917r2r0VP1S._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/993/conversions/917r2r0VP1S._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 736, \"original\": \"https://api.click-games.fr/storage/686/91R7hapuNGL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/686/conversions/91R7hapuNGL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 737, \"original\": \"https://api.click-games.fr/storage/687/81emblvvyhL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/687/conversions/81emblvvyhL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 738, \"original\": \"https://api.click-games.fr/storage/688/81s3EAEVwiL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/688/conversions/81s3EAEVwiL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 739, \"original\": \"https://api.click-games.fr/storage/689/91YXEa5KQ0L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/689/conversions/91YXEa5KQ0L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 740, \"original\": \"https://api.click-games.fr/storage/690/815jK+SFkWL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/690/conversions/815jK+SFkWL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 741, \"original\": \"https://api.click-games.fr/storage/691/81Z+apP-mSL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/691/conversions/81Z+apP-mSL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 742, \"original\": \"https://api.click-games.fr/storage/692/71MsXJsoImL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/692/conversions/71MsXJsoImL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 743, \"original\": \"https://api.click-games.fr/storage/693/91sPT8bWPzS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/693/conversions/91sPT8bWPzS._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 744, \"original\": \"https://api.click-games.fr/storage/694/913+a4I7jeS._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/694/conversions/913+a4I7jeS._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-03-09 17:04:51', '2022-05-18 09:00:46', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(90, NULL, 'Dragon Ball Z Kakarot', 'dragon-ball-z-kakarot-2', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/8f6c91a8-268e-4f2c-bb87-ad8b03667f35.__CR0,243,1920,594_PT0_SX970_V1___.jpg\" alt=\"Dragon ball Z kakarot \"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e43a4ef0-943a-4425-af79-953332a0a483.__CR310,0,810,1080_PT0_SX300_V1___.jpg\" alt=\"Dragon ball Z kakarot \"><br>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/23f47f3f-ee5c-4b8f-876d-3fb755d7c964.__CR0,0,350,175_PT0_SX350_V1___.jpg\" alt=\"bandai namco entertainment jeu vidéo \"><strong>Bandai Namco Entertainment</strong></p><p>&nbsp;</p><p>Bandai Namco Entertainment est un acteur majeur de l’industrie du jeu vidéo, réputé pour la création et l’édition de nombreuses franchises de jeux vidéo à succès comme Pac-Man, Tekken, SoulCalibur, Naruto Shippuden, Dragon Ball, Ace Combat et bien d’autres. « More fun for everyone», c’est la devise du groupe Bandai Namco, toujours en quête de nouveaux divertissements à vous proposer !</p><ul><li>Dreams</li><li>Fun</li><li>Inspiration</li></ul><h3><strong>Dragon Ball Z : Kakarot</strong></h3><p>Revivez l\'histoire de Goku et des autres guerriers Z dans DRAGON BALL Z: KAKAROT ! Menez des combats épiques et découvrez la vie dans le monde de DRAGON BALL Z : combattez, pêchez, mangez et entraînez-vous avec Goku, Gohan, Vegeta...</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e9d3f830-df28-4565-a855-41615b66167e.__CR420,0,1080,1080_PT0_SX220_V1___.png\" alt=\"Dragon ball z kakarot\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/5674fa19-e91a-4a13-b88e-c3405f96e04e.__CR0,0,606,606_PT0_SX220_V1___.jpg\" alt=\"dragon ball z kakarot\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e244c6ba-bb85-4b19-8784-2f7fff3ed041.__CR0,0,606,606_PT0_SX220_V1___.jpg\" alt=\"dragon ball z kakarot \"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d9a3dd90-6c59-4a54-8aa4-5a2511a830b1.__CR0,0,606,606_PT0_SX220_V1___.jpg\" alt=\"dragon ball z kakarot\"></th></tr><tr><th><h4>Une véritable dimension RPG</h4><p>Au cours de votre progression dans l\'histoire, explorez de nouvelles zones, vivez de nouvelles aventures et tissez des liens étroits avec d\'autres héros de l\'univers de DRAGON BALL Z.</p></th><th><h4>Revivez l\'histoire de DRAGON BALL Z</h4><p>De l’arrivée de Raditz au combat final contre Boo ; et profitez d’événements épiques ainsi que de quêtes secondaires amusantes. Des moments inédits de l\'histoire répondront pour la toute première fois à certaines questions brûlantes que tout le monde se pose sur l\'univers de Dragon Ball !</p></th><th><h4>Livrez des combats emblématiques</h4><p>Luttez sur de vastes champs de bataille à l\'environnement destructible et repoussez vos limites en affrontant des boss lors de combats épiques (Raditz, Freezer, Cell, Boo etc…). Augmentez votre niveau de puissance et relevez de grands défis !</p></th><th><h4>Ne combattez pas seulement comme les guerriers Z, vivez comme eux</h4><p>Pêchez, volez, mangez, entraînez-vous et combattez, tout en vous faisant des amis et en nouant des relations avec de multiples personnages de DRAGON BALL.</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th>&nbsp;</th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/097194a0-6b58-4a4c-bf8b-e68ea3cdf15b.__CR0,1,413,826_PT0_SX150_V1___.jpg\" alt=\"dragon ball z kakarot\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/4971dfd7-3f16-4413-8a56-48c27f36098f.__CR0,1,413,826_PT0_SX150_V1___.jpg\" alt=\"dragon ball z kakarot\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/9bd2adf9-832a-497e-9d97-d6ac846382d4.__CR0,1,413,826_PT0_SX150_V1___.jpg\" alt=\"dragon ball z kakarot\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-m