(92, NULL, 'Resident Evil VIllage', 'resident-evil-village-2', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/58620373-a6ba-4636-843a-cb1861eb3746.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Main\"></p><p>La référence du survival/horror revient dans un épisode explosif qui nous plonge quelques années après les événements terrifiants de Resident Evil 7 biohazard, le jeu unanimement salué par la critique.</p><p>Ethan et sa femme Mia refont doucement leur vie mais le passé les rattrapent et Ethan doit affronter l\'enfer pour retrouver sa fille.</p><p>Ce nouvel opus, toujours en vue à la première personne propose un environnement inédit : un village d’Europe peuplé d’étranges créatures et dominé par un château inquiétant.</p><h3><strong>Points Clés</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d8e98c6f-c5e6-4bca-9152-f3e2b1e2f024.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Chris\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/94c78fe4-61b2-42be-a841-4f8d2217934d.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Le village\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/52f64f27-54f7-452f-b9cd-a04623ad0f89.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"FPS\"></th></tr><tr><th><h4>Une nouvelle expérience</h4><p>Ethan Winters et son épouse Mia, commencent au loin une nouvelle vie paisible, enfin libérés de leur passé tortueux. Mais le sort s\'acharne de nouveau sur eux...</p></th><th><h4>Un nouvel environnement</h4><p>Un village situé en Europe de l’est qui vit dans la crainte des habitants du château qui le surplombe vont être le théâtre d’évènement étrange.</p></th><th><h4>Vue à la première personne</h4><p>Le jeu est toujours en vue à la première personne pour une atmosphère et une tension toujours plus intense. La possibilité de donner un coup de pied pour repousser les ennemis permet de nouvelles stratégies.</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/9f4131ef-f85f-4c8d-834e-96c88466a20d.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Chris\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e1e1ba9c-b404-4a55-a7cf-47d8784da876.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Vieille\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/b4f19456-c3c2-4b3e-882d-5c2a30d35af0.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Re-Verse\"></th></tr><tr><th><h4>Des vieilles connaissances et de nouveaux ennemis</h4><p>De Lady Dimitrescu et ses filles en passant par les lycans et des monstres encore inconnus, les rencontres sont toujours hautes en couleurs.</p></th><th><h4>Immersif, viscéral</h4><p>La puissance du moteur «RE Engine» combiné à aux possibilités de la PlayStation 5 et de la Xbox Series X, font de Resident Evil Village une expérience qui marquera aux fer rouge tous les joueurs.</p></th><th><h4>Multijoueur : Re:Verse</h4><p>Un jeu multijoueur en cadeau pour fêter les 25 ans de la série.</p></th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/863f829a-d30e-444a-b434-c8043387e3f8.__CR193,0,1940,1200_PT0_SX970_V1___.jpg\" alt=\"PRECOMMANDE\"></p>', 1, 50.49, 31, 50.49, NULL, NULL, 0, 0, 0, NULL, 'CU00081', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1046, \"original\": \"https://api.click-games.fr/storage/996/61jzT+9LklS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/996/conversions/61jzT+9LklS._AC_SL1000_-thumbnail.jpg\"}', '[{\"id\": 875, \"original\": \"https://api.click-games.fr/storage/825/81ZAHFDViiL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/825/conversions/81ZAHFDViiL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 876, \"original\": \"https://api.click-games.fr/storage/826/61pA8NBL4hL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-