(94, NULL, 'Ghostwire: Tokyo Deluxe Edition', 'ghostwire-tokyo-deluxe-edition', '<p>Face the unknown, uncover the truth and save the city Tokyo is overrun by deadly supernatural forces, perpetrated by a dangerous occultist, causing Tokyo\'s population to vanish in an instant. Ally with a powerful spectral entity on their?quest for vengeance?and master a powerful arsenal of abilities to unravel the?dark?truth behind the disappearance as you FACE THE UNKNOWN in Ghostwire: Tokyo. A beautifully haunted Tokyo Explore a unique vision of Tokyo twisted by a supernatural presence. From it\'s ultra-modern cityscape to it\'s traditional temples and narrow alleyways, discover a hauntingly beautiful city teeming with Yokai - vengeful spirts spirits that prowl the streets. Discover iconic landmarks like Shibuya Crossing and Tokyo Tower, stunningly rendered with incredible detail and built to take advantage of next-generation technology. Experience the city frozen in time when the city\'s population disappeared, and travel to the surreal underworld on your quest to save your family. Devastating Elemental Abilities Wield a combination of upgradeable elemental powers and ghost-hunting skills to combat the supernatural threat. Use your ethereal abilities to ascend to the to the top of Tokyo\'s skyline and soar over the streets to discover new missions or even get the drop on your enemies.</p>', 1, 44.99, 31, 44.99, NULL, NULL, 0, 0, 0, '2022-03-25 00:00:00', 'CU00083', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1048, \"original\": \"https://api.click-games.fr/storage/998/81noKFwzmML._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/998/conversions/81noKFwzmML._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1050, \"original\": \"https://api.click-games.fr/storage/1000/81iNDn3t47L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1000/conversions/81iNDn3t47L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1051, \"origina