(96, NULL, 'RUNE FACTORY 5', 'rune-factory-5', '<p><i>« En tant que nouvelle sentinelle du SEED, l’organisme de maintien de la paix, vous protégez la ville frontalière en capturant les monstres à problèmes grâce au sceau magique que le SEED vous a confié. Une fois vos devoirs accomplis, vous travaillez avec les habitants de Rigbarth et aidez la ville à se développer grâce aux récoltes, aux festivals et aux nouvelles rencontres ! »</i></p>', 1, 34.90, 31, 34.90, NULL, NULL, 0, 0, 0, '2022-03-25 00:00:00', 'CU00084', 17, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1060, \"original\": \"https://api.click-games.fr/storage/1010/51ShWMLr+eL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1010/conversions/51ShWMLr+eL._AC_-thumbnail.jpg\"}', '[{\"id\": 1061, \"original\": \"https://api.click-games.fr/storage/1011/51ShWMLr+eL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1011/conversions/51ShWMLr+eL._AC_-thumbnail.jpg\"}, {\"id\": 1062, \"original\": \"https://api.click-games.fr/storage/1012/71zaJ6aRu4L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1012/conversions/71zaJ6aRu4L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1063, \"original\": \"https://api.click-games.fr/storage/1013/71c0mEEfA0L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1013/conversions/71c0mEEfA0L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1064, \"original\": \"https://api.click-games.fr/storage/1014/71XXob3+I2L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1014/conversions/71XXob3+I2L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1065, \"original\": \"https://api.click-games.fr/storage/1015/71HWzuwD14L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1015/conversions/71HWzuwD14L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1066, \"original\": \"https://api.click-games.fr/storage/1016/71+DCHL48kL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage