(97, NULL, 'Pokémon Bouclier', 'pokemon-epee-2', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/0e66d60a-04f1-468e-8662-f6ac5097bb05.__CR0,0,600,180_PT0_SX600_V1___.jpg\" alt=\"s1\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a5ab4b0f-2fbe-4a8f-8b18-91fbe8c7aa4c.__CR400,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"s1\"></p><h3><strong>L’aventure Pokémon devient plus…sauvage !</strong></h3><p>Nouvelle région, nouveaux Pokémon, nouvelles règles : préparez-vous, la nouvelle génération de Pokémon tant attendue arrive cet hiver !</p><p>Dresseur ou Dresseuse, débutez votre aventure dans la fascinante région de Galar, inspirée de l’Angleterre de la Révolution Industrielle, où les combats Pokémon sont élevés au rang d’événements sportifs dans des stades ! Votre objectif : progresser avec votre équipe Pokémon pour devenir le meilleur dresseur. De tout nouveaux Pokémon vous attendent dans des environnements enchanteurs : vallées, montagnes, forêts et surtout, les Terres Sauvages, ces zones en monde ouvert où les Pokémon se déplacent librement ! Nouveauté colossale de cet opus, le phénomène Dynamax : il amplifie considérablement la taille de vos Pokémon en combat et, quand il est déployé par un Pokémon sauvage, seule une alliance de dresseurs chevronnés peut en venir à bout !</p><p>Choisissez votre combat dans Pokémon Épée et Pokémon Bouclier le 15 novembre, exclusivement sur Nintendo Switch !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/d207fcbe-1585-4059-9ed0-9e7328f1dc7f.__CR202,0,531,531_PT0_SX300_V1___.jpg\" alt=\"s2\"></p><h3><strong>Serez-vous à la hauteur des Pokémon Dynamax ?</strong></h3><p>Le phénomène Dynamax se produit uniquement dans la région de Galar, le Pokémon prend une taille de colosse pendant un court instant, ses pouvoirs sont décuplés et ses statistiques boostées. Utilisez judicieusement cette tactique Dynamax dévastatrice en combat : pendant 3 tours vous aurez un avantage non négligeable, mais votre adversaire a aussi ce pouvoir… Une variante existe, pour certains Pokémon uniquement, c’est le Gigamax : le Pokémon non seulement grossit mais change d’apparence ! Avec ces particularités, Galar est connue pour ses combats Pokémon d’arène se déroulant dans de véritables stades et accueillant des milliers de spectateurs. Combattez en Raids Dynamax : en ligne* ou en local jusqu’à 4 Dresseurs ou Dresseuses peuvent allier leur force pour terrasser un Pokémon Dynamax qui apparaît dans les Terres Sauvages ! Vous pouvez aussi solliciter l’aide de Dresseurs générés par l’IA.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/31a2ef0f-f4a1-4337-b8f5-779a92cce61f.__CR420,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s3\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/8fdc40db-5905-4f09-a51b-ce05534f1284.__CR562,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s4\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/53ccb0b6-f953-4373-add3-f0adad058f10.__CR479,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s6\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/10575451-502c-425a-877e-9a52bb27ce30.__CR430,0,1080,1080_PT0_SX220_V1___.jpg\" alt=\"s5\"></th></tr><tr><th><h4>Les Pokémon de Galar vous réservent de nombreuses surprises !</h4><p>De nouveaux Pokémon sont à découvrir : l’iconique Moumouton, roi des plaines ou encore le sombre Corvaillus qui peut vous transporter d’une ville à l’autre ; il y en a des dizaines !Arriverez-vous à tous les capturer ?</p><p>Les formes de Galar : Comme pour la région d’Alola, de vieilles connaissances des générations précédentes se sont adaptées à l’environnement unique de Galar, en témoigne le Smogogo de Galar coiffé d’un haut de forme fumant !</p><p>Des Pokémon dans tous leurs états ! Certains Pokémon comme Morpeko ont une apparence et des attaques changeantes selon leur humeur, Morpeko en mode affamé est …redoutable !</p></th><th><h4>Détrônez le Maître Pokémon de Galar !</h4><p>Vous commencez votre aventure avec un choix important, celui du premier Pokémon : qui de Flambino, Ouistempo ou Larméléon sera votre premier partenaire ? Parcourez la région de Galar, capturez des Pokémon sauvages pour constituer votre équipe, entraînez-les et, dans chaque nouvelle ville découverte, affrontez les Champions d’Arène pour prétendre au titre de Maître Pokémon !</p></th><th><h4>Faites jouer votre style et vos relations avec votre équipe Pokémon !</h4><p>Les combinaisons de look n’ont jamais été aussi nombreuses ! Vêtement, maquillage, coiffure et jusqu’à la couleur des yeux, vous personnalisez votre dresseur selon votre humeur ! Plutôt hipster ou streetwear aujourd’hui ?</p><p>Entre deux combats, passez du temps avec vos Pokémon !</p><p>Dans le Poké-Camping, vous pouvez voir vos Pokémon dans la nature, les nourrir avec des plats de curry et même jouer avec eux. Si vous augmentez leur niveau de bonheur, ils vous le rendront bien en combat !</p></th><th><h4>A chaque version sa particularité</h4><p>Certains Pokémon sont exclusifs à l’une ou l’autre des versions, mais également certains Champions d’Arène. Vous rencontrez Alistair, le maître des Pokémon de type Spectre, dans Pokémon Bouclier et Faïza, la spécialiste des Pokémon de type Combat, dans Pokémon Épée. Vous devrez aussi percer le mystère derrière chaque Légendaire, Zacian et Zamazenta !</p></th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/8844b709-341d-42c1-abf3-efb8f8edae89.__CR430,0,1080,1080_PT0_SX300_V1___.jpg\" alt=\"s6\"></p><h3><strong>Les Terres Sauvages vous offrent des contrées à explorer à perte de vue :</strong></h3><p>Ces vastes espaces à la faune et flore indomptées relient les différentes villes de la région de Galar. Pour la première fois dans un jeu Pokémon, en arpentant plaines, déserts et forêts, vous manipulez la caméra à 360° pour repérer des Pokémon évoluant dans la nature ; leur apparition peut dépendre de différents facteurs comme l’heure ou la météo, alors n’hésitez pas à y revenir ! Dans les hautes herbes ou les Terres Sauvages, dirigez-vous vers les Pokémon qui vous intéressent pour enclencher un combat et tenter de les capturer !</p><p>&nbsp;</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 59.99, 31, 59.99, NULL, NULL, 0, 0, 0, NULL, 'CU00085', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1077, \"original\": \"https://api.click-games.fr/storage/1027/819sd2k1sCL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1027/conversions/819sd2k1sCL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 467, \"original\": \"https://api.click-games.fr/storage/417/71CJV-hre0L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/417/conversions/71CJV-hre0L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 468, \"original\": \"https://api.click-games.fr/storage/418/71WSVlscKeL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/418/conversions/71WSVlscKeL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 469, \"original\": \"https://api.click-games.fr/storage/419/71rOi+S9ZJL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/419/conversions/71rOi+S9ZJL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 470, \"original\": \"https://api.click-games.fr/storage/420/719dc5TxcKL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/420/conversions/719dc5TxcKL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 471, \"original\": \"https://api.click-games.fr/storage/421/81a2bDzqr3L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/421/conversions/81a2bDzqr3L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 472, \"original\": \"https://api.click-games.fr/storage/422/61saVSjCM-L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/422/conversions/61saVSjCM-L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 473, \"original\": \"https://api.click-games.fr/storage/423/71TP1C8