(98, NULL, 'Gran Turismo 7', 'gran-turismo-7', '<p>Fort de ses 25 années d’expérience , Gran Turismo® 7 regroupe les meilleures fonctionnalités de la licence. Que vous soyez pilote compétitif ou débutant, collectionneur, préparateur, concepteur ou photographe, trouvez votre trajectoire dans une collection époustouflante de modes de jeu, parmi : Campagne GT*, Arcade et École de conduite. Avec le retour du légendaire mode de simulation GT, découvrez une campagne solo gratifiante tout en débloquant de nouveaux véhicules et défis. Et si vous aimez affronter d’autres pilotes en ligne, affûtez vos compétences et participez au mode GT Sport. Avec plus de 420 voitures disponibles au D1, GT7 recrée l\'aspect et les frissons procurés par des véhicules de légende ou des supercars à la pointe de la technologie à un niveau de détails jamais vu. Chaque voiture se pilote différemment et sa conduite sera véritablement unique dan s des conditions météo dynamiques, sur plus de 90 pistes, y compris des circuits classiques de l\'histoire de GT.</p>', 1, 43.49, 31, 43.49, NULL, NULL, 0, 0, 0, NULL, 'CU00086', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1078, \"original\": \"https://api.click-games.fr/storage/1028/81a31luMs9L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1028/conversions/81a31luMs9L._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1079, \"original\": \"https://api.click-games.fr/storage/1029/81a31luMs9L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1029/conversions/81a31luMs9L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1080, \"original\": \"https://api.click-games.fr/storage/1030/81d9pBu-M6L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1030/conversions/81d9pBu-M6L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1081, \"original\": \"https://api.click-games.fr/storage/1031/91sK9Qi5QlL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1031/conversions/91sK9Qi5