(104, NULL, 'Nintendo Switch Sports', 'nintendo-switch-sports', '<p>Prévenez vos proches, la compétition reprend dès le 29 avril avec Nintendo Switch Sports exclusivement sur Nintendo Switch ! Bowling, tennis, badminton, volley-ball font partit des 6 sports autour desquels vous allez pouvoir vous affrontez en local ou en ligne. Munissez-vous d’un Joy-Con et faites les mouvements les plus justes pour battre vos adversaires.</p>', 1, 57.05, 31, 57.05, NULL, NULL, 0, 0, 0, '2022-04-29 00:00:00', 'CU00092', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1111, \"original\": \"https://api.click-games.fr/storage/1061/71vKKkcKSTL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1061/conversions/71vKKkcKSTL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1112, \"original\": \"https://api.click-games.fr/storage/1062/71vKKkcKSTL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1062/conversions/71vKKkcKSTL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1113, \"original\": \"https://api.click-games.fr/storage/1063/81bNjoxVC0L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1063/conversions/81bNjoxVC0L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1114, \"original\": \"https://api.click-games.fr/storage/1064/814dPX7THeL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1064/conversions/814dPX7THeL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1115, \"original\": \"https://api.click-games.fr/storage/1065/81MHEdlLRDL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1065/conversions/81MHEdlLRDL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1116, \"original\": \"https://api.click-games.fr/storage/1066/81UTmFwk0lL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1066/conversions/81UTmFwk0lL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1117, \"original\": \"https://api.click-games.fr/storage/1067/81YBkI6ukjL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-