(105, NULL, 'Pokémon Soleil', 'pokemon-soleil', '<figure class=\"table\"><table><tbody><tr><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/179235f5-136e-4552-9624-2570fcf82924.png._CB485969217__SL300__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/dbff1532-b327-4d5d-8f47-d0a4b20022ad.png._CB485969607__SL300__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/210b39b8-598f-4766-b99f-456e0f55e335.png._CB485979614__SL300__.png\" alt=\"\"></th></tr><tr><th><h4>Brindibou</h4><p>POKÉMON PLUMEFEUILLE</p><p>Type : Plante / Vol</p><p>Taille : 0.3 m</p><p>Poids : 1.5 kg</p><p>Talent : Engrais</p></th><th><h4>Flamiaou</h4><p>POKÉMON CHAT FEU</p><p>Type : Feu</p><p>Taille : 0.4 m</p><p>Poids : 4.3 kg</p><p>Talent : Brasier</p></th><th><h4>Otaquin</h4><p>POKÉMON OTARIE</p><p>Type : Eau</p><p>Taille : 0.4 m</p><p>Poids : 7.5 kg</p><p>Talent : Torrent</p></th></tr></tbody></table></figure><h3><strong>POINTS CLÉS</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/8c5f46b6-5580-4d58-a953-f4e95ed02465.PNG._CB485955828__SL220__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/ae181700-1d73-4171-9a93-94546504bde5.PNG._CB485980579__SL220__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/bce5b6ed-4e4f-4565-b5d9-04aa2ede7b1b.PNG._CB485978044__SL220__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/1ec82cea-71b8-4d73-abb5-10bfef379e72.PNG._CB485974986__SL220__.png\" alt=\"\"></th></tr><tr><th><h4>Nouvelle région, nouveaux Pokémon et nouveaux amis !</h4><p>Composée de 4 îles à la nature luxuriante et d’une île artificielle, la région d’Alola est particulièrement appréciée des vacanciers… et des Pokémon ! Explorez les différentes îles, capturez des Pokémon inédits et faites-vous de nouveaux amis comme la mystérieuse Lilie ou votre futur meilleur ami : Tili !</p></th><th><h4>Les épreuves du Tour des Iles !</h4><p>Pour la première fois dans un jeu Pokémon, vous ne devez plus récupérer des badges dans les arènes mais participer à des Épreuves sur les différentes Îles d’Alola : des combats Pokémon, des missions pour aider les habitants, des trésors à trouver, des mystères à élucider… à vous de prouver que VOUS êtes le meilleur Dresseur !</p></th><th><h4>Déchaînez la puissance des capacités Z !</h4><p>Quand un Dresseur et son Pokémon s’entendent à merveille, ils peuvent déchaîner des attaques dévastatrices ! Ces nouvelles attaques d’une grande puissance peuvent être utilisées une seule fois par combat et certains Pokémon possèdent même des attaques dédiées comme Pikachu et sa « Pikachute Foudroyante » !</p></th><th><h4>Vous avez toujours rêvé de chevaucher un Dracaufeu ?</h4><p>A Alola, les Pokémon et les humains sont si proches que les Pokémon aident les humains à se déplacer ! Sur terre, en mer ou dans les airs, toute la région d’Alola est à votre portée grâce aux Poké Montures !</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/661dad8f-d4c6-4166-9d3c-0314e82c6175.PNG._CB485978047__SL220__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/f7c4b071-2d3a-4ceb-b854-70cac841128f.PNG._CB485969347__SL220__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/e5771f2a-afcc-4222-9f34-150237eeacb7.PNG._CB485974585__SL220__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/d8eef414-e1fc-428c-9d4f-40cb7fd40101.PNG._CB485980560__SL220__.png\" alt=\"\"></th></tr><tr><th><h4>L\'heure de la Bataille Royale est arrivée !</h4><p>Jusqu’à présent dans les jeux Pokémon, seuls les combats 1 contre 1 ou 2 contre 2 étaient possibles. Avec la Bataille Royale, quatre joueurs peuvent se faire face en jouant chacun pour soi ! Bienvenue dans une mêlée ouverte où tous les coups sont permis !</p></th><th><h4>Gardez une longueur d\'avance avec votre Motisma-Dex !</h4><p>Cette nouvelle forme de Pokédex est habitée par un Motisma, ce Pokémon qui peut prendre possession de divers appareils électriques ! Il vous donne bien sûr des informations sur les Pokémon que vous rencontrez, mais il vous guide aussi dans votre aventure. Son aide et sa bonne humeur vous soutiendront tout au long de votre périple !</p></th><th><h4>Compétition en ligne avec le Pokémon Global Link !</h4><p>Participez à des Compétitions Internet officielles mais aussi pour la première fois, créer des compétitions amicales en ligne dans lesquelles vous fixez vos propres règles avec le Tournoi Amical !</p></th><th><h4>Capturez des Pokémon avec style !</h4><p>Personnalisez votre personnage de la tête aux pieds en changeant sa tenue, sa coupe de cheveux et la couleur de ses yeux grâce à des lentilles de contact. Vous pouvez même changer la couleur d’un vêtement si elle ne vous plaît pas ! Il est temps de ressortir votre tenue de vacances !</p></th></tr></tbody></table></figure><p><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/75125410-0388-40c7-9209-f07ab8244fe0.PNG._CB485977232__SL300__.png\" alt=\"\"></p><h3><strong>VOUS PENSIEZ CONNAÎTRE TOUS LES POKÉMON ?</strong></h3><p>Les Raichu d\'Alola possèdent un double type : Électrik et Psy. Ils sont capables de concentrer leurs pouvoirs psychiques dans leur queue et de s’en servir pour flotter dans les airs !</p><p><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/75125410-0388-40c7-9209-f07ab8244fe0.PNG._CB485977232__SL300__.png\" alt=\"\"></p><p>RAICHU D\'ALOLA</p><p><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/247846ec-f0de-4e6e-9e12-2410102f6e22.PNG._CB485974618__SL300__.png\" alt=\"\"></p><p>MIAOUSS D\'ALOLA</p><p><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/d61d155b-db32-42e6-908e-519900399598.PNG._CB485980201__SL300__.png\" alt=\"\"></p><p>NOADKOKO D\'ALOLA</p><p><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/a2a69f20-2df5-4a86-947b-7cad34892426.PNG._CB485975461__SL300__.png\" alt=\"\"></p><p>GOUPIX D\'ALOLA</p><h3><strong>LES POKÉMON LÉGENDAIRES</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/63e2f188-3609-437e-935d-740b6dbcde1a.png._CB485975244__SL300__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/da9ce8a7-70f0-4701-997a-25f068538890.png._CB485935847__SL300__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/d020d269-3ae4-4da5-acd9-ac6d7b471b8b.png._CB485977204__SL300__.png\" alt=\"\"></th></tr><tr><th><h4>SOLGALEO</h4><p>Solgaleo est connu pour être « celui qui dévore le soleil ». Le corps de Solgaleo renferme une énorme quantité d\'énergie qui rayonne lorsqu\'il est actif, et sa crinière ressemble à s\'y méprendre au soleil. Sa capacité signature est Choc Météore : Solgaleo charge son adversaire avec la force d\'une météorite, en ignorant le talent de sa cible.</p></th><th><h4>La Version démo* spéciale de Pokémon Soleil et Pokémon Lune enfin disponible</h4><p>Elle présente aux joueurs la région d\'Alola ainsi que Sachanobi, l\'Amphinobi qui apparaît aux côtés de Sacha dans les dessins animés Pokémon, la série : XYZ. Il sera possible de transférer votre Amphinobi Forme Sacha de la Version démo spéciale vers la version complète du jeu après sa sortie le 23 novembre.</p><p>* Connexion Internet sans fil requise. L\'enregistrement d\'un identifiant Nintendo Network et l\'acceptation du contrat Nintendo Network sont nécessaires.</p></th><th><h4>LUNALA</h4><p>Nombreux sont ceux qui appellent Lunala « celui qui invite la lune ». Lunala tire son énergie de la lumière lunaire qu\'il absorbe en permanence. Lorsqu\'il étend ses immenses ailes, celles-ci renvoient l\'image d\'un magnifique ciel étoilé. Sa capacité signature est Rayon Spectral : Lunala envoie un puissant rayon de lumière vers son adversaire, en ignorant le talent de sa cible.</p></th></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', 1, 40.00, 31, 40.00, NULL, NULL, 0, 0, 0, NULL, 'CU00093', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1122, \"original\": \"https://api.click-games.fr/storage/1072/81rzUXrNtdL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1072/conversions/81rzUXrNtdL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1123, \"original\": \"https://api.click-games.fr/storage/1073/81rzUXrNtdL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1073/conversions/81rzUXrNtdL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1124, \"original\": \"https://api.click-games.fr/storage/1074/51WIiRXlsOL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1074/conversions/51WIiRXlsOL._AC_-thumbnail.jpg\"}, {\"id\": 1125, \"original\": \"https://api.click-games.fr/storage/1075/41nJazihCiL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1075/conversions/41nJazihCiL._AC_-thumbnail.jpg\"}, {\"id\": 1126, \"original\": \"https://api.click-games.fr/storage/1076/51ShkQTKuxL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1076/conversions/51ShkQTKuxL._AC_-thumbnail.jpg\"}, {\"id\": 1127, \"original\": \"https://api.click-games.