.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(107, NULL, 'Pokemon Ultra Soleil', 'pokemon-ultra-soleil', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/5e95a7da-be47-4a05-9c79-5c5cdf1254c8._SR300,300_.JPG\" alt=\"\"></p><h3><strong>A l’aube d’une aventure légendaire !</strong></h3><p>Le soleil d’Alola vous manque ? Plongez dans une aventure inédite parmi les Pokémon si particuliers de cette région pacifique. Incarnez de nouveaux héros et découvrez un nouveau pan de l’histoire de Pokémon Soleil et Pokémon Lune : votre Tour des îles reprend !</p><p>Ce nouvel opus développe notamment les sombres mystères des Ultra-Chimères et des Ultra-Brèches ! L’aventure Pokémon prend une nouvelle dimension mais une question demeure : serez-vous le meilleur dresseur d’Alola ?</p><h3><strong>Caractéristiques</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/1cfdc39e-439b-4279-967d-d0a0e08de905._SL300__.JPG\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/438dce49-e533-4ffb-bdb5-8db451f098f0._SL300__.JPG\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/0d5d5d19-6ba5-4f36-8f3b-ec6f3d88e463._SL300__.jpg\" alt=\"\"></th></tr><tr><th><h4>Votre aventure Alola continue, dans des terres inconnues !</h4><p>Vous pensiez tout savoir d’Alola ? Ce monde vous réserve bien des surprises, dont une nouvelle épreuve défendue par la mystérieuse Capitaine Oléa, et vous emmène rapidement dans des nouvelles zones au cours de votre aventure, comme la Plage des Surfeurs ou encore la Vallée des Pikachu ! Et si vous avez déjà été conquis par Pokémon Soleil ou Pokémon Lune, la version Ultra vous surprendra d’autant plus !</p></th><th><h4>Au creux de votre main, le secret du monde Pokémon</h4><p>Mais qui est vraiment Necrozma ? Il semble avoir fusionné avec les Pokémon légendaires Solgaelo et Lunala pour s’incarner en deux nouvelles formes terrifiantes ! Ces événements renferment de terribles révélations, le sort d’Alola pourrait bien en dépendre…</p></th><th><h4>Plus de 400 Pokémon à attraper !</h4><p>Dans cet opus Pokémon, plus de 400 Pokémon sont capturables, dont une grande partie inédite à Pokémon Soleil et Pokémon Lune. S’ajoutent à ceux-ci deux Ultra-Chimères, UC-Empillage et UC-Détonation !</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e2850d77-cfc9-412c-ba78-4558b2421133._SL300__.JPG\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/95d95124-6ed1-429b-a0a9-c1805bae31a6._SL300__.JPG\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a694def3-9693-412a-9be8-6b5ff52973c3._SL300__.JPG\" alt=\"\"></th></tr><tr><th><h4>Surfez entre les îles à dos de Pokémon !</h4><p>Un tout nouveau mode de jeu apparait lorsque vous voyagez entre deux îles : vous pouvez désormais surfer sur le dos d’un Démanta, réaliser toutes sortes de figures et surtout récupérer des Points de Combat à échanger contre des objets rares ! La Poké-Monture prend une toute nouvelle ampleur !</p></th><th><h4>Une nouvelle forme Pokémon révélée</h4><p>Les évolutions combinées de Rocabot, Lougaroc Nocturne et Lougaroc Diurne, donnent naissance à tout nouveau type de Pokémon très puissant, Lougaroc Crépusculaire ! Ce Pokémon inédit sera doté d’une capacité Z propre, Hurlement des Roches-Lames, et seulement disponible jusqu’au 10 janvier 2018 !</p></th><th><h4>Les nouveautés de Pokémon Soleil et Pokémon Lune reviennent améliorées</h4><p>Profitez de nouveaux Poké-Montures et de nouvelles capacités Z qui renforcent vos Pokémon préférés en combat! De nouvelles tenues pour votre personnage vous attendent dans les boutiques : le mot court que le bonnet Pikachu sied à tout le monde ! Enfin, vous pouvez désormais prendre des photos originales avec vos Pokémon grâce au club Photo d’Alola !</p></th></tr></tbody></table></figure>', 1, 49.00, 31, 49.0