.00, NULL, NULL, 0, 0, 0, NULL, 'CU00096', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1141, \"original\": \"https://api.click-games.fr/storage/1091/818MNsl62QL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1091/conversions/818MNsl62QL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1142, \"original\": \"https://api.click-games.fr/storage/1092/818MNsl62QL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1092/conversions/818MNsl62QL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1143, \"original\": \"https://api.click-games.fr/storage/1093/81uDuJTSsLL._AC_SL1195_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1093/conversions/81uDuJTSsLL._AC_SL1195_-thumbnail.jpg\"}, {\"id\": 1144, \"original\": \"https://api.click-games.fr/storage/1094/419B-qg8goL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1094/conversions/419B-qg8goL._AC_-thumbnail.jpg\"}, {\"id\": 1145, \"original\": \"https://api.click-games.fr/storage/1095/41j8v+SCS3L._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1095/conversions/41j8v+SCS3L._AC_-thumbnail.jpg\"}]', NULL, '2022-03-14 16:13:35', '2022-08-05 09:27:11', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(109, NULL, 'Pokemon Y', 'pokemon-ultra-soleil-3', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/cffaf847-5ea4-4f63-b89a-3be07d3b6294._SR300,300_.jpg\" alt=\"\"></p><h3><strong>Pokémon Y</strong></h3><p>Un monde en 3D à couper le souffle vous attend dans Pokémon Y, en exclusivité sur Nintendo 3DS. Voyagez dans la région de Kalos, une terre imprégnée de mystère que vous découvrirez dans la prochaine évolution Pokémon et vous pourrez choisir parmi trois nouveaux Pokémon de départ fraîchement découverts pour commencer votre périple !</p><p>Dans ce RPG, choisissez l\'un des trois Pokémon de départ récemment découverts pour commencer votre aventure : Marisson (type Plante), Feunnec (type Feu) ou encore Grenousse (type Eau). Chacun d\'eux possède ses propres capacités et gagnera de l\'expérience au fur et à mesure des combats pour devenir plus fort et évoluer à terme.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/4b28e6e5-60b2-45d2-965f-2d7bf0e3a212._SR300,300_.jpg\" alt=\"\"></p><p>Dans Pokémon Y, votre aventure Pokémon prend une nouvelle dimension. Chaque recoin de la région de Kalos en forme d\'étoile regorge de vie, des rues pavées d\'Illumis au fin fond de la pampa sauvage. Illumis est une métropole prospère, dont la tour érigée en son centre regorge de boutiques où affluent les clients, et vous y trouverez de quoi explorer à coup sûr.</p><p>De nombreux Pokémon fraichement découverts n\'attendent qu\'à être rencontrés. Par exemple Chevroum est un Pokémon de type Plante si costaud qu\'il peut porter une personne sur son dos, ou Nymphali, la nouvelle évolution d’Évolie, ou encore un mystérieux Pokémon qui est connecté d\'une certaine manière à Mewtwo. Il y a également Yveltal, un Pokémon Légendaire récemment découvert.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/eb540684-dfe4-4812-ac9b-8be56b25c6d8._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/7d98c9ea-b5a3-4e8a-b989-8471d265b5ea._SL300__.png\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/bcd0ec87-2767-497e-9831-e06021bbf20d._SL300__.png\" alt=\"\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p>', 1, 45.00, 31, 45.00, NULL, NULL, 0, 0, 0, NULL, 'CU00097', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1146, \"original\": \"https://api.click-games.fr/storage/1096/71HcZf2TggL._AC_SL1149_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1096/conversions/71HcZf2TggL._AC_SL1149_-thumbnail.jpg\"}', '[{\"id\": 1147, \"original\": \"https://api.click-games.fr/storage/1097/71HcZf2TggL._AC_SL1149_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1097/conversions/71HcZf2TggL._AC_SL1149_-thumbnail.jpg\"}, {\"id\": 1149, \"original\": \"https://api.click-games.fr/storage/1099/61eb9eFpQvL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1099/conversions/61eb9eFpQvL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 1150, \"original\": \"https://api.click-games.fr/storage/1100/61xXKVSzKmL._AC_SL1275_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1100/conversions/61xXKVSzKmL._AC_SL1275_-thumbnail.jpg\"}, {\"id\": 1151, \"original\": \"https://api.click-games.fr/storage/1101/71OxwMW9uFL._AC_SL1200_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1101/conversions/71OxwMW9uFL._AC_SL1200_-thumbnail.jpg\"}, {\"id\": 1152, \"original\": \"https://api.click-games.fr/storage/1102/71PtNfpSZAL._AC_SL1200_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1102/conversions/71PtNfpSZAL._AC_SL1200_-thumbnail.jpg\"}, {\"id\": 1153, \"original\": \"https://api.click-games.fr/storage/1103/61Z9JPGUNCL._AC_SL1000_-2.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1103/conversions/61Z9JPGUNCL._AC_SL1000_-2-thumbnail.jpg\"}, {\"id\": 1154,