3-14 16:21:00', '2022-08-05 09:27:04', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(111, NULL, 'Pokémon Saphir Alpha', 'pokemon-saphir-alpha', '<h3><strong>Pokémon Saphir Alpha</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/b9201e39-d363-4c38-839b-9ce4311fafc7._SL300__.jpg\" alt=\"\"></p><p>Au fil de votre aventure, vous pourrez créer votre propre Super Base Secrète, un espace rien qu\'à vous. Mais ce n\'est pas tout : vous pourrez retrouver d\'autres joueurs du monde entier pour partager vos Super Bases Secrètes ! Si vous trouvez des propriétaires de Bases que vous aimez, vous pouvez en faire vos Amis Secrets. Une fois que vous êtes Ami Secret avec quelqu\'un, cet ami peut utiliser ses \"pouvoirs spéciaux\" pour vous aider dans votre partie. Vous pouvez aussi vous illustrer en ligne en combattant d\'autres Dresseurs grâce au Player Search System (PSS). Pour relever des défis différents, choisissez des combats 2 vs.2 ou même 3 vs. 3, et échangez des Pokémon avec d\'autres Dresseurs du monde entier !</p><p>Plongez dans une incroyable aventure avec Pokémon Saphir Alpha sur Nintendo 3DS et 2DS ! Découvrez toutes sortes de nouveautés dans l\'univers de Pokémon Version Saphir, sorti sur Game Boy Advance en 2003. Avec des graphismes améliorés et des contenus inédits, préparez-vous à prouver que vous êtes le meilleur Dresseur de Pokémon de la région : à vous de capturer, et entraîner vos Pokémon pour les mener au combat dans ce RPG haletant !</p><p>Parcourez la région de Hoenn, où deux grandes organisations aux objectifs contradictoires se battent sans relâche : Team Magma et Team Aqua. Team Magma souhaite agrandir les terres de la région de Hoenn, tandis que Team Aqua veut laisser plus de place aux océans. Dans Pokémon Saphir Alpha, Team Magma est le camp le plus puissant, alors que Team Aqua est plus présente dans Pokémon Rubis Oméga. Quelle que soit la version de jeu que vous choisissez, vous vous trouverez entraîné au cœur du conflit !</p><p>L\'histoire débute lorsque vous vous installez à Bourg-en-Vol : là vous pouvez choisir parmi trois Pokémon pour démarrer l\'aventure. Chacun a son style particulier. Vous avez le choix entre Arcko, créature d\'herbe, Poussifeu, créature de feu, et Gobou, créature d\'eau. Quel que soit votre choix, il vous faudra élever votre Pokémon avec le plus grand soin pour en faire un partenaire de confiance : il pourra réaliser de superbes Méga-Évolutions au bon moment, ce qui lui permettra de faire preuve d\'encore plus de force ! Ouvrez l\'oeil pour repérer deux nouveaux Pokémon légendaires : Groudon, qui a créé la terre, et Kyogre, qui a créé les mers. Chacun dispose de nouvelles transformations que l\'on appelle Primo-Résurgence !</p><p>Afin de développer un lien puissant avec votre Pokémon, utilisez la fonction Poké Récré qui vous permet de vous rapprocher de votre créature en la caressant, jouant à des jeux avec elle, et lui offrant des friandises spéciales qu\'on appelle Poké-Puffs. Plus vous prenez soin de votre Pokémon, meilleur il est au combat. En dehors des affrontements, vous pouvez aussi exhiber votre Pokémon dans le Concours Pokémon Live ! pour voir lequel saura séduire le plus grand nombre à l\'aide de cinq critères : Sang-froid, Beauté, Grâce, Intelligence et Robustesse. Remportez les concours pour arriver au rang de Maître !</p><p>Bien sûr, vous ne serez pas seul dans la région de Hoenn, d\'autres Dresseurs de Poképon seront aussi là. Ils cherchent tous à être les meilleurs de tous : des Champions. Pour le devenir vous-même, vous devez mettre au défi chacun des champions d\'arène que vous rencontrez pour gagner des Badges d\'arêne. Obtenez les huit Badges et vous affronterez la Ligue Pokémon, où vous pourrez vous mesurer au Conseil des 4, puis le Champion en personne !</p><p>En lire moins</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/29f8abf8-aeff-4897-89eb-d17626dc8394._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/ebe3df21-f9be-4abb-aa76-919c9521fc87._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/dc9cf0d4-dc8a-4504-9935-401df9c66fca._SL300__.jpg\" alt=\"\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/aea48200-0547-4e56-9cd1-2bae49918190._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/ec7d05a8-8650-4e04-8b32-5dc2f4a55238._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/218c2b20-0a0d-43a9-a9fb-36277644bc0d._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/d93e56f7-7f6d-43a2-86fc-f480e0008f79._SL220__.jpg\" alt=\"\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/49354502-aca7-4263-a79f-cc24564cb6ef._SR970,300_.jpg\" alt=\"\"></p><p>&nbsp;</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 39.99, 31, 39.99, NULL, NULL, 0, 0, 0, NULL, 'CU00099', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1169, \"original\": \"https://api.click-games.fr/storage/1119/71gJM7HSx5L._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1119/conversions/71gJM7HSx5L._AC_SL1000_-thumbnail.jpg\"}', '[{\"id\": 1176, \"original\": \"https://api.click-games.fr/storage/1126/71gJM7HSx5L._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1126/conversions/71gJM7HSx5L._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1177, \"original\": \"https://api.click-games.fr/storage/1127/41Jmn9II3qL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1127/conversions/41Jmn9II3qL._AC_-thumbnail.jpg\"}, {\"id\": 1178, \"original\": \"https://api.click-games.fr/storage/1128/41dHTaZ+bbL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1128/conversions/41dHTaZ+bbL._AC_-thumbnail.jpg\"}, {\"id\": 1179, \"original\": \"https://api.click-games.fr/storage/1129/31MzCpJxPgL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1129/conversions/31MzCpJxPgL._AC_-thumbnail.jpg\"}, {\"id\": 1180, \"original\": \"https://api.click-games.fr/storage/1130/61sXw3FPg9L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1130/conversions/61sXw3FPg9L._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-03-14 16:28:10', '2022-08-05 09:27:01', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
