INSERT INTO `products` (`id`, `ref`, `name`, `slug`, `description`, `type_id`, `price`, `shop_id`, `sale_price`, `max_price`, `min_price`, `is_used`, `click_collect`, `pre_order`, `release_date`, `sku`, `quantity`, `in_stock`, `is_taxable`, `weight`, `brand_id`, `shipping_class_id`, `status`, `product_type`, `unit`, `height`, `width`, `length`, `image`, `gallery`, `deleted_at`, `created_at`, `updated_at`, `discount`, `product_condition`, `product_information_id`, `modele_id`, `mode`, `user_id`, `exchangeable`) VALUES
(114, NULL, 'Pokémon Diamant', 'pokemon-diamant', '<p>Dans Pokémon Version Diamant, découvrez une toute nouvelle île appelée Sinnoh et tentez de devenir le plus grand Entraîneur de Pokémon de tous les temps ! Au début de l’aventure, vous choisissez un Pokémon parmi les trois nouveaux Pokémon de départ : Tortipouss, Tiplouf ou Ouisticram, chacun avec des capacités uniques. Votre quête consiste à arrêter une nouvelle menace – la diabolique Team Galaxie - qui cherche à libérer les pouvoirs de Dialga et Palkia : deux nouveaux Pokémon légendaires dont on dit qu’ils pourraient contrôler respectivement le temps et l’espace.</p><p>Pendant votre voyage, vous affronterez une grande variété de Pokémon – dont de nombreux que vous n’avez encore jamais rencontrés ! Vous devrez attraper les Pokémon à l’aide de Pokéballs, les entraîner et en prendre soin. Si vous réussissez à tous les attraper et à compléter le Pokédex (un glossaire contenant tous les Pokémon disponibles), vous deviendrez le meilleur Entraîneur de Pokémon du monde entier !</p><p>Dans Pokémon Version Diamant et Version Perle, vous pouvez également défier d’autres véritables entraîneurs dans le monde entier, via la Connexion Wi-Fi Nintendo. Vous pouvez aussi échanger vos Pokémon en ligne, pour compléter votre Pokédex. En plus, après avoir enregistré les codes amis de vos amis, il vous sera possible de discuter via le chat vocal de la Nintendo DS.</p><p><strong>Caractéristiques :</strong>&nbsp;<br>- Attrapez, entraînez et mesurez-vous avec plus de 100 nouveaux Pokémon : pour la première fois, les entraîneurs pourront attraper de nouveaux Pokémon tels Goinfrex, Timoret, Lucario, Mime Jr. , Manzaï et bien d’autres - Explorez une nouvelle et gigantesque région : le Pokédex de Sinnoh recense jusqu’à 151 Pokémon, certains bien connus et plus de 80 nouveaux. Ainsi le Pokédex National regroupant toutes les régions pourrait contenir plus de 480 Pokémon. Avec 100 nouveaux Pokémon, cela signifie que certains ne peuvent pas faire partie du Pokédex de Sinnoh ! Comment peut-on les attraper tous ? - Des environnements en 3D: pour la première fois le monde de Pokémon est en 3-D, pour le rendre encore plus vivant - Des matchs et des échanges en ligne dans le monde entier grâce à la Connexion Wi-Fi Nintendo. Une fois les codes amis enregistrés, deux joueurs peuvent combattre et échanger des Pokémon tout en discutant. - Le cycle Jour et Nuit: en utilisant la fonction horloge de la DS, l’action se déroule en temps réel. Le temps influe aussi sur les Pokémon et les combats. - Importez vos Pokémon depuis votre GBA: depuis les jeux Pokémon Game Boy® Advance en utilisant le slot GBA de la Nintendo DS.</p><p><strong>Histoire :</strong>&nbsp;<br>Dans les mythes et folklores de la région de Sinnoh, deux Pokémon reviennent constamment : Dialga, dont on dit qu’il peut contrôler le temps, et Palkia, qui peut plier l’espace à sa volonté. Une sinistre organisation appelée Team Galaxie veut étendre son règne sur Sinnoh, en détournant à son profit le pouvoir de ces deux Pokémon. Après la découverte d’une mystérieuse mallette, la passion des Pokémon vous saisit : durant votre quête pour compléter votre Pokédex et devenir Champion de Ligue, votre chemin va croiser celui de la malfaisante Team Galaxie et vous mener à côtoyer des Pokémon titanesques lors d’un voyage merveilleux à travers les paysages de Sinnoh.</p>', 1, 38.18, 31, 38.18, NULL, NULL, 0, 0, 0, NULL, 'CU00101', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1189, \"original\": \"https://api.click-games.fr/storage/1139/51wJt0yN45L._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1139/conversions/51wJt0yN45L._AC_-thumbnail.jpg\"}', '[{\"id\": 1190, \"original\": \"https://api.click-games.fr/storage/1140/51EHF7AFQWL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1140/conversions/51EHF7AFQWL._AC_-thumbnail.jpg\"}, {\"id\": 1191, \"original\": \"https://api.click-games.fr/storage/1141/51JobfWenGL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1141/conversions/51JobfWenGL._AC_-thumbnail.jpg\"}, {\"id\": 1192, \"original\": \"https://api.click-games.fr/storage/1142/51Jus-bu9dL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1142/conversions/51Jus-bu9dL._AC_-thumbnail.jpg\"}, {\"id\": 1193, \"original\": \"https://api.click-games.fr/storage/1143/516RZfYIiWL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1143/conversions/516RZfYIiWL._AC_-thumbnail.jpg\"}, {\"id\": 1194, \"original\": \"https://api.click-games.fr/storage/1144/51cJQj1SdGL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1144/conversions/51cJQj1SdGL._AC_-thumbnail.jpg\"}, {\"id\": 1195, \"original\": \"https://api.click-games.fr/storage/1145/51LGb7buopL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1145/conversions/51LGb7buopL._AC_-thumbnail.jpg\"}]', NULL, '2022-03-15 18:18:56', '2022-08-05 09:26:53', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(115, NULL, 'Mario Strikers : Battle League Football', 'mario-strikers-battle-league-football', '<ul><li>Préparez-vous du football à 5 contre 5 sans règles où tous les coups sont permis pour gagner !</li><li>Dribblez vos adversaires, faites des passes à vos coéquipiers</li><li>Et servez-vous des tacles, des objets et des tirs spéciaux pour marquer un maximum de buts</li></ul>', 1, 42.49, 31, 42.49, NULL, NULL, 0, 0, 0, '2022-06-10 00:00:00', 'CU000102', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1196, \"original\": \"https://api.click-games.fr/storage/1146/81IYgTNVjdL._AC_SL1417_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1146/conversions/81IYgTNVjdL._AC_SL1417_-thumbnail.jpg\"}', '[{\"id\": 1197, \"original\": \"https://api.click-games.fr/storage/1147/81t0dlq+ZbL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1147/conversions/81t0dlq+ZbL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1198, \"original\": \"https://api.click-games.fr/storage/1148/81ZTiS46piL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1148/conversions/81ZTiS46piL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1199, \"original\": \"https://api.click-games.fr/storage/1149/81BWqQ+RjeL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1149/conversions/81BWqQ+RjeL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1200, \"original\": \"https://api.click-games.fr/storage/1150/61dKyHMSBQL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1150/conversions/61dKyHMSBQL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1201, \"original\": \"https://api.click-games.fr/storage/1151/71p4Kln6XML._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1151/conversions/71p4Kln6XML._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1202, \"original\": \"https://api.click-games.fr/storage/1152/814e0XJboML._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1152/conversions/814e0XJboML._AC_S