(116, NULL, 'Nintendo Selects - Animal Crossing New Leaf', 'nintendo-selects-animal-crossing-new-leaf', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/04ad8e41-438c-4e02-990b-42dd0826c2c2.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"1\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/d49f4752-e692-4da2-85cc-48397f8eec6a.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"1\"></p><h3><strong>Animal Crossing: New Leaf - Welcome Amiibo</strong></h3><p>S\'installer dans une nouvelle ville et s\'y faire de nouveaux amis est une étape importante dans une vie... surtout quand on en est le maire ! Tenez-vous prêt à découvrir une toute nouvelle vie dans une ville entièrement conçue par vous car Animal Crossing: New Leaf débarque sur Nintendo 3DS et Nintendo 3DS XL.</p><p>Reprenant le gameplay libre et très apprécié des précédents titres Animal Crossing, Animal Crossing: New Leaf est un jeu sans aucune restriction. Pas d\'objectifs, pas de scénario, pas même une fin : vous pouvez profiter de votre vie dans votre nouvelle ville comme bon vous semble. Et comme le temps dans le jeu passe au même rythme que dans le monde réel, chaque jour apporte son lot de nouvelles expériences !</p><p>Votre aventure dans Animal Crossing: New Leaf commence par hasard : peu après votre arrivée en ville, une erreur de la part de Marie, la secrétaire de mairie, fait de vous le maire !</p><h3><strong>Les caracteristiques</strong></h3><figure class=\"table\"><table><tbody><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr><tr><th>Vous avez envie de soleil ? Un séjour sur l\'île est ce qu\'il vous faut. Faites la traversée avec Amiral, puis explorez une île qui regorge de fruits tropicaux, d\'insectes et de poissons, pour votre plus grand plaisir. Pendant que vous y êtes, faites une ou deux excursions : jouez aux mini-jeux en solo ou avec des amis ou encore avec d\'autres joueurs en ligne, puis échangez les médailles que vous avez gagnées contre des souvenirs.</th><th>Dans Animal Crossing: New Leaf, laissez votre créativité s\'exprimer ! Achetez de nouveaux vêtements - hauts, pantalons, jupes, chapeaux, masques et chaussures, améliorez votre maison avec de nouvelles pièces et rénovations, montez vos propres expositions au musée local. Vous pouvez aussi écouter Kéké en concert ou derrière les platines au Club MDR, faire du shopping dans la Rue commerçante, ou encore personnaliser votre maison et intérieur en créant vos propres meubles chez Revente &amp; Retouches. Et bien plus encore !</th><th>Découvrez Animal Crossing: New Leaf avec vos amis, vos parents ou même avec des joueurs que vous n\'avez jamais rencontrés. Jusqu\'à quatre personnes peuvent vivre dans la même ville avec une seule carte de jeu (en jouant à différents moments), ce qui vous permet de partager votre expérience avec vos proches. Vous pouvez aussi retrouver vos amis qui détiennent aussi un exemplaire du jeu - en ligne ou en mode multijoueur local - pour visiter l\'île, découvrir les mini-jeux ou tout simplement traîner ensemble. Avec StreetPass, partagez votre maison avec d\'autres personnes et visitez les maisons des autres dans le village-témoin de l\'AJD, ou rendez-vous dans les villes des autres joueurs en ligne alors que vous dormez dans le Salon de détente.</th></tr></tbody></table></figure>', 1, 37.49, 31, 37.49, NULL, NULL, 0, 0, 0, NULL, 'CU00103', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1204, \"original\": \"https://api.click-games.fr/storage/1154/91QPcaYeG4L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1154/conversions/91QPcaYeG4L._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1205, \"original\": \"https://api.click-games.fr/storage/1155/71tl02phlXL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1155/conversions/71tl02phlXL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1206, \"original\": \"https://api.click-games.fr/storage/1156/71KZ3aVT-NL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1156/conversions/71KZ3aVT-NL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1207, \"original\": \"https://api.click-games.fr/storage/1157/81QWL-CV57L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1157/conversions/81QWL-CV57L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1209, \"original\": \"https://api.click-games.fr/storage/1159/81QV7GHJgEL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1159/conversions/81QV7GHJgEL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1210, \"original\": \"https://api.click-games.fr/storage/1160/81KeSnQS+4L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1160/conversions/81KeSnQS+4L._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1211, \"original\": \"https://api.click-games.fr/storage/1161/81yosgkfLdL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1161/conversions/81yosgkfLdL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1212, \"original\": \"https://api.click-games.fr/storage/1162/71zB3N6SAJL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1162/conversions/71zB3N6SAJL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1213, \"original\": \"https://api.click-games.fr/storage/1163/81itV958zPL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1163/conversions/81itV958zPL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1214, \"original\": \"https://api.click-games.fr/storage/1164/71UXCtHyGFL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1164/conversions/71UXCtHyGFL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-03-16 18:12:59', '2022-08-05 09:26:46', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(117, NULL, 'Super Mario 3D Land', 'super-mario-3d-land', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/49ab58ad-8b5b-4de9-97eb-e150da2d9ac8._SR285,285_.jpg\" alt=\"\">&nbsp;<br>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/11404c3e-3fd6-4c9d-bc42-e8a3179d7d70._SR230,100_.jpg\" alt=\"\"><strong>Nintendo Selects</strong></p><p>&nbsp;</p><p>Ce jeu est désormais disponible dans la gamme Nintendo Selects, une série de logiciels à succès incontournables offrant des expériences de jeu variées ! Découvrez Wii U, la gamme Nintendo Selects sur les consoles de la famille Nintendo 3DS et sur Wii.</p><h3><strong>Super Mario 3D Land</strong></h3><p>Super Mario 3D Land réinvente tout ce que les fans avaient adoré dans les précédentes aventures de Mario et les transporte pour la première fois dans un univers en véritable 3D ! Les joueurs vont découvrir la profondeur du jeu dans tous les sens du terme. Au fil des niveaux, distance et vitesse vont se faire ressentir dans les courses, les sauts et tout particulièrement les sauts sur les ennemis.</p><p>Comme dans tous les autres jeux pour Nintendo 3DS, vous pouvez aussi y jouer en 2D. Mais grâce aux images 3D, il est plus facile d\'estimer les profondeurs et les distances dans les décors. Découvrez les joies de la 3D en exécutant des sauts plus précis pour atteindre la plate-forme suivante et en calculant au millimètre comment permettre à Mario d\'atteindre les blocs \"?\" tant convoîtés !</p><p>Parmi les costumes de Mario, le Costume Tanouki, véritable chouchou des fans fait sont grand retour. Servez-vous de la queue du Costume Tanouki pour attaquer les ennemis ou planer tranquillement en partant des plates-formes les plus hautes.</p><p>Accessible mais aussi exigeant, Super Mario 3D Land vous propose des capacités, nouvelles ou déjà bien connues, qui ajoutent à l\'aventure une touche stratégique originale ! Frayez-vous un chemin jusqu\'au drapeau de la fin du niveau en faisant bon usage des mouvements spéciaux de Mario, ou tentez d\'exploiter vos nouvelles capacités de façon plus audacieuse en vous aventurant dans tous les raccourcis cachés pour y découvrir des secrets !</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/34b43fc2-46f2-4abe-b5c5-9f7247fdac80._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/77871ba2-c7ea-4407-8a46-697d360e8a49._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/562bbd8f-e680-467e-bb78-43e7df798cd6._SL300__.jpg\" alt=\"\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/9226419b-72ad-41ee-99e4-3803dedc518f._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/c813045e-6a9e-496e-99c6-568fa824fdcb._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/17fcc084-a4df-40b7-9be0-1dc89162e74c._SL220__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/b209fd4c-dcf0-486a-af03-bc33c5ae9425._SL220__.jpg\" alt=\"\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', 1, 31.99, 31, 31.99, NULL, NULL, 0, 0, 0, NULL, 'CU00104', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1215, \"original\": \"https://api.click-games.fr/storage/1165/81q4-evritL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1165/conversions/81q4-evritL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1216, \"original\": \"https://api.click-games.fr/storage/1166/71IyfHDGdVL._AC_SL1050_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1166/conversions/71IyfHDGdVL._AC_SL1050_-thumbnail.jpg\"}]', NULL, '2022-03-16 18:20:24', '2022-08-05 09:26:41', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(118, NULL, 'Nintendogs + cats Golden Retriever & ses nouveaux amis', 'nintendogs-cats-golden-retriever-ses-nouveaux-amis', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/37e48472-4d7f-40db-81e4-d81629fb26f1._SR285,285_.jpg\" alt=\"\">&nbsp;<br>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/4bcc65ff-33cc-41c6-b140-27a2d3ac1ff6._SR230,100_.jpg\" alt=\"\"><strong>Nintendo Selects</strong></p><p>&nbsp;</p><p>Ce jeu est désormais disponible dans la gamme Nintendo Selects, une série de logiciels à succès incontournables offrant des expériences de jeu variées ! Découvrez Wii U, la gamme Nintendo Selects sur les consoles de la famille Nintendo 3DS et sur Wii.</p><h3><strong>Nintendogs + cats Golden Retriever et ses nouveaux amis</strong></h3><p>Les chiots de Nintendogs sont de retour sur la console Nintendo 3DS, encore plus craquants et plus expressifs, avec, pour la première fois, des chatons ! Redécouvrez tout le fun du jeu Nintendogs original, avec de nombreuses races et des accessoires pour vos chiots et chatons. Laissez vos chiots et chatons s\'entraîner et s\'affronter dans différents défis et activités.</p><p>Nintendogs + cats tire pleinement parti de la caméra de la Nintendo 3DS et du principe de détection des expressions pour faire réagir vos chiots et chatons en temps réel et en fonction de vos mouvements. Approchez-vous de l’écran pour qu’ils viennent vous lécher le visage ! Enfin, vous pouvez inscrire vos chiots et chatons à des concours, leur apprendre toutes sortes de tours, et les faire participer à une avalanche d’activités !</p><p>Un choix de plus de 20 races</p><p>Chaque chiot et chaque chaton possède son propre pelage et sa propre personnalité.</p><p>Le choix des races varie en fonction de la version du jeu. Retrouvez, par exemple, le bouledogue français, le caniche nain et le golden retriever.</p><p>Chiots et chatons prennent vie</p><p>Les chiots et chatons sont plus ressemblants et expressifs que jamais avec la 3D.</p><p>Grâce à l\'appareil photo intégré, à l\'écran tactile et au microphone, les adorables chiots et chatons réagissent au toucher et à la voix. La technologie de reconnaissance faciale de la console Nintendo 3DS leur permet même de reconnaître leur maître.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/fb7f35ec-0b67-4f33-a4ab-9b5838e8e0f3._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/c82ca616-f1f3-45a6-a104-df4703b7fc89._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/c9517678-e946-4e59-83ff-ce55234fab23._SL300__.jpg\" alt=\"\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/9eef1f3b-d36d-4d0a-b915-70a12117bc6b._SR970,300_.jpg\" alt=\"\"></p><p>&nbsp;</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 38.92, 31, 38.92, NULL, NULL, 0, 0, 0, NULL, 'CU00105', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1217, \"original\": \"https://api.click-games.fr/storage/1167/814bt+UVQML._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1167/conversions/814bt+UVQML._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1218, \"original\": \"https://api.click-games.fr/storage/1168/71uzhvyBTcL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1168/conversions/71uzhvyBTcL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1219, \"original\": \"https://api.click-games.fr/storage/1169/71oj0pne5zL._AC_SL1442_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1169/conversions/71oj0pne5zL._AC_SL1442_-thumbnail.jpg\"}, {\"id\": 1220, \"original\": \"https://api.click-games.fr/storage/1170/71qMO7WWJeL._AC_SL1430_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1170/conversions/71qMO7WWJeL._AC_SL1430_-thumbnail.jpg\"}, {\"id\": 1221, \"original\": \"https://api.click-games.fr/storage/1171/71ZEmBu6FoL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1171/conversions/71ZEmBu6FoL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1222, \"original\": \"https://api.click-games.fr/storage/1172/71xFWlVN5vL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1172/conversions/71xFWlVN5vL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1223, \"original\": \"https://api.click-games.fr/storage/1173/71Mrvnz0hPL._AC_SL1205_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1173/conversions/71Mrvnz0hPL._AC_SL1205_-thumbnail.jpg\"}]', NULL, '2022-03-16 18:27:12', '2022-08-05 09:26:38', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(119, NULL, 'New super Mario Bros 2', 'new-super-mario-bros-2', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/eadd1b79-6c60-4ce1-8011-ea478855d879._SR970,300_.jpg\" alt=\"\"></p><h3><strong>New Super Mario Bros. 2</strong></h3><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/fa04ac8e-8db3-4880-b4d8-64eabb3f6be4._SL300__.jpg\" alt=\"\"></p><p>Dans le nouveau mode Pièces en folie - dont le but est de récupérer un maximum de pièces sans jamais échouer - déchaînez votre sens de la compétition. Foncez dans trois niveaux sélectionnés aléatoirement et faites très attention : vous ne posséderez qu’une vie ! En revanche, allez le plus vite possible et atteignez la ligne d’arrivée pour transformer en pièces toutes les secondes restantes. Vos résultats seront sauvegardés et partagés avec les personnes croisées via StreetPass. Vous pourrez même tenter de battre leur record ! Les éléments compétitifs et coopératifs de Pièces en folie et du mode coopération sauront vous passionner pendant de longues heures, même si vous avez déjà sauvé princesse Peach !</p><p>New Super Mario Bros. 2 est le premier jeu de Mario à scrolling horizontal spécialement conçu pour la console Nintendo 3DS. Fort de ses 80 niveaux, de ses nombreux passages secrets et de ses objets cachés, ce titre s’impose comme un grand classique du genre et comme un opus révolutionnaire ! Pour la première fois dans l’histoire de la série, votre mission sera de récupérer un million de pièces d’or. Heureusement, trois éléments « dorés » seront à votre disposition au fil de votre aventure.</p><p>La première transformation s\'opère grâce à la fleur d’or, permettant de transformer Mario en Mario d’or. Grâce à cet objet, vous pourrez lancer des boules de feu dorées et transformer autant les ennemis que les blocs en pièces d’or. Armés du deuxième élément, les fans de Mario les plus rapides pourront transformer les blocs de 10 pièces en blocs d’or. Ces blocs pourront alors être transportés sur la tête de Mario et libéreront une fontaine de pièces d’or pendant un certain temps. Enfin, si vous repérez un anneau d’or sur un parcours, et si vous êtes assez adroit pour sauter au milieu, tous les ennemis à l’écran pourront être transformés en or. Ces ennemis créeront alors des pièces d’une façon à chaque fois particulière, et offriront un maximum de pièces lorsque vous les éliminerez !</p><p>New Super Mario Bros. 2 possède aussi certains objets indémodables, chers aux fans de l’immortelle saga. La super feuille fait ainsi un grand retour et permet de transformer Mario en Mario raton laveur. Grâce à cet incroyable pouvoir issu du jeu Super Mario Bros. 3 de la NES, volez sur de courtes distances, flottez dans les airs et utilisez une queue de raton laveur pour frapper les blocs et les ennemis.</p><p>Pour la première fois dans un jeu de Super Mario sur console portable, l’aventure toute entière est accessible dans le mode coopération. Vous et un ami - chacun équipé d’une console Nintendo 3DS et d’un exemplaire du jeu - pouvez jouer comme Mario ou Luigi et tenter de sauver la princesse. Pour vous aider, trois capacités spéciales et coopératives sont à maîtriser dans des niveaux à découvrir à deux. Chaque pièce récupérée en mode coopératif compte pour les deux joueurs. Alors n’hésitez pas à enrôler un ami pour décrocher le million !</p><p>&nbsp;</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 50.00, 31, 50.00, NULL, NULL, 0, 0, 0, NULL, 'CU00106', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1224, \"original\": \"https://api.click-games.fr/storage/1174/717lYzT5wHS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1174/conversions/717lYzT5wHS._AC_SL1000_-thumbnail.jpg\"}', '[{\"id\": 1225, \"original\": \"https://api.click-games.fr/storage/1175/71T6czC9UbL._AC_SL1050_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1175/conversions/71T6czC9UbL._AC_SL1050_-thumbnail.jpg\"}]', NULL, '2022-03-16 18:30:16', '2022-08-05 09:25:57', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(120, NULL, 'Mario Kart 7', 'mario-kart-7', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/8a5db6cb-560d-4b8a-805e-99baa0ae76fb.__CR0,0,970,300_PT0_SX970_V1___.jpg\" alt=\"1\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/e2ee543a-cb6e-45f8-b241-db13abb11e02.__CR0,0,300,300_PT0_SX300_V1___.png\" alt=\"1\"></p><p>Nintendo Co., Ltd., multinationale japonaise basée à Kyoto, reconnue pour son innovation dans le secteur du divertissement interactif, produit des jeux vidéo et des consoles de jeu vidéo dont la console de salon Nintendo Switchvet les consoles portables de la famille Nintendo 3DS.Depuis 1983, Nintendo a vendu près de 4,7 milliards de jeux vidéo et plus de 750 millions de consoles à l\'échelle mondiale (Nintendo Switchet les consoles de la famille Nintendo 3DS comme la New Nintendo 3DS, New Nintendo 3DS XL, Nintendo 3DS, Nintendo 3DS XL,Nintendo 2DS, ainsi que les consoles Nintendo DS, Nintendo DSi, Nintendo DSi XL, Game Boy, Game Boy Advance, Super NES, Nintendo 64 et Nintendo GameCube, Wii and Wii U) et créé quelques-unes des plus grandes icônes du secteur telles que Mario, Donkey Kong, Metroid, Zelda et Pokémon.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/1b2d55ea-04bb-4032-831c-051f2929d46b.__CR11,0,1149,711_PT0_SX970_V1___.png\" alt=\" \"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/9cd82dab-3ebd-4fcd-b1e5-6b1b257554c1.__CR77,0,970,600_PT0_SX970_V1___.png\" alt=\" \"></p>', 1, 50.00, 31, 50.00, NULL, NULL, 0, 0, 0, NULL, 'CU00107', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1226, \"original\": \"https://api.click-games.fr/storage/1176/71lCliD80HL._AC_SL1150_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1176/conversions/71lCliD80HL._AC_SL1150_-thumbnail.jpg\"}', '[{\"id\": 1227, \"original\": \"https://api.click-games.fr/storage/1177/81l-CfAtWIL._AC_SL1152_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1177/conversions/81l-CfAtWIL._AC_SL1152_-thumbnail.jpg\"}, {\"id\": 1228, \"original\": \"https://api.click-games.fr/storage/1178/41bol0fEeVL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1178/conversions/41bol0fEeVL._AC_-thumbnail.jpg\"}, {\"id\": 1229, \"original\": \"https://api.click-games.fr/storage/1179/612hw0cG94L._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1179/conversions/612hw0cG94L._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1230, \"original\": \"https://api.click-games.fr/storage/1180/61scwUk+ggL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1180/conversions/61scwUk+ggL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1231, \"original\": \"https://api.click-games.fr/storage/1181/612R4H1GZ9L._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1181/conversions/612R4H1GZ9L._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1232, \"original\": \"https://api.click-games.fr/storage/1182/614SU-Hiz-L._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1182/conversions/614SU-Hiz-L._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1233, \"original\": \"https://api.click-games.fr/storage/1183/61Vlk6XC+rL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1183/conversions/61Vlk6XC+rL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1234, \"original\": \"https://api.click-games.fr/storage/1184/61ERR+Ma8KL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1184/conversions/61ERR+Ma8KL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1235, \"original\": \"https://api.click-games.fr/storage/1185/71ifbCFu0jL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1185/conversions/71ifbCFu0jL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1236, \"original\": \"https://api.click-games.fr/storage/1186/71rd8qSn9BL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1186/conversions/71rd8qSn9BL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1237, \"original\": \"https://api.click-games.fr/storage/1187/41bxTGQrSUL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1187/conversions/41bxTGQrSUL._AC_-thumbnail.jpg\"}]', NULL, '2022-03-16 18:33:46', '2022-08-05 09:25:31', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(121, NULL, 'Détective Pikachu', 'detective-pikachu', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/25f078af-1bda-4814-914a-fac947ed1fc4._SR300,300_.JPG\" alt=\"\"></p><h3><strong>Un éclair de génie pour résoudre les mystères Pokémon !</strong></h3><p>TESTEZ LA DÉMO GRATUITE EN SCANNANT LE QR CODE !</p><p>Et si pour une fois vous troquiez vos Poké Ball de dresseur pour une loupe d\'enquêteur ?</p><p>Incarnez le jeune Tim Goodman à la recherche de son père disparu et menez l\'enquête avec l\'aide de son ancien partenaire : Un Pikachu pas comme les autres. Un détective qui ne manque de \"Pikant\" ! Avec sa voix rauque et son air bourru, cet allié improbable accro au café et au jazz vous accompagne au coeur d\'un complot. Vous êtes le seul humain à pouvoir dialoguer avec lui ! Ensemble, parcourez la ville moderne et vibrante de Ryme City, interrogez des témoins - humains et Pokémon - et élucidez des affaires ! Rythmée par des cinématiques et des échanges comiques, cette enquête palpitante en neuf chapitres signe le premier titre d\'une série inédite Pokémon.</p><p>Parviendrez-vous à devenir le meilleur enquêteur ? Découvrez Détective Pikachu le 23 mars sur les consoles de la famille Nintendo 3DS.</p><h3><strong>Caractéristiques</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/572cb3f8-49ef-47e9-8205-93936051a214._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/6f72547a-b48b-4cd4-8741-2a24a29bdb1e._SL300__.jpg\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/ce13dba3-1dd4-45e8-ae7a-a3d3d3443efc._SL300__.JPG\" alt=\"\"></th></tr><tr><th><h4>Remontez la piste de votre père disparu à travers Ryme City !</h4><p>Vous incarnez Tim Goodman, résident de la ville de Ryme City où les Pokémon et les humains cohabitent paisiblement. Quand votre père, le détective privé Harry Goodman est porté disparu après un mystérieux accident de voiture, son ancien collègue, un fanfaron Pikachu se proclamant détective, vous prête patte forte pour le retrouver. 9 chapitres constitués de plusieurs enquêtes vous attendent, chacun vous rapprochant un peu plus de la vérité mais aussi du danger d\'un vaste complot ! Des personnages récurrents croisent votre route, ils vous aideront ou vous mettront des bâtons dans les roues : Qui de la reporter Emilia, du bienveillant Baker ou de la discrète secrétaire Amanda est vraiment digne de confiance ?</p></th><th><h4>Soyez vif comme l\'éclair pour élucider des affaires</h4><p>Au fil de vos enquêtes, des personnages ou des Pokémon sollicitent votre esprit de déduction pour résoudre leur problème : Un Capumain pickpocket, un étrange laboratoire ou encore un Dracaufeu devenu fou. Détective Pikachu rassemble les témoignages des Pokémon puis à vous d\'analyser la scène du crime et les preuves collectées sur l\'écran tactile ! Pour signer la fin de la mascarade, rassemblez les suspects et désignez le coupable ! Vous pouvez à tout moment toucher l\'icône Pikachu pour interagir avec votre acolyte : une réplique acerbe ou une Pika-Scène (une cinématique humoristique) se déclenchera. Il y a en 150, essayez de toutes les collectionner !</p></th><th><h4>Une ville peuplée de vos Pokémon préférés</h4><p>Ryme City est la ville idéale, humains et Pokémon en parfaite harmonie, et chaque habitant est généralement accompagné d\'un Pokémon. Préparez-vous à retrouver vos Pokémon préférés d\'Alola, mais également ceux des générations précédentes. Chaque Pokémon a une personnalité propre : Farceur, protecteur, bougon ou curieux, tous les types sont dans la nature !</p></th></tr></tbody></table></figure><h3><strong>Eurêpika ! Elucidez le mystère avant les autres enquêteurs de la ville</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/88b8be20-a5a7-4206-a803-20e67bb5d944._SL220__.png\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/0d764888-8f21-451b-9a1a-2dee67c3c630._SL220__.JPG\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/52b8e654-249f-4a42-bf44-d898416f254b._SL220__.JPG\" alt=\"\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/7de27168-6454-49fe-9659-6a2ec979b8f1._SL220__.JPG\" alt=\"\"></th></tr><tr><th><h4>Détective Pikachu</h4><p>Un Pikachu bourru, féru de café et de boutades mais très bon détective au demeurant.</p></th><th><h4>Tim Goodman</h4><p>Étudiant de 18 ans à l\'université, au sens de la justice sans faille, à la recherche de son père.</p></th><th><h4>Emilia</h4><p>Reporter chevronnée de la chaine GNN, elle s\'efforce de couvrir les crimes de Ryme City.</p></th><th><h4>Brad</h4><p>Un détective rival accompagné par un Elecsprint qui croise souvent la route de Tim et Détective Pikachu.</p></th></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', 1, 50.00, 31, 50.00, NULL, NULL, 0, 0, 0, NULL, 'CU00108', 19, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1238, \"original\": \"https://api.click-games.fr/storage/1188/81KqHOG+USL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1188/conversions/81KqHOG+USL._AC_SL1500_-thumbnail.jpg\"}', '[]', NULL, '2022-03-16 18:36:10', '2022-08-05 09:25:21', 0.00, 'new', NULL, NULL, 'shop-product', NULL, 1),
(122, NULL, 'Disney Magical World 2', 'disney-magical-world-2', '<p><br><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/fd941cff-9fc8-49a1-afc2-b5a5594a8d46.jpg._CB485956631__SR300,300_.jpg\" alt=\"\"></p><h3><strong>Votre vie, votre conte de fées !</strong></h3><p>Et si vous emménagiez dans un village en compagnie de vos héros Disney préférés ?</p><p>Incarnez et personnalisez votre personnage Mii et allez vite rencontrer vos nouveaux voisins : Mickey, Minnie, Elsa, Raiponce ....</p><p>Au village enchanté, vous n\'aurez pas le temps de vous ennuyer entre la décoration de votre maison, la gestion de votre propre café, la création de nouveaux vêtements avec Daisy et la création de meubles et de décorations avec les espiègles Tic et Tac ....</p><p>Plongez dans votre nouvelle vie avec Disney Magical World 2, en exclusivité sur Nintendo 2DS et 3DS.</p><h3><strong>Points Clés</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/4c77923e-f162-4f9d-a75e-4ef97d817266.PNG._CB485968554__SL300__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/0495c37e-4d94-4370-b281-00bc35ed4a41.PNG._CB485979338__SL300__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/73ff4bec-a630-440d-b812-09ca9a8bbdf0.PNG._CB485969114__SL300__.png\" alt=\"\"></th></tr><tr><th><h4>Faites-vous plus de 100 nouveaux amis !</h4><p>Partez à la découverte d’univers féériques et sympathisez avec vos héros préférés ! Vous pouvez, par exemple, faire du surf avec Stitch sur la plage à Hawaï ou même construire un bonhomme de neige avec Elsa, Anna et Olaf à Arendelle ! Il se peut même que vous ne rencontriez pas les mêmes personnages le jour et la nuit !</p></th><th><h4>Créez et personnalisez à l\'infini au Village enchanté !</h4><p>Avec tous les objets que vous collectez au cours de votre aventure, vous pouvez créer des vêtements pour votre Mii dans la boutique de Daisy, fabriquer des meubles pour votre Café ou pour votre maison avec Tic et Tac et même personnaliser la façade de votre maison avec les Trois Petits Cochons !</p></th><th><h4>Faites de beaux rêves !</h4><p>Entrez dans vos rêves et contrôlez votre personnage Mii ! Vous y rencontrerez encore plus de héros et pourrez y vivre des moments inoubliables comme une ballade en tapis volant avec Aladin et Jasmine et même un bain dans un pot de miel avec Winnie l’ourson ! Miam !</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/e32f6354-ab73-4bfb-9498-12b24955fe56.PNG._CB485980679__SL300__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/bf722776-2f0c-4a27-aafa-87a171c40516.PNG._CB485975027__SL300__.png\" alt=\"\"></th><th><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/fe819b39-2e0b-4d6f-a24f-7ee855d8bbdb.PNG._CB485977401__SL300__.png\" alt=\"\"></th></tr><tr><th><h4>Tasse à café ou tasse de thé ?</h4><p>C’est le Roi du royaume en personne qui vous nomme gérant du Café du Village enchanté ! Pour mener à bien cette mission palpitante, décorez le Café à votre goût, choisissez la musique d’ambiance, la tenue de vos employés et surtout, n’ayez pas peur de tester de nouvelles recettes ! Il paraît même que si vous décorez votre café aux couleurs d’un univers Disney, les héros de cet univers pourraient vous réserver une surprise…</p></th><th><h4>Chassez les fantômes avec votre baguette magique !</h4><p>Des fantômes s’amusent à jouer des tours à vos nouveaux amis ! Prenez votre courage à deux mains et à l’aide de votre baguette magique, partez les combattre pour récupérer ce qu’ils ont volé ! Plus vous avancez dans l’aventure, plus vos baguettes magiques sont puissantes !</p></th><th><h4>Immortalisez et partagez vos meilleurs moments !</h4><p>Prenez des photos dans le jeu pour ne pas oublier les merveilleux moments que vous allez vivre et pouvoir les partager avec vos amis sur les réseaux sociaux avec la fonction Partage d’image de votre Nintendo 2DS ou 3DS !</p></th></tr></tbody></table></figure><p><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/1e2cb6de-45fc-4a12-b2c2-8154b75ca9ac.PNG._CB485977055__SL300__.png\" alt=\"\"></p><h3><strong>4 Nouveaux univers fantastiques !</strong></h3><p>Enfilez votre bonnet et vos moufles et visitez Arendelle où vous pouvez, par exemple, construire un bonhomme de neige avec Elsa, Anna et Olaf !</p><p><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/1e2cb6de-45fc-4a12-b2c2-8154b75ca9ac.PNG._CB485977055__SL300__.png\" alt=\"\"></p><p>Monde de la Reine des Neiges</p><p><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/c44ad070-ebe6-42e2-b34a-21665847a08f.PNG._CB485953659__SL300__.png\" alt=\"\"></p><p>Monde de La Petite Sirène</p><p><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/05315637-3c61-42dc-8aeb-dd86a40043a0.PNG._CB485976089__SL300__.png\" alt=\"\"></p><p>Monde de Blanche-Neige</p><p><img src=\"https://images-na.ssl-images-amazon.com/images/G/08/aplusautomation/vendorimages/81f98efc-4287-48b8-965f-f6a61cc70a30.PNG._CB485957157__SL300__.png\" alt=\"\"></p><p>Monde de Lilo &amp; Stitch</p>', 1, 38.99, 31, 38.99, NULL, NULL, 0, 0, 0, NULL, 'CU00109', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1239, \"original\": \"https://api.click-games.fr/storage/1189/91SPt0GL6dL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1189/conversions/91SPt0GL6dL._AC_SL1500_-thumbnail.jpg\"}', '[]', NULL, '2022-03-16 18:38:34', '2022-05-18 09:00:46', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(123, NULL, 'Tomodachi Life', 'tomodachi-life', NULL, 1, 33.88, 31, 33.88, NULL, NULL, 0, 0, 0, NULL, 'CU00110', 17, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1240, \"original\": \"https://api.click-games.fr/storage/1190/81f+RY3slUL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1190/conversions/81f+RY3slUL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1241, \"original\": \"https://api.click-games.fr/storage/1191/91BHIpaMihL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1191/conversions/91BHIpaMihL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1242, \"original\": \"https://api.click-games.fr/storage/1192/51aAY6LhdKL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1192/conversions/51aAY6LhdKL._AC_-thumbnail.jpg\"}, {\"id\": 1243, \"original\": \"https://api.click-games.fr/storage/1193/91C7hOBkZML._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1193/conversions/91C7hOBkZML._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1244, \"original\": \"https://api.click-games.fr/storage/1194/51NNiLn3NpL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1194/conversions/51NNiLn3NpL._AC_-thumbnail.jpg\"}]', NULL, '2022-03-16 18:41:46', '2022-08-05 09:25:14', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL);
INSERT INTO `products` (`id`, `ref`, `name`, `slug`, `description`, `type_id`, `price`, `shop_id`, `sale_price`, `max_price`, `min_price`, `is_used`, `click_collect`, `pre_order`, `release_date`, `sku`, `quantity`, `in_stock`, `is_taxable`, `weight`, `brand_id`, `shipping_class_id`, `status`, `product_type`, `unit`, `height`, `width`, `length`, `image`, `gallery`, `deleted_at`, `created_at`, `updated_at`, `discount`, `product_condition`, `product_information_id`, `modele_id`, `mode`, `user_id`, `exchangeable`) VALUES
(124, NULL, 'The Legend of Zelda : Majora\'s Mask 3D', 'the-legend-of-zelda-majora-s-mask-3d', '<p>Pourrez-vous sauver le monde en 3 jours ?<br><br>Le Zelda le plus mystique de l’histoire revient vous envouter sur Nintendo 3DS. Plusieurs mois après avoir sauvé la princesse Zelda et le monde d’Hyrule dans The Legend of Zelda : Ocarina of Time, Link se voit à nouveau devenir le seul espoir de tout un peuple. Alors qu’il se balade à dos d’Epona dans la forêt, notre héros se voit surprendre par un dénommé Skull Kid, jeune garçon qui porte le masque maléfique Majora. Ce dernier lui dérobe son fidèle destrier ainsi que l’Ocarina du Temps, avant de s’enfuir. Link se retrouve alors étrangement projeté dans le monde parallèle de Termina où les habitants lui apprennent que la fin du monde est proche. En effet Skull Kid pousserait la Lune à s’écraser sur Termina et ses habitants… dans 72 heures ! 3 jours, c’est donc le temps qu’il vous reste pour aider Link à retrouver son Ocarina afin de voyager dans le temps et trouver un moyen de sauver le monde.<br><br><strong>CARACTERISTIQUES</strong> :&nbsp;<br><br>• Une expérience unique sur New Nintendo 3DS :<br><br>Des graphismes retravaillés à merveille, et un relief 3D stabilisé afin que contrées uniques et féériques vous sautent littéralement aux yeux.<br><br>Le second stick intégré à la New Nintendo 3DS facilite la progression du joueur et le contrôle de la caméra.<br><br>La reconnaissance de mouvement gyroscopique de la New Nintendo 3DS permet par exemple de viser à l’arc comme un véritable archer.<br><br><strong>L’écran du bas vous facilite la vie</strong> : Carte, inventaire, etc. Plus besoin de mettre pause !<br><br>• <strong>Bas les masques</strong> : Changez de masques pour changer de pouvoirs, transformez Link en Mojo, Goron ou encore en Zora. En portant le masque Mojo par exemple, Link peut rebondir sur l’eau et cracher des bulles, mais sera vulnérable au feu.<br><br>• La vie des Terminiens, quoi de plus étrange pour un peuple que de savoir qu’il ne leur reste que 3 jours à vivre ? Certains paniquent, d’autres se laissent mourir, il y en a encore qui préfère feindre l’ignorance. La clé pour sauver le monde est en eux, à vous donc de les questionner et de les aider dans leur vie de tous les jours pour avancer dans l’aventure.<br><br>• 3 jours, pour sauver le monde c’est court, mais avec l’Ocarina du Temps, vous pouvez voyager d’un jour à l’autre pour changer le destin de chaque Terminien, et peut-être ainsi contrer la malédiction de la Lune. Termina evolue selon les jours, par exemple, la Tour de Bourg-Clocher grandit au fur et à mesure que les charpentiers la construisent.<br><br>• Epona est là pour vous aider à traverser les plaines de Termina, cet endroit mystérieux, une sorte de monde parallèle au monde d’Hyrule.<br><br>• Les puzzles dans les donjons ne résisteront pas à votre habileté à changer d’apparence et à votre dextérité pour utiliser arc et autres bombes.<br><br><strong>HISTOIRE</strong> :<br><br>Après avoir vaincu Ganondorf, Link poursuit sa quête identitaire en traversant les bois perdus où il croise un certain Skull Kid, jeune garçon portant le maléfique Masque de Majora. Ce dernier dépossède Link d’Epona, sa fidèle monture, ainsi que de l\'Ocarina du Temps, avant de s’enfuir, laissant Link disparaitre dans un monde parallèle à Hyrule : Termina. Les habitants de Termina informent Link du sinistre destin promis à leur monde : la Lune menace de s’écraser sur eux… dans seulement 3 jours ! Cela serait vraisemblablement lié au même Skull Kid que Link a auparavant croisé. Afin d’éviter l’apocalypse, Link doit réveiller les 4 géants du monde de Termina, seuls eux sont capables de repousser la Lune. Pour réaliser sa quête, Link ne peut se priver de son Ocarina du Temps, c’est pourquoi il s’empresse de pourchasser Skull Kid !<br><br><strong>PERSONNAGES</strong> :&nbsp;<br><br>• <strong>Link</strong> : Le héros a la tunique verte est de retour, non pas pour sauver la princesse Zelda, mais pour sauver le monde cette fois-ci !&nbsp;<br><br>• <strong>Skull Kid</strong> : Apparu soudainement devant Link, ce garçon porte un masque étrange et mystérieux, qui renferme des pouvoirs d’une puissance insoupçonnée.&nbsp;<br><br>• <strong>Taya</strong> : Une fée un peu prétentieuse et agaçante. Malgré son caractère, Link pourra compter sur elle dans cette aventure. Son frère est la fée qui accompagne Skull Kid.<br><br>• <strong>Epona</strong> : Fidel destrier de Link, l’accompagne depuis The Legend of Zelda : Ocarina of Time.&nbsp;<br><br>• <strong>Le Vendeur de Masques</strong> : Ancien propriétaire du Masque de Majora, il est le seul à véritablement connaitre les pouvoirs maléfiques qui hantent ce dernier.&nbsp;<br><br>• <strong>La tribu Mojo</strong> : Ce peuple végétal vit dans un palais entouré de l’eau provenant de Bois-Cascade. Par décret royal, le palais est interdit aux non-Mojos.&nbsp;<br><br>• <strong>La tribu Goron</strong> : Les Gorons vivent à l’est dans la zone montagneuse du Pic des Neiges. Bien qu’habitués aux basses températures, ils subissent toutefois un climat curieusement glacial.&nbsp;<br><br>• <strong>La tribu Zora</strong> : Ce peuple aquatique est très sensible aux changements climatiques. Les Indigos, le célèbre groupe Zora, fait un carton chez toutes les races.<br><br><strong>INNOVATIONS</strong> : Le Zelda à l’atmosphère la plus singulière refait surface sous le masque de la new Nintendo 3DS. Link se voit alors évoluer dans des décors aux graphismes retravaillés avec l’ajout<br><br>d’effets visuels qui renforcent l’immersion. Le jeu prend une toute autre dimension lorsque l’effet 3D est activé, encore plus stable est plus fin sur la new Nintendo 3DS. La reconnaissance de mouvements de la New Nintendo 3DS vous permet aussi d’utiliser l’arc de Link comme si vous le teniez vous-même en bougeant la console !<br><br>&nbsp;</p>', 1, 39.99, 31, 39.99, NULL, NULL, 0, 0, 0, NULL, 'CU00111', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1245, \"original\": \"https://api.click-games.fr/storage/1195/81-iGyyz5-L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1195/conversions/81-iGyyz5-L._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1246, \"original\": \"https://api.click-games.fr/storage/1196/4109k4DWvJL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1196/conversions/4109k4DWvJL._AC_-thumbnail.jpg\"}, {\"id\": 1247, \"original\": \"https://api.click-games.fr/storage/1197/51ji9ffg0ML._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1197/conversions/51ji9ffg0ML._AC_-thumbnail.jpg\"}, {\"id\": 1248, \"original\": \"https://api.click-games.fr/storage/1198/41oG6C7m3jL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1198/conversions/41oG6C7m3jL._AC_-thumbnail.jpg\"}, {\"id\": 1249, \"original\": \"https://api.click-games.fr/storage/1199/41e2t-SZYoL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1199/conversions/41e2t-SZYoL._AC_-thumbnail.jpg\"}, {\"id\": 1250, \"original\": \"https://api.click-games.fr/storage/1200/516Vp2I18kL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1200/conversions/516Vp2I18kL._AC_-thumbnail.jpg\"}, {\"id\": 1251, \"original\": \"https://api.click-games.fr/storage/1201/410LefZCOcL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1201/conversions/410LefZCOcL._AC_-thumbnail.jpg\"}, {\"id\": 1252, \"original\": \"https://api.click-games.fr/storage/1202/51APc3qh1RL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1202/conversions/51APc3qh1RL._AC_-thumbnail.jpg\"}, {\"id\": 1253, \"original\": \"https://api.click-games.fr/storage/1203/41TJN90m56L._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1203/conversions/41TJN90m56L._AC_-thumbnail.jpg\"}, {\"id\": 1254, \"original\": \"https://api.click-games.fr/storage/1204/41Od-WwWG4L._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1204/conversions/41Od-WwWG4L._AC_-thumbnail.jpg\"}, {\"id\": 1255, \"original\": \"https://api.click-games.fr/storage/1205/413u+OtXLUL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1205/conversions/413u+OtXLUL._AC_-thumbnail.jpg\"}, {\"id\": 1256, \"original\": \"https://api.click-games.fr/storage/1206/41ENXfqbGKL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1206/conversions/41ENXfqbGKL._AC_-thumbnail.jpg\"}]', NULL, '2022-03-16 18:47:12', '2022-08-05 09:25:09', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(125, NULL, 'The Legend of Zelda : A Link Between Worlds', 'the-legend-of-zelda-majora-s-mask-3d-2', '<p>Embarquez pour une aventure unique dans The Legend of Zelda: Un lien entre les mondes&lt;br/&gt; Cette fois, Link peut se déplacer à travers les murs comme s\'il avait été peint sur eux&lt;br/&gt; Les visuels 3D de Nintendo 3DS ajoutent une nouvelle profondeur au monde du jeu&lt;br/&gt; Décidez quels articles louer ou acheter, selon le donjon que vous allez à la prochaine&lt;br/&gt; Tackle difficile donjons à votre façon</p>', 1, 49.99, 31, 49.99, NULL, NULL, 0, 0, 0, NULL, 'CU00112', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1257, \"original\": \"https://api.click-games.fr/storage/1207/81ztipT8EtL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1207/conversions/81ztipT8EtL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1258, \"original\": \"https://api.click-games.fr/storage/1208/51FBB73RqjL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1208/conversions/51FBB73RqjL._AC_-thumbnail.jpg\"}, {\"id\": 1259, \"original\": \"https://api.click-games.fr/storage/1209/51Nn4ol70jL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1209/conversions/51Nn4ol70jL._AC_-thumbnail.jpg\"}, {\"id\": 1260, \"original\": \"https://api.click-games.fr/storage/1210/41y6Nc8TDFL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1210/conversions/41y6Nc8TDFL._AC_-thumbnail.jpg\"}, {\"id\": 1261, \"original\": \"https://api.click-games.fr/storage/1211/51OXEIKIphL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1211/conversions/51OXEIKIphL._AC_-thumbnail.jpg\"}, {\"id\": 1262, \"original\": \"https://api.click-games.fr/storage/1212/51Ol91BzVjL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1212/conversions/51Ol91BzVjL._AC_-thumbnail.jpg\"}, {\"id\": 1263, \"original\": \"https://api.click-games.fr/storage/1213/51fbYF8BFDL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1213/conversions/51fbYF8BFDL._AC_-thumbnail.jpg\"}, {\"id\": 1264, \"original\": \"https://api.click-games.fr/storage/1214/71R7-DRFp1L._AC_SL1050_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1214/conversions/71R7-DRFp1L._AC_SL1050_-thumbnail.jpg\"}]', NULL, '2022-03-16 18:48:37', '2022-08-05 09:25:02', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
