peuple que de savoir qu’il ne leur reste que 3 jours à vivre ? Certains paniquent, d’autres se laissent mourir, il y en a encore qui préfère feindre l’ignorance. La clé pour sauver le monde est en eux, à vous donc de les questionner et de les aider dans leur vie de tous les jours pour avancer dans l’aventure.<br><br>• 3 jours, pour sauver le monde c’est court, mais avec l’Ocarina du Temps, vous pouvez voyager d’un jour à l’autre pour changer le destin de chaque Terminien, et peut-être ainsi contrer la malédiction de la Lune. Termina evolue selon les jours, par exemple, la Tour de Bourg-Clocher grandit au fur et à mesure que les charpentiers la construisent.<br><br>• Epona est là pour vous aider à traverser les plaines de Termina, cet endroit mystérieux, une sorte de monde parallèle au monde d’Hyrule.<br><br>• Les puzzles dans les donjons ne résisteront pas à votre habileté à changer d’apparence et à votre dextérité pour utiliser arc et autres bombes.<br><br><strong>HISTOIRE</strong> :<br><br>Après avoir vaincu Ganondorf, Link poursuit sa quête identitaire en traversant les bois perdus où il croise un certain Skull Kid, jeune garçon portant le maléfique Masque de Majora. Ce dernier dépossède Link d’Epona, sa fidèle monture, ainsi que de l\'Ocarina du Temps, avant de s’enfuir, laissant Link disparaitre dans un monde parallèle à Hyrule : Termina. Les habitants de Termina informent Link du sinistre destin promis à leur monde : la Lune menace de s’écraser sur eux… dans seulement 3 jours ! Cela serait vraisemblablement lié au même Skull Kid que Link a auparavant croisé. Afin d’éviter l’apocalypse, Link doit réveiller les 4 géants du monde de Termina, seuls eux sont capables de repousser la Lune. Pour réaliser sa quête, Link ne peut se priver de son Ocarina du Temps, c’est pourquoi il s’empresse de pourchasser Skull Kid !<br><br><strong>PERSONNAGES</strong> :&nbsp;<br><br>• <strong>Link</strong> : Le héros a la tunique verte est de retour, non pas pour sauver la princesse Zelda, mais pour sauver le monde cette fois-ci !&nbsp;<br><br>• <strong>Skull Kid</strong> : Apparu soudainement devant Link, ce garçon porte un masque étrange et mystérieux, qui renferme des pouvoirs d’une puissance insoupçonnée.&nbsp;<br><br>• <strong>Taya</strong> : Une fée un peu prétentieuse et agaçante. Malgré son caractère, Link pourra compter sur elle dans cette aventure. Son frère est la fée qui accompagne Skull Kid.<br><br>• <strong>Epona</strong> : Fidel destrier de Link, l’accompagne depuis The Legend of Zelda : Ocarina of Time.&nbsp;<br><br>• <strong>Le Vendeur de Masques</strong> : Ancien propriétaire du Masque de Majora, il est le seul à véritablement connaitre les pouvoirs maléfiques qui hantent ce dernier.&nbsp;<br><br>• <strong>La tribu Mojo</strong> : Ce peuple végétal vit dans un palais entouré de l’eau provenant de Bois-Cascade. Par décret royal, le palais est interdit aux non-Mojos.&nbsp;<br><br>• <strong>La tribu Goron</strong> : Les Gorons vivent à l’est dans la zone montagneuse du Pic des Neiges. Bien qu’habitués aux basses températures, ils subissent toutefois un climat curieusement glacial.&nbsp;<br><br>• <strong>La tribu Zora</strong> : Ce peuple aquatique est très sensible aux changements climatiques. Les Indigos, le célèbre groupe Zora, fait un carton chez toutes les races.<br><br><strong>INNOVATIONS</strong> : Le Zelda à l’atmosphère la plus singulière refait surface sous le masque de la new Nintendo 3DS. Link se voit alors évoluer dans des décors aux graphismes retravaillés avec l’ajout<br><br>d’effets visuels qui renforcent l’immersion. Le jeu prend une toute autre dimension lorsque l’effet 3D est activé, encore plus stable est plus fin sur la new Nintendo 3DS. La reconnaissance de mouvements de la New Nintendo 3DS vous permet aussi d’utiliser l’arc de Link comme si vous le teniez vous-même en bougeant la console !<br><br>&nbsp;</p>', 1, 51.69, 31, 33.60, NULL, NULL, 0, 0, 0, NULL, 'CU000110', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1265, \"original\": \"https://api.click-games.fr/storage/1215/81-iGyyz5-L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1215/conversions/81-iGyyz5-L._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1248, \"original\": \"https://api.click-games.fr/storage/1198/41oG6C7m3jL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1198/conversions/41oG6C7m3jL._AC_-thumbnail.jpg\"}, {\"id\": 1249, \"original\": \"https://api.click-games.fr/storage/1199/41e2t-SZYoL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1199/conversions/41e2t-SZYoL._AC_-thumbnail.jpg\"}, {\"id\": 1250, \"original\": \"https://api.click-games.fr/storage/1200/516Vp2I18kL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1200/conversions/516Vp2I18kL._AC_-thumbnail.jpg\"}, {\"id\": 1251, \"original\": \"https://api.click-games.fr/storage/1201/410LefZCOcL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1201/conversions/410LefZCOcL._AC_-thumbnail.jpg\"}, {\"id\": 1252, \"original\": \"https://api.click-games.fr/storage/1202/51APc3qh1RL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1202/conversions/51APc3qh1RL._AC_-thumbnail.jpg\"}, {\"id\": 1253, \"original\": \"https://api.click-games.fr/storage/1203/41TJN90m56L._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1203/conversions/41TJN90m56L._AC_-thumbnail.jpg\"}, {\"id\": 1254, \"original\": \"https://api.click-games.fr/storage/1204/41Od-WwWG4L._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1204/conversions/41Od-WwWG4L._AC_-thumbnail.jpg\"}, {\"id\": 1255, \"original\": \"https://api.click-games.fr/storage/1205/413u+OtXLUL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1205/conversions/413u+OtXLUL._AC_-thumbnail.jpg\"}, {\"id\": 1256, \"original\": \"https://api.click-games.fr/storage/1206/41ENXfqbGKL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1206/conversions/41ENXfqbGKL._AC_-thumbnail.jpg\"}]', '2022-03-16 18:50:57', '2022-03-16 18:48:37', '2022-03-16 18:50:57', 18.09, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(127, NULL, 'Luigi\'s Mansion', 'luigi-s-mansion', '<p>C\'est lui... Luigi !! Le moment est venu pour Luigi de sortir de l\'ombre que lui fait souvent son grand frère et d\'apparaître sous les feux des projecteurs dans le titre accompagnant le lancement de la console de salon Nintendo de nouvelle génération : le GameCube.</p><p>Ce jeu fondé sur le frisson a été produit en interne chez NCL, à Kyoto, au Japon, sous la supervision du légendaire producteur de jeu qu\'est Shigeru Miyamoto, et possède tous les atouts nécessaires pour un nouveau classique de Miyamoto. Luigi\'s Mansion devrait connaître un beau succès car il est l\'un des titres les plus attendus à l\'occasion du lancement européen. Toute l\'aventure tourne autour de Luigi, le frère souvent oublié de Mario, et de sa quête visant à résoudre les mystères d\'un manoir hanté et à retrouver Mario, qui a disparu dans les entrailles de cette vieille demeure.</p><p>Luigi devra progresser dans cette maison, salle après salle, en résolvant des énigmes en chemin. Très vite, Luigi tombera sur quelques-uns des habitants ectoplasmiques du manoir. Ceux-ci, de tailles et de formes très diverses, ne manquent pas de personnalité. Heureusement, Luigi sera secouru par l\'excentrique professeur K. Tastroff qui lui apprendra tout des mystères de cette demeure. Le professeur deviendra le conseiller de Luigi durant le jeu et lui apportera son aide par l\'intermédiaire du Game Boy \"Horror\", un Game Boy modifié permettant de consulter le plan du jeu, les objets recueillis, etc. Gad prèsentera à Luigi son aspirateur très spécial, le Poltergust 3000, qui occupe une place centrale dans le jeu. La lampe torche de Luigi permettra de figer les fantômes afin que l\'aspirateur puisse les avaler. Mais les fantômes ne se laisseront pas faire et se battront pour conserver leur liberté. Luigi devra rester à distance et, à l\'instar d\'un pêcheur vis-à-vis de sa prise, devra \"remonter\" chaque fantôme.</p><p>Le jeu comprend un mode d\'entraînement très complet qui vous permettra de découvrir toutes les ficelles de la capture de fantôme. Les commandes deviendront rapidement une seconde nature et le jeu constituera une excellente introduction à la manette du GCN et à ses multiples usages. Si vous parvenez à terminer Luigi\'s Mansion, vous serez à coup sûr un maître de la manette du GameCube.</p><p>Après avoir quelque peu progressé dans la partie, vous aurez la possibilité d\'améliorer l\'aspirateur. Il pourra alors aspirer puis souffler des \"substances\" aussi diverses que l\'eau, le feu et la glace, ce qui sera indispensable à la résolution de certaines énigmes du jeu.</p><p>Avec plus de 55 salles à explorer, des tonnes de fantômes différents à capturer et l\'apparition (sans jeu de mots) de quelques-uns des personnages préférés de Mario Bros., ce jeu a tout ce qu\'il faut pour devenir un hit auprès des joueurs dès son arrivée sur le sol européen.</p>', 1, 39.99, 31, 39.99, NULL, NULL, 0, 0, 0, NULL, 'CU00113', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1266, \"original\": \"https://api.click-games.fr/storage/1216/81uvMM6g+FL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1216/conversions/81uvMM6g+FL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1267, \"original\": \"https://api.click-games.fr/storage/1217/31hLZbGnrbL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1217/conversions/31hLZbGnrbL._AC_-thumbnail.jpg\"}, {\"id\": 1268, \"original\": \"https://api.click-games.fr/storage/1218/31f5LbZEF3L._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1218/conversions/31f5LbZEF3L._AC_-thumbnail.jpg\"}, {\"id\": 1269, \"original\": \"https://api.click-games.fr/storage/1219/31eQepf7i3L._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1219/conversions/31eQepf7i3L._AC_-thumbnail.jpg\"}, {\"id\": 1270, \"original\": \"https://api.click-games.fr/storage/1220/31fUXRy5SCL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1220/conversions/31fUXRy5SCL._AC_-thumbnail.jpg\"}, {\"id\": 1271, \"original\": \"https://api.click-games.fr/storage/1221/41CQF6eKxmL._AC_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1221/conversions/41CQF6eKxmL._AC_-thumbnail.jpg\"}]', NULL, '2022-03-16 19:07:08', '2022-08-05 09:24:55', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(128, NULL, 'Call Of Duty: Black Ops Cold War', 'call-of-duty-black-ops-cold-war-2', '<p>Black Ops Cold War va plonger les fans au c ur du chaos geopolitique de la Guerre froide qui a defini les annees 1980. Impossible de discerner le vrai du faux dans la Campagne solo haletante. Faites face a des figures historiques et d atroces verites lors de combats de part et d autre du monde dans des lieux emblematiques comme Berlin Est le Vietnam la Turquie les quartiers generaux du KGB et bien d autres. Multijoueur Zombies Warzone.</p>', 1, 43.00, 31, 43.00, NULL, NULL, 0, 0, 0, NULL, 'CU00114', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1272, \"original\": \"https://api.click-games.fr/storage/1222/71IJRU2k8yL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1222/conversions/71IJRU2k8yL._AC_SL1000_-thumbnail.jpg\"}', '[{\"id\": 1273, \"original\": \"https://api.click-games.fr/storage/1223/510ZrpAMPNL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1223/conversions/510ZrpAMPNL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1274, \"original\": \"https://api.click-games.fr/storage/1224/51EEeCW8Q-L._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1224/conversions/51EEeCW8Q-L._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1275, \"original\": \"https://api.click-games.fr/storage/1225/51gjjnY5pEL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1225/conversions/51gjjnY5pEL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1276, \"original\": \"https://api.click-games.fr/storage/1226/519cjKx-1WL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1226/conversions/519cjKx-1WL._AC_SL1000_-thumbnail.jpg\"}]', NULL, '2022-03-20 16:37:21', '2022-08-05 09:24:47', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(129, NULL, 'One Piece : Pirate Warriors 4', 'one-piece-pirate-warriors-4', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/ed9f2b28-3dcf-4d33-84d4-972b9c5139aa.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"  \"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/62c4269f-3bdd-4529-b08a-9796f5aae90e.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"   \"></p><h3><strong>One Piece : Pirate Warriors 4</strong></h3><p>Les guerriers pirates sont de retour avec une histoire encore plus explosive, de nouveaux environnements et des attaques encore plus déjantées dans ONE PIECE: PIRATE WARRIORS 4. Revivez les aventures de Luffy et des Chapeaux de paille depuis le début, alors qu\'ils voyagent d\'île en île dans l\'espoir de trouver l\'illustre trésor, le One Piece. Jouez sur certains des environnements et îles les plus extraordinaires de l\'univers de ONE PIECE et affrontez des ennemis inoubliables.</p><p>Choisissez parmi bon nombre de vos personnages favoris et affrontez d\'énormes vagues d\'ennemis en revivant les moments emblématiques de l\'anime One Piece. Développé par les maîtres de l\'action et du genre musou, KOEI TECMO GAMES, ONE PIECE: PIRATE WARRIORS 4 combine la satisfaction de décimer des hordes entières d\'ennemis avec les personnages dynamiques et hauts en couleur de la série One Piece. Embarquez dans une nouvelle aventure Pirate Warriors.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/07d7199a-99cd-469f-9654-2774ac1a114e.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"  \"></p><h3><strong>Caractéristiques principales</strong></h3><p>&nbsp;</p><ul><li>Une histoire encore plus longue - Vivez l\'histoire de ONE PIECE depuis le début.</li><li>De l\'action sauce musou – Développé par KOEI TECMO GAMES, maîtres de l\'action et du genre musou.</li><li>Des victoires satisfaisantes - Affrontez d\'énormes vagues d\'ennemis lors d\'immenses batailles inspirées des moments mémorables de l\'anime.</li><li>Des environnements destructibles - Ne laissez aucun bâtiment ou autre obstacle se mettre en travers de votre route jusqu\'à la victoire.</li></ul>', 1, 39.99, 31, 39.99, NULL, NULL, 0, 0, 0, NULL, 'CU00115', 51, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1277, \"original\": \"https://api.click-games.fr/storage/1227/81V7vApCUDL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1227/conversions/81V7vApCUDL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1278, \"original\": \"https://api.click-games.fr/storage/1228/71HNXIYtHNL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1228/conversions/71HNXIYtHNL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1279, \"original\": \"https://api.click-games.fr/storage/1229/71dvW-NC-rL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1229/conversions/71dvW-NC-rL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1280, \"original\": \"https://api.click-games.fr/storage/1230/71BBYgo8dCL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1230/conversions/71BBYgo8dCL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1281, \"original\": \"https://api.click-games.fr/storage/1231/7197ZSThxjL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1231/conversions/7197ZSThxjL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1282, \"original\": \"https://api.click-games.fr/storage/1232/7187lTunSeL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1232/conversions/7187lTunSeL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1283, \"original\": \"https://api.click-games.fr/storage/1233/71jpwtX6ODL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1233/conversions/71jpwtX6ODL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1284, \"original\": \"https://api.click-games.fr/storage/1234/714wo6kLqtL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1234/conversions/714wo6kLqtL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1285, \"original\": 