(130, NULL, 'Nintendo Switch OLED', 'nintendo-switch-oled', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/5a8652e3-50ed-4082-bd06-1e34a834babe.__CR0,0,970,600_PT0_SX970_V1___.jpg\" alt=\"Modèle OLED\"></p><h3><strong>Une nouvelle venue va bientôt rejoindre la gamme Nintendo Switch : la Nintendo Switch (modèle OLED)</strong></h3><p>La Nintendo Switch (modèle OLED) sortira le 8 octobre et offrira aux joueurs et aux joueuses une nouvelle possibilité pour profiter du vaste catalogue de titres disponibles sur Nintendo Switch.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/f1a46537-675d-41bd-855e-0b3c1aa0a4fd.__CR0,107,536,536_PT0_SX300_V1___.jpg\" alt=\"Image 1\"></p><p>La NIntendo Switch Modèle OLED possède des dimensions proches de celles de la Nintendo Switch</p><p>mais dispose d’un écran OLED plus grand aux couleurs intenses et aux contrastes élevés.</p><p>Elle dispose aussi d’un large support ajustable pour le jeu en mode sur table, d’une nouvelle station d’accueil avec port Ethernet pour un jeu en ligne stable, de 64 Go de mémoire interne et de haut-parleurs intégrés proposant un audio amélioré pour les modes nomades (portable et sur table).</p><p>Tout comme la Nintendo Switch, la Nintendo Switch (modèle OLED) permet de jouer sur un téléviseur et de partager les manettes Joy-Con détachables pour s’amuser en multijoueur.</p><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/f8f5ca1c-f3dc-4925-b2c4-b8448a72c21e.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"TV\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/f653a34f-9aca-419c-aad3-cd48225aefee.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Table\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/49517602-145c-4eb7-919c-9a77d8075280.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"Portable\"></th></tr><tr><th><h4>Mode téléviseur</h4><p>Installez la Nintendo Switch (modèle OLED) dans la station d’accueil pour jouer aux titres Nintendo Switch sur téléviseur. Le port LAN intégré dans la station d’accueil permet de profiter d’une nouvelle façon de se connecter en ligne en mode téléviseur.</p></th><th><h4>Mode sur table</h4><p>Déployez le support au dos de la console et servez-vous de l’écran de la console pour jouer à plusieurs grâce aux deux manettes Joy-Con incluses avec la console. Le large support ajustable offre une base solide et stable. Il permet aussi d’incliner librement la console pour offrir plusieurs angles de vue afin de mieux voir l’écran.</p></th><th><h4>Mode portable</h4><p>Transportez la console partout avec vous et jouez en mode portable entre amis, en mode local* comme en ligne**. L’écran OLED 7 pouces affiche des couleurs intenses et des contrastes élevés.</p></th></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/2001672a-16ae-433c-bfc8-2dd0df5a5c2c.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"1\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/8b93aa8f-c816-44b6-8ffe-5620c5001329.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"2\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/b560ee9c-98e9-4833-9a69-deca456581e9.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"3\"></th></tr><tr><th>&nbsp;</th><th>&nbsp;</th><th>&nbsp;</th></tr></tbody></table></figure><p><img src=\"https://m.media-amazon.com/images/S/aplus-media-library-service-media/24fc3132-ec76-4785-89a9-014a38d28694.__CR0,0,600,180_PT0_SX600_V1___.jpg\" alt=\"Back cover\"></p>', 1, 339.99, 31, 339.99, NULL, NULL, 0, 0, 0, NULL, 'CU000114', 18, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1286, \"original\": \"https://api.click-games.fr/storage/1236/71bqmKNnSiL._AC_SL1500_