(134, NULL, 'Ratchet & Clank: Rift Apart', 'ratchet-clank-rift-apart', '<p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/93907e81-188a-4a57-9464-120ba1d6a4b9.__CR0,0,600,180_PT0_SX600_V1___.jpg\" alt=\"PS5, ratchet, jeu vidéo, ratchet &amp; Clank, playstation\"></p><h2>Ratchet &amp; Clank: Rift Apart</h2><p>Voyagez dans de nouvelles dimensions avec Ratchet et Clank tandis qu’ils affrontent un empereur malfaisant venu d’une autre réalité. Sautez à une vitesse incroyable entre des mondes à l’action survoltée, le tout avec des graphismes à couper le souffle et à un arsenal de folie dans une aventure intergalactique sur PS5.</p><h3><strong>Fonctionnalités PS5</strong></h3><figure class=\"table\"><table><tbody><tr><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a41b9d17-de80-4055-9ffb-3ea5e443596d.__CR38,0,225,225_PT0_SX220_V1___.png\" alt=\"dualsense, retour haptique, ps5, jeu vidéo\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/98776b12-18ae-4ebb-93e1-dc09a8df0874.__CR38,0,225,225_PT0_SX220_V1___.png\" alt=\"ps5, jeu vidéo, dualsense, gâchettes adaptatives, accessoire\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/24a7cfb0-7f80-4a59-919b-c01b88898147.__CR38,0,225,225_PT0_SX220_V1___.png\" alt=\"ps5, ssd, harware, ratchet\"></th><th><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/20d67d80-44e9-40d3-b261-9bbcb00575d5.__CR38,0,225,225_PT0_SX220_V1___.png\" alt=\"ps5, casque, ratchet, accessoire, 3d\"></th></tr><tr><th><h4>Retour haptique</h4><p>Ressentez l’impact des explosions grâce au retour haptique de la manette sans fil DualSense.</p></th><th><h4>Gâchettes adaptatives</h4><p>Ressentez l\'énergie dimensionnelle avec des combats plus immersifs que jamais grâce à la manette sans fil DualSense qui fera que chaque arme aura un effet différent entre vos mains.</p></th><th><h4>Traversez la galaxie à la vitesse de la lumière</h4><p>Changez de planète comme de chemise avec des temps de chargement quasi inexistants grâce au SSD de la PS5.</p></th><th><h4>Technologie sonore Tempest 3D Audio Tech sur les casques compatibles</h4><p>Plongez dans des environnements sonores en 3D dans lesquels le son semble vous parvenir de toutes les directions. Partez à l\'aventure dans des mondes plus immersifs que jamais grâce à une ambiance sonore ultra fidèle.</p></th></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', 1, 42.99, 31, 42.99, NULL, NULL, 0, 0, 0, NULL, 'CU00119', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1313, \"original\": \"https://api.click-games.fr/storage/1263/71sR60hYpbS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1263/conversions/71sR60hYpbS._AC_SL1000_-thumbnail.jpg\"}', '[{\"id\": 1314, \"original\": \"https://api.click-games.fr/storage/1264/817l-LSgrzL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1264/conversions/817l-LSgrzL._AC_SL1500_-thumbnail.jpg\"}, {\"id\": 1315, \"original\": \"https://api.click-games.fr/storage/1265/61XKEVBoqJL._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1265/conversions/61XKEVBoqJL._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1316, \"original\": \"https://api.click-games.fr/storage/1266/615mzldtfWS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1266/conversions/615mzldtfWS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1317, \"original\": \"https://api.click-games.fr/storage/1267/61vHGE6vRaS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1267/conversions/61vHGE6vRaS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1318, \"original\": \"https://api.click-games.fr/storage/1268/61n6vFh3tKS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1268/conversions/61n6vFh3tKS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 1319, \"original\": \"https://api.click-games.fr/storage/1269/819pPKdA5fL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api