(135, NULL, 'Yoshi\'s : crafted world', 'yoshi-s-crafted-world', '<p>Menez Yoshi à travers une toute nouvelle aventure sur Nintendo Switch qui va reverser votre perspective des jeux de plateforme tels que vous les connaissez ! Explorez un monde gigantesque décoré à la manière d\'un diorama miniature avec des objets du quotidien comme des boîtes ou des gobelets en papier, où chaque stage à défilement latéral possède à la fois un avant-plan, mais également une face cachée avec différents points de vue qui offrent bien des surprises. Les décors sont truffés d\'objets inhabituels. Un œuf bien placé peut par exemple ouvrir un nouveau passage ! Explorez les moindres recoins pour dénicher des objets collectionnables cachés et atteindre votre objectif dans les stages en dirigeant Yoshi vers l\'objectif. Vous pouvez même faire participer un ami dans le multijoueur coopératif pour deux où chacun contrôle l\'action avec une manette Joy-Con !</p>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, NULL, 'CU00120', 19, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1324, \"original\": \"https://api.click-games.fr/storage/1274/Titelive_0045496422615_G_0045496422615.webp\", \"thumbnail\": \"https://api.click-games.fr/storage/1274/conversions/Titelive_0045496422615_G_0045496422615-thumbnail.jpg\"}', '[{\"id\": 1325, \"original\": \"https://api.click-games.fr/storage/1275/0045496422615_6.webp\", \"thumbnail\": \"https://api.click-games.fr/storage/1275/conversions/0045496422615_6-thumbnail.jpg\"}, {\"id\": 1326, \"original\": \"https://api.click-games.fr/storage/1276/0045496422615_5.webp\", \"thumbnail\": \"https://api.click-games.fr/storage/1276/conversions/0045496422615_5-thumbnail.jpg\"}, {\"id\": 1327, \"original\": \"https://api.click-games.fr/storage/1277/Titelive_0045496422615_G_0045496422615_3.webp\", \"thumbnail\": \"https://api.click-games.fr/storage/1277/conversions/Titelive_0045496422615_G_0045496422615_3-thumbnail.jpg\"}, {\"id\": 1328, \"original\