(136, NULL, 'Go Vacation', 'go-vacation', '<p>Avec les jours qui raccourcissent et la chute des températures, nul ne vous en voudrait de rêver à des rivages ensoleillés ! Que diriez-vous de l\'île Kawawii dans Go Vacation sur Wii ? Les quatre complexes hôteliers de cet endroit fabuleux offrent du fun à gogo et en font la destination idéale pour des vacances en famille.<br><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/2fcc655f-02c4-4a31-be3e-124a9fa108e6.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"1\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/40fc44e7-bf92-4d6b-b6a8-d61e072ebefe.__CR0,0,300,300_PT0_SX300_V1___.jpg\" alt=\"2\"></p><h3><strong>Go Vacation</strong></h3><p>Affrontez vos amis et votre famille à travers de nombreuses activités amusantes comme le ski, le beach volley, le mini-golf et bien d\'autres !</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/f661ad05-dc21-47df-8ffe-548a828b1e42.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"3\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/5239b63a-0d1b-476d-b505-542cfcc600b9.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"5\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/sota/6548aa56-35a0-4b01-9be1-ac75a7b6c037.__CR0,0,970,300_PT0_SX970_V1___.png\" alt=\"6\"></p><p>&nbsp;</p><p>&nbsp;</p><p><br><br>&nbsp;</p>', 1, 53.84, 31, 53.84, NULL, NULL, 0, 0, 0, NULL, 'CU00121', 19, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1330, \"original\": \"https://api.click-games.fr/storage/1280/81Z-QwdhLzL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1280/conversions/81Z-QwdhLzL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1331, \"original\": \"https://api.click-games.fr/storage/1281/71mKb0xh4qL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1281/conversions/71mKb0xh4qL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 1332, \"original\": \"https://api.click-games.fr/storage/1282/61z0W5xa8tL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1282/conversions/61z0W5xa8tL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 1333, \"original\": \"https://api.click-games.fr/storage/1283/7135HSCfzGL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1283/conversions/7135HSCfzGL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 1334, \"original\": \"https://api.click-games.fr/storage/1284/71ZJr1JbMWL._AC_SL1280_-2.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1284/conversions/71ZJr1JbMWL._AC_SL1280_-2-thumbnail.jpg\"}, {\"id\": 1335, \"original\": \"https://api.click-games.fr/storage/1285/71ZJr1JbMWL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1285/conversions/71ZJr1JbMWL._AC_SL1280_-thumbnail.jpg\"}]', NULL, '2022-03-24 17:11:05', '2022-08-05 09:23:39', 0.00, 'new', NULL, NULL, 'shop-product', NULL, 1),
(137, NULL, 'LEGO Star Wars : La Saga Skywalker', 'lego-star-wars-la-saga-skywalker', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a4c91a9d-6895-4517-8788-1e297acaf079.__CR0,178,1280,396_PT0_SX970_V1___.jpg\" alt=\"image 4\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/110230e7-754e-470c-90c3-be8f334970a7.__CR120,0,720,720_PT0_SX300_V1___.jpg\" alt=\"image\"></p><h3><strong>LEGO Star Wars : La Saga Skywalker.</strong></h3><p>Dans ce tout nouveau jeu vidéo LEGO disponible sur consoles, les joueurs pourront voyager en vitesse lumière à travers l’immense galaxie de l’univers Star Wars, et participer aux aventures inoubliables et bourrées d’action des 9 films de la saga Skywalker, y compris la conclusion très attendue de la série, Star Wars : L’Ascension de Skywalker, racontés avec l\'humour emblématique de LEGO.</p><p>En plongeant au cœur de cette immense saga, les joueurs pourront contrôler librement des centaines de personnages, de vaisseaux et de véhicules afin de tracer leur propre chemin à travers la galaxie.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/035a4874-f815-49e8-abb5-b19f3ee86eff.__CR352,0,720,720_PT0_SX300_V1___.jpg\" alt=\"image 6\"></p><p>· Explorez la saga en toute liberté. Les joueurs peuvent se plonger dans les 9 films de la saga Skywalker et choisir dès le début de vivre l’aventure dans l\'ordre de leur choix. À eux de décider où aller et comment jouer !</p><p>· Incarnez des héros et des méchants emblématiques. Les joueurs pourront incarner des héros tels que Luke Skywalker, Rey, Obi-Wan Kenobi, Finn, BB-8 ou rejoindre le côté obscur avec Dark Vador, l\'Empereur Palpatine, Kylo Ren et bien plus encore.</p><p>· Parcourez des lieux mythiques de l’univers Star Wars. Les joueurs pourront parcourir les vastes espaces inspirés des décors inoubliables des films tels que le désert de Géonosis, les marais de Dagobah et les étendues enneigées de la base Starkiller, dans l’ordre de leur choix, pour compléter des quêtes hilarantes et variées.</p><p>· Des briques pour toute la famille. Cette expérience vidéoludique LEGO hilarante et créative convient aux adultes et enfants de tout âge.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/807060c9-bc84-47aa-b083-953243ef4933.__CR0,124,1280,396_PT0_SX970_V1___.jpg\" alt=\"image 3\"></p>', 1, 44.99, 31, 44.99, NULL, NULL, 0, 0, 0, NULL, 'CU00122', 29, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1336, \"original\": \"https://api.click-games.fr/storage/1286/71j2uqFp4NL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1286/conversions/71j2uqFp4NL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1337, \"original\": \"https://api.click-games.fr/storage/1287/71j2uqFp4NL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1287/conversions/71j2uqFp4NL._AC_SL1500_-thumbnail.jpg\"}]', NULL, '2022-04-02 14:50:52', '2022-08-05 09:23:32', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
(138, NULL, 'LEGO Star Wars : La Saga Skywalker', 'lego-star-wars-la-saga-skywalker-2', '<p><br><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/a4c91a9d-6895-4517-8788-1e297acaf079.__CR0,178,1280,396_PT0_SX970_V1___.jpg\" alt=\"image 4\"></p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/110230e7-754e-470c-90c3-be8f334970a7.__CR120,0,720,720_PT0_SX300_V1___.jpg\" alt=\"image\"></p><h3><strong>LEGO Star Wars : La Saga Skywalker.</strong></h3><p>Dans ce tout nouveau jeu vidéo LEGO disponible sur consoles, les joueurs pourront voyager en vitesse lumière à travers l’immense galaxie de l’univers Star Wars, et participer aux aventures inoubliables et bourrées d’action des 9 films de la saga Skywalker, y compris la conclusion très attendue de la série, Star Wars : L’Ascension de Skywalker, racontés avec l\'humour emblématique de LEGO.</p><p>En plongeant au cœur de cette immense saga, les joueurs pourront contrôler librement des centaines de personnages, de vaisseaux et de véhicules afin de tracer leur propre chemin à travers la galaxie.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/035a4874-f815-49e8-abb5-b19f3ee86eff.__CR352,0,720,720_PT0_SX300_V1___.jpg\" alt=\"image 6\"></p><p>· Explorez la saga en toute liberté. Les joueurs peuvent se plonger dans les 9 films de la saga Skywalker et choisir dès le début de vivre l’aventure dans l\'ordre de leur choix. À eux de décider où aller et comment jouer !</p><p>· Incarnez des héros et des méchants emblématiques. Les joueurs pourront incarner des héros tels que Luke Skywalker, Rey, Obi-Wan Kenobi, Finn, BB-8 ou rejoindre le côté obscur avec Dark Vador, l\'Empereur Palpatine, Kylo Ren et bien plus encore.</p><p>· Parcourez des lieux mythiques de l’univers Star Wars. Les joueurs pourront parcourir les vastes espaces inspirés des décors inoubliables des films tels que le désert de Géonosis, les marais de Dagobah et les étendues enneigées de la base Starkiller, dans l’ordre de leur choix, pour compléter des quêtes hilarantes et variées.</p><p>· Des briques pour toute la famille. Cette expérience vidéoludique LEGO hilarante et créative convient aux adultes et enfants de tout âge.</p><p><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/807060c9-bc84-47aa-b083-953243ef4933.__CR0,124,1280,396_PT0_SX970_V1___.jpg\" alt=\"image 3\"></p>', 1, 54.99, 31, 54.99, NULL, NULL, 0, 0, 0, NULL, 'CU00123', 29, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1338, \"original\": \"https://api.click-games.fr/storage/1288/81OxH2JsW4L._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1288/conversions/81OxH2JsW4L._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 1339, \"original\": \"https://api.click-games.fr/storage/1289/61toaZHpvGL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1289/conversions/61toaZHpvGL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 1340, \"original\": \"https://api.click-games.fr/storage/1290/71ACQMKDI1L._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1290/conversions/71ACQMKDI1L._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 1341, \"original\": \"https://api.click-games.fr/storage/1291/61yZ1TRvljL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1291/conversions/61yZ1TRvljL._AC_SL1280_-thumbnail.jpg\"}, {\"id\": 1342, \"original\": \"https://api.click-games.fr/storage/1292/716gX-d7IpL._AC_SL1280_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1292/conversions/716gX-d7IpL._AC_SL1280_-thumbnail.jpg\"}]', NULL, '2022-04-02 14:52:05', '2022-08-05 09:23:24', 0.00, 'new', NULL, NULL, 'shop-product', NULL, NULL),
