(141, NULL, 'Dying Light 2', 'dying-light-2-2', '<p>Le virus a triomphé. Le dernier bastion de l’humanité est au bord de l’effondrement, déchiré par les conflits et infesté de monstres sanguinaires…</p><p>Vous incarnez Aiden Caldwell, un survivant infecté.</p><p>Dans ce monde impitoyable, vous devrez tirer parti de votre agilité exceptionnelle, de vos compétences en combat et de votre vivacité d’esprit pour survivre.</p><p>Utilisez-les à bon escient pour évoluer dans cet univers truffé de dangers et le remodeler à travers les choix que vous ferez. Le sort de la ville est entre vos mains.</p><p>Pre order incentive :</p><p>- Pack Reload : une tenue, une skin d’arme et un skin de deltaplane</p>', 1, 34.99, 31, 34.99, NULL, NULL, 0, 0, 0, NULL, 'CU000125', 20, 1, 0, NULL, NULL, NULL, 'publish', 'simple', 'u', NULL, NULL, NULL, '{\"id\": 1345, \"original\": \"https://api.click-games.fr/storage/1295/81EpLE7jqnL._AC_SL1500_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/1295/conversions/81EpLE7jqnL._AC_SL1500_-thumbnail.jpg\"}', '[{\"id\": 882, \"original\": \"https://api.click-games.fr/storage/832/6122JgPRa5S._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/832/conversions/6122JgPRa5S._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 883, \"original\": \"https://api.click-games.fr/storage/833/710aI-LOgmS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/833/conversions/710aI-LOgmS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 884, \"original\": \"https://api.click-games.fr/storage/834/61ZzWrogT6S._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/834/conversions/61ZzWrogT6S._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 885, \"original\": \"https://api.click-games.fr/storage/835/612rktVDPpS._AC_SL1000_.jpg\", \"thumbnail\": \"https://api.click-games.fr/storage/835/conversions/612rktVDPpS._AC_SL1000_-thumbnail.jpg\"}, {\"id\": 886, \"original\": \"https://api.click-games.fr/storage/836/81VZG3HeGpS._AC_SL1500_.jpg\", \"thumbn